                "trailer": null,
                "episodios": 12,
                "sinopse": "Indivíduos que podem materializar armas de sua alma são chamados de \"Blazers\", e eles frequentam a Kouryou Academy High School para usar suas habilidades. Cada aluno é obrigado a fazer parceria com outro, na esperança de que um dia, a dupla possa atingir o poder do Duo Absoluto.\n\nTooru Kokonoe espera frequentar esta academia para ganhar poder depois que sua irmã e amigos foram mortos por um homem misterioso. Porém, na cerimônia de abertura, ele é forçado a duelar com quem está sentado ao seu lado, sendo o perdedor expulso. Enquanto Tooru se prepara para dar tudo de si, não é uma arma que se manifesta de sua alma, mas um escudo, uma irregularidade que chama a atenção de uma estudante estrangeira chamada Julie Sigtuna.",
