    "a0005": {
        "id": "a0005",
        "parentes": [],
        "items": {
            "a0005_1": {
                "id": "a0005_1",
                "foto": "https://posters.hurtom.com/albums/anime/akka.jpg",
                "link": "https://myanimelist.net/anime/33337/ACCA__13-ku_Kansatsu-ka",
                "trailer": null,
                "episodios": 12,
                "sinopse": "ACCA - um órgão nacional do reino de Dowa que fornece serviços públicos aos cidadãos do país - foi estabelecido como parte do acordo de paz entre o rei de Dowa e os 13 estados do país durante uma revolta. Cem anos depois, Dowa está em um período de paz sem precedentes, em parte devido ao sistema ACCA. No entanto, rumores de um golpe de Estado começam a surgir. Jean Otus, o segundo em comando do departamento de inspeção da ACCA, é encarregado de inspecionar todas as 13 agências estaduais. O que ele descobrirá ao realizar sua auditoria?",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0005_2": {
                "id": "a0005_2",
                "foto": "https://i.pinimg.com/originals/71/ee/7c/71ee7cec286911df3fc8b5c45e108c3f.jpg",
                "link": "https://myanimelist.net/anime/39610/ACCA__13-ku_Kansatsu-ka_-_Regards",
                "trailer": null,
                "episodios": 1,
                "sinopse": "Situado na capital, Badon, um ano após os eventos do anime para TV, Jean e o resto do departamento da ACCA estão se preparando para o aniversário de um ano do estabelecimento da nova ordem. Para os personagens - presos entre rumores de inquietação, dias imutáveis, novas encruzilhadas, olhares lembrados em memórias e dias de novos começos - o tempo mais uma vez começa a avançar.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0005_3": {
                "id": "a0005_3",
                "foto": "https://tc-animate.techorus-cdn.com/resize_image/resize_image.php?image=01200919_58815774b892b.jpg&width=1200&height=630",
                "link": "https://myanimelist.net/anime/35720/ACCA__13-ku_Kansatsu-ka_Specials",
                "trailer": null,
                "episodios": 6,
                "sinopse": "Especiais curtos de ACCA: 13-ku Kansatsu-ka incluídos nos três Conjuntos BD Box.\n\nO primeiro episódio concentra-se em Jean e Lotta, onde Lotta reflete como Jean é muito esquecida no dia-a-dia, mas lembra as coisas mais importantes.\n\nO segundo episódio se concentra em Nino e Jean bebendo em um bar. Nino cutuca Jean por não ter nenhum amigo fora dele e de Lotta. A conversa então se dirige para as mulheres.",
                "maturidade": null,
                "pontosBase": 0.0
            }
        }
    },
    "a0006": {
        "id": "a0006",
        "parentes": [],
        "items": {
            "a0006_1": {
                "id": "a0006_1",
                "foto": "https://4.bp.blogspot.com/-LfY7p-8JYuk/XRri4OuEzbI/AAAAAAAAC24/H4UGU1L5EpIK5KP1jDyW8sOy3CsyiOJ8QCLcBGAs/s1600/Accel%2BWorld.jpg",
                "link": "https://myanimelist.net/anime/11759/Accel_World",
                "trailer": null,
                "episodios": 24,
                "sinopse": "Haruyuki Arita é um estudante do ensino médio com sobrepeso e intimidado que encontra consolo em jogos online. Mas sua vida dá uma guinada drástica um dia, quando ele descobre que todas as suas pontuações mais altas foram superadas por Kuroyukihime, o popular vice-presidente do conselho estudantil. Ela então o convida para a sala de estudantes e o apresenta ao \"Brain Burst\", um programa que permite aos usuários acelerar suas ondas cerebrais até o ponto onde o tempo parece parar. Brain Burst também funciona como um jogo de luta de realidade aumentada, e para conseguir mais pontos para acelerar, os usuários devem vencer duelos contra outros jogadores. No entanto, se um usuário perder todos os seus pontos, ele também perderá o acesso ao Brain Burst para sempre.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0006_2": {
                "id": "a0006_2",
                "foto": null,
                "link": "https://myanimelist.net/anime/13939/Accel_World_EX",
                "trailer": null,
                "episodios": 2,
                "sinopse": "OVA empacotado com os jogos de simulação e ação Accel World . Os discos Blu-ray OVA vieram com as versões de edição limitada do PS3 e o DVD com as versões de edição limitada do PSP.\n\nO projeto foi dividido em dois títulos PSP e PS3, e um episódio foi lançado com cada jogo:\n\n# EX01: Reverberação; Zankyou (incluído no Stage: 01 Ginyoku no Kakusei)\n\n# EX02: Férias; Onsen (incluído no Stage: 02 Kasoku no Chouten)",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0006_3": {
                "id": "a0006_3",
                "foto": "https://images-na.ssl-images-amazon.com/images/I/51t0YXFxwkL.jpg",
                "link": "https://myanimelist.net/anime/13859/Accel_World__Acchel_World",
                "trailer": null,
                "episodios": 8,
                "sinopse": "Spin-off da Accel World incluída no anime Blu-ray/DVDs.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0006_4": {
                "id": "a0006_4",
                "foto": "https://img.mandarake.co.jp/webshopimg/03/55/199/0355324199/03553241990.jpg",
                "link": "https://myanimelist.net/anime/31763/Accel_World__Infinite%E2%88%9EBurst",
                "trailer": null,
                "episodios": 1,
                "sinopse": "Em 2046, muitos aspectos da vida são realizados em uma rede virtual. Não importa o quão avançado o tempo se torne, no entanto, o bullying nunca desaparece. Haruyuki é um dos alunos intimidados. No entanto, um dia ele é contatado por Kuroyukihime, a pessoa mais famosa da escola. \"Você não gostaria de 'acelerar' e ir mais longe, garoto?\" Haruyuki é apresentado ao \"Mundo Accel\" e decide lutar como o cavaleiro de Kuroyukihime.",
                "maturidade": null,
                "pontosBase": 0.0
            }
