    "a0008": {
        "id": "a0008",
        "parentes": [],
        "items": {
            "a0008_1": {
                "id": "a0008_1",
                "foto": "https://pics.filmaffinity.com/Action_Heroine_Cheer_Fruits_Serie_de_TV-476584568-large.jpg",
                "link": "https://myanimelist.net/anime/34800/Action_Heroine_Cheer_Fruits",
                "trailer": null,
                "episodios": 12,
                "sinopse": "Vários anos atrás, as heroínas locais - personagens de super-heróis que representam cidades e realizam shows para aumentar a aclamação de sua cidade - tiveram um boom de popularidade. A mais famosa dessas heroínas locais, Kamidaio, está agendada para se apresentar na pequena cidade de Hinano, para grande entusiasmo da irmã mais nova de Mikan Kise, Yuzu. Infelizmente, quando Mikan leva Yuzu ao show, ela descobre que foi cancelado. Ela promete a sua irmã perturbada que ela vai se certificar de que pode ver o show. Desesperado para não decepcioná-la, Mikan pede ajuda a seu colega de classe, o fanático por heroína local An Akagi.\n\nMikan e Ann fizeram sua própria performance Kamidaio vestidos com fantasias caseiras, que as crianças na platéia amam, apesar de sua falta de valor de produção. O programa é gravado pelo presidente do conselho estudantil Misaki Shirogane, que o publica online para chamar a atenção. Misaki vem de uma família de políticos e decidiu revitalizar Hinano. Impressionada com o show, ela recruta Mikan e An para se tornarem as heroínas locais oficiais de sua cidade. Enquanto o grupo trabalha para melhorar seus shows, eles contam com a ajuda de uma variedade de pessoas interessantes.",
                "maturidade": null,
                "pontosBase": 0.0
            }
        }
