                "sinopse": "O segundo andar do ginásio - era onde sempre nos encontrávamos. Era hora da aula, mas é claro, não havia nenhuma aula acontecendo em um lugar como este.\nFoi aqui que Shimamura e eu nos tornamos amigos. Nós saímos por aqui - conversando sobre programas de TV e culinária, jogando pingue-pongue ... Foi aqui que fomentamos nossa amizade.\nMantendo minha cabeça apoiada na parede, deixei escapar um pequeno suspiro.\nQual foi essa sensação? Ontem, sonhei comigo e com Shimamura nos beijando.\nNão que eu seja assim. Tenho certeza de que Shimamura também não. Não é nem mesmo algo que valha a pena me repetir, mas sério, não é assim.\nÉ que quando ela ouve a palavra \"amigo\", quero que ela pense em mim primeiro. Isso é tudo.",
