                "trailer": null,
                "episodios": 100,
                "sinopse": "Seja enfrentando comentários misóginos de seu chefe ou sendo pressionado por colegas de trabalho condescendentes, o estresse é apenas outra parte do trabalho para Retsuko, a panda vermelha de 25 anos. Apesar de ser uma das funcionárias mais diligentes de seu escritório, sua pequenez e modéstia muitas vezes a levam a ser explorada pelos colegas. No entanto, quando sua irritação atinge o limite, Retsuko traz sua marca única de desabafar: karaokê de death metal agressivo esmagando a idiotice e hipocrisia das ações de seus colegas de trabalho e da vida profissional. Embora esse desabafo ocorra apenas em sua mente, dá-lhe uma saída para conter sua frustração em um mundo onde a hierarquia e as aparências reinam supremas.",
