                "link": "https://myanimelist.net/anime/36904/Aggressive_Retsuko_ONA",
                "trailer": null,
                "episodios": 10,
                "sinopse": "Alguns escritórios têm dinâmicas estereotipadas: o porco chauvinista de um chefe que nunca faz um trabalho real; os funcionários cujo objetivo é sugar o chefe; aqueles cujas vidas parecem perfeitas; e os indivíduos que têm todo o trabalho real empurrado para eles. Retsuko, a panda vermelha, está no último grupo, já que fica até tarde na maioria das noites para compensar o trabalho que seus colegas de trabalho têm preguiça de fazer eles mesmos.\n\nSeu alívio do estresse de sua vida cotidiana vem na forma de cantar death metal em um clube de karaokê local. Noite após noite, Retsuko canaliza sua dor para um microfone e considera o lugar como seu próprio santuário pessoal. Mas à medida que ela se afasta de sua zona de conforto e das ideias que as pessoas têm dela, ela descobre que permitir que outras pessoas entrem em seu mundo do death metal pode não ser tão ruim.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0015_3": {
