                "foto": "https://avo-magazine.nl/wp-content/uploads/2019/06/2_Aggressive-Retsuko-2nd-season.jpg",
                "link": "https://myanimelist.net/anime/37985/Aggressive_Retsuko_ONA_2nd_Season",
                "trailer": null,
                "episodios": 10,
                "sinopse": "A panda vermelha Retsuko continua a trabalhar em seu trabalho cíclico de escritório, com a ocasional descarga de estresse por meio de karaokê death metal. Com a companhia de seus novos amigos Gori e Washimi, a vida é mais agradável do que nunca. Mas algumas novas mudanças em seu status quo ameaçam adicionar mais estresse à sua vida. No escritório, a nova funcionária Anai parece uma excelente adição à empresa. No entanto, quando Retsuko é encarregado de seu treinamento, ela descobre que, sob sua dedicação inabalável, ele pode representar uma ameaça à estabilidade do local de trabalho. Enquanto isso, em casa, a mãe de Retsuko faz uma visita abrupta, com a intenção de que sua filha finalmente se acalme e encontre um homem. Com isso em mente, ela marca Retsuko para vários compromissos de casamento, para seu desgosto.\n\nAgora, Retsuko encontra mais razões para ir ao bar do karaokê e lançar suas diatribes furiosas. No entanto, sabendo que isso não resolverá realmente seus problemas, ela decide fazer uma escolha mais espontânea para evitar seus problemas. E assim, Retsuko se encontra em outra jornada de auto-reflexão, aprendendo mais sobre si mesma e o amor, com o apoio sempre catártico do karaokê death metal.",
