                "sinopse": "Sem o que é considerado o trunfo mais importante do basquete, Sora Kurumatani tem lutado com sua estatura curta desde o início de seu amor pelo esporte. Apesar de perder este aspecto benéfico, o impulso inabalável de Sora nunca permitiu que sua pequena estatura ditasse sua habilidade de jogar, acreditando fortemente em tentar o seu melhor e praticar persistentemente para provar sua capacidade.\n\nNa esperança de satisfazer os desejos de sua mãe, Sora entra na Kuzuryuu High School para se tornar um membro do clube de basquete e competir de todo o coração em torneios. Porém, Sora fica desapontado ao descobrir que o time de basquete masculino nada mais é do que um refúgio para punks que não têm interesse no esporte. Sora também descobre que os irmãos Chiaki e Momoharu Hanazono - que ele conhece - também perderam sua motivação para jogar.\n\nDeterminado a ressuscitar o time de basquete, Sora desafia os meninos para uma partida contra ele, onde seus pés rápidos e movimentos rápidos dominam o grupo. Gradualmente afetados pelas habilidades impressionantes de Sora, esforço absoluto e devoção incansável ao basquete, os meninos inesperadamente descobrem que sua paixão extinta pelo jogo reacende mais uma vez.",
