                "sinopse": "A lenda urbana do ritual 4:44 consiste em usar um tocador de rádio para produzir frequências na frente da Árvore Sagrada de Akeyuki exatamente às 4:44, transportando as pessoas para uma dimensão diferente.\n\nQuando Asuka Tsuchimiya e seus amigos - Nana Nanase, Mia Silverstone, Yuu Tounaka e Chloe Morisu - decidem realizar este ritual como uma atividade do Crystal Radio Research Club, eles ficam chocados quando o ritual funciona. Os cinco viajam para um mundo paralelo, conhecido como fragmento, onde encontram uma garota perturbadoramente familiar - o eu do mundo paralelo de Asuka. Esta Asuka é apelidada de Seriouska devido à sua atitude séria e capacidade de lutar.\n\nSeriouska lhes fala sobre o grande perigo que enfrenta todos os mundos paralelos, o Crepúsculo. À medida que retira os mundos paralelos de todas as suas possibilidades, Seriouska busca a morte do homem por trás do Crepúsculo, o Rei do Crepúsculo, para parar seu ataque sobre o multiverso.\n\nAkanesasu Shoujo segue as cinco garotas enquanto elas aprendem a aceitar seu verdadeiro eu, o tempo todo procurando pelo Rei do Crepúsculo. No entanto, a solução para o invasor Crepúsculo pode estar mais perto do que eles pensam.",
