                "trailer": null,
                "episodios": 12,
                "sinopse": "A descoberta de um hypergate na Lua uma vez permitiu que a raça humana se teletransportasse para Marte. Aqueles que escolheram se estabelecer lá descobriram uma tecnologia muito mais avançada do que a de seu planeta natal, que eles chamaram de \"Aldnoah\". Essa descoberta levou à fundação do Império Vers de Marte e a uma declaração de guerra contra os \"terráqueos\", aqueles que permaneceram na Terra. No entanto, uma batalha na lua - mais tarde chamada de \"Queda do Céu\" - fez com que o hipergate explodisse, destruindo a lua e levando os dois planetas a estabelecer um incômodo cessar-fogo.\n\nSua paz era frágil, no entanto. Quinze anos depois, o estudante do ensino médio Inaho Kaizuka testemunha o assassinato planejado da Princesa Asseylum Vers Allusia do Império Vers, que veio à Terra na esperança de reparar a relação entre o império e sua pátria. O cessar-fogo foi quebrado e os marcianos declararam guerra aos terráqueos mais uma vez. Diante desse inimigo intransponível, Inaho e seus amigos agora devem lutar contra o Império Vers para resolver a guerra de uma vez por todas.",
