                "trailer": null,
                "episodios": 12,
                "sinopse": "A guerra entre os terráqueos e o Império Vers de Marte terminou, permitindo que a humanidade desfrute alegremente de suas vidas em um tempo de paz. Dezenove meses depois, porém, a princesa Vers faz uma declaração pública chocante: \"os terráqueos são uma raça tola que cobiça recursos, destrói a natureza e se dedica à busca do prazer\". E assim, para proteger sua preciosa Terra, ela chama seus cavaleiros para pegar em armas, e a batalha violenta entre as duas civilizações reinicia.\n\nSlaine Troyard encontrou um lugar entre os marcianos, dando à Terra um breve descanso da guerra contra o Império Vers. No entanto, uma resolução pacífica parece inconcebível. As várias pessoas que lutaram desesperadamente pela sobrevivência no passado agora se encontram no meio de mais um conflito sangrento e caótico, que alterará para sempre o destino da humanidade.",
