                "sinopse": "Sana não é uma garotinha comum; ela possui uma habilidade especial conhecida como \"Sonho de Alice\". Devido ao seu poder, que lhe permite criar qualquer coisa a partir da imaginação, tudo o que ela conhece é o laboratório onde é cobaia. Desejando experimentar o mundo exterior, ela foge e encontra um velho florista teimoso chamado Zouroku Kashimura em uma loja de conveniência. Muito em breve, seus perseguidores alcançam e Zouroku é amarrado em problemas de Sana.\n\nPorém, longe de tentar se distanciar, Zouroku estende a mão para ajudar Sana. Seguindo seus valores e senso de justiça, ele até dá aos perseguidores um pedaço de sua mente! Zouroku então oferece a Sana um lugar para ficar, começando o dia a dia e as lutas da improvável dupla.",
                "maturidade": null,
                "pontosBase": 0.0
            }
        }
