        "items": {
            "a0039_1": {
                "id": "a0039_1",
                "foto": "https://pbs.twimg.com/media/Cbx8bg8UsAAzLKe.jpg",
                "link": "https://myanimelist.net/anime/31588/All_Out",
                "trailer": null,
                "episodios": 25,
                "sinopse": "O rugby é um esporte em que qualquer pessoa pode ser uma estrela ao segurar a bola. As regras são simples: um jogador tem que levar a bola para além das traves do campo enquanto evita a outra equipa, que pode usar toda a sua força para derrubar o inimigo. No entanto, o jogador pode passar para um companheiro atrás dele ou chutar a bola antes de ser derrubado. Ao contrário de outros esportes, o jogo continua mesmo quando a pessoa que está segurando a bola é derrubada.\n\nKenji Gion é um calouro do ensino médio baixinho, mas decidido, na Kanagawa High School. Logo após a cerimônia de abertura da escola, ele conhece o alto e tímido Sumiaki Iwashimizu, e os dois recebem um convite para observar o clube de rúgbi.\n\nQuando Gion assiste à partida, ele percebe que, embora caras grandes e altos tenham uma vantagem, há vagas para pessoas de todas as formas e tamanhos. Imediatamente convencido de que encontrou um esporte no qual pode se destacar, apesar de sua baixa estatura, ele se inscreve, embora Iwashimizu recuse. Gion é incapaz de aceitar as desculpas de Iwashimizu e o arrasta de volta ao esporte. Seu treinamento se torna intenso enquanto eles pretendem se tornar os campeões do Hanazono, o campeonato nacional de rúgbi do ensino médio.",
                "maturidade": null,
                "pontosBase": 0.0
            }
        }
    },
    "a0040": {
