                "foto": "https://i0.wp.com/gum-gum-streaming.com/wp-content/uploads/2019/07/Amaama_to_Inazuma_Indo_text_Episode_Lengkap.jpg?fit=1000%2C1379&ssl=1",
                "link": "https://myanimelist.net/anime/32828/Amaama_to_Inazuma",
                "trailer": null,
                "episodios": 12,
                "sinopse": "Desde a morte de sua esposa, Kouhei Inuzuka tem cuidado de sua filha Tsumugi com o melhor de suas habilidades. No entanto, com a falta de conhecimentos culinários e o trabalho atarefado de professor, ele acaba contando com refeições prontas de lojas de conveniência para alimentar a menina. Frustrado com sua própria incapacidade de fornecer uma refeição nutritiva e fresca para sua filha, Kouhei aceita uma oferta de sua aluna, Kotori Iida, para jantar no restaurante de sua família. Mas na primeira visita, o pai e a filha descobrem que o restaurante costuma estar fechado porque a mãe de Kotori está fora para trabalhar e que Kotori costuma comer sozinha. Após muito súplica de seu aluno, Kouhei decide continuar indo ao restaurante com Tsumugi para cozinhar e compartilhar comida caseira deliciosa com Kotori.\n\nAmaama para Inazumasegue a história comovente de um pai atencioso que tenta ao máximo fazer sua adorável filhinha feliz, enquanto explora os significados e valores por trás da culinária, da família e das refeições quentes em casa que muitas vezes são tidas como certas.",
                "maturidade": null,
                "pontosBase": 0.0
            }
        }
    },
