        "items": {
            "a0055_1": {
                "id": "a0055_1",
                "foto": "https://animephproject.com/wp-content/uploads/2017/08/anohana.jpg",
                "link": "https://myanimelist.net/anime/9989/Ano_Hi_Mita_Hana_no_Namae_wo_Bokutachi_wa_Mada_Shiranai",
                "trailer": null,
                "episodios": 11,
                "sinopse": "Jinta Yadomi vive pacificamente como uma reclusa, passando os dias longe da escola e jogando videogame em casa. Num dia quente de verão, seu amigo de infância, Meiko \"Menma\" Honma, aparece e o atormenta para realizar um desejo esquecido. Ele não liga para ela, o que a irrita, mas ele realmente não se importa. Afinal, Menma já morreu há anos.\n\nA princípio, Jinta pensa que ele está apenas alucinando com o calor do verão, mas depois se convence de que o que vê na verdade é o fantasma de Menma. Jinta e seu grupo de amigos de infância se separaram depois de sua morte prematura, mas eles se unem mais uma vez enquanto tentam colocar o espírito de Menma para descansar. Revivendo sua dor e culpa, Será que eles encontrarão forças para ajudar não apenas Menma a seguir em frente - mas também a si mesmos?",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0055_2": {
