                "link": "https://myanimelist.net/anime/31165/Meiji_x_Kokosake___anohana_Receipt_Oubo_Campaign",
                "trailer": null,
                "episodios": 2,
                "sinopse": "Meiji está realizando uma \"Campanha Recibo Oubo Meiji x Kokosake & anohana\" de 2 de junho a 16 de outubro para comemorar a abertura do Kokoro ga Sakebitagatterun Da em 19 de setembro . (Kokosake) filme. O Ano Hi Mita Hana no Namae o Boku-tachi wa Mada Shiranai. (anohana) e Toradora! a equipe do anime está fazendo este anime original e o personagem Menma da anohana canta a música tema do Meiji Chocolate nos comerciais da campanha.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0055_3": {
                "id": "a0055_3",
                "foto": "https://conimg.filejo.com/main/data/2020/06/03/202006030623128754xiqLUIpLBB.jpg",
                "link": "https://myanimelist.net/anime/28725/Kokoro_ga_Sakebitagatterunda",
                "trailer": null,
                "episodios": 1,
                "sinopse": "Jun Naruse é uma tagarela cuja vida é colorida por contos de fadas e finais felizes. No entanto, influenciada por sua crença profunda nesses contos, ela é muito ingênua e confiante, e suas palavras logo quebram o vínculo de sua família quando ela inadvertidamente revela o caso de seu pai. Naruse fica com uma cicatriz para o resto da vida depois de ser culpada pelo divórcio de seus pais, e seu arrependimento logo se manifesta em um ovo de fada - um ser que sela sua boca para não falar para proteger o final feliz de todos.\n\nAgora, mesmo no colégio, a fala de Naruse permanece bloqueada pelo ovo das fadas. Até tentar falar faz seu estômago embrulhar. Embora incapaz de transmitir seus pensamentos por meio de palavras, ela é inesperadamente escolhida para atuar em um musical ao lado de três outros alunos: Takumi Sakagami, Natsuki Nitou e Daiki Tasaki. Naruse faz seu caminho para a sala do clube para rejeitar a tarefa assustadora, mas muda de ideia quando ouve o belo canto de Sakagami.\n\nTalvez a \"maldição\" do ovo de fada não se aplique ao canto, e talvez Sakagami seja o príncipe dos contos de fadas que ela sempre buscou. Naruse será capaz de transmitir o hino de seu coração?",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0055_4": {
                "id": "a0055_4",
                "foto": "https://pbs.twimg.com/media/EMoUWk3UcAEIXVK.jpg",
                "link": "https://myanimelist.net/anime/39569/Sora_no_Aosa_wo_Shiru_Hito_yo",
                "trailer": null,
                "episodios": 1,
                "sinopse": "A estudante de ensino médio Aoi Aioi mora com sua irmã mais velha, Akane, depois que um trágico acidente levou seus pais embora 13 anos atrás. Porque Akane está cuidando dela sozinha, Aoi quer se mudar para Tóquio após sua formatura para aliviar o fardo de sua irmã e seguir uma carreira musical, inspirada pelo ex-namorado de Akane, Shinnosuke \"Shinno\" Kanamuro. Shinno fazia parte de uma banda até que ele partiu para Tóquio para se tornar um guitarrista profissional depois que os pais das irmãs faleceram, e ele nunca mais foi visto.\n\nUma tarde, enquanto Aoi praticava seu baixo em uma casa de hóspedes, ela se assustou com a versão de 18 anos de Shinno de 13 anos atrás! Como que por coincidência, o atual Shinno, de 31 anos, também retorna à cidade, mas mudou drasticamente. Existem agora dois Shinno, mas por que o Shinno é do presente passado?\n\nSora no Aosa wo Shiru Hito yo gira em torno desses quatro indivíduos enquanto eles confrontam seus sentimentos íntimos um pelo outro e tomam decisões que afetarão suas vidas de agora em diante.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0055_5": {
