                "link": "https://myanimelist.net/anime/15039/Ano_Hi_Mita_Hana_no_Namae_wo_Bokutachi_wa_Mada_Shiranai_Movie",
                "trailer": null,
                "episodios": 1,
                "sinopse": "Um ano depois que sua amiga falecida Honma Meiko apareceu para eles, Jinta Yadomi e os outros membros do Super Peace Busters decidem escrever cartas em sua memória. Na tentativa de aproveitar o verão juntos, eles relembram o tempo que passaram juntos antes e depois de sua morte.\n\nAnoHana. Filme reconta os principais acontecimentos da história dos pais na perspectiva de cada membro do Super Peace Busters.",
