                "sinopse": "Em 1972, um estudante popular da turma 3-3 da Yomiyama North Middle School, chamado Misaki, faleceu durante o ano letivo. Desde então, a cidade de Yomiyama tem sido envolta por uma atmosfera assustadora, dos segredos obscuros escondidos lá no fundo.\n\nVinte e seis anos depois, Kouichi Sakakibara, de 15 anos, é transferido para a turma 3-3 de Yomiyama North e logo depois descobre que um humor estranho e sombrio parece pairar sobre todos os alunos. Ele também se sente atraído pela misteriosa estudante Mei Misaki, que usa tapa-olho; entretanto, o resto da classe e os professores parecem tratá-la como se ela não existisse. Sem prestar atenção aos avisos de todos, incluindo a própria Mei, Kouichi começa a se aproximar não apenas dela, mas também da verdade por trás do terrível fenômeno que assola a classe 3-3 de Yomiyama North.\n\nOutrosegue Kouichi, Mei e seus colegas de classe enquanto são puxados para o enigma em torno de uma série de eventos trágicos e inevitáveis ​​- mas desvendar o horror de Yomiyama pode custar-lhes o preço final.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0057_2": {
                "id": "a0057_2",
                "foto": "https://www.nautiljon.com/images/anime/00/56/another_the_other_-_inga_2465.jpg",
                "link": "https://myanimelist.net/anime/11701/Another__The_Other_-_Inga",
                "trailer": null,
                "episodios": 1,
                "sinopse": "Pouco antes do início de um novo semestre, Misaki Fujioka visita sua irmã gêmea Mei Misaki na cidade de Yomiyama. As meninas aproveitam ao máximo os últimos dias de verão, vagando por uma cidade cansada pelo calor e visitando vários lugares, incluindo um shopping center e uma barraca de tiro. Quando eles rondam seu porão, Mei expressa seu desconforto sobre sua nova classe, que é considerada amaldiçoada.\n\nDesejando mais entretenimento, os gêmeos decidem fazer uma visita ao parque de diversões local. Mas o lazer de um dia sonolento de verão logo pode se tornar lamentável quando Mei vê a cor da morte em sua irmã - um presságio inconfundível de que uma tragédia está fadada a atacar.",
