                "episodios": 1,
                "sinopse": "O ano é 2027 e a cidade de Kyoto passou por um grande avanço tecnológico. Na cidade vive Naomi Katagaki, um garoto socialmente desajeitado e introvertido com uma paixão por livros, e Ruri Ichigyou, uma garota com uma personalidade fria que geralmente é direta com as pessoas, mas compartilha seu amor pela leitura. Apesar de ter interesses semelhantes, Naomi tem medo de abordar Ruri devido à sua natureza hostil.\n\nUm dia, quando Naomi sai para dar uma caminhada, uma aurora carmesim perfura o céu por um breve momento antes de desaparecer. Pouco depois, ele vê um corvo de três patas e um misterioso homem encapuzado que se revela ser Naomi de 10 anos no futuro, explicando que veio para mudar um evento trágico iminente que acontece com Ruri logo após o início do namoro. Inicialmente aceitando suas palavras com um grão de sal, a atual Naomi segue as instruções de seu eu futuro e começa a se aproximar de Ruri, determinada a salvá-la.\n\nHello World foca no presente Naomi ao lado de si mesmo de 10 anos no futuro. Com a ajuda de seu futuro eu, Naomi começa seus preparativos para salvar Ruri. Ele será capaz de mudar o futuro?",
