                "sinopse": "Quando uma criatura misteriosa reduz a lua a um crescente permanente, os alunos da classe 3-E da Kunugigaoka Middle School se vêem confrontados com uma tarefa enorme: assassinar a criatura responsável pelo desastre antes que a Terra tenha um destino semelhante. No entanto, o monstro, apelidado de Koro-sensei (o professor indestrutível), é capaz de voar a velocidades de até Mach 20, o que ele demonstra livremente, deixando qualquer tentativa de subjugá-lo em sua poeira extraterrestre. Além disso, os desajustados do 3-E logo descobrem que o estranho animal com tentáculos é mais do que apenas indomável - ele é o melhor professor que já tiveram!\n\nAdaptado do mangá de sucesso humorístico de Yuusei Matsui, Ansatsu Kyoushitsuconta a história desses alunos do ensino fundamental enquanto eles aprimoram suas habilidades de assassinato e crescem para se manterem fortes contra o sistema escolar opressor, seus próprios problemas de vida e, um dia, Koro-sensei.",
