                "trailer": null,
                "episodios": 12,
                "sinopse": "Futaba Yoshioka costumava ser uma atraente e popular estudante do ensino fundamental - muito querida pelo sexo oposto, mas condenada ao ostracismo pelas meninas. No entanto, ela foi capaz de ignorar tudo isso, porque a única opinião que realmente importava para ela era a de Kou Tanaka, uma colega de classe com quem ela compartilhou um abrigo da chuva uma vez, seguida por várias outras memórias preciosas e significativas. Ela até conseguiu fazer planos para se encontrar com o menino quieto e inocente no festival de verão, mas um simples mal-entendido e o subsequente desaparecimento de Tanaka a deixaram caminhando pelos corredores de sua escola sem amigos.\n\nAgora no colégio, Futaba não é a típica adolescente. Determinada a se tornar a favorita da turma dessa vez, ela evita todas as atenções indesejadas e, ao invés de agir de forma fofa e feminina, só se destaca pelo seu comportamento moleca e seu visual desgrenhado. Mas, ainda assim, seu mundo logo vira de cabeça para baixo quando o único garoto de quem ela gostou inesperadamente entra em sua vida mais uma vez - exceto que agora ele atende pelo nome de Kou Mabuchi, e não foi só o nome dele que passou por uma mudança radical .",
