                "sinopse": "Humanos e demônios são duas faces da mesma moeda, assim como Assiah e Gehenna, seus respectivos mundos. A única maneira de viajar entre os reinos é por meio da possessão, como nas histórias de fantasmas. No entanto, Satanás, o governante da Gehenna, não pode encontrar um hospedeiro adequado para possuir e, portanto, permanece aprisionado em seu mundo. Em uma tentativa desesperada de conquistar Assiah, ele envia seu filho, com a intenção de que ele eventualmente se transforme em um recipiente capaz de ser possuído pelo rei demônio.\n\nAo no Exorcistsegue Rin Okumura, que parece ser um adolescente comum, um tanto problemático - até que um dia ele é emboscado por demônios. Seu mundo vira de cabeça para baixo quando ele descobre que ele é na verdade o próprio filho de Satanás e que seu pai demônio deseja que ele volte para que possam conquistar Assiah juntos. Não querendo se juntar ao rei da Gehenna, Rin decide começar a treinar para se tornar um exorcista para que ele possa lutar para defender Assiah ao lado de seu irmão Yukio.",
