                "trailer": null,
                "episodios": 12,
                "sinopse": "Com a invenção dos sapatos antigravitacionais conhecidos como Grav-Shoes, a habilidade de voar livremente se tornou uma experiência cotidiana para as pessoas que habitam um arquipélago de quatro ilhas ao sul do Japão. Esta invenção trouxe às pessoas novas formas de viver e também um novo esporte conhecido como \"Flying Circus\", onde os participantes ganham pontos tocando em bóias flutuantes ou nas costas do oponente.\n\nA crédula e desajeitada Asuka Kurashina, recém-transferida para a Kunahama High School, entra neste mundo do vôo sem saber quando é capaz de realizar uma manobra difícil na primeira vez que participa de uma partida Flying Circus. Eventualmente, isso a leva a se juntar ao clube Flying Circus de sua escola. Liderados por seu treinador, Masaya Hinata, seus membros consistem na experiente Misaki Tobisawa e sua amiga superprotetora,Ao no Kanata no Four Rhythm segue este grupo novato voando alto acima dos céus e em direção aos seus sonhos, armados apenas com sua paixão inabalável contra um futuro incerto.",
