                "trailer": null,
                "episodios": 12,
                "sinopse": "Hotaru Tachibana tem um forte senso de justiça e simplesmente não pode deixar de enfrentar aqueles que optam por praticar atos maliciosos. Além disso, Hotaru é na verdade uma garota que gosta de se disfarçar de garoto. Depois de ouvir rumores de que sua melhor amiga foi enganada pelo popular anfitrião de um clube local, Hotaru tenta punir o malfeitor. Ao chegar ao clube, no entanto, ela é desafiada para um chamado \"jogo de sobrevivência\" pelo apresentador Masamune Matsuoka, onde a primeira pessoa atingida pela bala de uma arma de brinquedo perderá.\n\nDepois de uma luta destrutiva que resultou na perda de Hotaru, Masamune força o jovem \"garoto\" a se juntar à sua equipe de jogos de sobrevivência chamada Toy Gun Gun, a fim de reembolsar o custo dos danos que \"ele\" causou dentro do clube. Embora ela esteja inicialmente infeliz com esta reviravolta nos acontecimentos, Hotaru rapidamente começa a aproveitar o que os jogos de sobrevivência têm a oferecer e está determinada a pagar sua dívida, para desespero de Tooru Yukimura, o outro membro da Toy Gun Gun. Com o passar do tempo, Hotaru começa a desenvolver uma amizade próxima com o resto da equipe e espera participar da realização de seu sonho de vencer o Top Combat Game (TCG), um torneio para decidir o melhor time de jogos de sobrevivência do Japão.\n\nEmbora Hotaru dê o seu melhor, existem apenas dois pequenos problemas: ela é absolutamente terrível no jogo e Toy Gun Gun não permite membros do sexo feminino em seu time!",
