                "link": "https://myanimelist.net/anime/6164/Aoi_Hana",
                "trailer": null,
                "episodios": 11,
                "sinopse": "A tímida e suave Fumi Manjoume e a sincera e atenciosa Akira Okudaira eram as melhores amigas na escola primária, mas isso mudou quando Fumi e sua família se mudaram. Anos depois, Fumi volta para sua cidade natal depois de ser aceita na Matsuoka Girls 'High School. Ela finalmente se reúne com Akira, que vai estudar na Fujigatani Girls 'Academy. Apesar do reencontro, o relacionamento deles não é o mesmo de anos atrás.\n\nAssim que Fumi começa a frequentar a escola, a popular veterana Yasuko Sugimoto toma conhecimento dela e a elogia mais do que qualquer outro aluno. Depois de correr para Akira pedindo ajuda tantas vezes antes, Fumi deve descobrir quem ela é como pessoa, em vez de ficar na sombra de outra pessoa. No entanto, isso não impede Akira de querer que sua amizade com Fumi seja como antes. As meninas serão capazes de conquistar o estágio de crescimento do ensino médio antes que isso as separe?",
                "maturidade": null,
