    "a0065": {
        "id": "a0065",
        "parentes": [],
        "items": {
            "a0065_1": {
                "id": "a0065_1",
                "foto": "https://static-movie.a.88cdn.com/42f5825ab75812375444e4718981c156.jpg?imageView2/1/q/85/interlace/1",
                "link": "https://myanimelist.net/anime/18893/Aoki_Hagane_no_Arpeggio__Ars_Nova",
                "trailer": null,
                "episodios": 12,
                "sinopse": "No ano de 2039, os efeitos drásticos do aquecimento global fizeram com que o nível do mar subisse, resultando em grande perda de terra. Para garantir que a humanidade aprenda sua lição, uma frota de poderosos navios de guerra equipados com armamento avançado emerge, causando uma derrota esmagadora para as forças navais em todo o mundo. Chamando a si mesmas de Fleet of Fog, cada nave tem um \"Modelo Mental\", um avatar humanóide que representa o coração da nave, seu \"Núcleo da União\". Cada modelo tem uma personalidade diferente, mas todas seguem uma autoridade desconhecida conhecida como Código do Almirantado, que implementou um bloqueio para impedir que humanos viajem pelo mar.\n\nDezessete anos após o bloqueio, Gunzou Chihaya, um ex-aluno da National Marine Academy, se depara com o I-401 e seu Modelo Mental, Iona, que se alia à humanidade por razões desconhecidas. Utilizando essa esperança recém-descoberta de alcançar a paz para a humanidade, Gunzou e seus amigos formam um grupo de corsários, conhecido como Blue Steel, enquanto partem em uma jornada perigosa.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0065_2": {
                "id": "a0065_2",
                "foto": "https://pbs.twimg.com/profile_images/678230661426102272/Mj2JwZq__400x400.jpg",
                "link": "https://myanimelist.net/anime/23627/Aoki_Hagane_no_Arpeggio__Ars_Nova_-_Kirikumas",
                "trailer": null,
                "episodios": 13,
                "sinopse": "A retransmissão do anime de 12 episódios para TV Arpeggio of Blue Steel: Ars Nova começou na Tokyo MX e na Sun TV desde ontem, 5 de abril. Cada episódio vem com uma nova série curta de paródia de 60 segundos \"Kirikumas\" apresentando o mundo todas as meninas modelo mental se tornam ursinhos de pelúcia.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0065_3": {
                "id": "a0065_3",
                "foto": "https://images-na.ssl-images-amazon.com/images/I/912jXAIvcWL._RI_.jpg",
                "link": "https://myanimelist.net/anime/24921/Aoki_Hagane_no_Arpeggio__Ars_Nova_Cadenza",
                "trailer": null,
                "episodios": 1,
                "sinopse": "O grupo de corsários conhecido como Blue Steel continua sua missão de entregar os projetos do Vibration Warhead Torpedo - uma arma que pode virar a maré da guerra a seu favor - para os Estados Unidos. No entanto, uma nova ameaça surge de seu inimigo, a esmagadora Frota de Nevoeiro na forma de \"O Conselho de Alunos\". Este é um grupo de navios de guerra compostos pelos Modelos Mentais restantes - os avatares humanóides dos navios - que ainda não enfrentaram o imprevisível capitão do Blue Steel, Gunzou Chihaya.\n\nÀ medida que o Blue Steel se aproxima de compreender as origens da autoridade que controla o inimigo, o passado de Iona começa a revelar por que a guerra começou e sua razão para se aliar à humanidade.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0065_4": {
                "id": "a0065_4",
                "foto": "https://i0.wp.com/acgevent.com/wp-content/uploads/2015/03/11002692_398205643684238_2382072929946973451_o.jpg?w=1401&ssl=1",
                "link": "https://myanimelist.net/anime/24919/Aoki_Hagane_no_Arpeggio__Ars_Nova_DC",
                "trailer": null,
                "episodios": 1,
                "sinopse": "Recapitulação da série Aoki Hagane no Arpeggio: Ars Nova , com aproximadamente 40 minutos de material inédito.\n\nEm 2039, o aquecimento global fez com que o nível do mar subisse e uma grande quantidade de território fosse perdida. Como se em resposta, um misterioso grupo de navios de guerra envoltos em névoa, \"a Frota da Névoa\", apareceu em todos os cantos do oceano e começou a atacar navios humanos. Apesar da humanidade reunir todas as suas forças, eles foram totalmente derrotados pela força esmagadora da Névoa. Todas as rotas comerciais da humanidade foram bloqueadas pela Frota da Névoa, sua economia política foi destruída e a raça humana foi constantemente derrotada. Sete anos depois, o submarino I-401 da Fleet of Mist aparece antes do cadete Gunzo Chihaya. A forma de vida humanóide que pilota o submarino, que deveria ser seu inimigo, está oferecendo seus serviços à humanidade.",
                "maturidade": null,
                "pontosBase": 0.0
            }
        }
    },
    "a0066": {
        "id": "a0066",
        "parentes": [],
        "items": {
            "a0066_1": {
                "id": "a0066_1",
                "foto": "https://st.kp.yandex.net/im/poster/3/4/8/kinopoisk.ru-Appare-Ranman_21-3483948.jpg",
                "link": "https://myanimelist.net/anime/40532/Appare-Ranman",
                "trailer": null,
                "episodios": 13,
                "sinopse": "Nenhum sonho é grande demais para Appare Sorrano, um inventor socialmente desajeitado que morava em uma pequena cidade rural no Japão no final do século 19. Fascinado desde a infância pela criação de navios a vapor que podem conectar pessoas a grandes distâncias, ele aprendeu a fazer máquinas de todos os tipos a partir de vários textos científicos. Seu objetivo é navegar pelo mar, além do céu e, finalmente, para o outro lado da lua.\n\nInfelizmente, por meio de uma série de eventos, Appare se vê encalhado no meio do mar em seu mini navio a vapor. Flutuando ao lado dele está um samurai habilidoso, mas covarde, Kosame Ishikki, que foi encarregado de manter seu comportamento excêntrico sob controle. Quando toda a esperança parece perdida, um grande navio a vapor os salva e os leva para Los Angeles. Sem dinheiro ou planos, eles decidem participar da \"Corrida Selvagem Trans-America\", que dá a Appare a chance de construir seu próprio automóvel, e Kosame a oportunidade de usar o prêmio em dinheiro para voltar para casa. No entanto, contra pilotos rivais e desafios desconhecidos que residem na selva, quão longe esta aventura levará Appare e Kosame?",
                "maturidade": null,
                "pontosBase": 0.0
            }
        }
    },
