                "sinopse": "Kakeru e Suguru são irmãos que têm uma paixão ardente pelo futebol. No entanto, enquanto Suguru se torna uma estrela em ascensão no sistema de futebol juvenil japonês, Kakeru decide assumir um papel administrativo depois de lutar no campo. Mas devido a uma reviravolta cruel do destino, Kakeru acaba reavaliando o papel que escolheu.\n\nNa esperança de um dia entrar na Copa do Mundo tornando-se membro da seleção nacional, Kakeru treina mais forte do que qualquer outro. Ele não está sozinho nesta busca pela glória, no entanto. A amiga de infância de Kakeru, Nana, é uma prodígio do futebol, com o apelido perverso de “Bruxinha”. Ela é uma jogadora de primeira linha e já joga pelo Nadeshiko Japan, a seleção feminina japonesa. O sucesso de Nana dá a Kakeru o impulso extra de que ele precisa para alcançar seus objetivos.\n\nFutebol e fervor adolescente se combinam para uma jornada épica e emocionante. Confira por si mesmo na Área no Kishi !",
