                "trailer": null,
                "episodios": 12,
                "sinopse": "Quando eram crianças rindo e brincando juntos, Izumi Norimoto e Kazusa Onodera eram como irmãos. Mas, conforme seus corpos amadureciam no ensino médio, Kazusa começou a vê-lo como algo diferente; infelizmente para ela, as outras garotas também. Ostracizada, Kazusa não teve escolha a não ser se distanciar dele indo para o colégio. Depois de ingressar no clube de literatura, no entanto, ela encontra amigos que mantêm sua mente ocupada. Conhecido em toda a escola por ler em voz alta cenas de sexo em romances de literatura, a reputação do clube impediu todos os professores de aceitar a tarefa de ser seus conselheiros.\n\nDurante uma discussão sobre o que colocariam em sua lista de desejos, uma das garotas disse uma coisa: sexo. Esta única palavra envia ondas por todas as cinco meninas, à medida que o pensamento de sexo começa a dominar suas vidas diárias. E, depois de entrar em Izumi durante um momento muito privado, Kazusa é enviada em uma espiral de emoção que a força a enfrentar seus verdadeiros sentimentos por ele. Agora, com o coração acelerado e o clube de literatura enfrentando uma dissolução imediata, as cinco meninas devem trabalhar duro para manter a sanidade e o clube vivos.",
                "maturidade": null,
                "pontosBase": 0.0
            }
        }
