                "trailer": null,
                "episodios": 13,
                "sinopse": "Kou Ichinomiya é filho de um rico empresário que acredita piamente em seu status de elite. Como tal, ele está determinado a evitar se endividar com ninguém; mas um dia, depois de um encontro com algumas crianças travessas na ponte Arakawa, ele acabou caindo no rio que corria embaixo dela. Felizmente para ele, um transeunte está lá para salvá-lo - mas agora, ele deve sua vida a esse estranho!\n\nIrritado com isso, Kou insiste em retribuir, mas esse pode ser o pior negócio que o empresário arrogante já fez. A estranha - uma garota sem-teto estóica, vestindo um agasalho, conhecida apenas como Nino - vive em uma caixa de papelão sob a ponte e quer apenas uma coisa: se apaixonar. Pedindo a Kou para ser seu namorado, ele não tem escolha a não ser aceitar, forçando-o a se mudar de sua casa confortável e começar uma nova vida debaixo da ponte!",
