        "items": {
            "a0072_1": {
                "id": "a0072_1",
                "foto": "https://www.infoanime.com.br/poster/2012/arcanafamiglia.jpg",
                "link": "https://myanimelist.net/anime/12967/Arcana_Famiglia",
                "trailer": null,
                "episodios": 12,
                "sinopse": "Na ilha de Regalo, um grupo de protetores mafiosos com poderes sobrenaturais, chamados de Famiglia Arcana, protegem o povo de qualquer um que possa prejudicá-lo. Os membros de sua organização, tendo feito contratos com cartas de tarô, possuem habilidades diferentes, como força avassaladora, invisibilidade ou o poder de ver o coração de alguém.\n\nMondo, seu líder e o \"Papa\" de sua família, anuncia em sua festa de aniversário que se aposentará em breve. Ele planeja realizar o Arcana Duello, competição que, se vencida, concederá ao vencedor o título de Papa e qualquer desejo que desejar. Mas há mais em jogo do que apenas um título: Mondo também decide que o vencedor se casará com sua filha, Felicità. Enfurecida com isso, a obstinada Felicità decide entrar ela mesma na competição, a fim de fazer seu próprio caminho no mundo. Enquanto Felicità luta por sua liberdade, seus concorrentes lutam por seu coração.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0072_2": {
                "id": "a0072_2",
                "foto": "https://livedoor.blogimg.jp/sena_sakane/imgs/b/b/bb6a7ac3.jpg",
                "link": "https://myanimelist.net/anime/15411/Arcana_Famiglia__Capriccio_-_stile_Arcana_Famiglia",
                "trailer": null,
                "episodios": 1,
                "sinopse": "Depois de labutar em seu laboratório, o alquimista Jolly finalmente conseguiu fazer uma poção de troca de personalidade que certamente lhe trará entretenimento.\n\nOs meninos da Arcana Famiglia são enganados para tomar a poção e se encontram em corpos que não são seus. Com esse experimento bem-sucedido, Jolly abriu caminho para uma infinidade de cenários desconfortáveis. No entanto, apesar da luta desesperada dos meninos para se transformarem de volta, há algo a ser aprendido passando o dia no lugar de outra pessoa.",
                "maturidade": null,
