    "a0073": {
        "id": "a0073",
        "parentes": [],
        "items": {
            "a0073_1": {
                "id": "a0073_1",
                "foto": "https://pbs.twimg.com/media/CKvqJE8VAAErv1f.jpg:large",
                "link": "https://myanimelist.net/anime/477/Aria_the_Animation",
                "trailer": null,
                "episodios": 13,
                "sinopse": "Mergulhe pacificamente em Neo Venezia, uma cidade no planeta Aqua (anteriormente conhecida como Marte). Por volta do século 24, os humanos encontraram uma maneira de colonizar o planeta anteriormente inabitável. Por mais futurista que pareça, o Neo Venezia ainda está repleto de beleza rústica; gôndolas em canais largos e hidrovias são o principal meio de transporte. A própria cidade é uma réplica fiel da Veneza de Manhome (o planeta anteriormente conhecido como Terra).\n\nPara garantir que residentes e turistas aproveitem ao máximo as maravilhas da Neo Venezia, foram criadas empresas que oferecem passeios guiados de gôndola, uma das quais se chama Aria Company.\n\nEste é o local de trabalho de Akari Mizunashi, um adolescente de espírito livre de Manhome que agora é um novato Ondine (o título dado aos guias turísticos). Junte-se a Akari enquanto ela se familiariza intimamente com outros Ondine, turistas, residentes de Neo Venezia e até mesmo com a própria cidade, aprendendo muitas lições de vida valiosas ao longo do caminho, como a maravilhosa verdade de que existem coisas como milagres feitos pelo homem.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0073_2": {
                "id": "a0073_2",
                "foto": "https://pbs.twimg.com/media/CLY059DUYAAks4-.jpg",
                "link": "https://myanimelist.net/anime/962/Aria_the_Natural",
                "trailer": null,
                "episodios": 26,
                "sinopse": "Akari Mizunashi continua seu treinamento para se tornar uma Prima Undine (uma guia turística gondoleira profissional) junto com suas amigas Aika e Alice na pacífica cidade de Neo Venezia. Apesar de essas três meninas serem de empresas concorrentes, elas estão constantemente juntas, aprendendo mais sobre como se tornarem melhores guias de turismo e mais sobre os mistérios da Neo Venezia.\n\nÀ medida que o grupo continua conhecendo pessoas interessantes e inesquecíveis em suas rotinas diárias, eles também se aproximam dos segredos que tornam a enigmática e sempre bela cidade de Neo Venezia tão quente e viva.\n\nBem-vindo de volta a Neo Venezia: a cidade onde milagres podem ser feitos à mão.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0073_3": {
                "id": "a0073_3",
                "foto": "https://thewiki.ewr1.vultrobjects.com/data/617269615f7468655f6f76615f617269657474612e6a7067.jpg",
                "link": "https://myanimelist.net/anime/2563/Aria_the_OVA__Arietta",
                "trailer": null,
                "episodios": 1,
                "sinopse": "Akari Mizunashi sonha com a vida após atingir seu objetivo de se tornar uma Prima Ondine, mas ao acordar percebe que pode não ter a confiança necessária para administrar a Aria Company sozinha. Preocupada com o futuro, ela busca o conselho de sua mentora Alicia Florence - uma das três grandes \"Fadas da Água\" de Neo-Venezia.\n\nPara a surpresa de Akari, Alicia revela suas próprias lutas do passado, mas também compartilha as medidas que tomou para superar suas dúvidas sobre como dirigir a empresa e contratar um aprendiz. Encontrando consolo nas palavras de sua professora, Akari se prepara para abraçar todas as provações que ela deve superar em seu caminho para alcançar seus sonhos.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0073_4": {
                "id": "a0073_4",
                "foto": "https://prod.akimg.tv.rakuten.co.jp/content/92/26/32962/jacket_h_l.jpg",
                "link": "https://myanimelist.net/anime/3297/Aria_the_Origination",
                "trailer": null,
                "episodios": 13,
                "sinopse": "No século 24, no planeta Aqua, três garotas - Akari Mizunashi, Alice Carroll e Aika S. Granzchesta - continuam a trabalhar duro para alcançar seu objetivo de se tornar Prima Undines: gondoleiras profissionais de guias turísticos. Felizmente, as meninas têm a orientação das três melhores Prima Undines da Neo-Venezia - Alicia Florence, Athena Glory e Akira E. Ferrari - que são conhecidas como as \"Fadas da Água\" em homenagem a suas habilidades. Com a ajuda deles, os jovens aprendizes treinam arduamente e trabalham para superar as situações em que se encontram.\n\nAria The Origination acompanha as adversidades e o dia a dia dessas três jovens, que estão fazendo o possível para melhorar como gondoleiras de turismo em Neo-Venezia , uma réplica terraformada de Veneza.",
