                "trailer": null,
                "episodios": 6,
                "sinopse": "No reino medieval de Pars, o jovem príncipe Arslan enfrenta a hostilidade de seu pai e o desinteresse de sua mãe, e anseia por aprender mais sobre o mundo. Apesar de estar cercado de pobreza e escravidão, Arslan persiste em ver a possibilidade de um mundo mais nobre. Tudo muda quando a nação vizinha de Lusitânia invade Pars e Arslan é forçado a crescer em um instante.\n\nArslan Senki segue o Príncipe Arslan para a guerra, onde ele luta para salvar sua nação e família com a ajuda de um pequeno, mas dedicado círculo de conselheiros. Ao longo do caminho, o jovem príncipe encontra segredos em cada esquina e enfrenta inimigos que o odeiam por causa do que ele é, mas também encontra amigos onde menos espera. A história das nações em guerra, Arslan Senki é também a história da busca de um menino para se manter nas circunstâncias mais difíceis.",
                "maturidade": null,
                "pontosBase": 0.0
            },
            "a0076_2": {
