                "foto": "https://cdn.animenachrichten.de/wp-content/uploads/2016/05/heroic_legend_arslan_n01_fr_xp_dvd_vorlaufig.jpg",
                "link": "https://myanimelist.net/anime/28249/Arslan_Senki_TV",
                "trailer": null,
                "episodios": 25,
                "sinopse": "O ano é 320. Sob o governo do beligerante Rei Andrágoras III, o Reino de Pars está em guerra com o império vizinho, Lusitânia. Embora diferente de seu pai em muitos aspectos, Arslan, o jovem príncipe, se propõe a provar seu valor no campo de batalha pela primeira vez. No entanto, quando o rei é traído por um de seus oficiais de maior confiança, o exército parsiano é dizimado e a capital Ecbatana é sitiada. Com o exército em frangalhos e os lusitanos em sua cabeça, Arslan é forçado a fugir. Com um respeitado general ao seu lado, Daryun, Arslan logo parte em uma jornada em busca de aliados que o ajudarão a retomar sua casa.\n\nNo entanto, os inimigos que o príncipe enfrenta estão longe de se limitarem apenas àqueles que ocupam seu reino. Exércitos de outros reinos estão prontos para conquistar Ecbátana. Além disso, o cérebro por trás da vitória de Lusitânia, um homem enigmático escondido atrás de uma máscara de prata, representa uma ameaça perigosa para Arslan e sua empresa, pois ele possui um segredo que pode colocar em risco o direito de Arslan à sucessão.\n\nCom todas as probabilidades contra ele, Arslan deve encontrar a força e a coragem para superar esses obstáculos e aliados que o ajudarão a lutar na jornada que o ajudará a prepará-lo para o dia em que se tornará rei.",
                "maturidade": null,
                "pontosBase": 0.0
