                "link": "https://myanimelist.net/anime/31821/Arslan_Senki_TV__Fuujin_Ranbu",
                "trailer": null,
                "episodios": 8,
                "sinopse": "Continuando sua busca para retomar Ecbátana, o Príncipe Arslan e sua companhia marcham em direção à cidade. Mas ao receber a notícia de que o vizinho Reino de Turan está lançando um ataque à fortaleza Parsian na Cidadela de Peshawar, o príncipe é forçado a voltar para defender a fortaleza. Em meio a conter as forças invasoras, o exército Parsian é recebido por um visitante inesperado.\n\nQuando Arslan retorna a Peshawar, o Príncipe Hermes faz um pequeno desvio de seu confronto contra seu primo para procurar a lendária espada Rukhnabad, que lhe daria o direito de governar e retomar o que ele acredita ser seu por direito. No entanto, depois de desenterrar o artefato perdido, a lâmina é roubada pelos Cavaleiros do Templo de Lusitânia, levando o guerreiro mascarado a persegui-lo. Enquanto isso, em Ecbatana, o cativo Rei Andrágoras III encontra uma oportunidade para atacar e começa a se mover.\n\nEnquanto os lados separados do conflito real parsiano se chocam, o direito de Arslan ao trono cai sob ataque. Mas não importa os obstáculos em seu caminho, o jovem príncipe e seu leal bando de guerreiros avançam para restaurar Pars à sua antiga glória.",
