                "trailer": null,
                "episodios": 12,
                "sinopse": "No século 16, a cidade de Florença explode com um renascimento cultural e criativo na celebração do Renascimento. Arte, uma encantadora jovem de família aristocrática, sonha em ser artista e contribuir para a renovação da civilização. Porém, com a morte do pai, ela acaba perdendo a única pessoa que acreditava em sua paixão pela arte. Agora espera-se que ela se case com um nobre e viva como uma dona de casa refinada sem desonrar seu nome de família. Relutante em aceitar seu destino, a teimosa Arte sai às ruas em busca de um mestre artesão para aceitá-la como aprendiz.\n\nEm sua busca por um mentor, Arte tem que enfrentar a dura realidade ao ser completamente rejeitada por ser uma artista feminina. Ninguém acredita que as mulheres são capazes de um bom artesanato e, portanto, ninguém está disposto a aceitá-la. Felizmente, um renomado artesão chamado Leo é persuadido a aceitá-la como sua discípula, já que não tem nenhuma. E assim começa a nova vida de Arte, longe do conforto da sua nobre criação. Como aprendiz, ela deve ganhar seu sustento enquanto enfrenta vários desafios ao longo do difícil caminho para se tornar uma mestre artesã de pleno direito.",
                "maturidade": null,
                "pontosBase": 0.0
            }
        }
