                "sinopse": "Durante o recreio, Olivia, uma estudante estrangeira transferida que não sabe inglês, joga um jogo de \"olhar para o outro\" com Hanako Honda, uma cabeça de vento barulhenta. Seu comportamento turbulento estimula a ira de Kasumi Nomura, uma solitária inexpressiva constantemente provocada por sua irmã mais velha por sua tendência a perder jogos. Não querendo competir, Kasumi recusa a oferta de Olivia para se juntar à diversão, mas eventualmente se envolve de qualquer maneira e dispensa sua própria marca de travessuras. Logo, uma estranha amizade floresce entre o trio peculiar, e eles decidem formar o \"Clube do Passatempo\", onde são livres para retomar seus hijinks diários.\n\nSeja não aprender inglês, tentar desesperadamente se tornar popular ou ser pega pelos professores na hora errada, a vida escolar nunca será entediante quando as meninas de Asobi Asobaseestão preparados para suas travessuras hilariantes.",
