                "trailer": null,
                "episodios": 12,
                "sinopse": "À beira da extinção, a humanidade diminuiu e agora reside apenas na cidade-estado de Flandore, vivendo em cidades envoltas por cúpulas de vidro. Além das cúpulas existem licantropos cruéis que prosperam na escuridão; entre os cidadãos internos, existe uma distinção clara entre a nobreza e os plebeus. O sangue dos nobres permite que eles utilizem mana, concedendo-lhes habilidades que excedem os limites humanos e os ajuda muito a derrotar os licantropos.\n\nJá com 13 anos de idade, a nobre Melida Angel ainda não manifestou seu mana, e frequenta uma academia de elite onde é maltratada por sua falta. A fim de ajudá-la, Kufa Vampir é ordenada pela família Angel a se tornar a tutora de Melida. Embora Kufa pareça ser um mero mentor, um motivo oculto se esconde por trás de seu trabalho - ele deve assassiná-la se confirmar que ela não possui mana.\n\nA investigação de Kufa eventualmente o leva a determinar que ele deve eliminar Melida. No entanto, Kufa fica impressionada com sua determinação inabalável, espírito e crença em si mesma quando ele a testemunha em uma luta, optando por oferecer uma maneira que ela possa manifestar sua magia. Enquanto Melida aprende a usar mana com a ajuda dos ensinamentos de Kufa, Kufa abandona sua missão e arrisca tudo para manter sua descoberta de Melida desconhecida para a família de Anjos e sua própria guilda. No entanto, Kufa e Melida logo perceberão que esconder seu segredo não será o único desafio que enfrentam, pois problemas imprevistos estão esperando ao virar da esquina.",
                "maturidade": null,
                "pontosBase": 0.0
            }
        }
