              "link": "https://myanimelist.net/anime/9736/Astarotte_no_Omocha",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Succubi, como a jovem princesa Astarotte \"Lotte\" Ygvar, exigem a semente da vida dos homens para sobreviver, reabastecer sua magia e continuar a linhagem real do reino mágico. Isso significa que as súcubos são obrigadas a manter um harém de homens por perto. Ironicamente, Lotte despreza os homens, o que colocará sua vida em risco quando ela amadurecer. Para convencê-la a cumprir seus deveres, uma de suas assistentes, Judith Snorrevik, vai ao reino humano para encontrar um homem que Lotte pode tolerar.\n\nJudith retorna com Naoya Touhara, de 23 anos, um pai solteiro que infelizmente deixa sua filha, Asuha, para trás no reino humano. Como o primeiro membro do harém de Lotte, Naoya rapidamente se adapta a este novo ambiente, servindo à princesa para fazê-la feliz, ao invés de vê-la com intenções sexuais. Infelizmente, quando sua filha pode chegar ao reino mágico, o relacionamento de Naoya piora rapidamente com Lotte. Mesmo assim, ele se esforça para consertar o relacionamento deles.\n\nLogo fica claro, no entanto, que a presença de Naoya no reino mágico é mais do que mera coincidência. À medida que ele desenvolve seu vínculo com Lotte, o destino começa a reunir as conexões que o unem a todos os demais neste mundo encantador.",
              "maturidade": null,
              "pontosBase": 0.0
            },
