              "trailer": null,
              "episodios": 1,
              "sinopse": "O OVA Astaroette no Omocha é uma série de contos em três partes. Na primeira história, Lotte e Asuha procuram detalhes sobre seu projeto escolar. Na segunda parte, está a história de como Zelda se tornou a guarda-costas de Lotte. O final dos três é um flashback de como a rainha conheceu Naoya e como eles conceberam Asuha dez anos antes dos eventos do anime.",
