              "episodios": 12,
              "sinopse": "Yoichi Karasuma passou toda sua vida nas montanhas, treinando no estilo de esgrima do Vento Elevado e do Vento Divino. Sob a orientação de seu pai, ele é capaz de dominar a técnica aos 17 anos. Sem mais nada para aprender, Yoichi é enviado para um novo dojo localizado na cidade para que possa continuar a treinar e obter uma compreensão da sociedade moderna.\n\nInfelizmente, Yoichi não tem ideia de como agir ou falar com ninguém nos dias atuais e age como um samurai, com linguagem estranha e roupas tradicionais. Quando vai morar com as irmãs Ikaruga no dojo, Yoichi, sem noção de como interagir com outras pessoas, é constantemente levado a hilários mal-entendidos. Asu no Yoichi!segue Yoichi enquanto ele tropeça em sua nova vida e tenta aprender como viver no mundo moderno com sua nova família.",
