              "episodios": 13,
              "sinopse": "Natsume Tomoharu é um estudante normal do ensino médio em todos os sentidos, com uma exceção: ele está sendo seguido pelo fantasma de seu melhor amigo, Misao.\n\nDepois de se mudar para a antiga casa de seu irmão, Tomoharu espera continuar vivendo sua vida normal, mas um dia é deixado com uma pasta misteriosa e trancada sem qualquer instrução. A princípio, ele planeja deixá-lo armazenado; no entanto, sua casa logo é invadida por vários grupos de pessoas após a pasta. Apesar de ainda não saberem o propósito da pasta, Tomoharu e Misao tentam escapar com ela.\n\nA partir daí, Tomoharu tenta aprender os segredos por trás da pasta, as conexões entre ela e Misao, e por que ela tem o poder de mudar o mundo.",
