              "sinopse": "Após a primeira temporada, Tomoharu agora se depara com um dilema: se ele não fechar um contrato com um \"akuma\", ele corre o risco de perder seu querido amigo Takatsuki. No entanto, fazer isso comprometeria sua própria existência, pois resultaria em ele e seu amigo fantasma Misao se tornando um Asura Cryin '- a maior ameaça da humanidade, de acordo com os presidentes da escola. Para tornar a decisão ainda mais difícil, Tomoharu e Misao recuperaram algumas de suas memórias do passado - memórias de um mundo que eles nem sabiam que existia",
