              "trailer": null,
              "episodios": 12,
              "sinopse": "Quando as \"sereias\", uma força alienígena com um arsenal que ultrapassa em muito os limites da tecnologia atual, apareceram de repente, uma humanidade dividida manifestou-se em completa solidariedade pela primeira vez. Quatro países - Eagle Union, Royal Navy, Sakura Empire e Iron Blood - formaram o Azur Lane, abrindo caminho para o aprimoramento da guerra moderna, o que levou a uma vitória inicial contra a ameaça comum. No entanto, essa tênue união foi ameaçada por ideais opostos, dividindo a aliança em duas. O Império Sakura e o Sangue de Ferro se separaram e formaram o Eixo Vermelho, e a humanidade se fragmentou novamente.\n\nComo um lutador experiente e experiente, a Enterprise \"Gray Ghost\" dá os ombros à esperança de Azur Lane de terminar a guerra. Mas por trás de sua personalidade estóica se esconde uma garota frágil, com medo do oceano. Mesmo assim, ela continua a lutar por acreditar que esse é o único propósito de sua existência. Enquanto isso, Javelin, Laffey e Unicorn - três navios da união - tropeçam em Ayanami, um espião do Eixo Vermelho. Por mais estranho que possa parecer, eles tentam fazer amizade com ela, mas como inimigos, seus esforços são em vão. Mesmo assim, eles perseveram na esperança de um dia ter sucesso.\n\nEm meio ao conflito sem fim dentro da humanidade, as chaves que poderiam unir uma raça fragmentada podem existir: um soldado chegando a um acordo com sua personalidade misteriosa e camaradagem entre aqueles com ideais diferentes.",
              "maturidade": null,
