              "sinopse": "Depois que as fadas derrotaram Gunala, a Deusa do Mal, outra crise atingiu o Castelo das Fadas !! A energia mágica do mundo foi devorada pelos magos do mal. A flor do arco-íris, a fonte do poder mágico, logo murchará, e isso destruirá o mundo do Castelo das fadas. Apenas encontrar a lendária Pedra do Coração do Arco-Íris e permitir que ela reúna toda a energia essencial pode salvar o mundo. Para resolver a maior crise da história do Castelo das Fadas, o Príncipe YouLe, Sally e seu novo amigo XiaoQian, têm que voltar ao mundo humano e se reunir com Maggie e Michelle para lutar contra o mal novamente.",
