              "trailer": null,
              "episodios": 52,
              "sinopse": "Para ajudar a rainha das fadas a encontrar sua amiga desaparecida Melody, que era uma fada da música habilidosa do Castelo da Música, Sally, Maggie, Michelle e Beibei encontraram nove mágicos musicais e lutaram com a bruxa musical sombria Voiceless. Sally e as fadas suspeitam que Melody está conectada com o poder das trevas por trás da cena. Enquanto, qual é a verdade?",
