              "trailer": null,
              "episodios": 26,
              "sinopse": "Não muito longe do Mundo Mágico do Castelo das Fadas, há outro Reino Mágico chamado Castelo Colorido. Que é um lugar cheio de cor, alegria e humor, assim como um paraíso tranquilo e despreocupado ... Até que um dia, na orla do Reino, Lá uma ilha cinza escura, onde o dono dela, O Senhor da maldição negra acabei de acordar do sono. A fim de tornar sua ilha mais poderosa, ele decide roubar a \"Energia Mágica da Cor\" do Castelo Colorido para si mesmo.\n\nO Senhor enviou seus homens, os Soldados do Feijão Preto, esgueirar-se para o colorido Reino, para roubar a energia. Testemunhando seu próprio povo sendo intimidado, a princesa do Reino Colorido descobriu que não tinha mais nenhuma estratégia para tentar, já que ela havia sido amaldiçoada pela maldição misteriosa e se transformou em uma pequena fada. Mas ela nunca pensaria, haverá três garotas do mundo humano, para estar do lado dela, juntas, elas vão lidar com o Senhor da maldição negra. Além disso, a atmosfera pacífica e alegre do reino será mudada com a chegada das garotas.",
