              "trailer": null,
              "episodios": 25,
              "sinopse": "Diligente e metódico, o estudante de honra Eiichirou Maruo decide se exercitar mais no pouco tempo livre de que dispõe, porque se preocupa com sua saúde. Por isso, depois de ver um panfleto, ele se junta ao Southern Tennis Club no início do primeiro ano.\n\nSDurante o período de avaliação gratuita no clube, ele conhece Natsu Takasaki, outra aluna do primeiro ano, que está determinada a se tornar uma tenista profissional devido ao seu amor pelo esporte. Em contraste, a vida voltada para o estudo de Eiichirou existe porque ele acredita que é o que ele tem que fazer, não porque gosta disso. No entanto, seus dias monótonos chegam ao fim, pois quanto mais ele joga tênis, mais ele fica fascinado por ele.\n\nPassos de bebêé a história de um menino que aproveita ao máximo sua natureza trabalhadora e perfeccionista para desenvolver seu estilo de jogo único. Aos poucos, as habilidades de Eiichirou começam a melhorar e ele espera estar em pé de igualdade com os melhores jogadores de tênis.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0004_2": {
