              "link": "https://myanimelist.net/anime/27663/Baby_Steps_2nd_Season",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Depois de ter decidido jogar tênis profissionalmente, Eiichirou Maruo agora precisa convencer seus pais a apoiarem sua decisão. Para isso, ele aposta: se não conseguir vencer o Torneio Júnior de Tênis do Japão, desistirá de seu sonho. No entanto, ele precisará melhorar suas habilidades rapidamente se quiser se classificar para o torneio e ter alguma chance de derrotar os melhores jogadores do país. Por esse motivo, seu novo treinador Ryuuhei Aoi sugere que Eiichirou viaje para o exterior para treinar na Florida Tennis Academy.\n\nBaby Steps 2ª Temporadaleva a ação para a América quando Eiichirou inicia seu programa de treinamento de duas semanas, experimentando como é o tênis fora do Japão. Com esta experiência emocionante o esperando, Eiichirou espera que seu treinamento o aproxime de seu objetivo de se tornar um jogador profissional.",
              "maturidade": null,
              "pontosBase": 0.0
