              "trailer": null,
              "episodios": 12,
              "sinopse": "No recém-formado distrito de Shiniki em Tóquio, Zen Seizaki é um diligente promotor público no Ministério Público do Distrito de Tóquio. Atribuído a um caso envolvendo propaganda falsa, Zen - junto com seu oficial assistente, Atsuhiko Fumio - investigam a Japan Supiri, uma empresa farmacêutica que forneceu pesquisas clínicas fabricadas sobre o novo medicamento da empresa. Ao investigar o arquivo de Shin Inaba, um anestesiologista ligado ao crime, o caso toma um rumo sombrio quando Zen encontra uma página manchada com uma mistura de sangue, cabelo e pele, junto com a letra \"F\" rabiscada em toda a folha. À medida que ele investiga mais, o caso vai além da imaginação do Zen e se torna extremamente complexo, desafiando seu senso de justiça e seu conhecimento da verdade.\n\nIndo mais fundo na investigação, Zen começa a descobrir uma conspiração oculta por trás da eleição para prefeito em curso e laços com muitas pessoas de interesse envolvidas na eleição e aqueles mais próximos do que ele pensa. O caso se agrava e leva o Zen a um imprevisto furacão de corrupção e engano por trás da eleição, o estabelecimento do distrito de Shiniki e a misteriosa mulher associada a tudo isso.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
