              "trailer": null,
              "episodios": 13,
              "sinopse": "Durante o início da década de 1930 em Chicago, o trem transcontinental, Flying Pussyfoot, está iniciando sua jornada lendária que deixará um rastro de sangue por todo o país. Ao mesmo tempo, em Nova York, o ambicioso cientista Szilard e seu relutante assessor Ennis estão procurando garrafas perdidas do elixir da imortalidade. Além disso, a guerra entre os grupos mafiosos está piorando. A bordo do Advena Avis, em 1711, os alquimistas estão prestes a aprender o preço da imortalidade.\n\nBaseado nos premiados light novels de mesmo nome, Baccano!segue vários eventos que inicialmente parecem não relacionados, tanto no tempo quanto no espaço, mas são parte de uma história muito maior - uma de alquimia, sobrevivência e imortalidade. Mesclando esses eventos estão os ladrões de bom coração, Isaac e Miria, conectando várias pessoas, todas com suas próprias ambições e agendas ocultas, e criando laços e consequências para a vida toda para todos os envolvidos.",
