              "trailer": null,
              "episodios": 10,
              "sinopse": "Depois de falhar com seu chefe pela última vez, os membros da yakuza Kentarou, Ryou e Kazuhiko se deparam com uma de duas escolhas: ter seus órgãos colhidos e vendidos ou fazer uma viagem à Tailândia para cirurgia de redesignação sexual e se tornarem ídolos pop. Agora, após um ano de treinamento excruciante, os três bandidos renasceram como Airi, Chika e Mari. Estreando como o grupo de ídolos amadores The Goku Dolls, os três lutam para se tornarem ídolos de topo.\n\nNo entanto, apesar das horas de lavagem cerebral feminilizante que foram forçadas a suportar, os três ídolos conseguiram manter o espírito yakuza vivo em seus corações. Para consertar isso, seu chefe yakuza contrata Mandarin Kinoshita, um gerente lendário que nunca teve um grupo de ídolos falhando sob sua gestão. Com suas vidas agora em jogo, os relutantes yakuza devem trabalhar com seu novo gerente para liberar sua fofura interior e se tornarem os ídolos de sucesso dos quais seu chefe tirânico pode realmente se orgulhar.",
