              "trailer": null,
              "episodios": 13,
              "sinopse": "A Fumizuki Academy não é uma escola secundária japonesa típica. Esta instituição única implementou um sistema novo e inovador para classificar seus alunos. No final do primeiro ano, os alunos fazem uma prova que divide o corpo discente. Os maiores pontuadores são colocados na classe A, até a classe F, para o menor dos baixos.\n\nInfelizmente para Akihisa Yoshii, seu supostamente \"ótimo\" intelecto não era o bastante para tal teste, e agora ele está preso no final da classe F. Naturalmente, a classe F tem as piores instalações: não apenas tatames podres e mesas quebradas, mas também equipamentos desatualizados e móveis gastos. Pelo lado bom, seu amigo Yuuji Sakamoto está na mesma classe e, para surpresa de todos, a garota genial Mizuki Himeji também acabou na mesma classe devido a uma febre imprevista no dia do teste.\n\nInsatisfeito com seus privilégios, a classe F se reúne atrás de Yuuji, determinado a enfrentar as classes de nível superior para aproveitar seus privilégios usando o sistema de batalha de invocação de exames da escola. Os participantes podem convocar personagens de fantasia - cujos níveis de poder são iguais aos resultados dos testes de seus alunos - em uma batalha total. A classe F será capaz de chegar ao topo ou corresponderá às expectativas de todos e fracassará?",
