              "sinopse": "Cartas misteriosas caíram do céu um dia. Capazes de invocar criaturas poderosas de outra dimensão, eles se tornaram a peça central de um novo jogo chamado Bakugan. O jogo ganhou popularidade instantânea entre crianças e adolescentes, com os melhores deles competindo em um ranking mundial.\n\nEnquanto isso, a guerra pelo domínio sobre Vestroia, a pátria das cartas Bakugan, continua. Invadido pelo White Dragon Naga e seus servos, os Doom Beings, o reino se torna cada vez mais desestabilizado. As dimensões começam a se fundir e muitos jogadores de Bakugan percebem que seu passatempo não é apenas um jogo.\n\nDanma Kuusou, um desses jogadores de Bakugan, pretende se tornar o líder do Ranking Mundial algum dia. No entanto, durante uma de suas lutas, ele tem a visão de um confronto em Vestroia. A luta repentinamente move-se para a Terra, onde Danma obtém um poderoso Bakugan falante de fogo, Pyrus Dragonoid.\n\nEle logo é arrastado para o conflito e, junto com sua equipe Bakugan Brawlers, deve atravessar as dimensões e restaurar o equilíbrio em um mundo devastado.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0011_2": {
              "id": "b0011_2",
              "foto": "https://static.tranimeizle.net/animes/1420/large.jpeg",
              "link": "https://myanimelist.net/anime/7334/Bakugan_Battle_Brawlers__Gundalian_Invaders",
              "trailer": null,
              "episodios": 39,
              "sinopse": "O Bakugan Interspace é um sistema de realidade virtual, onde os jogadores podem lutar uns contra os outros e participar de torneios. Inicialmente projetado para ajudar a praticar e aprimorar as habilidades de Bakugan, rapidamente se tornou um ponto de encontro para muitos entusiastas. Durante um dos duelos de Danma Kuusou, o Interspace falha, e ele é nocauteado. Antes de recuperar a consciência, ele tem uma visão de Bakugan em guerra entre si mais uma vez.\n\nA explosão de energia que acompanhou a luta de Danma e causou o desligamento do sistema envia ondas de choque por toda a galáxia, atraindo a atenção das Doze Ordens, uma organização gundaliana. Eles se infiltram no Bakugan Interspace, à procura de lutadores fortes para se juntarem a eles em sua próxima guerra com outra raça alienígena, os Neathians.\n\nDanma e seus companheiros - Shun Kazami e Chouji Marukura - logo se vêem envolvidos em uma guerra extraterrestre. No entanto, por mais distante que possa parecer, o conflito ameaça a própria soberania da Terra e o futuro da raça Bakugan também.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0011_3": {
              "id": "b0011_3",
              "foto": "https://www.nautiljon.com/images/anime/00/92/bakugan_mechtanium_surge_5529.jpg",
              "link": "https://myanimelist.net/anime/10330/Bakugan_Battle_Brawlers__Mechtanium_Surge",
              "trailer": null,
              "episodios": 46,
              "sinopse": "Depois de retornar dos reinos feudais de Gundalia e Neathia, Danma Kuusou e seus companheiros continuam suas vidas na Terra. Agora, um ano depois, o mundo de realidade virtual de Bakugan Interspace finalmente se recuperou da invasão alienígena e mais uma vez se tornou um lugar para lutadores se reunirem e se desafiarem.\n\nAcontece, no entanto, que sempre que o Bakugan de Danma, Pyrus Dragonoid, libera seu poder em batalha, o Interspace experimenta novas interrupções. Incapaz de controlar os incríveis poderes concedidos a ele pelo Code Eve - o espírito da Mãe Bakugan - ele luta para manter o controle sobre o Mechtogan contido dentro dele. Quando fica fora de controle, a misteriosa entidade mecânica causa estragos no campo de batalha, atacando amigos e inimigos.\n\nPara piorar as coisas, o Bakugan Interspace corre o risco de ser infiltrado novamente. Um gênio desconhecido está enviando Chaos Bakugan mutante para o sistema, a fim de fazer uma lavagem cerebral em lutadores e assumir o controle do reino virtual. Em antecipação ao confronto inevitável, Danma deve encontrar uma maneira de manter a força destrutiva do Mechtogan sob controle e reunir os Battle Brawlers novamente.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0011_4": {
              "id": "b0011_4",
              "foto": "https://freeps2gamesblog2015.files.wordpress.com/2014/10/bakugan-battle-brawlers.jpg",
              "link": "https://myanimelist.net/anime/5337/Bakugan_Battle_Brawlers__New_Vestroia",
              "trailer": null,
              "episodios": 52,
              "sinopse": "Após a queda final do desonesto Bakugan Naga, a paz foi trazida de volta para Vestroia. Com a ajuda de Danma Kuusou, seu companheiro Pyrus Dragonoid e outros Battle Brawlers, o Infinity e o Silent Cores foram combinados e o reino foi recriado.\n\nNo entanto, New Vestroia não terá qualquer trégua enquanto invasores alienígenas humanóides, as Vestais, chegam e conquistam o mundo Bakugan de uma só vez. Armados com uma máquina temível capaz de restringir Bakugan em suas formas de bola, eles pretendem escravizar a corrida como uma forma de entretenimento.\n\nAgora, a única força em seu caminho é a Resistência dos Bakugan Battle Brawlers - um grupo de humanos, Bakugan e Vestais que se opõem à ideia de aniquilar uma raça consciente. Liderados por Danma, eles devem se aventurar em New Vestroia ocupada pelo inimigo e repelir os invasores, para assegurar a sobrevivência de todo o mundo.",
              "maturidade": null,
              "pontosBase": 0.0
            },
