              "trailer": null,
              "episodios": 50,
              "sinopse": "A série segue os pré-adolescentes Dan Kouzo, Shun Kazami, Wynton Styles, Lia Venegas e seu cachorro Lightning. Eles são conhecidos como os \"Incríveis\" e fazem vídeos no site ViewTube. Eventualmente, eles tropeçam em uma raça de criaturas biomecânicas chamadas Bakugan. Eles logo tornam-se amigos dos Bakugan e começam a lutar entre si, ao mesmo tempo em que defendem sua vizinhança de bandidos que usam os Bakugan para fins maliciosos.",
