              "foto": "https://ninjinanime.com/wp-content/uploads/tQNoovf36WGkvdEJZ27Ojoa8KoD.jpg",
              "link": "https://myanimelist.net/anime/7674/Bakuman",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Quando criança, Moritaka Mashiro sonhava em se tornar um mangaká, assim como seu herói e tio de infância, Tarou Kawaguchi, criador de um popular gag manga. Mas quando a tragédia acontece, ele desiste de seu sonho e passa os dias do ensino médio estudando, com o objetivo de se tornar um assalariado.\n\nUm dia, seu colega de classe Akito Takagi, o melhor aluno da escola e aspirante a escritor, nota os desenhos detalhados no caderno de Moritaka. Vendo o vasto potencial de seu talento artístico, Akito se aproxima de Moritaka, propondo que eles se tornem mangaká juntos. Depois de muito convencer, Moritaka percebe que se ele for capaz de criar uma popular série de mangá, ele pode conseguir que a garota por quem ele está apaixonado, Miho Azuki, participe da adaptação para anime como dubladora. Assim, a dupla começa a criar mangá com o pseudônimo de Muto Ashirogi, na esperança de se tornar o maior mangaká do Japão, um tipo que ninguém nunca viu.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0012_2": {
              "id": "b0012_2",
              "foto": "https://image.tmdb.org/t/p/w400/uRQK27FtULvj7T4JGXTjXr2XWd5.jpg",
              "link": "https://myanimelist.net/anime/10030/Bakuman_2nd_Season",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Com a serialização de seu novo mangá, \"Detective Trap\", a equipe de escritor-artista, Akito Takagi e Moritaka Mashiro, mais conhecido por seu pseudônimo Muto Ashirogi, está um passo mais perto de se tornar um mangaká de renome mundial. Para Mashiro, no entanto, a serialização é apenas o primeiro passo. Tendo prometido se casar com sua namorada de infância e aspirante a dubladora, Azuki Miho, assim que seu mangá for adaptado para anime, Mashiro deve continuar seu trabalho para popularizar o trabalho de Ashirogi. Um elenco tremendamente competitivo de mangakás ambiciosos - incluindo o gênio selvagem, Eiji Niizuma; a estudante elegante, Yuriko Aoki, e seu admirador e parceiro mais velho, Takurou Nakai; o prodígio preguiçoso, Kazuya Hiramaru; e o abrasivo artista Shinta Fukuda - ambos apóiam e competem com Muto Ashirogi na criação do próximo grande sucesso.\n\nÀ medida que se adaptam ao seu novo editor jovem e aparentemente não testado, a dupla dinâmica luta para manter sua serialização atual, garantir o ponto alto em Shounen Jack e, por fim, conseguir uma adaptação de seu mangá para anime. Com novos rivais e amigos, Bakuman. A 2ª temporada continua a história inspiradora de Takagi e Mashiro de trabalho duro e amor jovem.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0012_3": {
