              "trailer": null,
              "episodios": 1,
              "sinopse": "Animação curta incluída como bônus no volume 2 da caixa Blu-ray.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0012_4": {
              "id": "b0012_4",
              "foto": "https://pbs.twimg.com/media/EOUc0ENWAAAVnLx.jpg",
              "link": "https://myanimelist.net/anime/12365/Bakuman_3rd_Season",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Em sua terceira serialização, o duo de mangá Moritaka Mashiro e Akito Takagi - também conhecido por seu pseudônimo, Muto Ashirogi - está cada vez mais perto de seu sonho de uma adaptação para anime. No entanto, o verdadeiro desafio está apenas começando: se eles não conseguirem competir com o artista Eiji Niizuma no ranking dentro de seis meses, eles serão cancelados. Para piorar, vários rivais estão logo atrás e declarando guerra. Eles nem têm tempo para pensar em um anime!\n\nEm Bakuman. 3ª Temporada , Muto Ashirogi deve encontrar uma maneira de permanecer no topo da montanha colossal conhecida como ranking de Shounen Jack. Com novos problemas e novos assistentes, a dupla continua a lutar pelo seu sonho.",
