              "sinopse": "Primeiro Episódio: Resumo das duas temporadas anteriores de Bakuman.\n\nSegundo Episódio: Mostra muitas das obras dos mangakas. Os membros do elenco principal também falam sobre qual \"Bakuman\". trabalhos que eles gostariam de ver animados",
