              "sinopse": "O Bakumatsu foi uma era em que as almas dos jovens ardiam de ansiedade pelo futuro de seu país. Takasugi Shinsaku, um soldado da fortuna de Choshu, foge a bordo de um navio do governo com sua camarada Katsura Kogorou em busca de um misterioso \"relógio\" com o poder de manipular o tempo que ele teme que o governo queira guardar para si. Ao invés de permitir que tal poder caia em mãos erradas, Takasugi planeja destruir o artefato, mas, tendo-o obtido, o artefato é rapidamente roubado, forçando a dupla a seguir o misterioso ladrão até a sede do governo em Kyoto. Porém, ao chegarem na capital, descobrem que o governo foi derrubado e a divindade Susanoo agora reina em seu lugar. As ruas da cidade e as pessoas nelas são muito diferentes do que Takasugi e Katsura se lembram.",
