              "trailer": null,
              "episodios": 12,
              "sinopse": "Ryouma Sakamoto quer que todos saibam sobre sua paixão pelo rock 'n' roll, então ele vagueia pela cidade com sua guitarra elétrica disposto a mostrar a qualquer um que encontrar que ele é tão hábil quanto as famosas estrelas do Shinsengumi que eles admiram. Infelizmente, o Japão não permite nada além das Músicas do Céu daquele grupo, pois escrever ou tocar diferentes tipos de música é proibido e pode levar a consequências severas.\n\nAgitado por essas regras rígidas e lavagem cerebral, Ryouma faz tudo o que pode para mostrar às pessoas que a música que ama lhes trará a liberdade que merecem. Junto com seus companheiros de banda Shinsaku Takasugi e Kogoru Katsura, Ryouma trabalha duro para encontrar lugares para seu grupo de rock 'n' roll se apresentar. Recusando-se a desistir até que sua música seja aceita no Japão, o trio começa a perceber que há mais em sua paixão do que eles pensavam.",
