              "sinopse": "Tatara Fujita é uma estudante do ensino fundamental tímida que não tem nenhum plano específico para o futuro. Ele passou pela vida evitando qualquer tipo de confronto e misturando-se à multidão. Mas misturar-se não é suficiente para escapar dos problemas, já que alguns valentões o perseguem por dinheiro. Felizmente, ele é salvo por um homem chamado Kaname Sengoku.\n\nKaname convida Tatara para seu estúdio de dança. Embora ele normalmente nunca colocasse os pés em tal lugar, Tatara é cativada pela presença dominante de Sengoku. Com a oportunidade de dançar com seu colega de classe Shizuku Hanaoka - que costuma praticar no estúdio - Tatara percebe que há algo sobre a ideia de ser colocada no centro das atenções e dançar onde as pessoas o verão que o faz voltar. Com um desejo sincero e apaixonado de melhorar, Tatara começa sua jornada no mundo da dança competitiva.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "b0020": {
          "id": "b0020",
          "parentes": [],
          "items": {
            "b0020_1": {
              "id": "b0020_1",
              "foto": "https://pbs.twimg.com/media/Dh8HQJCWkAABYk6.jpg:large",
              "link": "https://myanimelist.net/anime/36649/Banana_Fish",
              "trailer": null,
              "episodios": 24,
              "sinopse": "Aslan Jade Callenreese, conhecido como Ash Lynx, foi um fugitivo apanhado nas ruas de Nova York e criado pelo infame padrinho da máfia, Dino Golzine. Agora com 17 anos e chefe de sua própria gangue, Ash consegue uma droga misteriosa chamada \"Banana Fish\" - as mesmas duas palavras que seu irmão mais velho, Griffin, murmurou desde seu retorno da Guerra do Iraque. No entanto, sua investigação é prejudicada quando Dino envia seus homens para recuperar a droga de Ash em um bar subterrâneo que ele usa como esconderijo.\n\nNo bar, Skip, amigo de Ash, o apresenta a Shunichi Ibe e seu assistente, Eiji Okumura, que são fotógrafos japoneses relatando sobre gangues de rua americanas. No entanto, a conversa é interrompida quando Shorter Wong, um dos aliados de Ash, liga para avisá-lo sobre Dino. Logo, os homens de Dino invadem o bar e, no caos que se segue, sequestram Skip e Eiji. Agora, Ash deve encontrar uma maneira de resgatá-los e continuar sua investigação sobre Banana Fish, mas sua história com a máfia o impedirá de ter sucesso?",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "b0021": {
          "id": "b0021",
          "parentes": [],
          "items": {
            "b0021_1": {
              "id": "b0021_1",
              "foto": "https://images-na.ssl-images-amazon.com/images/I/81Wu4ZYt%2BlL._AC_SY741_.jpg",
              "link": "https://myanimelist.net/anime/32664/Bananya",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Acima de um balcão de cozinha indefinido, pendura silenciosamente um cacho de bananas amarelas maduras. De repente, uma das frutas delgadas começa a tremer, suavemente no início, mas aumentando lentamente em ferocidade até se separar das outras. Com uma aterrissagem graciosa, o comestível comprido e curvilíneo rola gradativamente suas cascas douradas, revelando o que está sob sua cobertura firme para ser ... um gato?\n\nEste misterioso híbrido de felino e fruta é denominado Bananya. Despreocupada e gentil, a adorável criatura sonha um dia se tornar uma deliciosa bananya banhada em chocolate. Junto com sua companheira bananya, esta gatinha vestida de amarelo passa seus dias sem se importar com o mundo, desfrutando de uma existência bastante calma e pacífica enquanto experimenta o que o mundo tem a oferecer.",
              "maturidade": null,
