        "b0022": {
          "id": "b0022",
          "parentes": [],
          "items": {
            "b0022_1": {
              "id": "b0022_1",
              "foto": "https://pbs.twimg.com/media/C2sZh3kVIAEPzMS.jpg:large",
              "link": "https://myanimelist.net/anime/33573/BanG_Dream",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Quando Kasumi Toyama estava acampando quando criança, ela ouviu o ritmo do \"Star Beat\" enquanto admirava o céu estrelado. Este som cintilante e de tirar o fôlego deixou uma impressão duradoura nela e, desde então, ela tem procurado constantemente redescobrir essa emoção emocionante.\n\nAgora, como uma aluna recém-matriculada na Hanasakigawa Girls 'High School, Kasumi está mais determinada do que nunca para encontrar aquela sensação perdida novamente. Ela tenta uma miríade de atividades do clube escolar e até considera aceitar um emprego de meio período, mas nada disso parece adequado para ela. Isto é, até encontrar um violão em forma de estrela no depósito de uma velha loja de penhores. Isso a leva a uma casa de shows, onde ela é cativada por assistir uma performance ao vivo pela primeira vez. Estimulada pela adrenalina, ela instantaneamente decide formar uma banda, mesmo sem saber realmente o porquê. No entanto, tal empreendimento exige que ela enfrente vários obstáculos com novos amigos que ela fizer ao longo do caminho, tudo em sua busca para encontrar aquele ardor vibrante e palpitante mais uma vez.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0022_2": {
              "id": "b0022_2",
              "foto": "https://firebasestorage.googleapis.com/v0/b/anime-oki.appspot.com/o/anime%2Fcapa%2F2019%2FBanG%20Dream!%202nd%20Season.jpg?alt=media&token=88884460-5edf-4906-a846-dc40479c3bb4",
              "link": "https://myanimelist.net/anime/37869/BanG_Dream_2nd_Season",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Kasumi Toyama e os membros do Poppin'Party - sua banda do colégio - agora são alunos do segundo ano, mas com o novo ano escolar vem seu mais recente conjunto de desafios: deveres do conselho estudantil, cursinho escolar e empregos de meio período, entre outros coisas. Além disso, eles agora estão separados em classes diferentes e, como resultado, seu tempo livre juntos é reduzido. Olhando para trás, seus momentos alegres juntos parecem nada mais do que uma fantasia inatingível quando seus membros estão muito ocupados até mesmo para se reunir no porão de Arisa Ichigaya para sessões de prática. Enquanto a banda pondera sobre a situação, uma garota desconhecida surge de repente, sem saber puxando-os para os holofotes mais uma vez.\n\nNesta era crescente de bandas femininas, Afterglow, Pastel * Palettes, Roselia e Hello, Happy World! também começam a aparecer. Cada banda, formada por músicos com suas personalidades únicas, ilumina o palco com suas apresentações. Conforme Poppin'Party retorna ao cenário musical e encontra novos amigos, a música vibrante e de tirar o fôlego começa a tocar novamente!",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0022_3": {
              "id": "b0022_3",
              "foto": "https://mblogthumb-phinf.pstatic.net/MjAyMDA0MTRfMTgg/MDAxNTg2NzkxMjEwNDY0.bgJhU_3ndK5eY4aO9zJPqF4naGAFJC8ZkY8hTqjc5rkg.RWjEz8qjj1EDNNSGk9FyvfTXkqO0VRJfvIBzbbFgVnEg.JPEG.clxk5226/5.jpg?type=w2",
              "link": "https://myanimelist.net/anime/37870/BanG_Dream_3rd_Season",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Enquanto a banda feminina Poppin'Party continua ganhando fama, elas encontram um pôster para um evento no lendário Nippon Budoukan. Agora determinados a participar do \"BanG Dream\", Kasumi Toyama e os outros membros da Poppin'Party pretendem alcançar novos patamares e provar seu valor atuando naquele palco renomado.\n\nEnquanto isso, a banda rival RAISE A SUILEN sonha em mudar o mundo com \"a música mais forte\", mas se encontra em apuros sem um guitarrista. Embora dezenas de candidatos em potencial façam testes para o papel, o líder da banda CHU² acredita que eles são amadores e inadequados para a banda. No entanto, pode haver um guitarrista que corresponda aos altos padrões do CHU².\n\nBanG Dream! 3ª temporadaapresenta várias bandas femininas, incluindo Poppin'Party, Afterglow, Pastel * Palettes, Roselia, Hello Happy World! e agora RAISE A SUILEN, enquanto trabalham para surpreender os fãs em todo o Japão com suas performances espetaculares. Conforme a competição BanG Dream se aproxima, os membros da banda estão preparados para cativar o público com sua música sincera!",
              "maturidade": null,
              "pontosBase": 0.0
