            "b0023_1": {
              "id": "b0023_1",
              "foto": "https://tse3.mm.bing.net/th?id=OIP.VSeEFwqEdsx033RffzuYSAHaKO&pid=15.1",
              "link": "https://myanimelist.net/anime/406/Buzzer_Beater",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Hideyoshi é um menino sem-teto que vive em Nova York em um futuro próximo, que sobrevive lutando com outras crianças em jogos de basquete. Mas agora ele foi convocado para uma equipe profissional - uma equipe profissional com um objetivo único. Houve uma época em que os humanos dominavam o jogo de basquete. Mas os tempos mudaram e agora os jogadores alienígenas fisicamente superiores assumiram o controle do jogo, e quase não há jogadores humanos restantes. Mas a equipe de Hideyoshi - a primeira equipe totalmente humana a competir na Liga Espacial - pretende mudar tudo isso e trazer o campeonato de volta para a Terra.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0023_2": {
              "id": "b0023_2",
              "foto": "https://anitokyo.tv/uploads/posters/2015-12/1450253022_bez-imeni-1.jpg",
              "link": "https://myanimelist.net/anime/2684/Buzzer_Beater_2nd_Season",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Depois de ser convocado para o Time da Terra, um time de basquete formado apenas por humanos, Hideyoshi do street punk que se tornou profissional não poderia ser mais arrogante. A equipe ainda enfrenta os Gorons, uma raça de alienígenas fisicamente superior que já domina o jogo há algum tempo. Novos desafios e problemas estão em seu caminho. Hideyoshi está descontente com a equipe e os Gorons têm novos truques na manga.",
              "maturidade": null,
