              "trailer": null,
              "episodios": 11,
              "sinopse": "Escondido nas ruelas do distrito de Ginza está Eden Hall, um bar solitário operado por Ryuu Sasakura, o prodígio do barman que diz preparar os coquetéis mais incríveis que alguém já provou. No entanto, nem qualquer um pode encontrar o Eden Hall; antes, é o Eden Hall que deve encontrar você. Clientes de origens variadas, cada um atormentado por seus próprios problemas, entram neste bar. No entanto, Ryuu sempre sabe o coquetel ideal para consolar e guiar cada alma perturbada.",
