        "b0025": {
          "id": "b0025",
          "parentes": [],
          "items": {
            "b0025_1": {
              "id": "b0025_1",
              "foto": "https://ekladata.com/yOKCMaXAFX-hUlVKReAqRuaTaRI@550x764.jpg",
              "link": "https://myanimelist.net/anime/67/Basilisk__Kouga_Ninpou_Chou",
              "trailer": null,
              "episodios": 24,
              "sinopse": "Durante séculos, os clãs ninja Iga e Kouga travaram uma guerra amarga. Mas quando um cessar-fogo é ordenado pelo poderoso guerreiro Ieyasu Tokugawa, os dois clãs são forçados a baixar as armas.\n\nAnos depois, Gennosuke Kouga, herdeiro do clã Kouga, e Oboro Iga, herdeiro do clã Iga, se apaixonam. Por meio do casamento, os dois herdeiros buscam trazer paz aos clãs. Mas suas esperanças são frustradas quando as chamas da rivalidade entre seus clãs são reacendidas e eles são arrastados para outra guerra.\n\nOs dois netos de Ieyasu alegaram ser os próximos herdeiros do shogunato. Para resolver essa disputa, os Kouga e Iga são obrigados a enviar seus 10 melhores guerreiros para lutar em uma sangrenta batalha real, com cada clã representando um dos herdeiros potenciais do shogunato. Dois pergaminhos com os nomes dos lutadores são dados e devem ser marcados com sangue após a morte do lutador. O prêmio pela vitória é o favor do xogunato Tokugawa por mil anos. Divididos entre o amor um pelo outro e o dever para com seus clãs, Gennosuke e Oboro devem decidir o destino de seus clãs.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0025_2": {
              "id": "b0025_2",
              "foto": "https://2.bp.blogspot.com/-FRsibqzVlMw/Wk-a5HEiuHI/AAAAAAAAA8c/DpyP0ux4_W8RQAcXqVm0_B7deBZjtl5ogCLcBGAs/s1600/Cover%2B1.jpg",
              "link": "https://myanimelist.net/anime/35964/Basilisk__Ouka_Ninpouchou",
              "trailer": null,
              "episodios": 24,
              "sinopse": "Já se passaram 10 anos desde que a guerra entre os clãs ninja Iga e Kouga chegou ao fim. Os dois grupos fizeram as pazes, supostamente dissipando a animosidade que existia entre eles. Hachirou Kouga e Hibiki Iga, os sucessores de suas respectivas linhagens, parecem ter as condições perfeitas para seu amor florescer, mas nem todos estão satisfeitos com os resultados da antiga batalha.\n\nDiferentes contos sobre o confronto final entre Gennosuke Kouga e Oboro Iga se espalharam, deixando Tadanaga Tokugawa - que os Kouga representavam - insatisfeito. À medida que a tensão entre os dois clãs aumenta mais uma vez, o clima político em formação ameaça manter os dois amantes predestinados separados, assim como na geração anterior.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "b0026": {
          "id": "b0026",
          "parentes": [],
          "items": {
            "b0026_1": {
              "id": "b0026_1",
              "foto": "https://m1.paperblog.com/i/396/3960581/nueva-temporada-anime-L-a25WDo.jpeg",
              "link": "https://myanimelist.net/anime/32947/Battery",
              "trailer": null,
              "episodios": 11,
              "sinopse": "Com apenas 12 anos, Takumi Harada já é aclamado como um lançador de beisebol prodigioso. Mas quando sua família se muda para a cidade atrasada de Nitta, Takumi não tem escolha a não ser se juntar ao time de beisebol não qualificado de sua nova escola. Esse desenvolvimento tem pouco efeito sobre o menino, pois ele acredita que é mais interessante se esse clube sem nome se tornar uma força motriz devido à sua presença. No entanto, devido ao seu talento avassalador, Takumi precisa de um apanhador capaz de acompanhar seus arremessos.\n\nSuas preocupações logo cessam após conhecer Gou Nagakura. Como seu fã e colega estudante, Gou está ansioso para provar que não é um simples fanfarrão, mas um jogador habilidoso o suficiente para pegar os arremessos de Takumi. Em meio à luta para formar uma \"bateria\" com Gou, Takumi entra em conflito com seus novos companheiros de equipe devido à sua personalidade irreverente, mas luta para encontrar a verdadeira alegria do esporte sob a orientação de seu avô.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "b0027": {
          "id": "b0027",
          "parentes": [],
          "items": {
            "b0027_1": {
              "id": "b0027_1",
              "foto": "https://anime-look.ru/wp-content/uploads/2020/03/f1ad6e83-69db-448c-9093-3859e5340c74.jpg",
              "link": "https://myanimelist.net/anime/1186/Battle_Athletess_Daiundoukai_TV",
              "trailer": null,
              "episodios": 26,
              "sinopse": "Akari Kanzaki acabou de ingressar em uma academia só para meninas na esperança de entrar no University Satellite, um centro de treinamento esportivo de elite. Ela quer ganhar o título de Cosmo Beauty - um título conquistado anos atrás por sua mãe. Não é uma tarefa fácil para ela, já que o medo, a dúvida e a pressão dos colegas atrapalham, mas amigos, rivais e fãs lentamente a encorajam a superar seus obstáculos e se tornar a melhor dos Atletas de Batalha.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0027_2": {
              "id": "b0027_2",
              "foto": "https://cdn.banzaianimes.com.br/2018/09/Battle_Athletess_Daiundoukai.jpg",
              "link": "https://myanimelist.net/anime/1185/Battle_Athletess_Daiundoukai",
              "trailer": null,
              "episodios": 6,
              "sinopse": "É o ano de 4999 - a humanidade há muito abandonou a guerra em favor da competição intergaláctica por meio de eventos atléticos. Uma delas é um concurso feminino para o cobiçado título de \"Cosmo Beauty\". Akari Kanzaki acabou de entrar no University Satellite na esperança de se tornar a mais recente Beleza Cósmica - um título que sua mãe tinha há muito tempo. Em seus primeiros dias na universidade, ela conhece novos amigos, encontra rivais ferozes e luta para se tornar a melhor de todos os Atletas de Batalha.",
              "maturidade": null,
              "pontosBase": 0.0
