              "episodios": 12,
              "sinopse": "Em uma sociedade civilizada de animais antropomórficos, existe uma tensão incômoda entre carnívoros e herbívoros. Na Academia Cherryton, esse pico de desconfiança mútua após um incidente de predação resulta na morte de Tem, uma alpaca do clube de teatro da escola. O amigo de Tem, Legoshi, um lobo cinzento da equipe de palco, tem sido objeto de medo e suspeita por toda a sua vida. Imediatamente após a tragédia, ele continua a se esconder e a esconder seus traços ameaçadores, para a desaprovação de Louis, um cervo vermelho e atormentador do clube de teatro.\n\nQuando Louis entra furtivamente no auditório para treinar o substituto de Tem para uma próxima peça, ele designa Legoshi para vigiar. Naquela mesma noite, Legoshi tem um encontro fatídico com Haru, um coelho anão branco desprezado por seus pares. Seus crescentes sentimentos por Haru, complicados por seus instintos predatórios, o forçam a confrontar sua verdadeira natureza, as circunstâncias que cercam a morte de seu amigo e a corrente de violência que assola o mundo ao seu redor.",
