              "episodios": 20,
              "sinopse": "Com grandes avanços na tecnologia, a humanidade criou HIEs, robôs semelhantes aos humanos que atuam como servidores públicos e pessoais da sociedade. Ao contrário de muitos outros, o bondoso estudante do ensino médio Arato Endou trata os HIEs como iguais, mas sua situação financeira o impede de ter um.\n\nNo entanto, sua vida normal é destruída quando uma corrida normal ao supermercado local dá terrivelmente errado. Violentamente atacado por um HIE hackeado, Arato está à beira da morte; mas, felizmente, ele é salvo por um HIE anormal carregando um caixão armado. Seu nome é Lacia, um dos cinco HIEs altamente avançados que recentemente escaparam das garras da misteriosa MemeFrame Corporation.\n\nDiante de um carro hackeado que ameaça atropelá-los, Lacia oferece um acordo a Arato: em troca de salvar sua vida, ele deve se registrar como seu novo dono, assumindo assim total responsabilidade por seus atos. Com poucas opções, ele decide confiar nessa garota artificial e permite que ela more em sua casa. Embora Lacia comece a se adaptar ao seu novo estilo de vida pacífico, ela avisa o fascinado Arato de uma coisa - ela não tem alma.",
