              "trailer": null,
              "episodios": 60,
              "sinopse": "Ishiyama High é uma escola habitada inteiramente por delinquentes, onde a violência e a ilegalidade constantes são a norma. No entanto, existe uma regra universalmente reconhecida - não cruze o aluno do primeiro ano Tatsumi Oga, o lutador mais cruel de Ishiyama.\n\nUm dia, Oga está no leito de um rio quando encontra um homem flutuando rio abaixo. Depois de ser resgatado por Oga, o homem se divide ao meio para revelar um bebê, que rasteja nas costas de Oga e imediatamente se apega a ele. Embora ele ainda não saiba, este bebê se chama Kaiser de Emperana Belzebu IV, ou \"Bebê Beel\", para abreviar - o filho do Lorde Demônio!\n\nComo se encontrar o futuro Senhor do Submundo não fosse suficiente, Oga também é confrontado por Hildegard, a empregada demoníaca de Beel. Juntos, eles tentam criar o bebê Beel - embora cercados por delinquentes juvenis e poderes demoníacos, os dois podem enfrentar um desafio maior do que podem imaginar.",
              "maturidade": null,
