              "foto": "https://4.bp.blogspot.com/-AkmYm-jzl7c/W73S96p7dEI/AAAAAAAACdA/pA6B6Onz7M42igNfMdlbUirtSD_B4pS8QCLcBGAs/s1600/Beelzebub-jou%2Bno%2BOkinimesu%2Bmama%2B%255BSub-Espa%25C3%25B1ol%255D%255BMEGA-MF-GD%255D%255BHD-FullHD%255D%255BOnline%255D%2BSoAnimesiteHD2.jpg",
              "link": "https://myanimelist.net/anime/37716/Beelzebub-jou_no_Okinimesu_mama",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Segundo a lenda, Belzebu, um dos sete príncipes do Inferno, traiu a Deus e foi banido do Céu para a eternidade. Belzebu agora lidera o reino do Pandemônio, onde todos os ex-anjos vagam e trabalham todos os dias de suas vidas imortais. Um demônio como ele daria calafrios às pessoas com a simples menção de seu nome, mas ...\n\nE se Belzebu não for tão mau quanto se pensava inicialmente? E se ele fosse obcecado por coisas fofinhas? E se Belzebu for realmente uma mulher?\n\nIsso é o que o novo assistente Myurin descobre quando é contratado para servir a Sua Majestade Belzebu. Ela pode saber exatamente o que fazer para manter Pandemonium funcionando como um relógio, mas sempre que ela deixa o profissionalismo do escritório, a garota precisa de alguma ajuda para funcionar como um ... demônio normal. Por mais que Myurin não aguente ser pouco profissional, ele está secretamente obcecado pelas travessuras adoráveis ​​dela, e seu novo trabalho o ensina que nem tudo é exatamente o que parece, especialmente com os outros demônios-chefe do Pandemônio.",
              "maturidade": null,
              "pontosBase": 0.0
            },
