              "trailer": null,
              "episodios": 1,
              "sinopse": "A história segue o \"delinquente juvenil mais forte\", Oga Tatsumi, um primeiro ano no \"Ishiyama High\", a escola para delinquentes. Um dia, enquanto dormia próximo a um rio, ele vê um homem flutuando nele, ele o puxa para a margem e o homem se divide ao meio revelando um menino. Este menino é filho do rei demônio e foi escolhido para criá-lo com a empregada demoníaca do bebê, Hilda. A história acompanha sua vida com a criança e na escola do delinqüente.",
