              "trailer": null,
              "episodios": 12,
              "sinopse": "A jovem detetive Sonia Summers foi transferida para os arredores da cidade portuária de Libra depois de criar problemas com seus superiores. Libra é separada em dois setores - \"o superior\", o centro da riqueza e da política, e \"o exterior\". O Exterior é o lar de crimes, corrupção e incidentes curiosos envolvendo monstruosidades ou youkai. Cada caso em que Sonia trabalha parece implicar o envolvimento dessas criaturas misteriosas.\n\nSonia cruza o caminho com três peculiares youkai humanóides - Bem, Bela e Belo - que buscam proteger os humanos e lutar contra os malvados youkai que os aterrorizam. Vivendo como \"Youkai-Ningen\", eles são excluídos por outros youkai por seu estilo de vida humano, e rejeitados e feridos pelos humanos quando revelam suas verdadeiras formas.\n\nApesar das dificuldades que enfrentam, esses três Youkai-Ningen vivem secretamente entre humanos, continuando a perseguir seus sonhos de um dia se tornarem humanos também.",
