              "episodios": 12,
              "sinopse": "O supermercado é um edifício importante em qualquer cidade, pois fornece uma maneira conveniente de comprar uma variedade de alimentos em um ambiente seguro e familiar. No entanto, essas lojas mudam em um piscar de olhos, uma vez que as caixas de Bento não vendidas entram em suas vendas noturnas pela metade! A guerra estala e os amigos se tornam inimigos à medida que cada pessoa luta por honra, orgulho e jantar. Não há mais pessoas nesses supermercados, apenas Lobos e Cães - vencedores e perdedores.\n\nO aluno do ensino médio You Satou é dolorosamente apresentado a essas batalhas depois de tropeçar sem saber na zona de guerra, mas em vez de escolher evitar essas lutas noturnas, ele quer se juntar a eles. Depois de ver a falta de habilidades de combate de Satou, o veterano e Wolf Sen Yarizui o convida e Hana Oshiroi, uma garota que gosta de assistir às brigas, juntou-se ao seu Clube dos Amantes da Comida Metade do Preço para mostrar a eles a distinção entre os Cães e os Lobos. Juntos, eles aprendem o que realmente significa lutar por sua comida.",
