        "b0036": {
          "id": "b0036",
          "parentes": [],
          "items": {
            "b0036_1": {
              "id": "b0036_1",
              "foto": "https://animesonehd.xyz/wp-content/uploads/2020/08/Berserk-2016-online-em-HD.jpg",
              "link": "https://myanimelist.net/anime/32379/Berserk",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Agora marcado para a morte e destinado a ser caçado por demônios até o dia em que morre, Guts embarca em uma jornada para desafiar um destino terrível, enquanto ondas de feras o perseguem implacavelmente. Fortalecendo sua determinação, ele pega a lâmina monstruosa Matador de Dragões e jura vingança sobre o responsável, caçando o mesmo homem que ele uma vez admirou e considerou um amigo.\n\nAo longo do caminho, ele encontra alguns aliados improváveis, como um pequeno elfo chamado Puck, e Isidro, um jovem ladrão que quer aprender a esgrima com o ex-mercenário. À medida que o grupo desorganizado lentamente se reúne após ter decidido se juntar a Guts em sua missão, eles enfrentarão um perigo incrível diferente de tudo que já experimentaram antes.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0036_2": {
              "id": "b0036_2",
              "foto": "https://i.pinimg.com/originals/27/8b/c6/278bc66947b60ee94569c0665ad31eec.jpg",
              "link": "https://myanimelist.net/anime/33/Kenpuu_Denki_Berserk",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Nascido do cadáver de sua mãe, um jovem mercenário conhecido apenas como Guts, abraça o campo de batalha como seu único meio de sobrevivência. Dia após dia, colocando sua vida em risco apenas para ganhar o suficiente para sobreviver, ele passa de um derramamento de sangue para o outro.\n\nDepois de um encontro com o Band of the Hawk, uma tropa formidável de mercenários, Guts é recrutado por seu líder carismático Griffith, apelidado de \"White Hawk\". Como ele rapidamente subiu na classificação para se tornar o chefe da facção ofensiva, Guts prova ser uma adição poderosa à força de Griffith, tomando Midland pela tempestade. No entanto, enquanto a busca da banda por reconhecimento continua, Guts lentamente percebe que o mundo não é tão preto e branco como ele imaginava.\n\nAmbientado na era medieval, Kenpuu Denki Berserké um conto sombrio e corajoso que segue a luta de um homem para encontrar seu próprio caminho, enquanto apóia o desejo de poder de outro e a tragédia inimaginável que começa a girar as rodas do destino.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0036_3": {
              "id": "b0036_3",
              "foto": "https://animesonehd.xyz/wp-content/uploads/2020/08/berserk-2017-online-em-HD.jpg",
              "link": "https://myanimelist.net/anime/34055/Berserk_2nd_Season",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Demônios agora se tornaram comuns em todo o reino de Midland, que caiu no caos. O espadachim Guts ainda não consegue ficar no mesmo lugar por muito tempo devido à sua marca demoníaca. Ele sempre conseguiu se proteger quando estava sozinho, mas agora ele tem o desafio adicional de proteger o ex-Comandante Casca, uma casca de seu antigo eu que não se lembra nem confia nele. Eles nunca têm um momento de descanso com a constante ameaça de demônios, e precisam de um lugar onde Casca esteja segura até que encontrem uma maneira de curá-la. Seu aliado elfo, Puck, fala sobre a terra mística de Elfhelm, que é considerada um porto seguro contra os demônios que devastam as terras. Cansados ​​e com apenas uma vaga esperança, eles lutam para encontrar um lugar para morar - e ainda precisam encontrar os responsáveis ​​pela loucura que são forçados a suportar.",
              "maturidade": null,
              "pontosBase": 0.0
            },
