            "b0036_6": {
              "id": "b0036_6",
              "foto": "https://i.pinimg.com/originals/e7/22/68/e722681f9271cf0cf09fcfb2ac74a15e.jpg",
              "link": "https://myanimelist.net/anime/10218/Berserk__Ougon_Jidai-hen_I_-_Haou_no_Tamago",
              "trailer": null,
              "episodios": 1,
              "sinopse": "No Reino de Midland, um mercenário chamado Guts vagueia pela terra, preferindo uma vida de conflito a uma vida de paz. Apesar das probabilidades nunca estarem a seu favor, ele é uma força imparável que vence todos os oponentes, empunhando uma espada enorme maior do que ele.\n\nUm dia, Griffith, o misterioso líder do grupo mercenário Band of the Hawk, testemunha a destreza do guerreiro na batalha e convida o espadachim errante a se juntar ao seu esquadrão. Rejeitando a oferta, Guts desafia Griffith para um duelo - e, para a surpresa do primeiro, é posteriormente derrotado e forçado a se juntar.\n\nAgora, Guts deve lutar ao lado de Griffith e sua tripulação para ajudar Midland a derrotar o Império de Chuder. No entanto, Griffith parece abrigar segundas intenções, desejando algo muito maior do que apenas resolver a guerra ...",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0036_7": {
              "id": "b0036_7",
              "foto": "https://2.bp.blogspot.com/-p9wUc7fYJE4/Uop_wWvWt_I/AAAAAAAAIsY/49udkUAWqXM/s1600/Berserk-Ogon-Jidai-Hen-II-Doldrey-Koryaku.jpg",
              "link": "https://myanimelist.net/anime/12113/Berserk__Ougon_Jidai-hen_II_-_Doldrey_Kouryaku",
              "trailer": null,
              "episodios": 1,
              "sinopse": "O Band of the Hawk e seu enigmático líder Griffith continuam vencendo batalha após batalha conforme seu prestígio cresce em todo o reino de Midland. Mas sua última tarefa foi aquela que viu o fracasso de todos os que a tentaram: a subjugação da fortaleza impenetrável de Doldrey.\n\nMas com membros como Guts - o capitão dos invasores dos Hawks que pode facilmente derrubar 100 homens com sua espada gigantesca - essas tarefas se mostram triviais. No entanto, no rescaldo da batalha, Guts decide deixar os Hawks a fim de perseguir seu próprio sonho e se despede de seus companheiros, apesar das tentativas de Griffith para fazê-lo ficar. Este único evento faz com que Griffith perca a compostura e o leva a tomar uma decisão que irá alterar o seu destino e o dos Hawks para sempre.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0036_8": {
              "id": "b0036_8",
              "foto": "https://i.imgur.com/WuYZhfG.jpg",
              "link": "https://myanimelist.net/anime/12115/Berserk__Ougon_Jidai-hen_III_-_Kourin",
              "trailer": null,
              "episodios": 1,
              "sinopse": "O Band of the Hawk diminuiu no ano desde que Guts os deixou em sua jornada para forjar seu próprio destino. Sem saber de seu destino, Guts retorna aos Hawks - agora liderado por seu ex-aliado Casca - depois que um boato sobre eles passa em seu caminho. Outrora os salvadores do reino de Midland, o Band of the Hawk agora é caçado enquanto lutam desesperadamente por suas vidas enquanto planejam libertar seu líder, Griffith, depois que ele foi preso por cometer traição. Mas o homem que salvaram está longe de ser o Griffith de que se lembram.\n\nGriffith é uma casca de seu antigo eu carismático após um ano de tortura contínua e horrível. Não podendo mais andar, falar ou mesmo segurar uma espada, ele não tem nada além de uma pequena e estranha bugiganga, o Behelit Carmesim, que não o deixará. Todo o Band of the Hawk deseja alcançar a grandeza mais uma vez, mas quanto eles estão dispostos a sacrificar para retornar à sua glória passada? Não parece possível, mas quando o coração de Griffith escurece e um eclipse solar escurece o céu, o Behelit oferece uma escolha que deixará o Bando do Falcão com um destino encharcado de sangue que os assombrará pelo resto de seus dias.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
