              "link": "https://myanimelist.net/anime/31049/Beyblade_Burst",
              "trailer": null,
              "episodios": 51,
              "sinopse": "Valt Aoi é um garoto de sangue quente que adora atacar e empunha um Beyblade chamado Valkyrie. Seu amigo íntimo Shuu Kurenai é um Blader de elite que é um gênio, mas ainda se esforça muito, e empunha o Beyblade chamado Spriggan.",
              "maturidade": null,
