              "link": "https://myanimelist.net/anime/5962/Metal_Fight_Beyblade",
              "trailer": null,
              "episodios": 51,
              "sinopse": "Um novo elenco de personagens assume a batalha contínua entre o bem e o mal. Ginga, nosso herói, e seu grupo de amigos leais enfrentam um grupo perigoso chamado Nebulosa Negra. A única missão da Nebulosa Negra é dominar o mundo e liberar seu mal sobre ele; mas antes que eles possam fazer isso, eles devem destruir Ginga, pois ele é a única pessoa forte o suficiente para ficar em seu caminho. A trama se complica conforme os amigos se tornam inimigos e os inimigos se tornam aliados. Tudo começa e termina com Ginga enquanto ele luta para encontrar a força para defender seu mundo e a honra de Beyblade.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0038_3": {
              "id": "b0038_3",
              "foto": "https://zy.shehuizhuyi.cc/Uploads/vod/2018-05-14/5af8be90adba0.jpg",
              "link": "https://myanimelist.net/anime/8410/Metal_Fight_Beyblade__Baku",
              "trailer": null,
              "episodios": 51,
              "sinopse": "Ginga Hagane e sua equipe de Bladers estão de volta e prontos para novos desafios. O Campeonato Mundial acena, e Ginga está mais do que preparado, agora equipado com um novo Beyblade, o Galaxy Pegasus W105R2F. E ele estará lutando com um parceiro de tag dos EUA, Masamune Kadoya. No entanto, Masamune também está de olho no campeonato e planeja derrotar Gingka.\n\nMasamune pode não ser a única ameaça ao caminho da vitória de Ginga. O melhor Blader Kyoya do mundo foi escolhido ao lado de Ginga, Masamune, Tsubasa e Yu para representar o Japão, mas decidiu se juntar à equipe africana. Junto com seu companheiro Benkei, ele quer derrubar Ginga e o time japonês. O palco agora está montado para um dos confrontos mais dramáticos em Metal Fight Beyblade: Baku.",
              "maturidade": null,
