              "foto": "https://images-na.ssl-images-amazon.com/images/I/91-uy0W3AYL._RI_.jpg",
              "link": "https://myanimelist.net/anime/8245/Metal_Fight_Beyblade_vs_Taiyou__Shakunetsu_no_Shinryakusha_Sol_Blaze",
              "trailer": null,
              "episodios": 1,
              "sinopse": "São férias de verão. Diante de Ginga e Cia, que estão empolgados com um torneio de Beyblade, Helios, um jovem misterioso, está em seu caminho. Em suas mãos, ele possui \"Sol Blaze\", um Beyblade que foi transmitido desde os tempos antigos. Conforme a intensa batalha entre Ginga e Helios se desenrola, o clima extremo se desenvolve em todo o mundo.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0038_5": {
              "id": "b0038_5",
              "foto": "https://em.wattpad.com/6c6c71e96b31733729b597c83dee7edaf2e5b4a7/68747470733a2f2f73332e616d617a6f6e6177732e636f6d2f776174747061642d6d656469612d736572766963652f53746f7279496d6167652f444d656930314a655049536776413d3d2d3632363831333535342e313535306431383036363530303262373735353336343131313730392e6a7067",
              "link": "https://myanimelist.net/anime/10370/Metal_Fight_Beyblade_4D",
              "trailer": null,
              "episodios": 52,
              "sinopse": "No Cosmos, um evento incomum ocorreu.\n\nFazendo uma pausa em seu último triunfo sobre Fausto e o Núcleo Espiral, Ginga e companhia salvam um menino chamado Yuki de um jovem misterioso chamado Johannes. Embora Yuki seja um menino gênio e um astrônomo, ele é um Blader que possui “Anubius”.\n\nYuki diz que veio contar a Ginga e seus amigos sobre a voz do Fragmento Estelar. Ele testemunhou o Fragmento de Estrela (um meteoro) cair do céu um dia. Essa única luz habita em Anubius e ele diz que ouviu a voz do Fragmento de Estrela naquela noite. Um grande mal está tentando reviver o \"Sol Negro\" e \"Nemesis\", o deus da destruição, usando o poder desconhecido do Fragmento Estelar e destruir o mundo.\n\nGinga e seus amigos devem lutar novamente, assim que eles pegarem o jeito de seus novos beys de sistema 4D!\n\nOs números dos episódios continuam a partir de 103.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0038_6": {
              "id": "b0038_6",
              "foto": "https://www.v2anime.com/media/cache/fb/8f/fb8fc1ac54babef845651ac77234648a.jpg",
              "link": "https://myanimelist.net/anime/13231/Metal_Fight_Beyblade_Zero_G",
              "trailer": null,
              "episodios": 38,
              "sinopse": "Sete anos após a crise de Nemesis, grande parte do mundo foi devastada e arruinada após a trágica luta. Como resultado, a maioria das pessoas perdeu a fé e o interesse em Beyblading. Otori Tsubasa, que se tornou líder da WBBA, estabeleceu como objetivo de vida garantir que a humanidade pudesse se restaurar, bem como restaurar a popularidade de Beyblading. Ele criou o estilo de luta Zero-G como resultado e espera que uma nova geração de bladers se levante para aceitar o esporte mais uma vez. Um deles é um adolescente chamado Zero Kurogane, que pretende se tornar o blader top após ter um encontro destinado com o herói da crise Nemesis, Ginga Hagane.",
              "maturidade": null,
              "pontosBase": 0.0
