              "trailer": null,
              "episodios": 51,
              "sinopse": "Valt Aoi, que participou do Campeonato Japonês, foi escolhido para a prestigiosa equipe espanhola BC Sol e segue para a Espanha. Com os olhos postos no mundo, Valt e seus amigos começam seu desafio pela Liga Mundial! No entanto, para se qualificar para a Liga Mundial, eles devem primeiro vencer a Liga Europeia. Valt conseguirá levar o BC Sol à Liga Mundial? E ele pode derrotar os Bladers mais fortes do mundo?",
