              "sinopse": "Dez anos atrás, uma fada chamada Daisy apareceu e perguntou à criança Eiji Hoshimiya qual era o seu único desejo. Embora seu desejo permaneça um mistério, as consequências foram catastróficas. Em um evento chamado de \"Grande Destruição\", o mundo começou a desmoronar enquanto tudo desabava e inúmeras pessoas morriam.\n\nAgora, Eiji é um estudante do ensino médio cuja única preocupação é sua irmã doente. Ele não se lembra do que desejou; tudo o que ele lembra é que seu desejo causou a Grande Destruição. Nos anos que se seguiram a esse evento, milhares de outras pessoas também receberam habilidades para realizar o desejo de seus corações. Essas pessoas chamadas \"Ordens\" são consideradas más e odiadas pelo público em geral. No entanto, algumas dessas Ordens estão atrás da vida de Eiji em vingança por aqueles que ele matou. Será que Eiji conseguirá sobreviver às inúmeras tentativas de assassinato? E o maior mistério de todos: o que ele desejava e quais eram suas intenções ao desejar algo que causou tanta desolação?",
