              "trailer": null,
              "episodios": 12,
              "sinopse": "Por que as garotas deveriam ter toda a diversão? Esses meninos mágicos estão aqui para salvar o mundo dos sem amor ... pelo menos é isso que o wombat rosa que lhes dá seus poderes mágicos quer que eles façam.\n\nEm Binan Koukou Chikyuu Bouei-bu Love!, os personagens principais são os membros do \"Clube de Defesa da Terra\" na Binan High School, embora tudo o que eles realmente queiram fazer seja sair, brincar e relaxar no vizinho Banho Kurotama. Em um dia fatídico, porém, um wombat rosa aparece do nada e força esses cinco alunos do ensino médio a se tornarem \"Amantes da Batalha\" e proteger a Terra de um trio de vilões que estão recebendo ordens de um ouriço verde. Ao longo da série, os Battle Lovers irão enfrentar uma variedade de demônios, incluindo o monstro chikuwabu, um fantasma de pauzinho, um controle remoto de monstro e muitos outros inimigos estranhos!\n\nOs herdeiros do trono do amor serão capazes de proteger a Terra daqueles que querem destruir o amor? Ou o Clube de Conquista da Terra encherá o mundo de ódio?",
