              "trailer": null,
              "episodios": 46,
              "sinopse": "Usagi Tsukino é uma estudante comum e chorona que sempre tem notas baixas em seus testes. Inesperadamente, sua vida monótona vira de cabeça para baixo quando ela salva um gato com uma lua crescente na cabeça do perigo. A gata, chamada Luna, mais tarde revela que o encontro não foi um acidente: Usagi está destinada a se tornar Sailor Moon, uma guardiã planetária com o poder de proteger a Terra. Dado um broche especial que permite que ela se transforme, ela deve usar seus novos poderes para salvar a cidade de monstros malignos que roubam energia enviados pela malévola Rainha Beryl do Reino das Trevas.\n\nMas se acostumar com seus poderes e lutar contra vilões não são as únicas coisas com que ela precisa se preocupar. Ela deve encontrar a princesa perdida do Reino da Lua, os outros Sailor Guardians e o Lendário Cristal Prateado para salvar o planeta da destruição.",
