              "trailer": null,
              "episodios": 26,
              "sinopse": "Embora um pouco desajeitada e facilmente levada às lágrimas, Usagi Tsukino é uma garota típica de 14 anos no segundo ano do ensino fundamental. No entanto, tudo isso muda quando um encontro com Luna, um misterioso gato preto falante, cuja cabeça tem a marca de uma lua crescente, resulta no animal dando um broche mágico a ela. Agora Usagi pode se transformar em Sailor Moon, uma garota mágica em um uniforme de marinheiro que protege o amor e a paz!\n\nUsagi é apontada como guardiã da justiça e tem a tarefa de procurar o lendário Cristal Prateado, um artefato mágico que possui um poder imenso, bem como encontrar os outros Guardiões Marinheiros e a princesa perdida da casa de Luna, o Reino da Lua. Sua missão não é sem oposição, no entanto; A Rainha Beryl, governante do Reino das Trevas, quer reivindicar o Cristal Prateado e assumir o seu poder.\n\nEmbora ela ainda tenha que se preocupar com sua escola, família e vida amorosa, cabe a Sailor Moon e os outros Sailor Guardians salvar o dia!",
