              "link": "https://myanimelist.net/anime/31733/Bishoujo_Senshi_Sailor_Moon_Crystal_Season_III",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Usagi Tsukino ainda está lutando para equilibrar sua vida familiar com os deveres de ser Sailor Moon, a guardiã do amor e da justiça. Junto com os outros Sailor Guardians e seu namorado Mamoru Chiba, eles começam a investigar casos de alunos da Mugen Academy, uma escola para os alunos de elite, que estão sendo transformados em monstros. Durante a investigação, eles encontram três indivíduos estranhos: Haruka Tenou, um belo piloto de corrida; Michiru Kaiou, uma violinista talentosa; e Hotaru Tomoe, uma garota misteriosa com uma constituição fraca.\n\nConforme mais incidentes ocorrem, os Sailor Guardians se deparam com outra surpresa - o aparecimento de dois novos protetores planetários com motivos próprios. Apesar da questionável lealdade dos recém-chegados a Usagi e seus companheiros, todos eles enfrentam a ameaça de um inimigo comum: uma entidade do mal que se autodenomina Faraó 90.",
