              "episodios": 43,
              "sinopse": "Usagi Tsukino e seus amigos têm vivido em paz até serem chamados à ação novamente como Sailor Guardians, guerreiros planetários que lutam pela paz na galáxia. Usagi, também conhecido como Sailor Moon, lidera seu grupo para a batalha quando uma nova ameaça além das estrelas se apresenta: dois sobreviventes de uma raça alienígena, An e Ail. Para salvar a fonte de sua força vital, a Árvore Makai, An e Ail começam a coletar energia de humanos desavisados. Os Sailor Guardians devem parar sua trama ou enfrentar a aniquilação da Terra.\n\nMas quando uma ameaça diminui, outra segue - desta vez na forma de uma garotinha do futuro que busca a fonte do poder de Sailor Moon para salvar sua família. No entanto, ela não é a única competindo por isso, já que um grupo conhecido como Clã da Lua Negra também deseja obter o poder e usá-lo para propósitos nefastos. A fim de proteger seus destinos e a harmonia do universo, Sailor Moon e o resto dos Sailor Guardians devem lutar para impedir que essas forças tenham sucesso.",
