              "trailer": null,
              "episodios": 1,
              "sinopse": "Usagi e Chibiusa ouvem duas garotas conversando sobre as Sailor Senshi depois de verem um pôster. Com humor, enquanto as garotas discutem qual é o mais inteligente, o mais elegante, o mais forte e o líder dos Senshi, Usagi reivindica esses títulos para si mesma. Chibiusa balança a cabeça com a ilusão de Usagi. Clipes são mostrados da estreia de cada Sailor Senshi, e a música-imagem daquela garota é tocada ao fundo. Quando até mesmo Tuxedo Mask é mencionado, e as meninas vão embora sem ter mencionado Sailor Moon, Usagi interrompe a conversa e pergunta diretamente sobre Sailor Moon. As garotas dão uma série de elogios entusiasmados sobre Sailor Moon, mas ao contrário do que fizeram com as outras Senshi, elas também listam seus defeitos. Depois que as garotas vão embora, Usagi sarcasticamente se desculpa por ser um bebê chorão desajeitado e depois começa a chorar.",
