              "episodios": 1,
              "sinopse": "Quando Mamoru era pequeno, ele deu uma rosa a um menino chamado Fiore. Fiore prometeu que um dia traria muitas flores para Mamoru. Agora Fiore voltou à terra, mas suas intenções não são apenas para cumprir uma promessa ...",
