              "trailer": null,
              "episodios": 38,
              "sinopse": "Os Sailor Guardians e seu líder, Sailor Moon, continuam com seu dever de proteger a Terra de qualquer um que se atreva a causar danos. No entanto, as visões apocalípticas de Sailor Mars e o aparecimento de dois novos guardiões - Sailor Neptune e Sailor Uranus - sinalizam que uma nova batalha começará em breve.\n\nEsses recém-chegados procuram três talismãs que estão dentro dos Cristais do Coração Puro dentro dos seres humanos. Uma vez reunidos, esses objetos formam o Santo Graal, uma relíquia mágica com habilidades extraordinárias. Eles querem usar o Graal para salvar o mundo, mas uma organização maligna conhecida como Death Busters busca seu poder para seus próprios desejos.\n\nA remoção de um Talismã do Cristal do Coração de uma pessoa causará sua morte, algo que Urano e Netuno veem como um sacrifício necessário para formar o Graal, enquanto Sailor Moon e seu grupo consideram isso imperdoável. Mas pode qualquer sacrifício valer a pena o custo se salvar a vida de toda a raça humana?",
