              "trailer": null,
              "episodios": 1,
              "sinopse": "Um filme de estilo mostrado antes de Black Jack: Futari no Kuroi Isha e Black Jack: Dr. Pinoko no Mori no Bouken , todos os três foram incluídos no lançamento do DVD de Black Jack: Futari no Kuroi Isha .\n\nBlack Jack fica bravo com Pinoko, o próprio Tezuka e Astro Boy por deixarem o celular ligado durante uma operação ... apenas para descobrir que o paciente Sharaku foi quem o deixou ligado.",
