              "foto": "https://stat.ameba.jp/user_images/20160624/15/87yori/77/7f/j/o0300022513680785748.jpg",
              "link": "https://myanimelist.net/anime/10055/Black_Jack__Heian_Sento",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Esses curtas-metragens de animação originais são exibidos no \"300 Inch Theatre\" no Tezuka Osamu World no Kyoto Station Bldg, bem como um show de duas imagens incluindo filmes de animação entre os mangás principais de Tezuka Osamu, e um enfoca episódios históricos de Quioto.\n\nNeste teatro, a Fênix desempenha o papel de contadora de histórias, apresentando dois filmes. A Fênix escolhe uma história intitulada \"Old Woman\" (\"Oba-chan\") de vários episódios de \"Black Jack\" para discutir o tema de quanto o amor pode crescer nesta curta vida. Na história, há uma velha aparentemente gananciosa que está sempre pedindo dinheiro à nora, e seu filho e sua esposa se cansam do comportamento da velha. Naturalmente, existem brigas constantes na família,\n\nDepois de acidentalmente conhecer a família, Black Jack descobre que a velha fez com que seu filho, que estava morrendo na época, fosse tratado e salvo por um famoso médico que alegou uma grande quantia em dinheiro. Na verdade, ela tem pago pelo tratamento há algumas dezenas de anos. Por causa de seu grande amor pelo filho, a velha dedicou toda a sua vida a pagar pelo tratamento.\n\nSem saber do ato da mãe, o filho se sente desamparado e pressionado pela mãe e pela esposa. Mas quando ele finalmente descobre a verdade, fica profundamente impressionado com o amor de sua mãe, que valorizava a vida do filho mais do que a dela. Black Jack pergunta se ele poderia amá-la tanto quanto ela o amava. Explicando que apenas o amor é mais valioso do que a vida pode viver para sempre, a Fênix então conta uma história sobre a mudança da capital para Heian, que foi um grande projeto nacional e uma tentativa de infundir vida eterna a uma cidade.",
              "maturidade": null,
              "pontosBase": 0.0
            },
