              "trailer": null,
              "episodios": 12,
              "sinopse": "Dentro da Tailândia está Roanapur, uma cidade depravada e dominada pelo crime, onde nem mesmo as autoridades ou igrejas são intocadas pelas garras da corrupção. Um paraíso para presidiários e degenerados, a cidade é conhecida por ser o centro de atividades e operações ilegais, muitas vezes alimentadas por sindicatos do crime locais.\n\nEntra em cena Rokurou Okajima, um empresário japonês médio que leva uma vida monótona e monótona, quando finalmente consegue uma mudança de ritmo com uma viagem de entregas ao sudeste asiático. Sua viagem de negócios rapidamente se deteriora quando Rokurou é capturado por um grupo mercenário que operava em Roanapur, chamado Lagoa Negra. O grupo planeja usá-lo como moeda de troca em negociações que acabaram fracassando. Agora abandonado e traído por seu antigo empregador, Rokurou decide se juntar à Lagoa Negra. Para sobreviver, ele deve se adaptar rapidamente ao seu novo ambiente e se preparar para o derramamento de sangue e tribulação que virão.\n\nUm thriller de alta octanagem sem parar, Black Lagooninvestiga as profundezas da moralidade e virtude humanas. Veja Rokurou lutando para manter seus valores e filosofias intactos enquanto ele lentamente se transforma de empresário em mercenário implacável.",
