              "link": "https://myanimelist.net/anime/4901/Black_Lagoon__Robertas_Blood_Trail",
              "trailer": null,
              "episodios": 5,
              "sinopse": "Roberta, a terrorista que virou empregada doméstica que fez sua aparição na primeira temporada de Black Lagoon , retorna nesta série OVA de cinco episódios - e desta vez, todas as apostas estão canceladas!\n\nO benfeitor de Roberta, o patriarca do clã Lovelace, é assassinado durante um comício político. A trilha do assassino logo leva de volta a Roanapur - agora ela voltou em uma missão de vingança! Porém, logo atrás dela está o novo patriarca, Garcia, assim como a aprendiz (e empregada doméstica) de Roberta, Fabiola Iglesias. Enquanto a contagem dos corpos da violência sangrenta de Roberta aumenta, as forças de dentro da ilha corrupta (que inclui a Companhia Lagoon), bem como do exterior, convergem para o que ameaça se transformar em uma guerra total!",
