              "link": "https://myanimelist.net/anime/1519/Black_Lagoon__The_Second_Barrage",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Rokurou \"Rock\" Okajima juntou-se à Lagoon Company, um grupo mercenário pirata que opera em Roanapur, Tailândia. Apesar de seus protestos iniciais, esta favela imunda de almas depravadas e criminosos impiedosos agora serve como a casa do ex-assalariado. Preso, sem nada sobrando de sua vida passada, exceto as roupas do corpo e sua moralidade interior, Rock é forçado a realizar trabalhos ao lado dos outros membros da tripulação Lagoon. Repreendido por sua falta de coragem enquanto atravessa o ponto fraco da sociedade, ele deve decidir se continua em meio aos tiros e a crueldade ou arrisca tudo o que possui na tentativa de se libertar. Quer ele escolha o conforto de uma terra familiar ou a liberdade de ser um fora da lei, sua decisão terá consequências duradouras para a tripulação que lhe deu um lar.",
