              "trailer": null,
              "episodios": 8,
              "sinopse": "No primeiro dia do ensino fundamental, Mato Kuroi encontra Yomi Takanashi, uma garota tímida e retraída por quem ela imediatamente se interessa. Mato faz o possível para conversar com Yomi, querendo ser amigo dela. No início, ela é evitada, mas o gelo se quebra quando Yomi percebe um pássaro azul decorativo preso ao telefone de Mato, que pertence ao livro \"Li'l Birds At Play\". Ao descobrir que têm um interesse comum, os dois formam uma forte amizade.\n\nEm um universo alternativo, as garotas existem como seres paralelos, Mato como Black ★ Rock Shooter e Yomi como Dead Master. De alguma forma, o que acontece em um mundo parece ter efeito no outro e, sem saber disso, as meninas, sem saber, ficam presas nos fios do destino.",
