              "trailer": null,
              "episodios": 1,
              "sinopse": "Em seu primeiro dia de colégio, Mato Kuroi conhece Yomi Takanashi. Embora Yomi inicialmente fique surpreso com a personalidade direta de Mako, os dois rapidamente se tornam amigos e começam a passar tempo juntos diariamente. Como sinal de amizade, Mato dá a Yomi um amuleto de celular - uma estrela azul, idêntica à dela.\n\nNo entanto, quando os dois entram no segundo ano, o relacionamento começa a mudar. Colocada em uma classe diferente, Mato começa a passar mais tempo com Yuu Koutari, uma garota que ela conheceu através do time de basquete. Na verdade, os ex-melhores amigos se distanciam tanto que Mato não consegue encontrar Yomi em lugar nenhum, como se ela tivesse desaparecido completamente.\n\nEm outro lugar, Black ★ Rock Shooter está em uma missão para derrotar o Dead Master. Esses dois, embora opostos, têm uma conexão não muito diferente de Mato e Yomi. Conforme suas histórias começam a se cruzar, parece que o desaparecimento de Yomi pode ter a ver com o encanto em forma de estrela azul e a própria lendária pistoleira.",
