              "sinopse": "Ichigo Kurosaki é um colegial comum - até que sua família é atacada por um Hollow, um espírito corrupto que busca devorar almas humanas. É então que ele conhece uma Ceifadora de Almas chamada Rukia Kuchiki, que se machuca enquanto protegia a família de Ichigo do agressor. Para salvar sua família, Ichigo aceita a oferta de Rukia de tomar seus poderes e se torna um Soul Reaper como resultado.\n\nNo entanto, como Rukia é incapaz de recuperar seus poderes, Ichigo recebe a tarefa assustadora de caçar os Hollows que assolam sua cidade. No entanto, ele não está sozinho em sua luta, já que mais tarde se juntaram a seus amigos - colegas Orihime Inoue, Yasutora Sado e Uryuu Ishida - cada um com suas próprias habilidades únicas. Enquanto Ichigo e seus camaradas se acostumam com seus novos deveres e apoiam uns aos outros dentro e fora do campo de batalha, o jovem Soul Reaper logo aprende que os Hollows não são a única ameaça real para o mundo humano.",
              "maturidade": null,
              "pontosBase": 0.0
            },
