              "sinopse": "Na cidade de Karakura, houve uma erupção repentina de espíritos não identificáveis ​​chamados \"vazios\" (almas vazias), enquanto nos céus da Soul Society, o mundo real foi refletido. Uma misteriosa shinigami chamada Senna apareceu antes de Ichigo junto com um homem chamado Ganryu, liderando um grupo chamado \"Dark Ones\".",
