              "link": "https://myanimelist.net/anime/2889/Bleach_Movie_2__The_DiamondDust_Rebellion_-_Mou_Hitotsu_no_Hyourinmaru",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Designado para proteger uma procissão real que transporta um poderoso artefato chamado \"Ouin\", o Esquadrão 10 se reúne no mundo humano enquanto o Capitão Toushirou Hitsugaya e o Tenente Rangiku Matsumoto observam a área com cautela. No entanto, a caravana é repentinamente atingida por um grupo de agressores que causam estragos na procissão, roubando o Ouin no processo. Depois de um breve confronto com um dos atacantes, o perturbado Hitsugaya persegue os ladrões em fuga, deixando para trás Matsumoto e o esquadrão desorientado. Após o incidente, a Seireitei considera Hitsugaya um traidor por abandonar seu posto e coloca o Esquadrão 10 em bloqueio por tempo indeterminado.\n\nNo mundo humano, Ichigo Kurosaki está investigando uma anormalidade espiritual quando tropeça no Capitão ferido, mas é pego de surpresa quando Hitsugaya foge repentinamente. Logo sabendo da situação, Ichigo, Rukia Kuchiki, Renji Abarai e Matsumoto partiram para provar a inocência de Hitsugaya e descobrir a verdade por trás do roubo do Ouin. Enquanto isso, um fantasma do passado de Hitsugaya assombra seus pensamentos enquanto ele persegue o verdadeiro culpado.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0056_4": {
