              "link": "https://myanimelist.net/anime/4835/Bleach_Movie_3__Fade_to_Black_-_Kimi_no_Na_wo_Yobu",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Após um misterioso par atacar Rukia Kuchiki e apagar suas memórias enquanto ela estava em Seireitei, Ichigo Kurosaki, um substituto do Soul Reaper, brevemente esquece Rukia, até que ele é lembrado dela por Kon, um Underpod Mod-Soul. Confuso, ele procura o dono da loja de doces de sua cidade, Kisuke Urahara, que abre o caminho para Seireitei para eles. Ichigo fica chocado ao descobrir que seus aliados em Seireitei, os Shinigami da Soul Society, o esqueceram.\n\nCheio de ação, Kimi no Na wo Yobu segue Ichigo e Kon enquanto eles lutam contra seus ex-companheiros enquanto procuram a Rukia desaparecida e descobrem seus agressores antes de atacarem novamente.",
