              "trailer": null,
              "episodios": 1,
              "sinopse": "“Inferno” é o lugar para onde é enviada uma pessoa que cometeu crimes violentos quando estava viva. Shinigami são proibidos de ir lá. Um dia, os prisioneiros se revoltam e fogem para Karakura - o mundo real - onde Ichigo e seus amigos vivem. Ichigo e seus amigos são derrotados um após o outro por prisioneiros com um poder esmagador. Um homem misterioso aparece e vem em seu socorro. Com Kokutou liderando o caminho, Ichigo, Rukia, Uryuu e Renji marche para o Inferno para salvar o mundo.\n\nNota: Episódio 299 de Bleach serve como um prólogo para este filme.",
