              "sinopse": "Historicamente, 72% de todas as mortes em Londres estão relacionadas a dragões, seres fantásticos invisíveis para a maioria das pessoas. Embora desconhecido para a maioria, algumas pessoas têm enfrentado esses dragões.\n\nApenas os habitantes do reverso de Londres que vivem no lado oculto \"reverso\" de Londres podem ver os dragões. Mesmo assim, apenas alguns selecionados tornam-se qualificados o suficiente como bruxos ou bruxos para fazer contato direto com eles.\n\nOs protagonistas da história são a dupla de bruxas Noel Niihashi e Ninny Spangcole. Eles são agentes de proteção da Wing Bind (WB), uma organização para a conservação e gestão de dragões. Sua missão é proteger e gerenciar os dragões dentro de Londres em nome do povo.",
