              "episodios": 12,
              "sinopse": "Desejando ser independente, Maika Sakuranomiya, de 16 anos, está desesperada para conseguir um emprego de meio período para ter dinheiro para estudar no exterior. Infelizmente, suas inscrições são constantemente rejeitadas devido ao olhar ameaçador que ela involuntariamente faz sempre que sorri, apesar de sua disposição alegre.\n\nDepois de mais uma entrevista fracassada, ela se depara com o Café Stile, uma cafeteria onde os servidores interagem com os clientes enquanto interpretam características distintas. O gerente da loja italiana, Dino, se apaixona pela fofura de Maika à primeira vista e lhe oferece um emprego de garçonete de natureza sádica. Juntamente com sua falta de jeito inerente, ela consegue atender com sucesso a um par de clientes masoquistas de acordo com sua nova e implacável persona. Ao lado de Kaho Hinata como a tsundere e Mafuyu Hoshikawa como a irmã mais nova, Maika decide tirar o máximo proveito de sua peculiaridade única e consolidar sua posição no café com crueldade impiedosa!",
