              "episodios": 10,
              "sinopse": "Staz Charlie Blood é um poderoso vampiro que governa o distrito oriental do Demon World. Segundo rumores, ele é um monstro sanguinário e impiedoso, mas na realidade, Staz é apenas um otaku obcecado pela cultura japonesa e completamente desinteressado por sangue humano. Deixando a gestão de seu território para seus subordinados, Staz passa seus dias preguiçosamente, entregando-se a animes, mangás e jogos.\n\nQuando Fuyumi Yanagi, uma garota japonesa, acidentalmente vagueia por um portal que leva ao mundo dos demônios, Staz fica radiante. Mas quando ele começa a sentir uma atração incomum por ela, seu território é atacado, resultando na morte prematura de Fuyumi. Ela se transforma em um fantasma errante e o cabisbaixo Staz jura ressuscitá-la, pois isso significaria ser capaz de viajar para o mundo humano, algo que ele sempre sonhou.\n\nBlood Lad segue Staz e Fuyumi, logo acompanhado pelo mágico espacial Bell e o meio-lobisomem Lobo, enquanto eles viajam para encontrar uma magia que pode trazer os humanos de volta à vida.",
