              "link": "https://myanimelist.net/anime/150/Blood_",
              "trailer": null,
              "episodios": 50,
              "sinopse": "Saya Otonashi é uma garota aparentemente comum que vive uma vida mundana com sua família adotiva na cidade de Okinawa. Na verdade, suas únicas peculiaridades são sofrer de anemia e não conseguir se lembrar de nada de sua vida além do ano anterior.\n\nNo entanto, o passado esquecido de Saya rapidamente volta para assombrá-la - uma noite, ela é atacada na escola por uma criatura que se alimenta de sangue humano. Quando toda a esperança parece perdida, um homem misterioso chamado Haji aparece e se defende temporariamente da criatura. Mas quando seu salvador a força a beber seu sangue, Saya de repente entra em transe e mata o monstro com facilidade, usando seu próprio sangue como catalisador.\n\nSaya então fica sabendo de uma organização chamada Red Shield, fundada com o único propósito de derrotar as bestas infernais. Agora Saya e Haji devem trabalhar junto com o Escudo Vermelho para lutar contra esses monstros temíveis e desvendar os segredos do passado da garota.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0059_2": {
