              "trailer": null,
              "episodios": 1,
              "sinopse": "Tendo escapado dos muitos horrores de sua vila, Saya Kisaragi jura caçar o monstro responsável e fazê-lo pagar com sua vida. Enquanto ela rasga carne e osso por sua vingança, ela encontra SIRRUT, um grupo de hackers engenhosos, que recrutam Saya para ajudá-los a derrotar um inimigo comum - alguém que ela conhece muito bem.\n\nInfelizmente, o caminho que ela segue é pavimentado com tragédia, pois mais uma vez, Saya enfrenta a traição nas mãos daqueles que ela confiou. Com as costas contra a parede, a temível caçadora de monstros deve lutar com toda a sua força e habilidade se quiser superar esta missão final e vingança exata.",
