              "episodios": 13,
              "sinopse": "Cinco anos atrás, algo terrível aconteceu na Ilha Kamioki. Algo tão apavorante que tirou toda a memória da mente de Mari Wakatake ao mesmo tempo que deixou todos os outros humanos na ilha mortos em seu rastro! Agora matriculada contra sua vontade em uma academia de garotas isoladas, Mari não sabe que olhos ocultos a observam, esperando que sua memória volte.\n\nEnterrado em sua psique está o segredo mais terrível de todos: embora Mari fosse a única humana que sobreviveu, ela pode não ter sido a única sobrevivente! Como algo em uma pele feminina invade a Academia Kaihou, a única esperança de Mari pode estar em uma garota estranha por quem ela é inexplicavelmente atraída, mas não pode confiar.",
