              "episodios": 12,
              "sinopse": "Quando a tragédia está prestes a acontecer, Satoru Fujinuma é mandado de volta vários minutos antes do acidente. O destacado artista de mangá de 29 anos aproveitou esse fenômeno poderoso, mas misterioso, que ele chama de \"Revival\", para salvar muitas vidas.\n\nNo entanto, quando é injustamente acusado de assassinar alguém próximo a ele, Satoru é enviado de volta ao passado, mas desta vez para 1988, 18 anos no passado. Logo, ele percebe que o assassinato pode estar relacionado ao sequestro e assassinato de um de seus colegas, o solitário e misterioso Kayo Hinazuki, ocorrido quando ele era criança. Esta é sua chance de consertar as coisas.\n\nBoku dake ga Inai Machisegue Satoru em sua missão de descobrir o que realmente aconteceu 18 anos atrás e prevenir a morte de seu colega de classe, protegendo aqueles com quem ele se preocupa no presente.",
