              "foto": "https://pbs.twimg.com/media/EZFy48LXkAEOU_Z.jpg:large",
              "link": "https://myanimelist.net/anime/31964/Boku_no_Hero_Academia",
              "trailer": null,
              "episodios": 13,
              "sinopse": "O aparecimento de \"peculiaridades\", superpoderes recém-descobertos, tem aumentado constantemente ao longo dos anos, com 80 por cento da humanidade possuindo várias habilidades, desde a manipulação de elementos até a transformação. Isso deixa o resto do mundo completamente sem poder, e Izuku Midoriya é um desses indivíduos.\n\nDesde criança, o ambicioso aluno do ensino fundamental não quis nada mais do que ser um herói. O destino injusto de Izuku o deixa admirando heróis e tomando notas sobre eles sempre que pode. Mas parece que sua persistência deu alguns frutos: Izuku conhece o herói número um e seu ídolo pessoal, All Might. A peculiaridade de All Might é uma habilidade única que pode ser herdada, e ele escolheu Izuku para ser seu sucessor!\n\nSuportando muitos meses de treinamento extenuante, Izuku se matriculou na UA High, uma prestigiosa escola de segundo grau famosa por seu excelente programa de treinamento de heróis, e os calouros deste ano parecem especialmente promissores. Com seus colegas bizarros, mas talentosos, e a ameaça de uma organização vilã, Izuku logo aprenderá o que realmente significa ser um herói.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0064_2": {
