              "link": "https://myanimelist.net/anime/33486/Boku_no_Hero_Academia_2nd_Season",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Na UA Academy, nem mesmo um ataque violento pode atrapalhar seu evento de maior prestígio: o festival de esportes da escola. Conhecido em todo o Japão, este festival é uma oportunidade para aspirantes a heróis mostrarem suas habilidades, tanto para o público quanto para recrutadores em potencial.\n\nNo entanto, o caminho para a glória nunca é fácil, especialmente para Izuku Midoriya - cuja peculiaridade possui grande poder bruto, mas também é terrivelmente ineficiente. Pitted contra seus colegas talentosos, como o fogo e gelo empunhando Shouto Todoroki, Izuku deve utilizar sua inteligência afiada e dominar o ambiente para alcançar a vitória e provar ao mundo seu valor.",
