              "link": "https://myanimelist.net/anime/36456/Boku_no_Hero_Academia_3rd_Season",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Quando o verão chega para os alunos da UA Academy, cada um desses super-heróis em treinamento se esforça ao máximo para se tornarem heróis renomados. Eles se dirigem a um campo de treinamento na floresta administrado pelos heróis profissionais da UA, onde os alunos se enfrentam na batalha e passam por testes perigosos, melhorando suas habilidades e ultrapassando seus limites. No entanto, sua viagem escolar de repente vira de cabeça para baixo quando a Liga dos Vilões chega, invadindo o acampamento com a missão de capturar um dos alunos.\n\nBoku no Hero Academia 3ª Temporada segue Izuku \"Deku\" Midoriya, um estudante ambicioso em treinamento para realizar seu sonho de se tornar um herói semelhante ao seu modelo - All Might. Sendo um dos alunos apanhados em meio ao caos do ataque do vilão,",
              "maturidade": null,
