              "link": "https://myanimelist.net/anime/38408/Boku_no_Hero_Academia_4th_Season",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Depois de passar com sucesso no exame de Licença Provisória de Herói, Izuku \"Deku\" Midoriya busca um estágio extracurricular em uma agência de heróis profissional. Por recomendação de seu mentor All Might, Midoriya consegue uma posição sob o ex-companheiro de All Might, Sir Nightsye, agora um herói famoso por seus próprios méritos.\n\nEnquanto os colegas de classe de Midoriya desenvolvem suas próprias habilidades por meio de vários estágios, o vilão Kai Chisaki utiliza seus poderes aterrorizantes para obter favores no submundo do crime. Conhecido pelo apelido de Overhaul, as ambições de Chisaki colidem com a Liga dos Vilões e seu líder, Tomura Shigaraki.\n\nAtravés de seu trabalho com Sir Nightsye, Midoriya descobre o sindicato do crime de Chisaki e a relação hostil do vilão com uma jovem misteriosa chamada Eri. Temendo pela segurança da criança, Midoriya e seu veterano Mirio Toogata devem trabalhar juntos para pôr fim ao reinado de terror de Chisaki.",
