              "link": "https://myanimelist.net/anime/36896/Boku_no_Hero_Academia_the_Movie_1__Futari_no_Hero",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Os alunos da UA High School da Classe 1-A chegaram às férias de verão. Izuku Midoriya acompanha seu mentor All Might a um festival comemorativo de super-heróis na I-Island, um pedaço de terra isolado dedicado a pesquisar Quirks e tudo o mais associado ao negócio de heróis. Midoriya tem a oportunidade de conhecer Dave, amigo de All Might, e Melissa, filha de Dave, duas talentosas engenheiras de equipamentos heróis. Ele também encontra seus colegas de classe, a maioria dos quais teve a oportunidade de passar parte das férias de verão no festival.\n\nNo entanto, um esquadrão misterioso de vilões se infiltra em I-Island, e cabe a Midoriya e seus amigos confrontá-los, usando seus Quirks em desenvolvimento para lutar contra o novo inimigo e descobrir um plano traiçoeiro.",
