              "foto": "https://pbs.twimg.com/media/EdxS5_hU0AAlTSg.jpg",
              "link": "https://myanimelist.net/anime/39565/Boku_no_Hero_Academia_the_Movie_2__Heroes_Rising",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Izuku \"Deku\" Midoriya e seus colegas alunos da Classe 1-A do curso de herói da UA High foram escolhidos para participar de um programa de segurança na Ilha de Nabu. Para melhorar ainda mais suas habilidades e ganhar experiência em atos heroicos mais comuns, os alunos ajudam os cidadãos gentis com pequenos serviços e tarefas diárias. Com o baixo índice de criminalidade na comunidade tranquila, tudo parece bem e bem, mas a ascensão de um novo vilão ameaça colocar a coragem dos alunos à prova e desafiar suas capacidades como heróis.\n\nUm vilão impiedoso chamado Nine está em busca de uma certa \"peculiaridade\" necessária para cumprir seu plano diabólico - criar uma sociedade onde apenas aqueles com as peculiaridades mais fortes reinam supremos. Como seu ataque à Ilha de Nabu põe em risco a vida dos residentes, proteger os cidadãos se torna a primeira prioridade para a Classe 1-A; derrotar Nove junto com seus cúmplices perversos também é imperativo. Uma estratégia direta é formulada até que um menino chamado Katsuma Shimano, com quem Deku fizera amizade, repentinamente requer proteção especial. Preocupado com o bem-estar do menino, Deku e seus colegas devem agora traçar um plano para garantir a segurança de Katsuma a todo custo.\n\nCom Nove causando estragos para encontrar o catalisador para seus esquemas mal intencionados e os heróis desesperados para defender Katsuma do perigo, Deku e seus amigos serão capazes de sair vitoriosos ou se encontrarão incapazes de escapar de uma situação desesperadora?",
              "maturidade": null,
