              "sinopse": "Nesta nova aventura, alguns alunos da Classe 1-A são enviados para aprimorar suas habilidades de sobrevivência em um curso de treinamento. Como ainda não receberam suas licenças provisórias, eles estão ansiosos para se libertar e se divertir um pouco.\n\nEles descobrem rapidamente que o perigo que enfrentam não é uma simulação! Será necessário o treinamento combinado, o trabalho em equipe e o raciocínio rápido se eles forem aprovados nesta tarefa!",
