              "link": "https://myanimelist.net/anime/38302/Boku_no_Tonari_ni_Ankoku_Hakaishin_ga_Imasu",
              "trailer": null,
              "episodios": 12,
              "sinopse": "No passado distante, Miguel, o Deus da Destruição, foi selado dentro do cavaleiro que governava a luz e as trevas, Sturmhurt. Ao lado do cavaleiro estava Gestöber, que o acompanhou em inúmeras batalhas. Nos dias de hoje, o destino os faz reencarnar como Kabuto Hanadori e Seri Koyuki, dois colegas de classe.\n\nO reencontro deles deve ser um momento de alegria, se não pelo fato de que esses heróis fantasiados são apenas produtos dos delírios de Kabuto. Como o fictício \"Gestöber\", Seri se encontra em várias situações embaraçosas devido às travessuras de Kabuto que às vezes fogem de seu controle. Além disso, seu colega de classe Utsugi Tsukimiya entra na briga com suas habilidades absurdamente precisas de leitura de mentes, destruindo lentamente a vida social de Seri.\n\nSeri se esforça para ficar longe deles, recusando-se a reconhecer suas travessuras, no entanto, com o chuunibyou de Kabuto e a imprevisibilidade de Utsugi, ele só será varrido pela loucura que vem em sua direção.",
