              "trailer": null,
              "episodios": 12,
              "sinopse": "Quando Kodaka Hasegawa descobre que será transferido para uma nova escola, ele está determinado a causar uma impressão positiva, e talvez até mesmo alguns amigos. No entanto, Kodaka descobre que está sem sorte quando é imediatamente rotulado como um delinquente violento devido ao seu cabelo loiro e expressão intimidante. Embora um mês tenha se passado, Kodaka ainda está sozinho graças à sua notória reputação. No entanto, sua vida começa a mudar quando ele encontra a solitária Yozora Mikazuki conversando com sua amiga imaginária em uma sala de aula vazia.\n\nDepois de compartilhar histórias de sua vida solitária de colégio, Kodaka e Yozora decidem superar as dificuldades de fazer amigos criando o Clube do Vizinho. Criado para pessoas que não têm amigos, as atividades diárias envolvem o aprendizado de habilidades sociais e como se encaixar, o que, felizmente, lhes permitirá fazer amigos. Junto com a amante de eroges Sena Kashiwazaki e outros párias excêntricos, Kodaka pode finalmente ter conseguido encontrar pessoas que ele pode chamar de amigos, neste clube cheio de excêntricos hilariantes.",
