              "sinopse": "Hasegawa Kodaka transferiu-se de escola e está tendo dificuldade em fazer amigos. Não ajuda que seu cabelo loiro tende a fazer as pessoas pensarem que ele é um delinquente. Um dia, ele encontra sua colega de classe solitária e mal-humorada Yozora enquanto ela está conversando animadamente com seu amigo imaginário Tomo. Percebendo que nenhum dos dois tem amigos de verdade, decidem que a melhor maneira de mudar essa situação é formar um clube e começar a recrutar.\nFoi assim que se formou o \"Rinjinbu\", Clube dos Vizinhos, um clube pensado especificamente para quem não tem muitos amigos. À medida que outros colegas solitários se juntam aos poucos em seu pequeno clube, eles tentarão aprender como construir amizades cozinhando juntos, jogando e outras atividades em grupo.",
