              "link": "https://myanimelist.net/anime/14967/Boku_wa_Tomodachi_ga_Sukunai_Next",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Clube dos Vizinhos - um clube fundado com o objetivo de fazer amigos, onde meninos e meninas infelizes com poucos amigos vivem suas vidas lamentáveis.\n\nEmbora Yozora Mikazuki tenha enfrentado certo incidente no final do verão, o dia a dia do Clube do Vizinho continua normalmente. Uma estranha freira, membros do conselho estudantil e outros novos rostos aparecem, fazendo com que a vida de Kodaka Hasegawa fique ainda mais ocupada.\n\nEnquanto todos gostam de ir ao parque de diversões, jogar, comemorar aniversários e desafiar o \"festival da escola\" - um símbolo da vida escolar que as pessoas normais vivem - as relações entre os membros lentamente começam a mudar ...\n\nVamos para a próxima etapa comece, nesta infeliz comédia de amor sobre a maioridade !!",
