              "episodios": 24,
              "sinopse": "15 crianças, 8 meninos e 7 meninas, estão aproveitando o acampamento de verão juntos quando de repente descobrem uma gruta à beira-mar. Ao entrar no lugar misterioso, eles encontram uma sala cheia de computadores, bem como um homem chamado Kokopelli, que se apresenta como o proprietário. Ele afirma estar trabalhando em um jogo que envolve um robô gigante que foi projetado para proteger a Terra de 15 invasões alienígenas diferentes. Kokopelli ainda não conseguiu testar o jogo, então convence todas as crianças, exceto uma, a assinar um contrato no que ele afirma ser uma aventura divertida.\n\nPorém, assim que os contratos são assinados, as coisas começam a ficar muito mais sombrias. Em Bokurano, as crianças devem agora pilotar o robô gigante Zearth, um de cada vez, na esperança de que tenham o que é preciso para derrotar todos os próximos inimigos. Mas Kokopelli deixou de fora uma informação muito importante: a fonte de energia do robô gigante Zearth.",
