              "trailer": null,
              "episodios": 13,
              "sinopse": "Nariyuki Yuiga, um empobrecido estudante do terceiro ano do ensino médio, trabalha incansavelmente para receber a indicação VIP, uma bolsa que cobriria todas as mensalidades da faculdade. Em reconhecimento ao seu trabalho árduo, o diretor concede-lhe a renomada bolsa de estudos.\n\nNo entanto, essa bolsa é concedida com uma condição: ele deve ser o tutor dos gênios da escola em suas matérias mais fracas! Juntando-se à sua nova brigada de alunos estão o maestro de matemática Rizu Ogata, que quer estudar humanas; a lenda da literatura Fumino Furuhashi, que quer estudar ciências; e o amigo de infância experiente de Yuiga, Uruka Takemoto, que não tem jeito em tudo o mais.\n\nBokutachi wa Benkyou ga Dekinaisegue Yuiga enquanto ele tenta ensinar seus três tutelados excêntricos em uma série de palhaçadas estranhas e cômicas. Mas como as ambições de Ogata e Furuhashi conflitam com seus talentos, Yuiga será capaz de ajudar seus alunos a realizar seus sonhos?",
              "maturidade": null,
