              "trailer": null,
              "episodios": 13,
              "sinopse": "Sob a devotada tutela de Nariyuki Yuiga, seus colegas Rizu Ogata, Fumino Furuhashi e Uruka Takemoto estão finalmente conseguindo notas médias em seus piores assuntos. Mas o tempo está passando e ainda há um longo caminho a percorrer antes que os três gênios da Ichinose Academy estejam prontos para seus próximos exames universitários. Enquanto isso, as meninas ainda lutam para equilibrar a busca de seus sonhos com sua crescente afeição por seu tutor desavisado.\n\nJuntando-se a eles estão Mafuyu Kirisu, uma professora com fortes opiniões sobre educação e talento por causa de seu passado como patinadora artística em ascensão, e Asumi Kominami, formada em sua escola com o objetivo de cursar uma universidade médica nacional. Com essas duas adições, o grupo de seis está mais animado do que nunca. Completamente envolvido em palhaçadas hilárias com seus novos amigos, Yuiga descobre que seu último ano de colégio agora inclui muito mais do que apenas ir para a aula e estudar.",
