              "trailer": null,
              "episodios": 18,
              "sinopse": "Trocas silenciosas entre a população de estudantes do sexo feminino da Shinyo Academy giram em torno de uma entidade sobrenatural enigmática. Esta entidade é Boogiepop, um Shinigami que, segundo rumores, assassina pessoas no auge de sua beleza antes que seu fascínio diminua. Poucos sabem de sua verdadeira natureza: um guardião que, entre os períodos de dormência, se manifesta como o alter ego de uma estudante do ensino médio chamada Touka Miyashita para afastar \"os inimigos do mundo\". Agora, uma série de desaparecimentos misteriosos - presumidos pela escola como meros fugitivos - fez Boogiepop despertar. Mas em algum lugar da academia, uma criatura ameaçadora se esconde, esperando o momento oportuno para atacar.\n\nBoogiepop wa Warawanaiexplora sutilmente as associações intrínsecas entre os seres humanos e sua percepção do tempo, enquanto se aprofunda nos relacionamentos complexos, emoções, memórias e passados ​​de seus personagens.",
