              "trailer": null,
              "episodios": -1,
              "sinopse": "Após o final bem-sucedido da Quarta Guerra Mundial Shinobi, Konohagakure tem desfrutado de um período de paz, prosperidade e extraordinário avanço tecnológico. Isso tudo se deve aos esforços das Forças Aliadas Shinobi e do Sétimo Hokage da vila, Naruto Uzumaki. Agora parecendo uma metrópole moderna, Konohagakure mudou, particularmente a vida de um shinobi. Sob o olhar atento de Naruto e seus antigos camaradas, uma nova geração de shinobi se aproximou para aprender os costumes ninja.\n\nBoruto Uzumaki costuma ser o centro das atenções como filho do Sétimo Hokage. Apesar de ter herdado o comportamento turbulento e teimoso de Naruto, Boruto é considerado um prodígio e é capaz de liberar seu potencial com a ajuda de amigos e familiares solidários. Infelizmente, isso só piorou sua arrogância e seu desejo de superar Naruto, o que, junto com o estilo de vida agitado de seu pai, prejudicou seu relacionamento. No entanto, uma força sinistra fermentando dentro da vila pode ameaçar a vida despreocupada de Boruto.\n\nNovos amigos e rostos familiares se juntam a Boruto quando uma nova história começa em Boruto: Naruto Next Generations.",
              "maturidade": null,
