              "trailer": null,
              "episodios": 1,
              "sinopse": "O espirituoso Boruto Uzumaki, filho do Sétimo Hokage Naruto, é um ninja habilidoso que possui a mesma ousadia e paixão que seu pai teve. No entanto, a ausência constante de seu pai, que está ocupado com seus deveres Hokage, coloca um freio no fogo de Boruto. Ao saber que seu pai observará os aspirantes a ninjas que participarão dos próximos exames Chunin, Boruto é levado a provar a ele que é digno de sua atenção. Para fazer isso, ele conta com a ajuda do amigo de infância e rival de Naruto, Sasuke Uchiha.\n\nOs exames Chunin começam e progridem suavemente, até que de repente, o Konohagakure é atacado por um novo inimigo que ameaça a paz de longa data da vila. Agora enfrentando um perigo real, Naruto e seus camaradas devem trabalhar juntos para proteger o futuro de seu querido lar e derrotar o mal que aterroriza seu mundo. À medida que essa batalha se desenrola, Boruto percebe as lutas que seu pai experimentou - e o que realmente significa ser um ninja.",
