              "sinopse": "Isanami, uma jovem sacerdotisa de Izumo, é forçada a assistir um grupo de ninjas malignos queimar seu templo e massacrar as pessoas, deixando-a sem escolha a não ser fugir para a floresta para escapar do mesmo destino. Por acaso, ela se depara com Saizou Kirigakure, um ninja sem mestre da escola Iga. Os dois vão ao Castelo de Ueda para pedir ajuda a Yukimura Sanada. A posse de um estranho e devastador poder por Isanami é revelada, e Sanada prontamente concorda em ajudá-la, reunindo dez bravos guerreiros ao lado de Isanami.\n\nAssim começa Brave 10, uma história ambientada no período dos Reinos Combatentes. Ele segue a jornada de Saizou e Isanami pelas terras carregadas de guerra em busca de bravos guerreiros para servir sob a bandeira de Yukimura, cada um possuindo poderosas habilidades próprias. Eles terão que viajar para longe, enquanto tentam afastar aqueles que perseguem o poder das trevas que ela possui para torná-los seus.",
