              "episodios": 12,
              "sinopse": "Ryouta Sakamoto está desempregado e mora com sua mãe. Sua única conquista real é ser o melhor jogador do popular videogame online Btooom! No entanto, sua vida pacífica está prestes a mudar quando ele se encontra encalhado em uma ilha no meio do nada, com um pequeno cristal verde incrustado em sua mão esquerda e sem nenhuma lembrança de como chegou lá. Para seu choque, alguém decidiu recriar o jogo de que tanto gosta na vida real, em que as apostas são a vida ou a morte.\n\nArmados com um saco cheio de bombas exclusivas conhecidas como \"BIM\", os jogadores têm a tarefa de matar sete de seus colegas participantes e pegar seus cristais verdes para voltar para casa. Condenando inicialmente qualquer forma de violência, Ryouta é forçado a lutar ao perceber que muitos dos outros jogadores não são tão acolhedores quanto parecem. Juntando-se a Himiko, um colega Btooom! jogador, eles tentam sair da ilha juntos, chegando cada vez mais perto da verdade por trás dessa disputa de morte.",
