              "trailer": null,
              "episodios": 13,
              "sinopse": "Quando o estudante normal do ensino médio Aoba Watase é repentinamente alvejado por um robô gigante conhecido como \"Valiancer\", ele é salvo por sua misteriosa colega de classe Hina Yumihara. Depois de revelar que ela e seu inimigo robótico são do futuro, Hina repentinamente impele Aoba 70 anos à frente para evitar sua morte.\n\nAo chegar, Aoba se encontra na cabine de um Valiancer chamado \"Luxon\", preso no meio de um tiroteio entre as forças militares da Aliança do Pacto Livre (FPA) e a República Zogilia. Depois que ele mostra alta compatibilidade com um piloto FPA chamado Dio Weinberg, os dois realizam um \"acoplamento\" bem-sucedido, permitindo que eles compartilhem experiências e, posteriormente, aumentem suas capacidades e habilidades. Embora Aoba seja capaz de sobreviver a esta batalha inesperada, ele é levado sob custódia pelo navio Cygnus da FPA, que deseja interrogá-lo. Embora a principal preocupação do aluno seja se algum dia conseguirá voltar para casa, o que ele não percebe é que está prestes a se envolver em uma guerra para proteger o mundo.",
