        "b0083": {
          "id": "b0083",
          "parentes": [],
          "items": {
            "b0083_1": {
              "id": "b0083_1",
              "foto": "https://funart.pro/uploads/posts/2019-10/1571942755_velikij-iz-brodjachih-psov-anime-13.jpg",
              "link": "https://myanimelist.net/anime/31478/Bungou_Stray_Dogs",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Por semanas, o orfanato de Atsushi Nakajima foi atormentado por um tigre místico que só ele parece estar ciente. Suspeito de estar por trás dos estranhos incidentes, o jovem de 18 anos é repentinamente expulso do orfanato e deixado com fome, sem teto e vagando pela cidade.\n\nEnquanto morria de fome na margem do rio, Atsushi salva um homem bastante excêntrico chamado Osamu Dazai do afogamento. Entusiasta excêntrico do suicídio e detetive sobrenatural, Dazai está investigando o mesmo tigre que está aterrorizando o menino. Junto com o parceiro de Dazai, Doppo Kunikida, eles resolvem o mistério, mas sua resolução deixa Atsushi em uma situação difícil. Como vários eventos estranhos acontecem, Atsushi é coagido a se juntar à sua empresa de investigadores sobrenaturais, assumindo casos incomuns que a polícia não pode lidar, ao lado de seus numerosos colegas de trabalho enigmáticos.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0083_2": {
              "id": "b0083_2",
              "foto": "https://pbs.twimg.com/media/Do0OzoqWwAEvmsh.jpg",
              "link": "https://myanimelist.net/anime/32867/Bungou_Stray_Dogs_2nd_Season",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Apesar de suas diferenças de posição, três homens - o mais jovem executivo sênior da Máfia do Porto, Osamu Dazai, o membro de menor escalão, Sakunosuke Oda, e o agente de inteligência, Angou Sakaguchi - se reúnem no Lupin Bar no final do dia para relaxar e delicie-se na companhia de amigos.\n\nPorém, uma noite, Angou desaparece. Uma fotografia tirada no bar é tudo o que resta das três juntas.\n\nAvançando para o presente, Dazai agora é um membro da Agência de Detetives Armados. The Guild, uma organização americana talentosa, entrou na briga e pretende obter a autorização de trabalho da Agência. Eles agora devem dividir sua atenção entre os dois grupos, a Guilda e a Máfia do Porto, que se opõem à sua própria existência.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0083_3": {
              "id": "b0083_3",
              "foto": "https://img.moviesrankings.com/t/p/w1280/2r5ABwl5AEcOJHoMnA3AexB3jNl.jpg",
              "link": "https://myanimelist.net/anime/38003/Bungou_Stray_Dogs_3rd_Season",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Após a conclusão da guerra organizacional de três vias, o burocrata do governo Ango Sakaguchi relembra um acontecimento ocorrido anos atrás, após a morte do ex-chefe da Máfia do Porto. Osamu Dazai, ainda um novo recruta na época, foi encarregado de investigar rumores relacionados a uma explosão misteriosa que dizimou parte da cidade anos atrás - e sua conexão com o suposto reaparecimento do ex-chefe.\n\nDevido a circunstâncias fora de seu controle, ele se associou a Chuuya Nakahara, o talentoso e impulsivo líder de um clã rival conhecido como '' Carneiro '', para descobrir a verdade por trás do caso e iluminar o mito de Arahabaki— o deus do fogo que poderia simplesmente levar Dazai à solução do caso.\n\nEnquanto isso, nos dias atuais, é business as usual mais uma vez para a Agência de Detetives Armados. Sua pausa pacífica não durará muito, no entanto, enquanto os velhos e novos inimigos reúnem suas forças e se preparam para outro confronto.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0083_4": {
              "id": "b0083_4",
              "foto": "https://imgc.eximg.jp/i=https%253A%252F%252Fs.eximg.jp%252Fexnews%252Ffeed%252FLisani%252FLisani_0000259373_a667_1.jpg,zoom=1200,quality=70,type=jpg",
              "link": "https://myanimelist.net/anime/42250/Bungou_Stray_Dogs_Wan",
              "trailer": null,
              "episodios": 0,
              "sinopse": "Os dias pacíficos do trabalho muito popular Bungo Stray Dogs estão aqui. Os personagens da Armed Detective Agency e da Mafia estão em miniatura ?! Devido a Atsushi e co. ficando fofo, essa é uma experiência diferente do trabalho original - um mangá de gag agradável!",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0083_5": {
              "id": "b0083_5",
              "foto": "https://digital-mono-zakki.c.blog.ss-blog.jp/_images/blog/_ea1/digital-mono-zakki/20180303_bungoh_2f-bfa2b.jpg",
              "link": "https://myanimelist.net/anime/34944/Bungou_Stray_Dogs__Dead_Apple",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Uma catástrofe em grande escala está ocorrendo em todo o planeta. Os usuários da habilidade são descobertos após o aparecimento de uma névoa misteriosa, aparentemente tendo cometido suicídio, então a Armed Detective Agency começa a investigar essas mortes misteriosas. O caso parece envolver um usuário de habilidade desconhecido conhecido como \"Colecionador\", um homem que pode ser o mentor do incidente.\n\nA confiança e a coragem são postas à prova para salvar a cidade de Yokohama e os usuários de habilidades em todo o mundo das garras do Coletor, onde a Armed Detective Agency forma uma parceria improvável com a perigosa Port Mafia.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "b0083_6": {
              "id": "b0083_6",
              "foto": "https://1.bp.blogspot.com/-ApObQQTlO1g/XeMgspn1tOI/AAAAAAAAAlw/J1lEEE1v4lc8xAMXA0wpKBDhYZnvf6RCQCLcBGAsYHQ/s1600/Bungou%2BStray%2BDogs%2BHitori%2BAyumu.png",
              "link": "https://myanimelist.net/anime/33071/Bungou_Stray_Dogs__Hitori_Ayumu",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Membros da Armed Detective Agency discutem o candidato mais adequado para o segundo em comando. Doppo Kunikida está cumprindo tarefas oficiais conforme planejado em seu diário, como de costume. Inesperadamente, ocorre um incidente relacionado a uma bomba, desafiando os ideais que ele sempre defendeu. Ao pesar uma vida em centenas, como ele procederá?",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
