              "sinopse": "Quando três completos estranhos, Mishiba Toki, Nakajyo Nobuto e Saitoh Kazuo, são contratados por uma corporação para competir no Bus Game, uma luta de cães ilegal conduzida em sigilo absoluto, eles recebem o código de equipe \"Equipe AAA\" (Triplo Anônimo). Esse grupo de três, que difere inteiramente de seus ambientes de vida e de suas personalidades, tem que trabalhar em conjunto de maneira eficaz, mas sem eliminar mutuamente a desconfiança mútua ou intrometer-se na privacidade um do outro. Eles têm apenas um ponto em comum - cada um deles precisa de uma grande quantia em dinheiro para suas circunstâncias individuais. Para conseguir o dinheiro, eles devem jogar o jogo, apesar de suas próprias vidas estarem em jogo.",
