              "sinopse": "A história começa quando o estudante Kazuki Muto é morto uma noite salvando uma garota misteriosa de um monstro, apenas para acordar em seu dormitório da escola, acreditando ter sido um sonho; no entanto, ele logo descobre que o sonho não era um sonho quando um monstro serpentino gigante ataca ele e sua irmã. Tokiko Tsumura, a garota que ele salvou, explica que o monstro é um homúnculo. Kazuki foi atacado e morto por ele quando a estava resgatando; entretanto, ela, sentindo-se responsável por ele, o reanimou colocando um medalhão Kakugane em seu peito, servindo como um coração substituto.\n\nO Kakugane, como explica Tokiko, é um dispositivo alquímico que, quando ativado, assume uma determinada forma com base no usuário do Kakugane, formando um Buso Renkin único. O Buso Renkin é a única coisa que pode destruir um monstro homúnculo. Usando isso, Kazuki cria seu próprio Buso Renkin (o \"Coração da Luz do Sol\", uma enorme lança). Junto com Tokiko e seu próprio Buso Renkin (a \"Saia Valquíria\", uma foice de execução), Kazuki se junta à luta contra os homúnculos e seu mestre.",
