              "trailer": null,
              "episodios": 11,
              "sinopse": "Dinheiro é poder e, sem ele, a vida não tem sentido. Em um país cuja economia está em frangalhos, o estudante universitário de economia do segundo ano Kimimaro Yoga entende esse fato muito bem, pois está cercado pela vida relativamente luxuosa de seus colegas e lutando para sobreviver. No entanto, seu mundo vira de cabeça para baixo quando um estranho de cartola chega tarde da noite em sua porta.\n\nAtendendo pelo nome de Masakaki, o visitante pede ao Yoga para vir ao Distrito Financeiro Oriental, um lugar onde o dinheiro flui em abundância se alguém oferecer seu \"futuro\" como garantia. Embora relutante, a ganância vence a razão e o Yoga aceita a oferta; assim, assumindo o manto de um “Entre”. Mas, sem o seu conhecimento, a terra da riqueza em que entrou é um reino alternativo construído à semelhança do seu, onde Entres são forçados a participar em duelos semanais chamados \"Negócios\", com suas garantias em jogo. Armado contra seus compatriotas e destino, Yoga deve se adaptar rapidamente a este novo mundo se ele espera proteger sua fortuna e futuro - e descobrir quanto dinheiro realmente vale.",
              "maturidade": null,
