              "sinopse": "O que é felicidade? Sempre fã da psicologia, questões como essa são as que o estudante do ensino médio Ritsu Shikishima gosta de ponderar enquanto passa seus dias de paz com seus amigos. Seu mundo perfeito, no entanto, começa a se desfazer quando ele ouve uma voz estranha obscurecida pela estática, implorando por ajuda. Essa voz pertence a μ, um ídolo pop querido, cujo canto começa a ter um efeito adverso no mundo. Diante dos olhos de Ritsu, os rostos de seus amigos e familiares são distorcidos por falhas conforme o som da voz de μ os transforma em Digiheads: monstros furiosos empenhados no extermínio de todos aqueles que começam a despertar para a verdadeira natureza de sua existência.\n\nPercebendo que está preso em um mundo virtual criado por μ chamado Mobius, Ritsu deve agora reunir todos os outros que conseguiram perceber a verdade antes de serem eliminados. Juntos, eles usarão seus novos poderes e armas concedidos por suas emoções - conhecido como Efeito Catarse - para lutar contra o misterioso grupo conhecido como Os Músicos Ostinato enquanto eles lutam para escapar.",
