              "link": "https://myanimelist.net/anime/2116/Captain_Tsubasa",
              "trailer": null,
              "episodios": 128,
              "sinopse": "Capitão Tsubasa é a história apaixonante de um estudante do ensino fundamental cujos pensamentos e sonhos giram quase inteiramente em torno do amor pelo futebol. Tsubasa Oozora, de 11 anos, começou a jogar futebol muito jovem e, embora fosse principalmente um esporte recreativo para seus amigos, para ele tornou-se uma espécie de obsessão.\n\nPara realizar seu sonho com o melhor de suas habilidades no ensino fundamental, Tsubasa muda-se com sua mãe para a cidade de Nankatsu, conhecida por seus excelentes times de futebol do ensino fundamental. Mas embora ele fosse facilmente o melhor em sua cidade velha, Nankatsu tem muito mais competição e ele precisará de toda sua habilidade e talento para se destacar dessa nova multidão.\n\nEle encontra não apenas rivais, mas também novos amigos, como a linda garota Sanae Nakazawa e o talentoso goleiro Genzo Wakabayashi, que compartilha a mesma paixão de Tsubasa e provará ser um amigo querido ao ajudá-lo a ir em direção aos seus sonhos. Representar o Japão na Copa do Mundo da FIFA é o maior sonho de Tsubasa, mas será preciso muito mais do que talento para alcançá-lo.",
