        "c0011": {
          "id": "c0011",
          "parentes": [],
          "items": {
            "c0011_1": {
              "id": "c0011_1",
              "foto": "https://i.pinimg.com/originals/37/bd/39/37bd39b5831f5d85ff8eb52bc77c2a85.jpg",
              "link": "https://myanimelist.net/anime/232/Cardcaptor_Sakura",
              "trailer": null,
              "episodios": 70,
              "sinopse": "Sakura Kinomoto é uma menina de dez anos da quarta série, uma espécie de jardim, até que um dia ela se depara com um livro misterioso contendo um conjunto de cartas. Infelizmente, ela tem pouco tempo para adivinhar o que as cartas significam, porque ela acidentalmente provoca uma rajada de vento mágica e sem querer espalha as cartas por todo o mundo. De repente, acordada do livro, a Besta do Selo, Keroberos (apelidada de Kero-chan), diz a Sakura que ela lançou as Cartas Clow místicas criadas pelo feiticeiro Clow Reed. As cartas não são brinquedos comuns. Cada um deles possui poderes incríveis e, como gostam de agir de forma independente, Clow selou todas as cartas de um livro. Agora que as Cartas foram liberadas, elas representam um grande perigo para o mundo, e cabe a Sakura impedir que as Cartas causem uma catástrofe!\n\nNomeando Sakura o título de \"a Cardcaptor\" e concedendo a ela a Chave Selada, Keroberos a incumbe de encontrar e recapturar todas as cartas. Ao lado de sua melhor amiga Tomoyo Daidouji, e com a orientação de Kero-chan, Sakura deve aprender a equilibrar seu novo dever secreto com os problemas diários de uma jovem que envolve amor, família e escola, enquanto ela voa em suas aventuras mágicas como Sakura o Cardcaptor.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0011_2": {
              "id": "c0011_2",
              "foto": "https://auctions.c.yimg.jp/images.auctions.yahoo.co.jp/image/dr000/auc0406/users/0abce1104f0303183ae7e0d847416ec9c2a5cb30/i-img850x1200-1527840362ex8iso72684.jpg",
              "link": "https://myanimelist.net/anime/371/Cardcaptor_Sakura_Movie_1",
              "trailer": null,
              "episodios": 1,
              "sinopse": "São férias de inverno e Sakura ganha uma viagem para Hong Kong. Kero, cético quanto à sorte dela nas loterias, questiona se ela teve apenas sorte ou se foi convocada para Hong Kong por causa da inevitabilidade. Enquanto Sakura caminha pela Bird Street de Hong Kong, ela sente uma força maligna chamando por ela. Ao perseguir dois pássaros estranhos, ela é levada a um mundo fantasma, onde descobre que foi feita para vir a Hong Kong por uma mulher, Madoushi, que aparentemente quer vingança de Clow Reed. Com a mãe de Syaoran, a ajuda de Yelan e a orientação da voz de Clow Reed, ela deve lutar contra Madoushi e resgatar seus amigos e entes queridos, que foram capturados.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0011_3": {
              "id": "c0011_3",
              "foto": "https://i.imgur.com/23gYDNB.jpg",
              "link": "https://myanimelist.net/anime/372/Cardcaptor_Sakura_Movie_2__Fuuin_Sareta_Card",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Para o Festival Nadeshiko deste ano, a turma do ensino fundamental de Sakura Kinomoto está apresentando uma peça. Ela vai retratar uma princesa que luta para responder à confissão de amor do príncipe do país vizinho. Sakura tem empatia por sua personagem muito bem, já que ela mesma ainda deve uma resposta ao garoto que confessou seu amor por ela quatro meses atrás.\n\nQuando os primos Shaoran e Meiling Li voltam de Hong Kong para fazer uma visita surpresa a seus amigos no Japão, Sakura recebe mais incentivos para finalmente declarar seus sentimentos. No entanto, ela é repetidamente distraída por uma presença que lembra uma Carta Clow, bem como desaparecimentos inexplicáveis ​​pela cidade.\n\nEventualmente, Sakura descobre outra das criações de Clow Reed - o \"Nada\" - que antes estava selada sob a antiga casa do mago. Ele tem poder igual a todas as 52 cartas que Sakura possui e, além disso, quer tirar essas cartas dela! Objetos, espaço e pessoas desaparecem de Tomoeda com cada cartão que é roubado. Sakura se propõe a capturar o Nada para que tudo volte ao normal, mas o que ela deve sacrificar no processo?",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0011_4": {
              "id": "c0011_4",
              "foto": "https://i.imgur.com/lGAgiEq.jpg",
              "link": "https://myanimelist.net/anime/33354/Cardcaptor_Sakura__Clear_Card-hen",
              "trailer": null,
              "episodios": 22,
              "sinopse": "Com todas as Clow Cards recapturadas e transformadas em suas próprias Sakura Cards, Sakura Kinomoto agora entra em seu primeiro ano na Tomoeda Middle School. Após seu primeiro dia de aulas, Sakura se reúne com seu amor Shaoran Li, que a informa que está se mudando permanentemente para Tomoeda. Para sua surpresa, descobriu-se que Shaoran freqüentaria a mesma escola e parecia que a vida de Sakura estava indo na direção certa.\n\nNo entanto, quando Sakura vai dormir, ela encontra em seu sonho uma misteriosa figura encapuzada e se encontra cercada por cartas transparentes. Acordando com medo, Sakura fica chocada ao ver que seu sonho se tornou realidade, com as cartas Sakura se tornando claras. Continuados encontros oníricos com o inimigo desconhecido e sua conquista de uma nova chave mágica definem o cenário para a última aventura de Cardcaptor Sakura!",
              "maturidade": null,
              "pontosBase": 0.0
            },
