              "trailer": null,
              "episodios": 65,
              "sinopse": "Cardfight !! Vanguard apresenta um mundo onde o jogo Cardfight !! O Vanguard está se tornando a última mania entre os jogos de cartas colecionáveis, tornando-se parte da vida cotidiana de pessoas em todo o mundo. O jogo não se limita apenas à Terra; batalhas entre as criaturas usadas pelos jogadores acontecem em outro planeta chamado Cray.\n\nA história começa com Aichi Sendou, um tímido estudante do ensino médio cuja atitude mansa freqüentemente o torna alvo de valentões. Aichi recebeu uma carta muito rara, \"Blaster Blade\", quando era muito jovem. É o seu único tesouro que lhe dá esperança. Isto é, até que seja tirado dele. Embora Aichi nunca tenha jogado Cardfight !! Antes da vanguarda, ele desafia o ladrão para um jogo para ganhar o \"Blaster Blade\" de volta. Este jogo de apostas altas rapidamente leva Aichi para o mundo das batalhas Vanguard, que irá testar e mudar seu valor como jogador e como pessoa.",
              "maturidade": null,
              "pontosBase": 0.0
            },
