              "sinopse": "Aichi e seus amigos venceram o Torneio Nacional e decidem seguir seus próprios caminhos até que um garoto misterioso chamado Takuto Tatsunagi aparece. Ele revela que os líderes Royal Paladins, Dark Paladins e Kagero foram capturados, e a única maneira de libertar Cray é os lutadores Vanguard usarem um novo poder - Limit Break. Como os Paladinos Reais perdem a habilidade de lutar, o deck de Aichi é alterado para um deck de Paladino Dourado. Aichi e seus amigos agora devem vencer o Vanguard VF Circuit se quiserem saber mais sobre as ocorrências em Cray e libertar seus velhos amigos.",
