              "episodios": 33,
              "sinopse": "Vários dias após a batalha mortal contra Link Joker que envolve o mundo inteiro, o mundo voltou à paz.\n\nMas Kai Toshiki enfrenta uma situação surpreendente. Sendou Aichi, o herói que salvou o mundo da invasão de Link Joker, desapareceu repentinamente. Além disso, a memória de todos sobre Aichi está perdida ... Quase todas as dicas foram perdidas, e Kai começa a procurar Aichi com \"Blaster Blade\" e o deck de Royal Paladin, a única dica existente e a prova de seus laços.\n\nKai é abordado por lutadores que se autodenominam \"Quatre Knights\". Os quatro --- Gaillard, Neve, Ratie e Sarah --- são lutadores com poder de classe mundial em lutas de vanguarda. Eles controlam o poder misterioso e incentivam Kai a desistir de pesquisar Aichi. Qual é o seu propósito ...!? E qual é a relação deles com Aichi ...!\n\nKai, com o novo poder \"Legion\" em suas mãos, luta para levar Aichi de volta. Agora, a guerra começou!",
