              "trailer": null,
              "episodios": 24,
              "sinopse": "Em um futuro distante, a Terra se tornou um deserto e a humanidade como a conhecemos morreu. Tudo o que resta são robôs conscientes. Eles deveriam ser capazes de viver para sempre - até que aquele chamado Luna morreu e The Ruin começou. Seus corpos irão enferrujar e não há nada que possa ser feito para consertar isso. Agora os robôs são deixados apenas para contemplar suas mortes, continuando apenas pelo boato de que se eles comerem aquele chamado Casshern, eles ganharão a imortalidade.\n\nCasshern nada sabe sobre seu passado, por que existe ou o que é, mas deve descobrir ou enfrentará o tormento constante de ser caçado por robôs que não querem morrer. Casshern deixa a morte onde quer que vá, mas deve enfrentá-la se quiser descobrir a verdade deste mundo.",
              "maturidade": null,
              "pontosBase": 0.0
            },
