              "link": "https://myanimelist.net/anime/4810/Shinzou_Ningen_Casshern",
              "trailer": null,
              "episodios": 35,
              "sinopse": "O brilhante Dr. Azuma criou muitos robôs para ajudar a humanidade. No entanto, durante uma tempestade, seu laboratório foi atingido por um raio, corrompendo a programação de um de seus robôs, BK-1, que se renomeou Braiking Boss e declara que em vez de servir à humanidade, a humanidade agora o servirá! Ele reúne outros robôs em um exército esmagador decidido a escravizar a raça humana.\n\nTetsuya, filho do Dr. Azuma, pede a seu pai para transformá-lo em um andróide indestrutível para que ele tenha o poder de destruir a ameaça que seu pai criou inadvertidamente. Pouco depois, Braiking Boss captura o Dr. Azuma e sua esposa. Tetsuya, agora rebatizado de Casshern, se propõe a virar a maré da guerra e resgatar seus pais, com a ajuda de sua namorada, Luna, e do cão robô Friender.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0015_3": {
