              "trailer": null,
              "episodios": 4,
              "sinopse": "Em um futuro próximo, a tecnologia dos robôs avançou ao ponto da autoconsciência. Sob a liderança do \"Rei Negro\", as máquinas dizimaram a população humana e conquistaram o mundo. Aqueles que sobreviveram ao holocausto inicial foram escravizados para o resto da vida. Mas durante as dificuldades, um herói solitário aparece como o salvador da humanidade. Ele é Casshan - uma fusão de homem e máquina dirigida para combater o Rei Negro e suas forças até o fim.",
