              "sinopse": "Embora na superfície Yuu Otosaka pareça ser apenas mais um adolescente charmoso e inteligente, ele tem um segredo - ele tem a habilidade de entrar na mente das pessoas e controlar totalmente seu corpo por cinco segundos de cada vez. Yuu tem usado essa habilidade há anos para obter as notas mais altas, o que lhe permitiu entrar em um colégio de prestígio.\n\nQuando a enigmática Nao Tomori pega Yuu usando seu poder, ela o força a se transferir para a Hoshinoumi Academy, uma escola para alunos com habilidades sobrenaturais. O conselho estudantil da escola, liderado por Nao, tem a tarefa de rastrear secretamente adolescentes que abusam de seus poderes. Yuu é forçado a se juntar ao conselho estudantil e, juntos, eles enfrentam desafios formidáveis ​​que o aproximam da chocante verdade de que sua própria habilidade, aparentemente incompleta, pode ser mais poderosa do que ele jamais poderia ter imaginado.\n\nUma história original de Jun Maeda, criador de Angel Beats e Clannad , Charlotte explora a vida sobrenatural desses adolescentes e o preço que eles devem pagar por serem especiais.",
