              "sinopse": "Uma série de assassinatos horríveis apelidados de \"Loucura da Nova Geração\" uma vez induziu a histeria em massa em Shibuya. No auge, durante um motim frenético, um súbito terremoto reduziu o distrito a nada além de entulho, enquanto deixou as enfermarias ao redor estranhamente intactas.\n\nSeis anos depois, em um Shibuya recém-reconstruído, mortes misteriosas começaram a surgir novamente. Não demora muito para que o estudante do terceiro ano Takuru Miyashiro perceba uma conexão: as datas dos assassinatos recentes correspondem às dos incidentes da Loucura da Nova Geração. Ele, junto com vários membros do clube do jornal de sua escola, decidem se aprofundar no mistério, apenas para se encontrarem presos no meio de uma nova cena de crime ...",
