              "trailer": null,
              "episodios": 12,
              "sinopse": "Ao longo de Shibuya, uma série de assassinatos apelidados de \"Loucura da Nova Geração\" ganhou grande atenção. À medida que esses crimes ganharam infâmia, eles se tornaram um tópico quente de discussão entre as pessoas da área. No entanto, esses assassinatos da \"Nova Geração\" não atraem o interesse de Takumi Nishijou, um otaku do ensino médio que freqüentemente tem delírios e sente que está sendo constantemente observado.\n\nSem se preocupar com o mundo real, Takumi passa seu tempo jogando jogos online e assistindo anime. No entanto, sua vida comum é interrompida quando ele recebe uma imagem horrível de um homem preso a uma parede de um usuário chamado Shogun. Depois de se acalmar em um cyber café, Takumi vê exatamente a mesma cena de crime que a imagem retratada diante de seus olhos,\n\nEm conflito com a natureza da realidade, Takumi acha difícil julgar onde depositar sua confiança enquanto é pego nos assassinatos da \"Nova Geração\", acreditando que o assassino está tentando pegá-lo.",
