              "trailer": null,
              "episodios": 22,
              "sinopse": "Sempre foi a aspiração do Clube de Pesquisa Robótica da Escola Secundária Tanegashima Central completar o GunPro1, um robô gigante em pleno funcionamento. Durante anos, os sócios do clube contribuíram para o seu progresso e agora o objetivo de Akiho Senomiya é tornar o sonho de todos os ex-sócios do clube uma realidade. No entanto, as coisas não são tão fáceis quanto parecem, pois o clube não tem fundos para um empreendimento tão grande. Além disso, o único outro membro do clube, Kaito Yashio, não mostra interesse em ajudar seu amigo de infância e, em vez disso, joga jogos de luta mecha em seu \"PokeCom\".\n\nComo Kaito está perdendo seus dias, recebe uma mensagem indecifrável e ouve uma voz que parece abafada pelo barulho da estática. Ele procura a fonte, apenas para perceber que veio de Airi Yukifune, uma IA que só existe dentro do sistema de realidade aumentada acessível através do PokeCom. Robotic; Notes segue a história de Kaito quando ele descobre um relatório peculiar no banco de dados de Airi, que teria consequências desastrosas no futuro.",
