              "trailer": null,
              "episodios": 12,
              "sinopse": "Um blog que refuta o sobrenatural, co-dirigido pelo adolescente do NEET Yuuta Gamon e seu entusiasmado melhor amigo Ryouka Narusawa, se torna o catalisador que reunirá um grupo de pessoas que supostamente não têm nada a ver umas com as outras.\n\nEsses indivíduos incluem o cartomante do ensino médio Miyuu Aikawa, que se juntou a Yuuta para trabalhar no blog; o realista Sarai Hashigami, que fica chocado quando a tragédia atinge sua família; a artista doujin Ririka Nishizono, que tem uma habilidade incrível de prever o futuro com sua arte; a praticante de magia negra e especialista em maldições local Aria Kurenaino e sua amiga fantasmagórica; Shun Moritsuka, um detetive otaku aparentemente infantil; e o repórter Touko Sumikaze.\n\nEnquanto este grupo improvável, limitado apenas pelas cordas do destino, encontra seu caminho para o outro, eles são confrontados com assassinatos e outros eventos que são encobertos pela presença do sobrenatural. Eles devem se unir para resolver os mistérios que envolvem a cidade e suas vidas.",
