              "link": "https://myanimelist.net/anime/5238/Chocolate_Underground__Bokura_no_Chocolate_Sensou",
              "trailer": null,
              "episodios": 1,
              "sinopse": "A história se passa, aparentemente, em um país moderno imaginário. O partido político \"Good for You\" que subiu ao poder sem consentimento eleitoral instituiu uma \"Lei de Proibição do Chocolate!\" Todos os alimentos e bebidas que envolvem chocolate, junto com quase todos os outros deleites agradáveis, foram proibidos pela nova administração.\n\nEntram Huntly e Smudger, dois meninos que costumavam andar pela loja de doces da Sra. Bubby apenas para dar uma olhada na adorável Louise. Desde que a nova lei foi aprovada, a loja, antes um local animado, tornou-se pobre. Louise avisa os meninos sobre um negócio incipiente envolvendo a distribuição de chocolate contrabandeado. Enquanto caminham para a mina secreta de ingredientes de chocolate, eles se deparam com um código misterioso.\n\nDepois de decodificar com sucesso a cifra, os meninos entram na sede do traficante ilegal. Lá dentro, eles estão agradavelmente surpresos com o início de uma Festa de Chocolate! Hunter e Smudger estão felizmente reunidos com o sabor do chocolate novamente. Mas a festa é abruptamente interrompida pela presença da Polícia do Chocolate. Enquanto as pessoas fogem em todas as direções, o amigo dos meninos Div é capturado pelos oficiais!\n\nImperdoável! Tudo o que ele queria era um pedaço de chocolate! O que há de tão errado nisso? Huntley, Smudger e Louise decidem embarcar em seu próprio empreendimento de contrabando de chocolate. Com seus talentos combinados, conhecimento e paixão, eles serão capazes de recuperar o mundo \"Diversão e Belo\" que eles habitavam?!",
