        "c0051": {
          "id": "c0051",
          "parentes": [],
          "items": {
            "c0051_1": {
              "id": "c0051_1",
              "foto": "https://t1.daumcdn.net/cfile/blog/2418624B5184B65F19",
              "link": "https://myanimelist.net/anime/14741/Chuunibyou_demo_Koi_ga_Shitai",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Todo mundo já passou por aquele estágio de sua vida em que se considera especial, diferente da massa de humanos comuns. Eles podem ir tão longe a ponto de se verem capazes de exercer poderes místicos, ou talvez até acreditarem que descendem de um reino de fantasia. Essa \"doença\" é conhecida como \"chuunibyou\" e costuma ser a fonte de alguns dos momentos mais embaraçosos da vida de uma pessoa.\n\nPara Yuuta Togashi, as cicatrizes que seu chuunibyou deixou para trás ainda estão frescas. Tendo posado como o \"Mestre da Chama Negra\" durante seus anos de ensino médio, ele olha para trás para aqueles tempos com extrema vergonha, tanto que decide estudar em um colégio longe, onde ninguém o reconhecerá. Deixando sua história sombria para trás, ele deseja viver uma vida normal de colégio.\n\nInfelizmente, ele ainda não escapou de seu passado: entra Rikka Takanashi, a nova colega de classe de Yuuta e autodeclarada embarcação do \"Olho Mau\". Enquanto essa excêntrica jovem entra na vida de Yuuta, seu sonho de uma vida comum, sem chuunibyou, rapidamente se desintegra. Nesta história hilária e comovente de um menino que só quer deixar suas memórias embaraçosas para trás, os delírios de antigamente estão longe de ser uma coisa do passado.",
              "maturidade": null,
              "pontosBase": 0.0
            },
