              "link": "https://myanimelist.net/anime/15687/Chuunibyou_demo_Koi_ga_Shitai_Lite",
              "trailer": null,
              "episodios": 6,
              "sinopse": "Incluído em Love, Chunibyo & Other Delusions! Coleções completas de DVD / Blu-ray como um extra de 22 minutos intitulado Chuni-Shorts.\n\nEpisódio 1: Voleibol (バ レ ー ボ ー ル)\nEpisódio 2: The Wicked Lord Shingan - The Dawning (邪王 真 眼 ・ 黎明 篇)\nEpisódio 3: My Big Brother (わ た し の お 兄 ち ゃ ん)\nEpisódio 4: Estou fazendo carne e ensopado de batata! (肉 じ ゃ が 作 る よ!)\nEpisódio 5: A Bela Adormecida Depois da Escola (眠 れ る 放 課後 の 美 少女)\nEpisódio 6: Dekomori vs Nibutani (凸 守 VS 丹 生 谷)",
              "maturidade": null,
              "pontosBase": 0.0
