              "foto": "https://animeenelkotatsu.files.wordpress.com/2015/01/chuunibyou-ren-01.jpg",
              "link": "https://myanimelist.net/anime/18671/Chuunibyou_demo_Koi_ga_Shitai_Ren",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Os pombinhos desajeitados, Yuuta Togashi e Rikka Takanashi agora estão morando juntos enquanto entram em um novo ano escolar, mas seu adorável relacionamento continua estagnado. Yuuta luta para se adaptar a ter uma namorada chuuni enquanto a gangue - Sanae Dekomori, Shinka Nibutani e Kumin Tsuyuri - ainda mantém suas peculiaridades, apesar de ter avançado no ano. Para piorar as coisas, outra garota chuuni da escola secundária de Yuuta, Satone Shichimiya, aparece ...\n\nCom os vários eventos girando em torno de Yuuta, ele será capaz de desenvolver seu relacionamento com Rikka?",
