              "foto": "https://www.infoanime.com.br/poster/2014/chuunishitairenrw.jpg",
              "link": "https://myanimelist.net/anime/27601/Chuunibyou_demo_Koi_ga_Shitai_Ren__The_Rikka_Wars",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Em um dia normal de aula, Rikka Takanashi nota Makoto Isshiki secretamente passando um pen drive para Yuuta Togashi. Curiosa, Rikka conversa com suas amigas sobre o caso, que concordam que Yuuta está escondendo algo dela. Eles decidem descobrir o conteúdo do pen drive por todos os meios necessários, mas para sua surpresa, ele continha apenas fotos de um ídolo que Yuuta adorava no ensino médio. No entanto, Rikka fica ofendida, pois ela afirma que isso quebra seu contrato como amantes e exige que Yuuta devolva o pen drive.\n\nApesar de ter visto Yuuta devolver o pen drive, ela ainda se sentia insegura sobre a situação. Isso a leva a entrar furtivamente no quarto de Yuuta durante a noite, apenas para descobrir que o pen drive não foi devolvido! Examinando seu conteúdo, ela rapidamente corre para a cama quando Yuuta entra em seu quarto. Para seu terror, ela encontra o pen drive esmagado devido à sua negligência em mantê-lo em um lugar seguro. Yuuta descobre rapidamente e exige um pedido de desculpas. No entanto, Rikka também exige um pedido de desculpas dele, resultando em ambos se recusando a ser o primeiro a se desculpar. Os dois pombinhos serão capazes de resolver sua discussão?",
              "maturidade": null,
