              "trailer": null,
              "episodios": 1,
              "sinopse": "Embora Yuuta Togashi e Rikka Takanashi tenham acabado de começar a namorar, eles não sabem como progredir em seu jovem relacionamento. Por serem tímidos, nenhum deles é capaz de dar o primeiro passo. Rikka decide pedir a seu representante de classe Shinka Nibutani alguns conselhos de amor, e ela aconselha Rikka a se aproximar de Yuuta durante o Natal. Seguindo a sugestão do amigo de Yuuta, Makoto Isshiki, eles deram uma festa de Natal na casa de Sanae Dekomori.\n\nDurante a festa, Yuuta percebe que Rikka desapareceu e procura por ela. Quando ele encontra Rikka, ele percebe que ela está agindo de forma estranha e rapidamente descobre que ela e Sanae estão bêbadas! Como essa festa de Natal será para o casal?",
