              "trailer": null,
              "episodios": 1,
              "sinopse": "Embora já seja um estudante do terceiro ano do ensino médio, Rikka Takanashi continua sendo um chuunibyou - uma \"doença\" que faz as pessoas fantasiarem sobre si mesmas e ao seu redor. O relacionamento dela com Yuuta Togashi também não mudou nos últimos seis meses, e com os exames de admissão chegando, ambos se esforçam para se matricular na mesma faculdade. No entanto, Tooka - a irmã mais velha de Rikka - decide levar Rikka para a Itália, pois ela encontrou um emprego estável lá. Esta mudança imprevista de acontecimentos causa uma comoção entre o casal, pois nenhum dos dois quer se separar um do outro. Desesperados por ideias, procuram a ajuda dos amigos e, após uma breve conversa, apresentam um plano - fugir.\n\nChuunibyou demo Koi ga Shitai! Filme: Take On Meé um drama sensacional com o casal - Yuuta e Rikka - enquanto eles viajam pelo Japão. Os dois tentam impedir que Rikka seja levado para a Itália, mas será que conseguirão?",
