              "sinopse": "Ao olhar casual, o caçador de recompensas amnésico Wu Liuqi parece bastante intimidante. Com suas técnicas de tesoura telecinética mortal e sua capacidade de se transformar perfeitamente em qualquer coisa, não se esperaria seu comportamento modesto. Na verdade, Wu é péssimo em seu trabalho. Muitas vezes, o freelancer pode ser encontrado estragando um assassinato ou mirando na pessoa errada. Embora seus fracassos possam ser devidos a suas habilidades abaixo da média, geralmente se resume a ele ser uma criança normal, com um coração inadequado para sua linha de trabalho.\n\nAcompanhado por seu amigo emplumado Dai Bo, Wu está em uma busca simples para recuperar suas memórias. Embora seu trabalho diurno discreto como cabeleireiro e sua ocupação após o expediente sejam simplesmente um meio para ele pagar dívidas, seus vários empreendimentos parecem se entrelaçar com sua busca por recuperar seu passado perdido.",
