              "trailer": null,
              "episodios": 12,
              "sinopse": "A realidade virtual e a chegada da tecnologia Circlet mudaram a vida das pessoas. Um novo esporte eletrônico competitivo chamado Circlet Bout surge, e as escolas duelam para determinar o clube e o jogador Circlet Bout mais fortes. Um dia, Yuuka Sasaki é confundido com um desafiante e luta contra Chikage Fujimura, o melhor jogador do Japão, empatando a luta intensa apesar de sua inexperiência. Esses eventos levaram a sua paixão pelo esporte, decidindo se tornar uma jogadora do Circlet Bout.\n\nDois anos depois, Yuuka se muda para Tóquio e se matricula na Union School, um lugar onde ela pode praticar e perseguir seu sonho de lutar contra Chikage novamente. Após sua chegada na Union School, ela descobre que o clube fechou. Agora, seu primeiro objetivo é ajudar o atlético Miyuki Kasahara e o gerente do clube, Ayumu Aizawa, a reabrir o Union's Circle Bout Club e devolvê-lo à sua antiga glória.",
