          "items": {
            "c0055_1": {
              "id": "c0055_1",
              "foto": "https://i.imgur.com/Ncua2Vx.jpg",
              "link": "https://myanimelist.net/anime/34382/Citrus",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Durante o verão de seu primeiro ano do ensino médio, a mãe de Yuzu Aihara se casou novamente, forçando-a a se transferir para uma nova escola. Para uma socialite da moda como Yuzu, este evento inconveniente é apenas mais uma oportunidade de fazer novos amigos, se apaixonar e, finalmente, experimentar o primeiro beijo. Infelizmente, os sonhos e o estilo de Yuzu não se conformam com sua nova escola ultrastrita, só para meninas, cheia de fechadas obedientes e superprotetoras. Sua aparência espalhafatosa consegue chamar a atenção de Mei Aihara, a bela e imponente presidente do conselho estudantil, que imediatamente começa a acariciar sensualmente o corpo de Yuzu em um esforço para confiscar seu celular.\n\nCompletamente exausta desde o primeiro dia, Yuzu chega em casa e descobre uma verdade chocante - Mei é na verdade sua nova meia-irmã! Embora Yuzu inicialmente tente ser amigável com ela, a rotina fria de Mei força Yuzu a começar a provocá-la. Mas antes que Yuzu pudesse terminar sua frase, Mei a força ao chão e a beija, com Yuzu tentando desesperadamente se libertar. Uma vez feito isso, Mei sai furiosamente da sala, deixando Yuzu ponderar sobre a verdadeira natureza de seu primeiro beijo e os segredos por trás da expressão torturada nos olhos de sua nova irmã.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
