        "c0056": {
          "id": "c0056",
          "parentes": [],
          "items": {
            "c0056_1": {
              "id": "c0056_1",
              "foto": "https://pbs.twimg.com/media/EC7vYEhWkAYAiVR.jpg:large",
              "link": "https://myanimelist.net/anime/2167/Clannad",
              "trailer": null,
              "episodios": 23,
              "sinopse": "Tomoya Okazaki é um delinquente que acha a vida monótona e acredita que nunca chegará a nada. Junto com seu amigo Youhei Sunohara, ele mata a escola e planeja desperdiçar seus dias de escola secundária.\n\nUm dia, enquanto caminhava para a escola, Tomoya passa por uma jovem resmungando baixinho para si mesma. Sem aviso, ela exclama \"Anpan!\" (uma comida japonesa popular) que chama a atenção de Tomoya. Ele logo descobre que o nome da garota é Nagisa Furukawa e que ela exclama coisas de que gosta para se motivar. Nagisa afirma que eles agora são amigos, mas Tomoya vai embora passando o encontro como nada.\n\nNo entanto, Tomoya descobre que está notando Nagisa cada vez mais na escola. Eventualmente, ele concede e torna-se amigo dela. Tomoya descobre que Nagisa está retida há um ano devido a uma doença grave e que seu sonho é reviver o clube de teatro da escola. Alegando que não tem nada melhor para fazer, ele decide ajudá-la a atingir esse objetivo junto com a ajuda de outras quatro meninas.\n\nConforme Tomoya passa mais tempo com as meninas, ele aprende mais sobre elas e seus problemas. Enquanto tenta ajudar cada garota a superar seu respectivo obstáculo, ele começa a perceber que a vida não é tão monótona quanto ele pensava.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0056_2": {
              "id": "c0056_2",
              "foto": "https://1.bp.blogspot.com/-qG5vWOSNumY/XfT_qdFHpwI/AAAAAAAAAb4/PGgtRzgMvzIDzUkv2ZkWm5EeFtw74Y-OwCLcBGAsYHQ/s750/clannad%2Bs2.jpg",
              "link": "https://myanimelist.net/anime/4181/Clannad__After_Story",
              "trailer": null,
              "episodios": 24,
              "sinopse": "Clannad: After Story , a sequência da série aclamada pela crítica Clannad , começa depois que Tomoya Okazaki e Nagisa Furukawa terminam o ensino médio. Juntos, eles experimentam a montanha-russa emocional do crescimento. Incapaz de decidir sobre um rumo para seu futuro, Tomoya aprende o valor de uma forte ética de trabalho e descobre a força do apoio de Nagisa. Por meio da dedicação e da unidade de propósito do casal, eles avançam para enfrentar seus problemas pessoais, aprofundar seus antigos relacionamentos e criar novos laços.\n\nO tempo também se move no mundo ilusório. Conforme as planícies esfriam com a aproximação do inverno, a Garota Ilusória e a Boneca do Lixo se deparam com uma situação difícil que revela o verdadeiro propósito do Mundo.\n\nBaseado no romance visual de Key e produzido pela Kyoto Animation, Clannad: After Story é um drama impactante que destaca a importância da família e as lutas da vida adulta.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0056_3": {
              "id": "c0056_3",
              "foto": "https://i.pinimg.com/originals/75/94/ac/7594ac29834dd51edbc6f8026b2fff72.jpg",
              "link": "https://myanimelist.net/anime/6351/Clannad__After_Story_-_Mou_Hitotsu_no_Sekai_Kyou-hen",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Incluído no 8º e último DVD de Clannad ~ After Story ~ está um episódio extra ambientado em um universo alternativo. Aqui, Fujibayashi Kyou é a heroína principal no lugar de Furukawa Nagisa.\n\nO amor pode ser maravilhosamente excitante, mas também extremamente doloroso. Fujibayashi Ryou, irmã de Kyou, está apaixonada por Okazaki Tomoya, o protagonista masculino. Com a ajuda de Kyou, Ryou consegue reunir coragem para convidá-lo para sair e agora Tomoya e Ryou são um casal. No entanto, conforme as coisas progridem, Kyou começa a reconhecer seus sentimentos por Tomoya, e um triângulo amoroso é formado.\n\nÀ medida que tudo é revelado, as irmãs aprendem as dores do amor e tentam decidir entre os dois amores da sua vida: Tomoya, ou um ao outro.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0056_4": {
              "id": "c0056_4",
              "foto": "https://enixdvdshop.weebly.com/uploads/2/2/5/8/22583858/2203967.jpg?310",
              "link": "https://myanimelist.net/anime/4059/Clannad__Mou_Hitotsu_no_Sekai_Tomoyo-hen",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Clannad: Mou Hitotsu no Sekai, Tomoyo-hen se passa em uma realidade alternativa, onde Tomoya Okazaki namora sua jovem, Tomoyo Sakagami.\n\nTomoyo foi eleito o próximo presidente do conselho estudantil da escola. Esta é uma ótima notícia, pois agora ela pode trabalhar para atingir seu objetivo de impedir que as cerejeiras da escola sejam cortadas. Embora Tomoya esteja em êxtase por ela, dada sua reputação de delinquente na escola, seu relacionamento com Tomoyo os está tornando alvo de fofocas no campus, o que pode comprometer sua posição como presidente do conselho estudantil. A desaprovação da comunidade escolar em relação ao relacionamento se torna mais evidente quando o vice-presidente do conselho estudantil e até mesmo a administração da escola alertam Tomoya para se distanciar de Tomoyo.\n\nCom a má atmosfera ampliando o fosso entre Tomoya e Tomoyo, Tomoya sucumbirá à pressão da sociedade e fará o que eles dizem, ou o amor um pelo outro se elevará acima de tudo?",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0056_5": {
              "id": "c0056_5",
              "foto": "https://pbs.twimg.com/media/EWnEll0U0AEQMs5.jpg",
              "link": "https://myanimelist.net/anime/1723/Clannad_Movie",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Tomoya Okazaki é um delinquente cínico que não tem ambição enquanto trabalha apaticamente até o ensino médio. Durante sua infância, uma tragédia fez com que seu pai buscasse consolo no alcoolismo e negligenciasse o filho. No entanto, a interação humana significativa pode ser uma bênção, como Tomoya aprende ao conhecer a enigmática Nagisa Furukawa. A estranha garota oferece um gesto de amizade a Tomoya, mas ele rejeita o pedido, descartando-o como um incidente trivial. No entanto, quando ele logo percebe que está encontrando Nagisa cada vez com mais frequência durante a escola, Tomoya deixa de lado suas perturbações e torna-se amigo da garota.\n\nQuando ele descobre que o sonho de Nagisa é reviver o Drama Club, Tomoya decide se livrar dos prazeres comuns da vida e se dedicar a ajudar sua nova amiga a alcançar sua ambição. Mas o que começa como uma simples amizade pode progredir para algo muito mais profundo, íntimo e transformador. Enquanto a dupla enfrenta várias dificuldades e aflições, Tomoya e Nagisa gradualmente aceitam os desafios da vida.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "c0057": {
