              "foto": "https://apl-hamivideo.cdn.hinet.net/HamiVideo/getHamiVideoImg.php?deviceType=3&imageId=sourceImages@2251100657_o.jpg",
              "link": "https://myanimelist.net/anime/31157/ClassicaLoid",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Desde que seu pai usou o resto da fortuna da família e saiu da cidade, Kanae Otowa viveu na mansão ancestral de sua família, Otowakan. Sem nenhuma maneira de saldar as dívidas de seu pai, Otowakan está sendo executado e Kanae deve expulsar os residentes restantes - sua amiga Sousuke Kagura e duas pessoas estranhas que afirmam ser conhecidas de seu pai, Wolfgang Amadeus Mozart e Ludwig van Beethoven. Depois de serem ressuscitados de alguma forma, Mozart e Beethoven começaram a usar \"Motes\" e \"Beethes\" respectivamente, e começaram a se entregar a uma variedade de atividades idiotas e não musicais.\n\nEnquanto teimosamente se recusa a deixar Otowakan, Beethes desbloqueia o poder oculto de Musik, salvando Otowakan da demolição e atrasando seu despejo. Com essa descoberta, outros usuários do Musik são atraídos para Otowakan, incluindo Frédéric Chopin, Franz Liszt e Franz Schubert. No entanto, nem todos os usuários de Musik têm desejos inocentes. Do outro lado da cidade, o enigmático Johann Sebastian Bach está sentado no topo de um prédio alto, planejando como usar sua música.",
