              "foto": "https://shinigamilist.files.wordpress.com/2015/06/classroomcrisis-anime-poster.jpg",
              "link": "https://myanimelist.net/anime/30383/Classroom%E2%98%86Crisis",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Na colônia marciana Quarta Tóquio está uma sala de aula das mentes mais brilhantes da Kirishina Corporation liderando o desenvolvimento aeroespacial: A-TEC, liderada pelo engenheiro gênio Kaito Sera, antecipando ansiosamente a chegada de seu mais novo membro. Logo fica claro, entretanto, que o aluno transferido dificilmente é comum - Nagisa Kiryuu, recém-nomeado chefe da A-TEC e irmão mais novo do CEO da corporação, é enviado para encerrar o programa. Para manter a sala de aula viva, Kaito e seus alunos trabalham desesperadamente para desenvolver um sucessor para seu foguete mais poderoso, o X-2; enquanto isso, Nagisa sobe a escada corporativa em busca de sua própria missão. Apesar disso, suas batalhas separadas logo revelam que muito mais está acontecendo na Kirishina Corporation do que aparenta.\n\nSala de aula ☆ crisesegue Kaito e Nagisa, bem como a irmã mais nova de Kaito, Mizuki, e o piloto de testes da A-TEC, Iris Shirasaki, em uma história de intriga, guerra política e, contra todas as probabilidades, romance. Conforme Nagisa e A-TEC são arrastados cada vez mais para as conspirações da Kirishina Corporation, as amizades crescem e o passado é revelado enquanto eles lutam para evitar a crise em sala de aula.",
