              "episodios": 26,
              "sinopse": "Quando um demônio metamorfo com sede de carne humana, conhecido como \"youma\", chega à aldeia de Raki, uma mulher solitária com olhos prateados entra na cidade com apenas uma espada nas costas. Ela é uma \"Claymore\", um ser fabricado como meio-humano e meio-youma, com o propósito expresso de exterminar esses monstros. Depois que a família de Raki é morta, o Claymore salva sua vida, mas ele é posteriormente banido de sua casa. Sem ter para onde ir, Raki encontra a Claymore, conhecida como Clare, e decide segui-la em suas jornadas.\n\nEnquanto a dupla viaja de cidade em cidade, derrotando youma ao longo do caminho, mais sobre a organização de Clare e seus companheiros guerreiros vem à luz. Com cada cidade limpa e cada demônio destruído.",
