              "foto": "https://sp-akiba-souken.k-img.com/thumbnail/images/article/000/722/722997.jpg?w=1200&m=amp_resize",
              "link": "https://myanimelist.net/anime/32407/Clockwork_Planet",
              "trailer": null,
              "episodios": 12,
              "sinopse": "A lenda diz que quando a Terra foi destruída, o grande relojoeiro Y fez uma substituição de engrenagens e engrenagens. Naoto Miura é um jovem que aspira ser um grande relojoeiro. No entanto, apesar de seu talento único - audição sensível que pode entender imediatamente a mecânica de um relógio apenas com o ruído - ele fez pouco progresso. Mas isso muda quando um caixão cai do céu em seu apartamento, revelando RyuZU, um autômato feminino forjado pelo próprio Y.\n\nA notícia da chegada de RyuZU traz Marie Bell Breguet, a herdeira talentosa de uma linha distinta de relojoeiros, e seu guarda-costas ciborgue Vainney Halter na vida de Naoto também. Quando ela e Naoto se envolvem em uma batalha cheia de ação por suas vidas, eles descobrem uma verdade incômoda: o planeta mecânico no qual a humanidade viveu por mais de um milênio está começando a quebrar - um segredo que muitas pessoas matarão para proteger.",
