        "c0062": {
          "id": "c0062",
          "parentes": [],
          "items": {
            "c0062_1": {
              "id": "c0062_1",
              "foto": "https://img.vncdn.xyz/storage20/hh247/images/closers-side-blacklambs-f1872.jpg",
              "link": "https://myanimelist.net/anime/32152/Closers__Side_Blacklambs",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Depois que os monstros dimensionais invasores foram derrotados, Seul foi reconstruída. Esta é a história de Closers em New Seoul.\nPortões dimensionais misteriosos se abriram em todo o planeta e desencadearam uma invasão mundial de monstros dimensionais. Nenhum monstro e nenhuma tática tiveram qualquer efeito nas ondas de monstros dimensionais saindo dos portões dimensionais. Cidade após cidade foi destruída sem piedade.\n\nMas a abertura dos portões dimensionais não causou apenas danos e destruição. O poder psicocinético que despertou também permitiu que uma pequena minoria de humanos ganhasse poderes psíquicos extraordinários. Com esses guerreiros psíquicos, governos ao redor do mundo foram capazes de virar a maré da guerra contra esses monstros. Após perdas indescritíveis, o povo da terra pelo menos conseguiu fechar os portões. Uma vez que eles fecharam os portões, esses médiuns começaram a ser chamados de \"FECHADORES\", e a invasão dos monstros dimensionais foi chamada de Primeira Guerra Dimensional.\n\nCom os monstros dimensionais vencidos, a paz voltou ao mundo e as cidades foram reconstruídas. Por meio de pesquisas dedicadas sobre os portões dimensionais e o poder psicocinético, os humanos aprenderam que os portões se abrem quando há uma singularidade neste poder misterioso. No entanto, sua compreensão dos portões ainda estava incompleta. Os CLOSERS que sobreviveram à Primeira Guerra Dimensional tornaram-se parte de uma organização chamada UNION. Juntos, eles pesquisaram o poder psicocinético em todo o mundo, trabalhando para prevenir outra guerra dimensional.\n\nE foi então que os portões dimensionais em todo o mundo começaram a tremer novamente - enquanto criaturas exangues cada vez mais fortes renovavam o ataque à Terra.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "c0063": {
          "id": "c0063",
          "parentes": [],
          "items": {
            "c0063_1": {
              "id": "c0063_1",
              "foto": "https://cdn.myanimelist.net/images/anime/1980/103243l.jpg",
              "link": "https://myanimelist.net/anime/69/Cluster_Edge",
              "trailer": null,
              "episodios": 25,
              "sinopse": "A Cluster Edge Academy não é qualquer escola; é A escola, onde os descendentes da elite se reúnem para se preparar para seus papéis em um mundo onde soldados artificiais e seitas religiosas são os principais fatores na batalha pelo controle total. O que pode ser parte do motivo pelo qual a nova estudante transferida Ágata Fluorita não parece se encaixar. Não é apenas que a atitude entusiástica de Ágata se destaca entre o equilíbrio sombrio e taciturno do corpo discente. Há algo nele que exige atenção, mesmo de alunos de honras cansados ​​como Beryl Jasper, e desde o momento de sua chegada ele está no centro de uma série de mistérios que nem mesmo Agate entende. Porque Agate não é apenas mais um aluno, ele é parte de algo tão importante e perigoso,",
              "maturidade": null,
