              "sinopse": "A Arca da Frota foi destruída, e um número significativo de tropas inimigas foi exterminada devido ao seu pouso forçado. Enquanto as forças restantes dos Cavaleiros de São Miguel se reagrupam para lançar um ataque final ao Castelo Weisswolf, os W-0, junto com seu novo aliado Ashley Ashra, estão prontos para interceptá-los.\n\nEnquanto isso, com seu Geass fora de controle, Shin se move para apagar a existência de seu irmão mais novo de uma vez por todas. Mas Akito, tendo prometido a Leila que ele voltaria vivo, se recusa a aceitar tal destino, e os dois se enfrentam em sua batalha final.",
