              "foto": "https://www.kinopoisk.ru/im/poster/3/3/5/kinopoisk.ru-Code-Geass_3A-Fukkatsu-no-Lelouch-3354312--o--.jpg",
              "link": "https://myanimelist.net/anime/34437/Code_Geass__Fukkatsu_no_Lelouch",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Desde a morte do homem que se acredita ser o mais perverso imperador da Britannia, há um ano, o mundo tem desfrutado de uma paz sem precedentes sob a orientação da Federação das Nações Unidas. No entanto, essa frágil calma é quebrada quando militantes armados sequestram com sucesso a ex-princesa Nunnally vi Britannia e Suzaku Kururugi, o conselheiro chefe dos Cavaleiros Negros, desencadeando uma crise internacional.\n\nO poderoso e pouco confiável Reino do Zilkhstan é acusado de orquestrar sua captura. Para investigar, as autoridades mundiais enviam Kallen Stadtfeld e seus associados em uma operação secreta no país. Lá, eles encontram a bruxa imortal CC, que está em uma missão para completar a ressurreição do homem responsável pela maior revolução da história - uma lenda que se levantará, assumirá o comando e salvará o mundo do perigo mais uma vez.",
