            "c0066_12": {
              "id": "c0066_12",
              "foto": "https://pisces.bbystatic.com/image2/BestBuy_US/images/products/3196/31963318_so.jpg",
              "link": "https://myanimelist.net/anime/1575/Code_Geass__Hangyaku_no_Lelouch",
              "trailer": null,
              "episodios": 25,
              "sinopse": "No ano de 2010, o Sacro Império da Britânia se firma como nação militar dominante, começando com a conquista do Japão. Renomeado para Área 11 após sua rápida derrota, o Japão viu uma resistência significativa contra esses tiranos na tentativa de recuperar a independência.\n\nLelouch Lamperouge, um estudante britânico, infelizmente se encontra em um fogo cruzado entre o britânico e as forças armadas rebeldes da Área 11. Ele consegue escapar, no entanto, graças ao aparecimento oportuno de uma garota misteriosa chamada CC, que concede a ele Geass, o \"Poder dos Reis\". Percebendo o vasto potencial de seu novo \"poder de obediência absoluta\", Lelouch embarca em uma jornada perigosa como o vigilante mascarado conhecido como Zero, liderando um ataque impiedoso contra Britannia para se vingar de uma vez por todas.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0066_13": {
              "id": "c0066_13",
              "foto": "https://snitt.hu/system/covers/big/covers_81765.jpg?1597403195",
              "link": "https://myanimelist.net/anime/8728/Code_Geass__Hangyaku_no_Lelouch_-_Kiseki_no_Birthday",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Em um dia animado de dezembro na Ashford Academy, os alunos estão se preparando alegremente para o festival escolar de amanhã. No entanto, as comemorações foram interrompidas abruptamente quando terroristas atacaram a academia. Os alunos são feitos reféns e colocados sob bloqueio enquanto os remanescentes militantes da Federação Neo-Chinesa assumem o controle da escola.\n\nMal sabem os agressores que entre o corpo estudantil estão aqueles com poderes extraordinários, incluindo Lelouch Lamperouge, que empunha o Geass, e o soldado britânico Suzaku Kururugi. Para proteger sua escola e restaurar a paz, Lelouch e o conselho estudantil devem se unir novamente para realizar um último milagre.",
              "maturidade": null,
