              "sinopse": "Do Code Geass: Lelouch of the Rebellion - Kiseki no DVD/Blu-ray de aniversário . É diferente dos 9 especiais Omake Flash incluídos no DVD / Blu-ray do Code Geass R2.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0066_15": {
              "id": "c0066_15",
              "foto": "https://2.bp.blogspot.com/-AZMJzBUafL4/WKnGtKTz97I/AAAAAAAAADs/w-yyIDgzALYe2cCpjuiEuvUV9ptKRw5swCLcB/s1600/nunnally-in-wonderland-code-geass.jpg",
              "link": "https://myanimelist.net/anime/12685/Code_Geass__Hangyaku_no_Lelouch_-_Nunnally_in_Wonderland",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Em um dia claro e tranquilo, os irmãos Nunnally e Lelouch Lamperouge reservam um momento para relaxar sob uma árvore. Quando Nunnally lhe pede para contar uma história, Lelouch, que está firmemente decidido a fazer o máximo por sua irmã, faz uso único de sua habilidade de Geass, quebrando barreiras para contar a história mais divertida que pode.\n\nDespertando sozinha sob a árvore, a anteriormente cega Nunnally descobre que pode ver novamente e imediatamente avista um estranho coelho que se assemelha a Anya Alstreim, o Cavaleiro dos Seis. A visão desse coelho faz com que Nunnally caia em um buraco, levando-a a um colorido país das maravilhas. Narrado pelo próprio Lelouch, Code Geass: Hangyaku no Lelouch - Nunnally no País das Maravilhassegue o perdido Nunnally enquanto ela procura um caminho de volta para casa, encontrando uma série de personagens coloridos e familiares ao longo do caminho.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0066_16": {
              "id": "c0066_16",
              "foto": "https://dengeki-plus-fenix.top/wp-content/uploads/2019/02/689cd013cd8c5f7820b4e410c80042b0.jpg",
              "link": "https://myanimelist.net/anime/34438/Code_Geass__Hangyaku_no_Lelouch_I_-_Koudou",
              "trailer": null,
              "episodios": 1,
              "sinopse": "O Sagrado Império Britannian é uma nação poderosa que usa sua força militar para expandir seu domínio, e a pequena nação insular do Japão é mais uma vítima. Durante um conflito mundial em 2010 conhecido como a Segunda Guerra do Pacífico, o outrora orgulhoso país foi reduzido a escombros e zombeteiramente renomeado para Área 11.\n\nNo entanto, um estudante planeja libertar o Japão do controle da Britannia por meio de uma rebelião extraordinária. Seu nome é Lelouch Lamperouge, e ele é alimentado com ódio pelo Império, conspirando para apagar seu nome amaldiçoado da face do planeta. Os planos maliciosos de Lelouch são inesperadamente acelerados ao conhecer a misteriosa mulher CC, que concede a ele uma habilidade sobrenatural conhecida como \"Geass\" que torna qualquer comando de Lelouch incapaz de desafiar sua vontade.\n\nAgora armado com um poder devastador, Lelouch assume a persona de Zero, uma figura revolucionária que carrega as esperanças e sonhos dos oprimidos ao redor do mundo. Ele jura restaurar a gloriosa nação do Japão e entregar a retribuição divina à Britânia.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0066_17": {
              "id": "c0066_17",
              "foto": "https://dengeki-plus-fenix.top/wp-content/uploads/2019/08/tumblr_inline_p0nlvyBvp51tgfdew_1280_waifu2x_art_noise0_scale_tta_1.png",
              "link": "https://myanimelist.net/anime/34439/Code_Geass__Hangyaku_no_Lelouch_II_-_Handou",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Tendo alcançado vitórias milagrosas em uma série de batalhas contra o Exército Britannian, Lelouch Lamperouge trouxe os Cavaleiros Negros, sua organização paramilitar, a um estado mais poderoso do que nunca. Nada parece impossível para ele quando utiliza sua força militar, intelecto e poder de obediência absoluta de Geass.\n\nNo entanto, os obstáculos em face da revolta nunca cessam, colocando Lelouch em uma situação difícil. Mais preocupante, as proezas de combate de Suzaku Kururugi e o aparecimento de uma criança misteriosa chamada VV ameaçam colocar um fim à grande rebelião de Lelouch.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0066_18": {
              "id": "c0066_18",
              "foto": "https://www.animeler.net/upload/media/entries/2018-10/09/3741-11-65b799fa83662c037170afd8f5f17c37.jpg",
              "link": "https://myanimelist.net/anime/34440/Code_Geass__Hangyaku_no_Lelouch_III_-_Oudou",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Os sonhos de Lelouch Lamperouge de destruir o Sagrado Império Britannian estão se desintegrando lentamente. Sua irmã, Nunnally, foi sequestrada por Schneizel el Britannia, e Suzaku Kururugi está ignorando seus apelos desesperados por ajuda. Os Cavaleiros Negros estão lentamente perdendo a fé em Lelouch como seu líder, e a Federação das Nações Unidas declarou guerra global à Britannia.\n\nTendo sofrido inúmeras traições, uma perda significativa de poder e um ressentimento cada vez maior em relação ao Imperador Charles zi Britannia, o aleijado Lelouch toma uma decisão final: se ele não pode destruir o Império de fora, ele o tomará para si mesmo dentro.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "c0066_19": {
              "id": "c0066_19",
              "foto": "https://img-cdn.jg.jugem.jp/7f7/1348130/20090818_905292.jpg",
              "link": "https://myanimelist.net/anime/1953/Code_Geass__Hangyaku_no_Lelouch_Picture_Drama",
              "trailer": null,
              "episodios": 9,
              "sinopse": "Na Ashford Academy, as garotas começam a conversar no banho e, mais tarde, planejam um festival de inversão de papéis de gênero, que deixa todos ansiosos, exceto Lelouch Lamperouge. Os alunos também participaram da grande inauguração da piscina Clovis Land, para grande constrangimento da escassamente vestida Cornelia li Britannia. Eventos do passado de Lelouch mostram um capítulo de sua educação real e como ele conheceu Suzaku Kururugi. Code Geass: Hangyaku no Lelouch Picture Drama mostra que, quando estão longe do derramamento de sangue e da agonia da guerra, os personagens vivem vidas muito diferentes e muitas vezes bem-humoradas.",
              "maturidade": null,
              "pontosBase": 0.0
            },
