              "episodios": 12,
              "sinopse": "Kaoruko \"Chaos\" Moeta é uma jovem artista de mangá que está sem sorte. Ela quer desenhar mangás sobre garotas do ensino médio, mas seus storyboards são insossos, sua arte pouco inspirada e suas premissas são fracas. Seu editor preocupado e exasperado surge com uma ideia: pressione Chaos para ser mais social. Então, por recomendação dela, Chaos se muda para um dormitório para mulheres artistas de mangá. Ela logo conhece os outros residentes: Tsubasa Katsuki, uma artista de mangá shounen; Ruki Irokawa, que desenha mangás eróticos populares entre as mulheres; e Koyume Koizuka, um artista shoujo que, como Chaos, ainda não foi serializado. Fazendo amizade rapidamente com essas garotas, Chaos encontra uma nova inspiração para seu mangá e continua a aumentar sua criatividade.\n\nComic Girlsé uma vitrine do cotidiano desses artistas de mangá. Será que Chaos finalmente será capaz de fazer sua estréia e se tornar serializada? Nenhuma das garotas sabe, mas todas farão o possível para ajudar umas às outras a se tornarem as melhores artistas que podem ser.",
