              "episodios": 13,
              "sinopse": "Em um dia ensolarado de julho do 41º ano da Era Shinka, Jirou Hitoyoshi é encarregado de ouvir secretamente um encontro secreto entre um importante cientista do governo e um espião industrial. No entanto, seu disfarce é descoberto e o espião se revela um alienígena disfarçado. Em meio ao caos que se seguiu, Jirou alista a ajuda da garçonete do café e garota mágica Kikko Hoshino, um dos muitos \"super-humanos\" que se misturam à sociedade e secretamente protegem a humanidade de ameaças extraterrestres. Como membro da agência governamental conhecida como Laboratório de Pesquisa da Super População, Jirou tem a dupla tarefa de proteger os super-humanos que defendem a humanidade e eliminar qualquer um considerado perigoso demais para viver. Tendo provado ser uma aliada digna, Kikko é convidada a ingressar na agência como sua mais nova recruta.\n\nAvancemos cinco anos: desaprovação e aversão pelos super-humanos agora são comuns em Tóquio. Da corrupção governamental e ideias conflitantes de justiça à moralidade dos direitos sobre-humanos, o relacionamento entre os humanos e a minoria sobrenatural se equilibra precariamente em um mundo permeado por sussurros de inquietação e inquietação. Em circunstâncias misteriosas, Jirou traiu a agência e agora é um fugitivo em fuga. Enquanto ele se esgueira pelas ruelas chuvosas de Shinjuku, ele é perseguido pelos mesmos super-humanos que ele mesmo recrutou.",
