              "sinopse": "Quinze anos atrás, um portal do hiperespaço apareceu no meio do Oceano Pacífico, conectando a Terra a um mundo estranho cheio de fadas e monstros. A cidade de San-Teresa tornou-se o lar de mais de dois milhões desses visitantes de outro mundo. Infelizmente, o boom populacional também trouxe sua cota justa de problemas - drogas, prostituição e tráfico. Para combater o crime desenfreado que espreita nas sombras da cidade, um novo departamento foi estabelecido na Polícia Metropolitana de San-Teresa.\n\nO ex-soldado da JSDF, Kei Matoba, é um dos melhores policiais que o departamento tem a oferecer, apesar de sua inclinação para quebrar as regras ocasionalmente. Depois que um caso de tráfico de fadas dá errado, Kei perde Rick Fury, seu amigo e parceiro de quatro anos, colocando-o em uma busca por vingança. Para ajudá-lo com o caso, o departamento o junta com Tilarna Exedilika, uma nobre do Reino Farbani. Como um dos Cavaleiros de Mirvor, seu dever é resgatar a nobre fada que Kei encontrou durante seu último caso. Apesar de sua aversão por não-humanos, ele aceita o arranjo a pedido de seus superiores. Agora, a improvável dupla deve se unir e superar suas diferenças para devolver a fada desaparecida ao seu país e vingar a morte do parceiro de Kei.",
