              "trailer": null,
              "episodios": 25,
              "sinopse": "Angelise Ikaruga Misurugi é a primeira princesa do nobre Império Misurugi. O reino viu grande poder e prosperidade devido ao avanço da tecnologia revolucionária conhecida como \"Mana\", uma curva abstrata de luz que reduziu os problemas mundiais de guerra e poluição a uma paz atemporal.\n\nNo entanto, nem todos são abençoados com a capacidade de empunhar Mana. Aqueles que não podem são rotulados de \"Norma\", párias da sociedade que são considerados uma ameaça à civilização e vivem sob constante perseguição, e a própria Angelise é uma das muitas que querem que a Norma seja exterminada. Mas quando o décimo sexto aniversário de Angelise começa, é descoberto em uma revelação chocante que ela é na verdade uma Norma. O caos se instala, o público fica indignado e a outrora adorada princesa é exilada em Arzenal: uma remota base militar onde Normas é forçado a se alistar.\n\nAgora, o ex-membro da realeza deve se adaptar a um estilo de vida severo e totalmente diferente; pilotar robôs mecânicos conhecidos como \"Paramail\" para afastar feras grandes e devastadoras conhecidas como DRAGÕES. No entanto, uma verdade sinistra sobre essas criaturas selvagens ameaça mudar tudo.",
              "maturidade": null,
