              "sinopse": "Kou Kitamura e Aoba Tsukishima costumam estar em desacordo - embora suas famílias sejam amigos íntimos e parceiros de negócios. Embora filho único do proprietário de uma loja de esportes, Kou nunca se interessou em jogar beisebol. Apesar disso, ele possui uma capacidade de rebatidas impressionante aprimorada por visitas frequentes ao centro de rebatidas de beisebol local administrado pela família Tsukushima. Por outro lado, Aoba adora jogar beisebol e é um craque com uma forma excepcional de arremessar.\n\nNo entanto, esses dois opostos aparentemente completos compartilham algo muito importante para eles - Wakaba Tsukishima, a irmã mais velha de Aoba e namorada de Kou. Admirada pela dupla briguenta, Wakaba muitas vezes se vê como o catalisador de sua rivalidade sem fim. Mas quer percebam ou não que têm mais em comum do que qualquer um deles gostaria de admitir, só o tempo dirá. O jogo de beisebol pode ser apenas o que a dupla precisa para superar suas próprias lutas pessoais.",
