              "sinopse": "Em um mundo onde quimeras meio-humanas, meio-animais vivem e trabalham ao lado de pessoas normais, certamente haverá algumas maçãs podres no grupo. Infelizmente, criminosos meio humanos significam pistas não humanas que geralmente deixam a polícia perplexa. É aí que entram os detetives lobos solitários, como Hiroshi Inaba. Ele é literalmente parte lobo e tem a incrível capacidade de extrair informações críticas apenas examinando ou experimentando uma amostra do cabelo de alguém! Claro, essa habilidade também resultou em Inaba tendo um pouco de um fetiche por cabelo, mas isso não parece ser um problema para seus dois assistentes. (Bem, pelo menos o travesti não está reclamando muito.) E não é nada comparado aos gostos estranhos do nêmesis de Inaba, o onívoro (e meio bode) chefe do crime Don Valentino, quem tem apetite para com curso legal verde em vez de tenros verdes jovens! Inaba jurou tirar Valentino do rebanho criminoso antes que Don Corleone pudesse engolir mais massa mal obtida, mas terá que mastigar um monte de evidências para conseguir sua cabra. Pode o trabalho obstinado de detetive colocar os baaaaad atrás das grades?",
