              "trailer": null,
              "episodios": 25,
              "sinopse": "Um dia, Honey Kisaragi é uma colegial católica que está na moda e corta aulas. No próximo, seu pai foi assassinado por divas demoníacas de uma organização covarde chamada Panther Claw. Quando sua mensagem final revela que ela é um andróide, Honey usa o poder transformador do Solidificador do Elemento Atmosférico - a mesma coisa que Garra de Pantera queria roubar - para buscar vingança contra o clã sombrio. Será que Honey consegue lutar para subir na classificação de Garra de Pantera para derrotar sua líder, a sinistra Irmã Jill, enquanto consegue escapar dos olhos vigilantes de Miss Histler, a diretora de sua escola?\n\nCom a ajuda do jornalista Hayami Seiji, de seu pai ninja e de seu irmão apaixonado pela escola primária, Honey às vezes aparece como uma piloto de corrida, às vezes como uma modelo glamorosa e às vezes como uma pedinte, mas sua verdadeira identidade não é outra senão a guerreira de amor, fofinho querida!",
