              "trailer": null,
              "episodios": 3,
              "sinopse": "Uma misteriosa organização conhecida como Panther Claw tornou sua presença conhecida aterrorizando Tóquio e fazendo com que os policiais fugissem por seu dinheiro. A polícia fica ainda mais perplexa com o aparecimento de um vigilante cosplayer solitário que frustra todos os esquemas malignos de Panther Claw antes de desaparecer. Esse cosplayer é Honey Kisaragi, o resultado do experimento premiado do falecido Professor Kisaragi. Um mestre do disfarce, Honey pode alterar magicamente sua aparência física e roupas. Mas, com um toque do botão em forma de coração em sua gargantilha, ela se transforma em Cutie Honey, a guerreira do amor e da justiça com pouca roupa e espada.",
