              "foto": "https://i.pinimg.com/originals/b0/92/72/b09272a196830310636522ea19ce434d.jpg",
              "link": "https://myanimelist.net/anime/32189/Danganronpa_3__The_End_of_Kibougamine_Gakuen_-_Mirai-hen",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Depois que Makoto Naegi e seus companheiros sobreviventes escaparam da Hope's Peak Academy para o mundo além, eles logo se juntaram à Future Foundation, uma organização dedicada a combater o desespero. Quando tudo parecia estar melhorando, Naegi é preso e julgado por traição por defender um grupo malicioso de Remnants of Despair. Diante de todos os executivos da Future Foundation, ele se encontra, junto com Kyouko Kirigiri e Aoi Asahina, enfrentando um destino desconhecido.\n\nO problema em questão só aumenta quando a segurança supostamente impenetrável da organização é invadida por um\nrosto familiar: Monokuma. Para o horror de Naegi, o urso mecânico anuncia imediatamente o início de um novo jogo de matar, pois momentos depois, a primeira vítima aparece como um sinal de desespero para retomar sua conquista brutal.\n\nNa conclusão Danganronpa emocionante conto 's de esperança e desespero, Naegi, a Escola de nível Sorte Student Super alta, deve voltar a desvendar o mistério como seus colegas e amigos começam a cair em torno dele. No entanto, não há mais testes de classe; entre os 16 participantes desesperados, há apenas um assassino - e sua morte significa o fim deste jogo infernal.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0020_4": {
              "id": "d0020_4",
              "foto": "https://anidlencodes.xyz/wp-content/uploads/2020/04/Super-Danganronpa-2.5.jpg",
              "link": "https://myanimelist.net/anime/34152/Super_Danganronpa_25__Komaeda_Nagito_to_Sekai_no_Hakaimono",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Na Hope's Peak Academy, uma escola cheia de indivíduos extraordinariamente talentosos, Nagito Komaeda é um garoto comum sem características especiais ou habilidades interessantes para falar - exceto por sua incrível azar. O simples fato de caminhar para a escola pela manhã leva a uma série de acidentes infelizes, que só aumentam com o passar do dia. Apesar disso, Komaeda leva uma vida relativamente normal e está satisfeito com sua modesta fatia de felicidade.\n\nMas tudo muda quando um menino misterioso que se declara o \"Destruidor do Mundo\" chega para destruir este paraíso sem esperança.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0020_5": {
              "id": "d0020_5",
              "foto": "https://darckness68.files.wordpress.com/2019/04/danganronpa_3_858923.jpg",
              "link": "https://myanimelist.net/anime/33028/Danganronpa_3__The_End_of_Kibougamine_Gakuen_-_Zetsubou-hen",
              "trailer": null,
              "episodios": 11,
              "sinopse": "A turma não convencional 77-B da Hope's Peak Academy está prestes a ter uma adição ainda mais excêntrica: Chisa Yukizome, uma ex-aluna com o título de Governanta de Nível Super High School - e sua nova professora de sala de aula. Alegre, apaixonada e capaz, Chisa começa imediatamente a corrigir o comportamento problemático dos alunos e fortalecer seus relacionamentos. Pode não ser fácil lidar com alunos diversos, desde princesas e enfermeiras até yakuza e alunos incrivelmente sortudos, mas tudo é possível com o poder da esperança.\n\nEnquanto isso, Hajime Hinata, um menino comum do Curso de Reserva da escola, anseia por um talento. Um dia, ele tem um encontro inesperado com o jogador Super High School da classe 77-B, Chiaki Nanami, que apresenta a ele uma visão nova e cheia de esperança da vida. No entanto, sem o seu conhecimento, o escalão superior da escola está prestes a executar um projeto sinistro centrado em Hajime que colocará Hope's Peak - e o resto do mundo - de joelhos.\n\nZetsubou-hen narra a vida diária realizada na academia de cultivo de talentos e a escuridão que se esconde por baixo. À medida que o desespero infecta lentamente a esperança, planos são colocados em movimento para iniciar o Evento Maior, Mais Terrível e Mais Trágico da História Humana, e o fim começa.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0020_6": {
              "id": "d0020_6",
              "foto": "https://pbs.twimg.com/media/Eg7ztM6X0AIUEPJ.jpg",
              "link": "https://myanimelist.net/anime/34103/Danganronpa_3__The_End_of_Kibougamine_Gakuen_-_Kibou-hen",
              "trailer": null,
              "episodios": 1,
              "sinopse": "A Future Foundation está em frangalhos após o Final Killing Game e a revelação do verdadeiro culpado. Enquanto uma conspiração desesperada surge de um dos sobreviventes para livrar o mundo do desespero de uma vez por todas, os membros restantes da Future Foundation devem se unir para impedir que essa atrocidade aconteça. Felizmente, eles se encontram com a ajuda de um grupo de aliados improváveis ​​enquanto correm contra o relógio para impedir que seu mundo seja mudado.\n\nNeste final do enredo de Hope's Peak da série Danganronpa , os jogadores neste jogo de morte sem fim começam a entender o verdadeiro significado por trás do desespero, esperança e expiação.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "d0021": {
