              "foto": "https://pbs.twimg.com/media/DM99QyUVoAAejdp.jpg:large",
              "link": "https://myanimelist.net/anime/26349/Danna_ga_Nani_wo_Itteiru_ka_Wakaranai_Ken",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Embora eles não pudessem ser mais diferentes, o amor floresceu entre Hajime Tsunashi, um otaku hardcore que se fecha em casa enquanto ganha a vida com seu blog, e sua esposa Kaoru, uma trabalhadora trabalhadora que, em contraste, é bastante comum, embora um tanto bêbado louco. Como esse casal improvável descobre, o amor é muito mais do que apenas um primeiro beijo ou um casamento; os anos que se seguem na jornada do casamento trazem consigo muitas alegrias e também desafios.\n\nSeja devido às suas personalidades peculiares ou às pessoas peculiares que os cercam, Hajime e Kaoru se vêem presos em uma variedade de travessuras ridículas e desconcertantes. Mas, apesar das lutas que enfrentam, o amor que os une os estimula a seguir em frente e se esforçar para se tornarem pessoas melhores, a fim de trazer felicidade ao seu parceiro.",
