              "trailer": null,
              "episodios": 13,
              "sinopse": "O casal Tsunashi está tão animado e excêntrico como sempre. Os otakus hardcore confinados em Hajime e a workaholic office lady Kaoru ainda se metem em situações hilariantes, graças às suas próprias naturezas excêntricas e ao bizarro grupo de amigos que os rodeia.\n\nDepois de saber sobre a gravidez de Kaoru, Hajime se esforça mais do que nunca para se tornar um bom marido e um pai digno. Enquanto isso, Kaoru reflete sobre seu relacionamento e se lembra de todas as provações e tribulações que os aproximaram. Os dois continuam a dar o melhor de si na vida e no casamento - tudo em prol de um amor duradouro e altruísta.",
              "maturidade": null,
