          "items": {
            "d0022_1": {
              "id": "d0022_1",
              "foto": "https://image.tmdb.org/t/p/w1280/aJIQ63qHGlb1iuUhLWUrwpkgoyY.jpg",
              "link": "https://myanimelist.net/anime/16355/Dansai_Bunri_no_Crime_Edge",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Kiri Haimura tem uma obsessão por cabelos bonitos - especificamente, cortá-los. Esse traço bizarro é o que o leva a procurar um suposto fantasma de cabelos compridos que vive em uma casa abandonada em uma colina. No entanto, ele não encontra um fantasma, mas uma linda garota com cabelos longos e soltos chamada Iwai Mushanokouji, a \"Rainha do Cabelo\", cujo cabelo não pode ser cortado devido a uma maldição familiar.\n\nIwai explica que há um jogo de morte em torno dela, e que se ela for morta por um objeto amaldiçoado, apropriadamente chamado de \"Killing Good\", o usuário terá seu desejo realizado. Depois de proteger Iwai de \"Autores\" - usuários de Killing Goods - ele descobre que na verdade existe um Killing Good transmitido por sua própria família: uma tesoura usada por seu ancestral para cometer assassinatos. Chamando a tesoura de \"The Severing Crime Edge\", ele descobre que é capaz de cortar o cabelo amaldiçoado de Iwai com elas, deixando-a livre para viver uma vida normal. No entanto, muitos autores buscam matar a Rainha do Cabelo, e Kiri terá que protegê-la neste jogo letal do destino.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "d0023": {
