              "trailer": null,
              "episodios": 12,
              "sinopse": "Vagando pelos corredores da Sanada North High School, exclusivamente para meninos, estão três camaradas próximos: o excêntrico líder com uma imaginação hiperativa Hidenori, o apaixonado Yoshitake e o racional e prudente Tadakuni. Suas vidas estão cheias de robôs gigantes, amor verdadeiro e drama intenso ... em sua imaginação colorida, pelo menos. Na verdade, eles são apenas um trio comum de caras comuns tentando passar o tempo, mas quem disse que a vida cotidiana não poderia ser interessante? Quer se trate de uma intrincada reconstituição de RPG ou um encontro romântico inesperado na margem do rio ao pôr do sol, Danshi Koukousei no Nichijou está repleto de situações bizarras, mas hilariamente relacionáveis, que são tudo menos mundanas.",
