              "sinopse": "O mangá original de comédia de humor segue a vida cotidiana humorística, porém \"realista\" de Tadakuni, Hidenori, Yoshitake e outros alunos de uma escola secundária para meninos.\n\nEsta entrada se refere aos episódios não exibidos lançados em DVDs e BDs. Os especiais pré-transmissão foram todos incluídos na série de TV e não estão listados separadamente no MAL.\n\nEpisódio 1: High School Boys and Ideals\nEpisódio 2: High School Boys and Loneliness\nEpisódio 3: High School Boys and Zippers\nEpisódio 4: High School Boys and Tricks\nEpisódio 5: High School Boys and Hiccups\nEpisódio 6: High School Boys and Consideration",
