              "link": "https://myanimelist.net/anime/8915/Dantalian_no_Shoka",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Seis meses atrás, Lord Hugh Anthony Disward, também conhecido como Huey, perdeu seu avô excêntrico, Sir Wesley Disward, que era um renomado colecionador de livros raros. O testamento de seu avô afirma que, para herdar seu feudo e tudo que está dentro dele, ele deve assumir a tutela da Bibliotheca Mystica de Dantalian - um arquivo que contém conhecimentos proibidos - e também cuidar de uma misteriosa garota chamada Dalian.\n\nQuando Huey se instala na mansão, um velho rival de seu avô arranja um encontro com ele. Dalian, sabendo que o rival é o assassino de Wesley, vai junto e descobre que o assassino está de posse de um Livro Fantasma - um livro amaldiçoado que Wesley tentou selar. Quando o livro coloca os dois em perigo, Huey descobre que a Bibliotheca Mystica de Dantalian e Dalian são a mesma coisa, e ela confia a Huey a chave para desbloquear o conhecimento armazenado dentro dela. Juntos, Dalian e Huey selam o livro e, assim, começam uma parceria improvável enquanto resolvem mistérios causados ​​por outros Livros Fantasmas.",
