        "d0025": {
          "id": "d0025",
          "parentes": [],
          "items": {
            "d0025_1": {
              "id": "d0025_1",
              "foto": "https://n.sinaimg.cn/ent/transform/w950h1342/20180116/Lgel-fyqrewi5491696.jpg",
              "link": "https://myanimelist.net/anime/35849/Darling_in_the_FranXX",
              "trailer": null,
              "episodios": 24,
              "sinopse": "Em um futuro distante, a humanidade foi levada à quase extinção por bestas gigantes conhecidas como Klaxosaurs, forçando os humanos sobreviventes a se refugiarem em enormes cidades fortificadas chamadas Plantations. As crianças criadas aqui são treinadas para pilotar mechas gigantes conhecidas como FranXX - as únicas armas conhecidas por serem eficazes contra os Klaxosaurs - em pares de menino e menina. Criadas com o único propósito de pilotar essas máquinas, essas crianças não sabem nada do mundo exterior e só podem provar sua existência defendendo sua raça.\n\nHiro, um aspirante a piloto da FranXX, perdeu a motivação e a autoconfiança após ser reprovado em um teste de aptidão. Pulando a cerimônia de formatura de sua classe, Hiro se retira para um lago na floresta, onde encontra uma garota misteriosa com dois chifres crescendo em sua cabeça. Ela se apresenta com seu codinome Zero Two, que é conhecido por pertencer a um infame piloto da FranXX conhecido como \"Partner Killer\". Antes que Hiro pudesse digerir o encontro, a plantação é abalada por um ataque súbito de um Klaxosaur. Zero Two envolve a criatura em sua FranXX, mas ela é fortemente danificada na batalha e cai perto de Hiro. Encontrando seu parceiro morto, Zero Two convida Hiro para pilotar o mecha com ela, e a dupla derrota facilmente o Klaxosaur na luta que se seguiu. Com um novo parceiro ao seu lado, Hiro teve a chance de redenção por seus erros do passado.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "d0026": {
          "id": "d0026",
          "parentes": [],
          "items": {
            "d0026_1": {
              "id": "d0026_1",
              "foto": "https://i.pinimg.com/originals/72/d2/a0/72d2a02d7d194cbdd53f11465525743d.jpg",
              "link": "https://myanimelist.net/anime/2025/Darker_than_Black__Kuro_no_Keiyakusha",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Já se passaram 10 anos desde que Heaven's Gate apareceu na América do Sul e Hell's Gate apareceu no Japão, velando o céu noturno antes familiar com uma paisagem opressiva do céu. Com seus propósitos desconhecidos, esses portões são espaços nos quais as próprias leis da física são ignoradas. Com o aparecimento dos Portões, surgiram os Empreiteiros, que, em troca de sua humanidade, recebem habilidades sobrenaturais.\n\nNa cidade japonesa ao redor de Hell's Gate, a Chefe da Seção 4 Misaki Kirihara se encontra em conflito com um infame empreiteiro de codinome Hei. Chamado de \"Black Reaper\" no mundo underground, Hei, como seus associados, empreende missões para o misterioso e implacável Syndicate enquanto lentamente descasca as camadas escuras que cobrem uma trama nefasta que ameaça a própria existência de Empreiteiros.\n\nDa mente de Tensai Okamura vem um thriller de ficção científica que assume a forma de uma exposição sutil sobre uma guerra na qual as posições políticas e a justiça não têm influência - uma guerra travada exclusivamente nas sombras.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0026_2": {
              "id": "d0026_2",
              "foto": "https://pic4.zhimg.com/50/b1faa758016288c50957f284cc60b837_hd.jpg?source=1940ef5c",
              "link": "https://myanimelist.net/anime/6573/Darker_than_Black__Ryuusei_no_Gemini",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Uma noite, enquanto meteoros cruzam o céu estrelado, Shion Pavlichenko se torna um empreiteiro. Apesar da transformação de seu irmão, a irmã gêmea de Shion, Suou, continua a viver uma vida bastante normal, frequentando o ensino médio com seus amigos e sendo apanhada na estranheza de crescer. No entanto, tudo muda quando sua casa é invadida por um homem mascarado vestido de preto, destruindo qualquer senso de normalidade que ela já teve. Revelada a possuir suas próprias habilidades latentes de Contratante, Suou fica presa entre a família, amigos e seu próprio senso de propósito enquanto se aventura no mundo implacável de assassinos e espionagem que os Contratantes chamam de lar.\n\nEnquanto isso, em Tóquio, a investigação em torno do colapso repentino de Hell's Gate está em andamento, e os sinais proféticos da desgraça apontam na direção de uma boneca de cabelos prateados.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0026_3": {
              "id": "d0026_3",
              "foto": "https://st-listas.20minutos.es/images/2016-06/412219/5000738_640px.jpg?1466837800",
              "link": "https://myanimelist.net/anime/4182/Darker_than_Black__Kuro_no_Keiyakusha_-_Sakura_no_Hana_no_Mankai_no_Shita",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Uma história paralela de Darker than Black , também chamada de Episódio 26, que se passa durante os eventos de Kuro no Keiyakusha .\n\nO Syndicate tem outro trabalho para Hei e sua equipe. Esta atribuição envolve os pertences de um empreiteiro morto, que se acredita ter sido enterrado sob uma cerejeira. Enquanto isso, Misaki Kirihara e sua equipe planejam uma viagem para o festival Cherry Blossom.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0026_4": {
              "id": "d0026_4",
              "foto": "https://d.wattpad.com/story_parts/747220347/images/15a9a83e280c1cf1409489006189.jpg",
              "link": "https://myanimelist.net/anime/7338/Darker_than_Black__Kuro_no_Keiyakusha_Gaiden",
              "trailer": null,
              "episodios": 4,
              "sinopse": "Fugindo das consequências de sua decisão no Portão do Inferno, o superpoderoso empreiteiro Hei e seu companheiro Yin se refugiam em uma pousada tranquila, assumindo o aspecto de um casal para não levantar suspeitas. Na tentativa de se recuperar dos eventos recentes, Hei faz amizade com outros hóspedes da pousada. Ele descobre que um deles é um outro empreiteiro encarregado de matá-lo. O encontro resultante significa um desastre para Hei e Yin, que são forçados a lutar por suas vidas e lutar com as feridas emocionais sofridas em suas vidas anteriores juntos.",
              "maturidade": null,
