              "link": "https://myanimelist.net/anime/38656/Darwins_Game",
              "trailer": null,
              "episodios": 11,
              "sinopse": "O estudante Kaname Sudou recebe um convite de um colega para jogar o Darwin's Game, um jogo para celular do qual ele nunca ouviu falar. No entanto, assim que ele abre o aplicativo, uma cobra verde de repente sai da tela do telefone e morde seu pescoço, deixando-o inconsciente. Acordando na enfermaria sem sinais de picada de cobra, a escola o orienta a tirar o resto do dia de folga. Embora fique intrigado com o que aconteceu, ele descarta a experiência surreal como uma alucinação e embarca no trem para casa.\n\nInfelizmente, sua curiosidade o vence e ele usa o aplicativo mais uma vez. Como o aplicativo parece ser igual a qualquer outro jogo de batalha, Kaname solta um suspiro de alívio e decide iniciar sua primeira partida. No entanto, a agradável surpresa dura pouco, já que seu oponente no jogo aparece inesperadamente bem na frente dele e tenta caçá-lo com uma faca.\n\nEnquanto ele corre desesperadamente por sua vida, Kaname soma dois mais dois e percebe que o Jogo de Darwin não é um jogo comum, mas sim uma luta brutal pela sobrevivência.",
