              "sinopse": "A história gira em torno de Shouta, um garoto normal do ensino médio cuja vida muda repentinamente quando uma criatura chamada Gasshapon aparece na frente dele e afirma vir do futuro. (O Gasshapon tem o formato das máquinas distribuidoras de prêmios Gashapon da Bandai.) O Gasshapon foi enviado ao passado pelo futuro Shouta, de uma era em que um grupo alienígena chamado CC (ou Cold Cosmo) assumiu como missão mudar todas as estrelas e planetas que têm luz e calor em lugares escuros e frios como o deles. O Gasshapon pretendia levar o jovem Shouta até 2080 para salvar o futuro, mas porque a viagem no tempo ainda não havia sido totalmente aperfeiçoada, Shouta é lançado em uma época completamente diferente, a era do Incidente Honnouji (1582), onde Shouta realmente se torna o famoso senhor da guerra Oda Nobunaga.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
