          "items": {
            "d0029_1": {
              "id": "d0029_1",
              "foto": "https://2.bp.blogspot.com/-GrgBlm0JAEU/W0TQEfRabZI/AAAAAAAAABw/Zn89ef0IucI_cYHGhqt7C3h_7QVbSaioQCLcBGAs/s1600/Date%2Ba%2BLIVE.jpg",
              "link": "https://myanimelist.net/anime/15583/Date_A_Live",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Trinta anos atrás, o continente eurasiático foi devastado por um \"terremoto espacial\" supermassivo - um fenômeno envolvendo vibrações espaciais de origem desconhecida - resultando na morte de mais de 150 milhões de pessoas. Desde então, esses terremotos têm assolado o mundo de forma intermitente, embora em uma escala mais leve.\n\nShidou Itsuka é um estudante aparentemente mediano que mora com sua irmã mais nova, Kotori. Quando um terremoto espacial iminente ameaça a segurança da cidade de Tengu, ele corre para salvá-la, apenas para ser pego na erupção resultante. Ele descobre uma garota misteriosa em sua origem, que se revela ser um \"Espírito\", uma entidade sobrenatural cuja aparência desencadeia um terremoto espacial. Logo depois, ele se envolve em uma escaramuça entre a garota e a Equipe Anti-Espírito,\n\nNo entanto, existe um terceiro que acredita em salvar os espíritos: \"Ratatoskr\", que surpreendentemente é comandado pela irmã mais nova de Shidou! Kotori recruta Shidou à força após o confronto, apresentando a ele um método alternativo de lidar com o perigo representado pelos Espíritos - fazê-los se apaixonar por ele. Agora, o destino do mundo depende de suas proezas no namoro, enquanto ele busca Espíritos para encantá-los.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0029_2": {
              "id": "d0029_2",
              "foto": "https://vignette.wikia.nocookie.net/date-a-live/images/2/2c/Date_A_Live_II_Official_Art.jpg/revision/latest?cb=20190925074503&path-prefix=ru",
              "link": "https://myanimelist.net/anime/19163/Date_A_Live_II",
              "trailer": null,
              "episodios": 10,
              "sinopse": "Os espíritos são entidades sobrenaturais com imenso poder, capazes de criar terremotos espaciais sempre que aparecem. Uma maneira de lidar com eles é por meio da força bruta e matá-los ... ou fazê-los se apaixonar e selar seus poderes.\n\nDepois de selar três Espíritos, Shidou Itsuka continua sua missão com Ratatoskr em localizar mais espíritos e datá-los, para garantir a segurança do mundo de futuras destruições. Porém, desta vez, seus problemas não se limitarão aos Espíritos, pois uma ameaça mais imponente parece ter percebido suas atividades.",
              "maturidade": null,
