              "link": "https://myanimelist.net/anime/22961/Date_A_Live_II__Kurumi_Star_Festival",
              "trailer": null,
              "episodios": 1,
              "sinopse": "No dia do festival Tanabata, Shidou Itsuka encontra a misteriosa Kurumi Tokisaki, que começa a convidá-lo para um encontro. Embora nervoso, Shidou aceita a oferta. Os dois passam o tempo visitando um planetário, comprando comida no festival e experimentando uma cerimônia de casamento simulada. Enquanto isso, os amigos de Shirou - Tooka Yatogami, Yoshino e Kotori Itsuka - estão procurando por ele, enquanto também aproveitam o festival.\n\nEnquanto Shidou passa o dia com Kurumi, ele começa a notar um lado inesperado mais suave dela. Ele sabe que Kurumi é infamemente chamada de \"Pior Espírito\", mas a garota que está diante dele é uma alma gentil. No entanto, conforme o dia chega ao fim, Shirou finalmente começa a entender a verdade por trás de tudo.",
              "maturidade": null,
