              "sinopse": "Shidou Itsuka continua sua busca por Ratatoskr em encontrar Espíritos e tentar selar seus poderes, tudo isso enquanto mantém seu relacionamento com aqueles que ele já havia selado. Além disso, à medida que novos Espíritos aparecem, ele deve passar por provações mais complicadas - tudo para impedir novos desastres à medida que descobre mais sobre a origem dos Espíritos.",
