              "sinopse": "Guerra (data), recomeça.\nOs dias pacíficos de Itsuka Shidou voltaram sem ter que salvar os Espíritos dos dias de batalha implacável. Mas, os dias de paz foram interrompidos pelo surgimento de uma misteriosa esfera emitindo uma onda espiritual ―― assim como uma misteriosa garota que se revelou ao mesmo tempo. Qual é o propósito dela em ficar de olho em Shidou ...? A missão que havia sido confiada a Shidou sob a situação tensa era,\n\n“Namorar todos os Espíritos e fazê-los se apaixonar ?!”\n\n――Com o destino da humanidade em jogo, a guerra (data) recomeça!",
