              "trailer": null,
              "episodios": 12,
              "sinopse": "Parecia que seria um dia normal para Ganta Igarashi e seus colegas - eles estavam se preparando para fazer uma excursão escolar a um certo parque de diversões da prisão chamado Deadman Wonderland, onde os condenados realizam atos perigosos para a diversão dos espectadores. No entanto, a vida de Ganta rapidamente vira de cabeça para baixo quando sua classe inteira é massacrada por um misterioso homem de vermelho. Enquadrado pelo incidente e condenado à morte, Ganta é enviado para a própria prisão que deveria visitar.\n\nMas o pesadelo de Ganta está apenas começando.\n\nO jovem protagonista é lançado em um mundo de prisioneiros sádicos e poderes enigmáticos, para viver em constante medo da coleira letal colocada em seu pescoço, que é retardada apenas pela vitória nos jogos mortais da prisão. Ganta deve apostar sua vida para sobreviver em um lugar implacável onde nem sempre é fácil distinguir amigo de inimigo, enquanto tenta encontrar o misterioso \"Homem Vermelho\" e limpar seu nome, em Deadman Wonderland.",
