              "sinopse": "Dois anos após a onda catastrófica que varreu o Japão, o policial Kiyomasa Senji está tentando tornar o mundo um lugar mais seguro. Usando seus poderes Branch of Sin, ele para os criminosos de todas as maneiras que pode. Depois de resgatar um menino chamado Izuru Tsukiyoshi de uma gangue chamada Goreless Peace, o conflito entre Kiyomasa e seus adversários esquenta rapidamente, a ponto de ser explosivo.\n\nOferecendo um vislumbre do passado do futuro Deadman, a história segue Senji, ajudando a desenvolver o raciocínio que orienta suas ações mais tarde na vida.",
