              "trailer": null,
              "episodios": 12,
              "sinopse": "Ichirou Suzuki, um programador quase na casa dos trinta, está se afogando no trabalho. Esgotado, ele eventualmente tem a chance de pegar no sono, apenas para acordar e se descobrir em um mundo de RPG de fantasia, que está misturado com os jogos que ele estava depurando na realidade. Neste novo lugar, ele percebe que não apenas sua aparência mudou para uma versão mais jovem de si mesmo, mas seu nome também mudou para Satou, um apelido que ele usava enquanto fazia testes beta em jogos.\n\nNo entanto, antes que Satou possa compreender totalmente sua situação, um exército de lizardmen lança um ataque contra ele. Forçado a lançar um feitiço poderoso em retaliação, Satou os elimina completamente e seu nível é aumentado para 310, maximizando efetivamente suas estatísticas. Agora, como um aventureiro de alto nível armado com uma infinidade de habilidades e sem nenhuma maneira de retornar à realidade, Satou parte para explorar este novo mundo mágico.",
