              "foto": "https://simania.co.il/images/users/41749.jpg",
              "link": "https://myanimelist.net/anime/1535/Death_Note",
              "trailer": null,
              "episodios": 37,
              "sinopse": "Um shinigami, como deus da morte, pode matar qualquer pessoa - desde que veja o rosto da vítima e escreva o nome dela em um caderno chamado Death Note. Um dia, Ryuk, entediado com o estilo de vida dos shinigami e interessado em ver como um humano usaria um Death Note, joga um no reino humano.\n\nO estudante do ensino médio e prodígio Light Yagami se depara com o Death Note e - uma vez que ele deplora o estado do mundo - testa o caderno mortal escrevendo o nome de um criminoso nele. Quando o criminoso morre imediatamente após sua experiência com o Death Note, Light fica muito surpreso e rapidamente reconhece o quão devastador pode ser o poder que caiu em suas mãos.\n\nCom essa capacidade divina, Light decide extinguir todos os criminosos para construir um novo mundo onde o crime não exista e as pessoas o veneram como um deus. A polícia, porém, descobre rapidamente que um assassino em série tem como alvo criminosos e, consequentemente, tenta prender o culpado. Para isso, os investigadores japoneses contam com a ajuda do melhor detetive do mundo: um jovem e excêntrico conhecido apenas pelo nome de L.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0033_2": {
              "id": "d0033_2",
              "foto": "https://img.comunidades.net/dig/digitalnews/death_movie_Death_Note_Road_Show_Rewrite_Vision_of_God.jpg",
              "link": "https://myanimelist.net/anime/2994/Death_Note__Rewrite",
              "trailer": null,
              "episodios": 2,
              "sinopse": "1. Genshisuru Kami (Visions of a God)\nUm episódio de duas horas de Death Note, principalmente uma compilação dos confrontos entre Light e L, reeditado da perspectiva de Ryuk com novo diálogo e trilha sonora junto com animação adicional que não poderia ser incluída em a série original. Um Shinigami Sem Nome vem a Ryuk para questioná-lo sobre sua nova história no mundo humano.\n\n2. L o Tsugu Mono (sucessores de L)\nEsta história continua de onde a anterior parou, continuando a história da Light. Como o especial anterior contou as batalhas de Light e L, esta história faz o mesmo com os conflitos entre Light, Mello e Near.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "d0034": {
          "id": "d0034",
          "parentes": [],
          "items": {
            "d0034_1": {
              "id": "d0034_1",
              "foto": "https://animesonehd.xyz/wp-content/uploads/2020/02/death-parade-online-em-hd.jpg",
              "link": "https://myanimelist.net/anime/28223/Death_Parade",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Após a morte, não há céu ou inferno, apenas uma barreira entre a reencarnação e o esquecimento. Lá, o atendente irá, um após o outro, desafiar pares de recém-falecidos para um jogo aleatório em que seu destino de ascender à reencarnação ou cair no vazio será apostado. Seja boliche, dardos, hóquei no ar ou qualquer coisa no meio, a verdadeira natureza de cada pessoa será revelada em um desfile medonho de morte e memórias, dançando aos caprichos do mestre do bar. Bem-vindo ao Quindecim, onde o Decim, árbitro da vida após a morte, espera!\n\nDeath Parade expande o one-shot original destinado a treinar jovens animadores. Segue-se ainda mais pessoas sendo julgadas - até que um estranho hóspede de cabelos negros faz com que Decim comece a questionar suas próprias decisões.",
              "maturidade": null,
              "pontosBase": 0.0
