              "foto": "https://1.bp.blogspot.com/-43oRJiCxdwU/XzYRE6J6PcI/AAAAAAAABPo/9IriasDipiQeIecPAw8CznG39n-XcdtXQCLcBGAsYHQ/s1600/Death%2BBilliards.webp",
              "link": "https://myanimelist.net/anime/14353/Death_Billiards",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Dois homens acabam de chegar a um local conhecido como Quindecim e não se lembram de como chegaram lá. Eles são imediatamente recebidos por uma jovem que os acompanha até um pequeno bar, onde um barman os espera. Eles são informados de que terão que participar de um jogo, escolhido aleatoriamente pela roleta, e não poderão sair até o seu término; se recusarem, as consequências serão terríveis. Além das regras do jogo, os dois homens são instruídos a jogar como se suas vidas estivessem em jogo.\n\nO jogo escolhido é o bilhar. Mas há mais do que apenas encaçapar bolas de bilhar, já que os dois estão prestes a descobrir que o resultado pode significar vida ou morte.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0034_3": {
              "id": "d0034_3",
              "foto": "https://static-movie.a.88cdn.com/bce2a3a90000737d922647560de0ab3d.jpg?imageView2/1/q/85/interlace/1",
              "link": "https://myanimelist.net/anime/13863/Arve_Rezzle__Kikaijikake_no_Yousei-tachi",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Um dia, quando Remu Mikage está em uma vídeo chamada com sua irmã, Shiki, que viajou para a futurística Mega Float City da ilha Okinotori para estudar, ela confessa que tanto o áudio quanto o visual são completamente artificiais. Para ser mais eficiente em seus estudos, Shiki usou nanomáquinas ligadas ao sistema neural para carregar sua consciência em um computador e está armazenando seu corpo físico em uma \"piscina corporal\". Embora chocado, Remu apóia a decisão de sua irmã, até que o desastre conhecido como \"Early Rapture\" aconteça.\n\nO Arrebatamento Precoce faz com que todos os que carregaram suas consciências entrem em coma ou morram. Remu visita o apartamento vazio de sua irmã uma última vez, mas fica chocado quando Shiki chega na porta. Sem memória de sua família ou passado, e sendo perseguidos por um grupo violento de pesquisadores, Shiki e seu irmão são forçados a fugir usando seu novo poder de manipulação de nanomáquinas.",
              "maturidade": null,
              "pontosBase": 0.0
            },
