              "episodios": 1,
              "sinopse": "Ryo é sobre o filho de um samurai que perdeu seus pais durante o ataque de navios ingleses a uma cidade japonesa que recebeu o nome de Ryo e se tornou o guarda-costas de Ryoma Sakamoto, um homem que tem seu próprio plano de lutar pelo país.",
              "maturidade": null,
