          "items": {
            "d0035_1": {
              "id": "d0035_1",
              "foto": "https://images.sr.roku.com/idType/roku/context/global/id/e4549d9ad811521f95fd5e3d1c84654c/images/gracenote/assets/p8278808_b_v8_ab.jpg",
              "link": "https://myanimelist.net/anime/1826/Deltora_Quest",
              "trailer": null,
              "episodios": 65,
              "sinopse": "Há muito tempo, o ferreiro Adin forjou um cinto de sete gemas poderosas, uma de cada uma das sete tribos de Deltora. Empunhando o poder incomparável do cinto, ele repeliu a tentativa do Senhor das Sombras de derrubar o reino. Adin foi coroado rei de Deltora, mas nunca se esqueceu de que o inimigo permanecia invicto.\n\nSéculos depois, a memória do Senhor das Sombras tornou-se desbotada e quase esquecida, e o povo de Deltora vê sua monarquia como desapegada e indiferente. Para sua consternação, o Senhor das Sombras ataca mais uma vez, quebrando o Cinturão de Deltora ao espalhar as sete joias pelo continente. Jarred, um amigo próximo do jovem rei Endon, ajuda ele e sua esposa a escapar do castelo quando o Senhor das Sombras assume o controle, e eles se separam para se esconder.\n\nO Senhor das Sombras agora reina sobre Deltora e muitos anos se passam sob seu governo tirânico. No entanto, há um raio de esperança no filho de Jarred, Lief, a quem ele criou e treinou com amor para encontrar as gemas espalhadas e remontar o Cinturão de Deltora. Junto com seus companheiros Barda e Jasmine, Lief deve enfrentar inimigos tortuosos e feras perigosas para expulsar o Senhor das Sombras e devolver a paz a Deltora.",
              "maturidade": null,
              "pontosBase": 0.0
            }
