              "trailer": null,
              "episodios": 52,
              "sinopse": "Baseado no desenho animado americano, \"The Powerpuff Girls\".\b\bO professor Utonium e seu filho Ken estão estudando o estranho Chemical X. Quando um bolo de mochi entra na fórmula, ele se transforma em Chemical Z. Ken dispara um raio de Chemical Z em uma geleira na Baía de Tóquio, mas isso causa estranhas luzes pretas e brancas para espalhar. As luzes negras transformam suas vítimas em monstros, com ênfase em uma luz negra que atinge um macaco do zoológico e o transforma em Mojo Jojo.\n\nAs luzes brancas, no entanto, apontam para três garotas normais, Momoko, Miyako e Kaoru. Isso lhes dá o poder de se transformar em super-heróis, as Powerpuff Girls Z!",
