              "sinopse": "O professor de biologia do colégio Tetsuo Takahashi pode parecer um instrutor comum do dia a dia, mas por trás de sua aparência gentil existe algo menos comum: seu fascínio pelo \"Ajin\", mais conhecido como \"Demi\". Embora esses seres meio-humanos, meio-monstros tenham se integrado à sociedade humana, Takahashi acredita que muito sobre eles permanecerá desconhecido, a menos que ele interaja com eles em primeira mão.\n\nDemi-chan wa Kataritaisegue a vida diária de Takahashi na Shibasaki High School junto com seus três alunos Demi - Hikari Takanashi, um vampiro enérgico; Kyouko Machi, um dullahan gentil; e Yuki Kusakabe, a tímida mulher da neve. Ao longo do caminho, Takahashi também conhece o professor Sakie Satou, uma súcubo com aversão por homens. Para cumprir seu objetivo de aprender mais sobre Demi, Takahashi decide conduzir entrevistas casuais com as meninas para aprender mais sobre suas habilidades, psique e interação com a sociedade humana. Conforme Takahashi fortalece seu vínculo com seus alunos, ele logo descobre que as Demi não são tão incomuns quanto ele inicialmente acreditava.",
