              "sinopse": "Makoto Niwa registra meticulosamente a quantidade de experiências positivas e negativas da juventude em que se envolve como se para avaliar sua própria vida. Quando seus pais vão para o exterior, ele se muda para uma nova cidade para morar com sua tia, aceitando a mudança e pronto para um novo começo. No entanto, por mais comum que ele tivesse imaginado sua adolescência, ele nunca poderia ter levado em consideração a existência de um primo enigmático há muito desaparecido.\n\nAo se mudar para a casa da tia, ele descobre o primo que nunca conheceu: Erio Touwa. Apesar de ter a idade de Makoto, ela não poderia ser mais diferente: Erio opta por se enrolar em um futon o dia todo ao invés de ir para a escola. Ela até afirma ser uma alienígena, e com um padrão de fala e personalidade para apoiá-lo, qualquer chance da tão sonhada vida normal de Makoto é instantaneamente jogada pela janela.\n\nAo encontrar uma série de outras garotas excêntricas na cidade, Makoto deve enfrentar a possibilidade de ver seus pontos de juventude no vermelho. No entanto, ele pode se surpreender com o quão emocionante um jovem anormal pode ser.",
