        "d0049": {
          "id": "d0049",
          "parentes": [],
          "items": {
            "d0049_1": {
              "id": "d0049_1",
              "foto": "https://4.bp.blogspot.com/-3AYumOrZGQ8/WlgGBR0no-I/AAAAAAAACZ4/sWvGHo70kbsQFCwUqZl6WBMfNKnR721JwCLcBGAs/s1600/111.jpg",
              "link": "https://myanimelist.net/anime/552/Digimon_Adventure",
              "trailer": null,
              "episodios": 54,
              "sinopse": "Quando um grupo de sete crianças vai para um acampamento de verão, a última coisa que esperam é neve caindo em julho. Na confusão que se segue a esse fenômeno, cada um deles recebe um dispositivo estranho que os transporta para outro mundo. Assim que eles acordam neste novo mundo, eles encontram estranhas criaturas que se autodenominam \"Digimon\". Os Digimon dizem a eles que pousaram no \"Mundo Digital\", longe de casa.\n\nCom apenas os Digimon e os \"Digivices\" como proteção, as sete crianças partiram para encontrar o caminho de casa e descobrir o motivo pelo qual foram trazidas para cá. Liderado pelo impulsivo Taichi Yagami e seu faminto parceiro Digimon Agumon, este grupo terá que lutar contra males desconhecidos enquanto descobrem mais sobre este estranho mundo digital.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_2": {
              "id": "d0049_2",
              "foto": "https://isubtitles.org/img/poster/2016/6/13/dejimon-adobencha-02.jpg;widh=400;height=600;crop=auto;format=webp",
              "link": "https://myanimelist.net/anime/1313/Digimon_Adventure_02",
              "trailer": null,
              "episodios": 50,
              "sinopse": "Taichi Yagami e seus amigos mudaram para o ensino fundamental, mas nessa época, eles perderam o contato com seus parceiros Digimon. Taichi fica, portanto, surpreso ao receber um chamado de socorro convocando-o para o Mundo Digital. Uma vez lá, ele descobre que os Digimon estão vivendo com medo do misterioso Imperador Digimon, que está de alguma forma suprimindo sua habilidade de Digivolve!\n\nNo mundo real, Hikari Yagami e Takeru Takaishi se reúnem na mesma classe da quinta série. Eles compartilham três colegas de escola: Daisuke Motomiya, que lembra a ambos Taichi; Miyako Inoue, um mago técnico; e Iori Hida, vizinho de Miyako. Quando essas três crianças recebem Digivices \"D-3\", elas - junto com Hikari e Takeru, que ainda possuem seus próprios Digivices originais - constituem a nova geração de \"Crianças Escolhidas\" que devem salvar o mundo mais uma vez. Com o poder dos Digi-Ovos blindados, eles devem frustrar os planos do imperador Digimon de espalhar sua influência por todo o mundo digital.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_3": {
              "id": "d0049_3",
              "foto": "https://images.withthewill.net/digimonmovie3_poster_july7_2020.jpg",
              "link": "https://myanimelist.net/anime/2962/Digimon_Adventure_02_Movies",
              "trailer": null,
              "episodios": 2,
              "sinopse": "Anos depois que um menino na América perdeu um de seus amigos Digimon, um Digimon viral maligno sequestrou com sucesso as Crianças Escolhidas originais. Seus amigos mais jovens devem correr contra o tempo com seus parceiros Digimon para descobrir a fonte desta nova ameaça e talvez resolver um mistério de anos de idade.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_4": {
              "id": "d0049_4",
              "foto": "https://pbs.twimg.com/media/ChdSf82UcAA6WUV.jpg",
              "link": "https://myanimelist.net/anime/2398/Digimon_Adventure_02__Diablomon_no_Gyakushuu",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Depois dos acontecimentos de 02, tudo finalmente voltou ao normal. Isto é, até que um ícone estranhamente familiar comece a aparecer em sistemas de computador por todo o Japão. E não apenas sistemas de computador ... TVs, telefones celulares, videogames; qualquer coisa com uma tela com recursos online. E este ícone parece estar procurando por alguém ... Yagami Taichi, e Ishida Yamato, que o derrotou vários anos antes. Sim, acontece que este digimon água-viva é na verdade Diablomon, o Digimon do tipo vírus que foi derrotado no segundo filme. Mas desta vez, ele aprendeu a se tornar físico e está enviando milhares de cópias de si mesmo para o mundo real.\n\nKoushiro e Ken elaboram um plano para livrar o mundo do vírus de uma vez por todas, mas será necessário a ajuda de todos os Destinados, do passado e do presente. Mais uma vez, é uma corrida contra o tempo para acabar com a trama de Diablomon ... mas mesmo isso está envolto em sombras.\n\nO renascimento de Omagamon será o suficiente para parar Diablomon uma segunda vez, ou os milhões de cópias provarão um aumento de poder suficiente para afastar o \"Digimon Campeão da Justiça\"? Claro, ele não viu a nova geração de Escolhidos, nem as novas técnicas. É uma luta até o fim, com a destruição de Tóquio em risco.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_5": {
              "id": "d0049_5",
              "foto": "https://anitokyo.tv/uploads/posters/2015-08/1439293290_digimon_movie_11_364x515.jpg",
              "link": "https://myanimelist.net/anime/8490/Digimon_Adventure_3D__Digimon_Grand_Prix",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Digimon especial, corrida ao estilo Mario Kart.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_6": {
              "id": "d0049_6",
              "foto": "https://i.pinimg.com/474x/76/4f/46/764f469c10afb147c667b8f7daabcc07.jpg",
              "link": "https://myanimelist.net/anime/2961/Digimon_Adventure_Movie",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Um irmão e uma irmã descobrem que o mundo digital tem mais de 1s e 0s quando uma criatura viva sai do computador da família. As aventuras de um grupo de crianças começam com o aparecimento de um Monstro Digital no mundo real.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_7": {
              "id": "d0049_7",
              "foto": "https://img.elo7.com.br/product/original/2C16CB1/big-poster-anime-digimon-lo11-tamanho-90x60-cm-presente-geek.jpg",
              "link": "https://myanimelist.net/anime/25687/Digimon_Adventure_tri_1__Saikai",
              "trailer": null,
              "episodios": 1,
              "sinopse": "O portão do Digital World está fechado há três anos. Taichi Yagami e seus amigos seguiram em frente e, agora que ele está no segundo ano do ensino médio, é hora de crescer. Enquanto todos sabem o que querem fazer com suas vidas, Taichi permanece inseguro. Enquanto isso, o grupo se distancia ainda mais conforme eles seguem seus próprios caminhos.\n\nUm dia, um Digimon insetoide desonesto chamado Kuwagamon se materializa e interrompe a eletrônica por toda a cidade. Taichi o persegue imprudentemente e acaba encurralado pelo ataque Digimon. De repente, o Digivice que ele ainda carrega - um dispositivo digital que serve a vários propósitos, incluindo ajudar o parceiro Digimon a evoluir - brilha e Agumon aparece. Os dois são capazes de derrotar Kuwagamon, mas por que o Digimon cruzou para este mundo em primeiro lugar? O que está acontecendo no mundo digital, e como exatamente isso envolve Meiko Mochizuki, a nova aluna transferida da classe de Taichi?",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_8": {
              "id": "d0049_8",
              "foto": "https://i.imgur.com/2ck9wSw.jpg",
              "link": "https://myanimelist.net/anime/32108/Digimon_Adventure_tri_2__Ketsui",
              "trailer": null,
              "episodios": 1,
              "sinopse": "O tempo passou desde o surgimento de Alphamon e as obras de restauração foram avançando aos poucos na cidade de Odaiba.\n\n\"Eu tinha decidido que assim que voltasse ao Japão, com certeza tomaria um grande banho de banheira!\" grita Mimi. Por causa disso e do desejo de fazer seus novos membros Meiko Mochizuki e Meicoomon se sentirem bem-vindos, os DigiDestined vão para um parque temático de fontes termais próximas. Todos se divertem, mas Joe não aparece.\n\nJoe se sente preso entre a realidade iminente dos exames de admissão à faculdade e suas responsabilidades como DigiDestinado.\n\n\"Por que temos que fazer isso de novo?\"\n\nSó então, outro Digimon infectado aparece em Odaiba. É aquele tipo de vírus orgulhoso, Ogremon ... Enquanto um helicóptero de uma estação de TV retransmite sua violência, Mimi e Palmon entram em ação.\n\n\"Vamos mostrar às pessoas que existem bons Digimon também!\"\n\nMimi e Palmon ignoram as tentativas de Koushirou de contê-los, entretanto, e sua batalha traz consequências imprevistas ...\n\nJoe e Mimi têm seus próprios problemas. Então, no dia do festival da Tsukishima General High School, aquele homem aparece diante deles ...\n\nA aventura agora evolui mais uma vez ...",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_9": {
              "id": "d0049_9",
              "foto": "https://3.bp.blogspot.com/-jG39dMX1azA/V-ek2stIMJI/AAAAAAACcoA/lf2lSh8yd8g-zxbdE6540MDif81m2JatwCLcB/s1600/2x3%2B%25281%2529%2B%25281%2529.png",
              "link": "https://myanimelist.net/anime/32551/Digimon_Adventure_tri_3__Kokuhaku",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Taichi e amigos não conseguem esconder o quão perturbador foi que algo de repente deu errado com Meicoomon, fazendo com que ela destruísse Leomon e desaparecesse além da distorção.\n\n\"Se o Meicoomon estava infectado, eu quero descobrir o que o causou. Houve algum sinal de que isso aconteceu? E quando no mundo isso aconteceu?\" Diante de uma situação além da imaginação, Koushirou se esforça para pensar em alguma contramedida.\n\nMas, sem meios eficazes à sua disposição, ele acaba interrogando Meiko por informações. \"Por favor, lembre-se. Preciso de informações se vou descobrir o que está por trás da infecção.\" Meiko abaixa a cabeça, incapaz de oferecer qualquer resposta ...\n\nAgumon e os outros foram colocados em quarentena no escritório de Koushirou para se proteger contra a infecção, mas Patamon começa a mostrar sinais de qualquer maneira ... Ao mesmo tempo, Agumon e os outros são informados pela voz de Hikari sobre um segredo importante sobre o Digital Mundo.\n\n\"O tempo ... aproxima-se ...\"\n\nEntão, durante a batalha contra Meicoomon, quando ela aparece novamente, disse que o \"tempo\" chega. Taichi e amigos agonizam com o segredo revelado. À medida que os sentimentos de cada um se entrelaçam, chegam a uma certa determinação ...\n\n\"Se esperarmos 'algum dia', antes que você perceba já estaremos crescidos.\"\n\nA aventura agora evolui mais uma vez ...",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_10": {
              "id": "d0049_10",
              "foto": "https://cdn.hobbyconsolas.com/sites/navi.axelspringer.es/public/styles/1200/public/media/image/2016/10/digimon-adventure-tri_0.jpg?itok=xC-WGVyO",
              "link": "https://myanimelist.net/anime/34299/Digimon_Adventure_tri_4__Soushitsu",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Primeiro houve a agitação do Meicoomon, e então a reinicialização acabou acontecendo. Taichi e seus amigos deixaram Meiko para trás em sua angústia e se dirigiram para o Mundo Digital.\n\nEles se reencontram com seu parceiro Digimon, que perdeu todas as suas memórias até este ponto. Mesmo assim, os DigiDestined decidem estender a mão e reconstruir esses laços, e seus Digimon respondem na mesma moeda. A única exceção é Biyomon, que é abertamente cautelosa mesmo depois de digivolver para seu estágio de Rookie ...\n\n\"Eu te disse, eu não sei nada sobre 'o passado'!\"\n\nA gentileza de Sora em colocar os outros antes de si mesma só deixa Biyomon ainda mais desconfiada. Isso deixa Sora atordoado e magoado, e Taichi e Yamato não sabem o que dizer a ela.\n\nEnquanto todos discutem o que devem fazer aqui no Mundo Digital, o Meicoomon aparece de repente e depois desaparece. Por algum motivo, ela ainda tem suas memórias, enquanto vagueia com lágrimas nos olhos, procurando por Meiko. Ver isso fortalece a determinação das crianças de viajar pelo Mundo Digital para salvar a Meicoomon. Mas então, diante de seus olhos, aparece aquele homem que estivera com os Mestres das Trevas.\n\nEnquanto isso, no mundo real, Nishijima recebe a notícia de que Himekawa desapareceu. Enquanto investiga, ele determina que há alguma agenda oculta por trás do comportamento dela até este ponto. Tem a ver com um acontecimento do passado que determinou os dois destinos ...\n\nA aventura agora evolui mais uma vez ...",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_11": {
              "id": "d0049_11",
              "foto": "https://m.media-amazon.com/images/M/MV5BOTE5ZDMzMTAtZDNkOC00ODQ0LWJkZjItODRkZjJiNmUyNGI2XkEyXkFqcGdeQXVyNzEyMDQ1MDA@._V1_.jpg",
