            "d0049_13": {
              "id": "d0049_13",
              "foto": "https://pbs.twimg.com/media/EUQ_FupXYAEbAPr.jpg:large",
              "link": "https://myanimelist.net/anime/41074/Digimon_Adventure_",
              "trailer": null,
              "episodios": -1,
              "sinopse": "No ano de 2020, a tecnologia está em toda parte. Cada dispositivo digital em todo o mundo está conectado por uma rede única por onde os dados viajam. Sem o conhecimento dos humanos, essa rede se tornou o lar de formas de vida conhecidas como \"Digimon\".\n\nTaichi Yagami, do quinto ano, está se preparando para o acampamento de verão quando ocorrências estranhas começam em Tóquio; certos sistemas eletrônicos começaram a dar errado. Quando ele descobre que sua irmã e sua mãe estão presas em um trem incontrolável, ele corre para a estação próxima. De repente, Taichi é transportado para outro mundo, onde conhece uma estranha criatura chamada Agumon, que de alguma forma já sabe seu nome. Taichi também recebe um estranho dispositivo chamado \"Digivice\", que permite que ele se comunique com o mundo não digitalizado.\n\nTaichi descobre que está na \"Rede\", e Digimon semelhantes a vírus estão atacando as áreas que mantêm os sistemas eletrônicos de Tóquio. Cabe a Taichi e seu novo parceiro Agumon parar esses ataques cibernéticos antes que o mundo inteiro seja ameaçado pelas ações de Digimon maliciosos.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_14": {
