              "foto": "https://images.withthewill.net/memorial_artimag_july28_2019.jpg",
              "link": "https://myanimelist.net/anime/41206/Digimon_Adventure__20_Shuunen_Memorial_Story",
              "trailer": null,
              "episodios": 5,
              "sinopse": "Uma campanha de crowdfunding foi aberta para o \"Digimon Adventure Memorial Story Project\". Foi para 5 curtas que incluíram uma prequela do próximo filme e histórias paralelas sobre a vida diária dos personagens Digimon e seus parceiros, que são histórias que não entraram no filme.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0049_15": {
              "id": "d0049_15",
              "foto": "https://pm1.narvii.com/6418/980c0c09f0052c6a6d4ef13cc75602690f9b22c9_hq.jpg",
              "link": "https://myanimelist.net/anime/2397/Digimon_Adventure__Bokura_no_War_Game",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Este filme se passa após o término da série Adventure. Tudo começa quando um novo ovo de Digimon é encontrado na internet e consegue penetrar em quase todos os sistemas de computador no Japão. Quando o ovo choca, ele é identificado como um novo tipo de Digimon, um tipo de vírus. Ele se sustenta comendo dados de vários sistemas e começa a causar estragos no Japão. À medida que consome mais e mais dados, ele continua a evoluir. E Taichi e Koushiro decidem que é hora de parar.\n\nEles estão fora, enviando Agumon e Tentomon pela Internet para lutar contra este novo inimigo. Mas, com os sistemas de controle de vírus como os militares americanos, muito em breve, essa ameaça digital pode se tornar muito real. Chamando a ajuda de Yamato e Takeru, eles esperam poder parar o que já começou e talvez salvar este mundo uma segunda vez.",
              "maturidade": null,
              "pontosBase": 0.0
            },
