              "foto": "https://media.notify.moe/images/anime/large/wklA5Kimg@2.webp?1523972721",
              "link": "https://myanimelist.net/anime/859/Digimon_Savers",
              "trailer": null,
              "episodios": 48,
              "sinopse": "Masaru, um estudante do segundo ano do ensino médio e lutador de rua invicto, está prestes a aprender o significado da palavra \"trabalho em equipe\". Após Agumon escapar da DATS, uma organização que lida com Digimon, ele acaba em uma briga com Masaru. Logo Yoshino e Lalamon vêm para capturar Agumon, e os dois lutadores escapam. Depois que um Digimon maligno aparece, cabe a Masaru e Agumon derrotá-lo com sua carga de DNA.\n\nLogo, Masaru deve se juntar ao DATS para acabar com os Digimons que vêm para a Terra. Com a ajuda de Yoshino, Ikuto e Touma, o grupo deve parar qualquer Digimon malvado que apareça e devolvê-los ao Mundo Digital.",
