              "sinopse": "O mundo humano foi atacado por uma força desconhecida. Usando espinhos envenenados, fez todos os humanos dormirem. Agumon, Gaomon e Lalamon são os únicos que sobraram para derrotar este inimigo. Guiados por Rhythm, uma jovem que eles salvaram, eles descobrem que seu inimigo se chama Argomon. Mas o que os três digimons podem fazer, quando eles nem mesmo podem evoluir.",
