              "sinopse": "Digimon Tamers se passa em um mundo onde a popular franquia Digimon está na moda, consistindo em um desenho animado, videogames e o jogo de cartas colecionáveis. Takato Matsuda é um grande fã de Digimon que está particularmente obcecado com o jogo de cartas e constantemente sonha acordado com o universo nele. Um dia, ele encontra um misterioso cartão azul, que desliza por um brinquedo de scanner para usar no popular jogo de batalha. Seu brinquedo brilha de repente e se transforma em um Digivice, e o desenho feito em leque de Takato, Guilmon, se materializa na sua frente. Empolgado com a perspectiva de ter um Digimon na vida real, Takato abraça seu novo parceiro e suas aventuras como Digimon Tamer começam.\n\nTakato rapidamente descobre que ser um Digimon Tamer não é só diversão e jogos - na verdade, é muito mais perigoso do que os jogos de cartas aos quais ele está acostumado. Digimons selvagens começaram a aparecer por todo o Japão, causando tumultos que resultaram em caos e destruição. Armado com seu Digivice, que pode escanear cartas comerciais para fortalecer Guilmon, Takato e seu novo parceiro partem para combater o Digimon desonesto. Eles têm a tarefa de proteger o mundo dos ataques dos Digimons, enquanto uma misteriosa organização determinada a eliminar todos os Digimons e seus Tamers se esconde nas sombras ...",
