              "sinopse": "No século 24, a viagem espacial intergalática se tornou uma realidade. Um dos primeiros postos avançados nos confins do espaço é o WATCHER'S NEST - um portal inflador de buracos - que recentemente foi atacado por uma força misteriosa conhecida simplesmente como GHOUL ... Um grupo de jovens cadetes designados para o portal são inesperadamente jogados em um ninho de vespas de problemas enquanto finalizam seu treinamento para se tornar um piloto de elite no Esquadrão Serafim.",
