              "episodios": 13,
              "sinopse": "Através de uma dobra de longa distância chamada de \"Projeto Exodus\", Worns, Ryer e os outros membros da tripulação do \"Ninho de Vigilantes\" conseguem escapar da Terra. Misaki, que estava participando da batalha final com \"Ghoul\" naquele momento, não está presente lá e diante de seus olhos, a terra muda e é cercada por uma barreira de tempo.\n\nRyer e os outros procuram uma maneira de escapar desse labirinto de espaço-tempo, mas a Terra muda para várias formas. Inúmeros \"agoras\" aparecem devido a vários eixos de tempo.\b\bE também Misaki, que deveria ter desaparecido por causa do incidente do Projeto Exodus, ainda afortiori. Antes de Ryer e os outros, diferentes formas de Misaki aparecem. A Misaki da escola de treinamento, a Misaki de sua infância.\n\nEsses reflexos são causados ​​pelos conflitos que existem dentro de Misaki?\n\nEla acorda pela segunda vez e, quando obtém a resposta, a história está levando a uma direção completamente diferente agora.\n\nMisaki, Ryer e os outros conseguirão encontrar um final realmente feliz ?!",
