              "sinopse": "A lenda do Portão Divino é uma história contada às crianças que retrata a fusão do mundo dos vivos, os céus e o mundo subterrâneo. \"Adaptadores\" - pessoas nascidas com habilidades elementais únicas que lhes foram dadas pela união desses mundos - formaram o Conselho Mundial, uma organização que controla o caos do Portal retratando sua lenda como nada mais do que um mito. Esses adaptadores são treinados em uma academia especial pertencente ao Conselho Mundial, que permite que os alunos aprimorem suas habilidades.\n\nAoto, um adolescente com poderes excepcionais de água e um passado trágico, rejeita a oferta de ingressar na academia várias vezes - até ser pressionado com sucesso pela usuária do vento energético Midori e pela teimosa usuária do fogo Akane. Juntos, com o Conselho Mundial e seu misterioso líder Arthur, eles procuram o Portão na esperança de descobrir a verdade. Mas, para alcançar seus objetivos, eles devem se unir e superar seu próprio desespero enquanto lidam com as travessuras dos bastidores.",
