              "episodios": 13,
              "sinopse": "Dog Days se passa no mundo de Flonyard, uma Terra alternativa habitada por seres que se parecem com humanos, mas também têm orelhas e rabos de animais específicos. A República de Biscotti, uma união de cidadãos caninos, foi atacada pelas forças felinas dos Cavaleiros Galette Leo. Em um esforço para salvar Biscotti, a Princesa Millhiore convoca um campeão de outro mundo para defender seu povo. Esse campeão é Cinque Izumi, um estudante normal do ensino médio da Terra.\n\nConcordando em ajudar Biscotti, Cinque recupera uma arma sagrada chamada Palladion e se prepara para a guerra. Em Flonyard, as guerras são travadas sem baixas e são mais parecidas com competições esportivas com o objetivo de arrecadar dinheiro para os reinos participantes. Cinque tem sucesso em seu papel de campeão de Biscotti, mas descobre que um campeão convocado não pode retornar ao seu mundo natal. Os cientistas de Biscotti se esforçarão para encontrar uma maneira de Cinque voltar para casa, mas até que eles descubram algo, ele deve servir a Princesa Millhiore continuando a lutar como o herói de Biscotti.",
