              "episodios": 13,
              "sinopse": "Cinque retorna à terra de Flonyard em Dog Days para retomar seus deveres como o herói da República Biscotti e é como se ele nunca tivesse partido!\n\nA diferença desta vez é que ele trouxe dois amigos que se tornaram heróis por seus próprios méritos: a melhor amiga de infância Rebecca Anderson, que se tornou a heroína do Principado de Pastilha a pedido de sua líder Princesa Couvert Eschenbach Pastilhada e seu primo Nanami Takatsuki, que se torna o herói do Galette Lion Dominion.\n\nPorém, como na primeira temporada, com tantos segredos a serem descobertos e mistérios a serem resolvidos, ainda haverá tempo para os eventos atléticos que esses três adolescentes hiper e atléticos adoram participar?",
