              "link": "https://myanimelist.net/anime/16385/Dog_Days",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Cinque Izumi, Nanami Takatsuki e Rebecca Anderson devem mais uma vez embarcar em uma jornada para o continente de Flonyard e participar dos jogos de guerra amistosos das três nações aliadas: Biscotti Republic, Galette e Pastilage. Cinque é o herói de Biscotti, que por acaso também é primo do herói de Galette, Nanami. Rebecca é a heroína de Pastillage e uma querida amiga de Cinque.\n\nDias de cão''começa no mundo humano. Rebecca prepara suas coisas para sua jornada de volta ao Japão para Pastilage. Enquanto isso, Cinque e Nanami começaram a viajar para Biscotti e Galette, respectivamente, todo o caminho da Inglaterra, quando de repente, uma onda bizarra de má sorte - na forma de um raio, é claro - os desvia do curso. Eles logo se encontram na grande Floresta do Dragão, protegidos por uma Sacerdotisa do Dragão chamada Sharu. A Sacerdotisa do Dragão os informa que os demônios ameaçam invadir a floresta, assim como todo o continente de Flonyard!\n\nParece que uma verdadeira guerra está prestes a começar em Dog Days '' . Esses três heróis podem salvar todo o continente desses seres malignos?",
