              "sinopse": "Na adolescência, poucas coisas podem machucar mais as pessoas do que as dores de cabeça que vêm com o amor não correspondido. Esse é o caso de Natsuo Fujii, que se viu fascinado pela sempre alegre professora de sua escola, Hina. Desanimado por esse desejo inalcançável, Natsuo humilha seus amigos e vai a um mixer. Aí conhece Rui, uma rapariga cuja falta de entusiasmo rivaliza com ele. Depois de se relacionar com a estranheza mútua, Rui leva Natsuo para sua casa e pede-lhe para fazer sexo com ela, na esperança de que a experiência impeça seus amigos de tratá-la como uma criança sem noção. Com seus sentimentos desesperados em relação a Hina ainda em sua mente, Natsuo concorda hesitantemente.\n\nIgualmente insatisfeitos com suas \"primeiras vezes\", os dois decidem se separar como estranhos. No entanto, antes mesmo de ter a chance de processar essa experiência, o pai de Natsuo lança uma grande bomba: ele está se casando novamente, e sua nova esposa, Tsukiko Tachibana, está vindo agora para encontrar Natsuo. Como se isso não bastasse para um choque, suas filhas - e, por sua vez, novas irmãs de Natsuo - são Hina e Rui Tachibana, a mulher por quem ele está apaixonado e a garota com quem ele compartilhou sua primeira noite. Agora, Natsuo deve aceitar os sentimentos que tem por seus meio-irmãos, enquanto seus olhos se abrem para o lado mais sombrio do amor.",
