              "foto": "https://static.tvmaze.com/uploads/images/original_untouched/148/372006.jpg",
              "link": "https://myanimelist.net/anime/36525/Dorei-ku_The_Animation",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Ansiosa para saber por que o namorado de sua melhor amiga a trocou por um homem, a teimosa Eiya Arakawa sugere um encontro com eles. Reunidos em um café, Yuuga Oota concorda em responder às perguntas de Eiya apenas se ela puder verificar corretamente o relacionamento de um casal sentado em frente a eles, o que ela faz em sua primeira tentativa. Maravilhado com seu intelecto e intuição surpreendentes, ele a convida para uma reunião privada onde a apresenta ao conceito de Método de Controle de Escravos, ou SCM, um dispositivo parecido com um retentor que tem a capacidade de transformar pessoas em escravas.\n\nQuando dois usuários de SCM entram em duelo, os dispositivos exercem uma influência poderosa em seus cérebros. Uma vez que o duelo termina, o SCM amplifica o senso de obrigação do perdedor e o força a se curvar à vontade do vencedor. Querendo desesperadamente testar suas próprias habilidades, Yuuga pede a Eiya para agir como seu seguro no caso de ele mesmo se tornar um escravo. Com acesso a 10 milhões de ienes, o trabalho de Eiya é convencer o suposto mestre de Yuuga a libertá-lo de sua servidão. Embora hesitante no início, as palavras de Yuuga ressoam com seu anseio pessoal por algo mais de sua vida, e ela concorda com seu pedido. No entanto, quando uma organização misteriosa começa a acumular escravos rapidamente, Eiya se envolve em um jogo muito mais perigoso do que ela jamais poderia ter imaginado.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
