              "link": "https://myanimelist.net/anime/38668/Dorohedoro",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Hole - um distrito escuro, decrépito e desordenado onde o forte presa sobre os fracos e a morte é uma ocorrência comum - é quase condizente com o nome dado a ele. Um reino separado da lei e da ética, é um campo de testes para os usuários de magia que o dominam. Como uma raça que ocupa os degraus mais altos de sua sociedade, os usuários de magia pensam nos habitantes de Hole como nada mais do que insetos. Assassinados, mutilados e feitos experimentos sem pensar duas vezes, os impotentes moradores de Hole lotam os corredores do hospital de Hole diariamente.\n\nPossuindo acesso livre de e para a fossa, e com pouco desafio à sua autoridade, os usuários de magia parecem indomáveis ​​para a maioria - exceto para alguns. Kaiman, mais réptil do que o homem, é um desses indivíduos. Ele os caça em uma busca imprudente por respostas com apenas um par de baionetas confiável e sua imunidade à magia. Amaldiçoado por sua aparência e atormentado por pesadelos, os usuários de magia são sua única pista para restaurar sua vida ao normal. Com seu maior obstáculo sendo seu estômago, sua companheira Nikaidou, que dirige o restaurante Hungry Bug, é sua maior aliada.\n\nSituado em um mundo corajoso de design infernal, Dorohedoro consegue uma mistura saudável de comédia e leveza com morte e carnificina. Fazendo muitas voltas e reviravoltas ao seguir a vida dos residentes de Hole, ele tece um mundo único de origem sobrenatural e aparência sombria, não para os melindrosos ou facilmente perturbados.",
