              "foto": "https://t1.daumcdn.net/cfile/tistory/2572ED50547D54F50C",
              "link": "https://myanimelist.net/anime/5760/Dororo_to_Hyakkimaru",
              "trailer": null,
              "episodios": 26,
              "sinopse": "Hyakkimaru é um jovem que carece de 48 partes do corpo porque foram tiradas dele por demônios antes do nascimento, como pagamento por seu pai, Kagemitsu Daigo, para obter seu desejo de dominar o país. Quando o menino nasceu, faltavam 48 partes de seu corpo e, portanto, foi abandonado - jogado no rio. Hyakkimaru cresceu e agora obteve partes falsas do corpo para poder eliminar os 48 demônios que foram feitos de seu corpo e recuperar as partes que faltam. Junto na aventura está o menino ladrão, Dororo, de quem se torna amigo.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0063_2": {
              "id": "d0063_2",
              "foto": "https://static.zerochan.net/Dororo.%28Manga%29.full.2448567.jpg",
              "link": "https://myanimelist.net/anime/37520/Dororo",
              "trailer": null,
              "episodios": 24,
              "sinopse": "A terra do ganancioso senhor samurai Daigo Kagemitsu está morrendo, e ele faria qualquer coisa pelo poder, até mesmo renunciar a Buda e fazer um pacto com os demônios. Suas orações são respondidas por 12 demônios que lhe concedem o poder que deseja ajudando no crescimento de sua prefeitura, mas a um preço. Quando o primeiro filho de Kagemitsu nasce, o menino não tem membros, nem nariz, nem olhos, nem orelhas, nem pele - mas ainda assim vive.\n\nEsta criança é descartada em um rio e esquecida. Mas, por sorte, ele é salvo por um curandeiro que lhe fornece próteses e armas, permitindo-lhe sobreviver e se defender sozinho. O menino vive e cresce e, embora não possa ver, ouvir ou sentir nada, ele deve derrotar os demônios que o levaram como sacrifício. Com a morte de cada um, ele recupera uma parte de si que é sua por direito. Por muitos anos ele vagou sozinho, até que um dia um menino órfão, Dororo, fez amizade com ele. O improvável par de náufragos agora luta por sua sobrevivência e humanidade em um mundo implacável e infestado de demônios.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0063_3": {
              "id": "d0063_3",
              "foto": "https://pbs.twimg.com/media/DW4JmHKUQAADyqc.jpg:large",
              "link": "https://myanimelist.net/anime/11471/Dororo_Pilot",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Antes de produzir uma série de TV, um filme piloto foi feito para permitir que patrocinadores e emissoras de televisão apreendessem a qualidade penetrante do trabalho. Este é o filme piloto de \"Dororo\" em que os personagens se aproximam dos personagens da história original em relação aos personagens da série de TV. Os rostos e personalidades dos personagens da série de TV são alterados de tempos em tempos para ganhar popularidade entre seus telespectadores. Como resultado, às vezes os espectadores realmente adoravam, mas outras vezes não ia bem. O piloto de \"Dororo\" foi feito em cores, mas a série de TV era monocromática devido ao orçamento mais apertado. A história retrata uma jornada na qual o menino ladrão chamado Dororo e um homem amaldiçoado chamado Hyakkimaru destroem monstros. Hyakkimaru pode ser um \"humano\" completo somente depois de destruir 48 demônios.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
