              "trailer": null,
              "episodios": 25,
              "sinopse": "Monstros estão vindo do Inferno para o mundo humano para obter espíritos humanos. Como as mentes das pessoas estão ficando sujas, sendo atraídas pelos espíritos sujos, os monstros quebram a regra de ir para o mundo humano.\n\nTsutomu, um menino que vai para a Yokai Elementary School, é repentinamente atacado por monstros. Aqueles que o salvaram dos monstros são Enma-kun, o filho de Enma, Yukiko, uma mulher da neve, e Kapaeru. Eles são membros da Patrulha de Monstros que são enviados ao mundo humano para prender monstros.",
