              "trailer": null,
              "episodios": 12,
              "sinopse": "Conheça a Patrulha do Demônio: um príncipe demônio cabeça quente; uma sensual princesa de gelo seminua; um luxurioso espião demônio-sapo; um chapéu de mago falante ... e uma garotinha. Este grupo maltrapilho foi encarregado de proteger a Terra de uma multidão de demônios que amariam nada mais do que derrubar seu mundo ao seu redor. Eles enfrentarão uma lula vingativa, um gatinho sonâmbulo, um pote cheio de cobras, uma cadela caçadora noturna, um odiador de virilhas e até mesmo um idiota literal! Desça para uma irrealidade cheia de quedas, comportamento obsceno e jatos culturais obscuros o suficiente para nos afogar!",
