              "link": "https://myanimelist.net/anime/1556/Kikoushi_Enma",
              "trailer": null,
              "episodios": 4,
              "sinopse": "Enma é um personagem criado pelo gênio artista de mangá Go Nagai. Agora, o popular personagem faz sua aparição em um atraente anime de terror japonês para adultos. É um suspense erótico de arrepiar os cabelos em que Enma enfrenta incidentes complicados e horríveis causados ​​por demônios que se escondem na escuridão. Mas os humanos iluminaram a escuridão da noite com luzes de néon e transformaram seu mundo em um que nunca dorme, então os demônios agora espreitam na \"escuridão do coração humano\". Corações insatisfeitos, corações reprimidos, desespero ... tal escuridão do coração é o lugar onde se escondem.\n\nEnma é o Príncipe Demônio do Submundo, um demônio \"Nascido do Fogo\". Sua missão é recuperar ou destruir os demônios que escaparam do submundo para o mundo humano. Junto com sua parceira, a princesa Yukihime, \"Born of Ice\", e o monstro, Kapaeru, Enma monta a \"Agência de Detetives de Enma\". Esta noite, como qualquer outra noite, eles vão vagar pela cidade sem dormir. Incidentes horríveis que não poderiam ser atos humanos ocorrem um após o outro. O fedor do mal permanece na cena ... O fogo de Enma rasga a escuridão!",
              "maturidade": null,
