              "sinopse": "Subaru Mikazuki é um autor de romance de mistério de 23 anos, introvertido e uma pessoa estranhamente tímida. Ele prefere ficar em casa para ler um livro do que sair e interagir com outras pessoas. Exacerbando ainda mais essa vida de solidão, seus pais morreram tragicamente em um acidente há muitos anos, deixando-o sozinho no mundo.\n\nUm dia, ao dar oferendas no túmulo de seus pais, Subaru encontra um pequeno gato cinza e branco chamado Haru, que acaba levando para casa com ele. Subaru, no entanto, nunca cuidou de ninguém em sua vida - ele pode ao menos cuidar de um gato? Haru é grato a Subaru, pois ele dá a ela toda a comida que ela deseja - um luxo para um gato que está acostumado a uma vida difícil nas ruas. Mas ela percebe que Subaru não consegue nem cuidar de si mesmo! Ela ficará bem com esse idiota?\n\nDoukyonin wa Hiza, Tokidoki, Atama no Ue. conta a história de uma amizade improvável entre um humano e um gato que tentam promover a compreensão um com o outro.",
