              "trailer": null,
              "episodios": 153,
              "sinopse": "Gokuu Son é um garoto que vive sozinho na floresta - isto é, até que uma garota chamada Bulma o encontra em sua busca por um conjunto de objetos mágicos chamados de \"Dragon Balls\". Já que os artefatos garantem um desejo a quem os coleciona, Bulma espera reuni-los e desejar um namorado perfeito. Gokuu está de posse de uma bola de dragão, mas infelizmente para Bulma, ele se recusa a se separar dela, então ela faz um acordo: ele pode acompanhá-la em sua jornada se a deixar emprestar o poder da bola de dragão. Com isso, os dois embarcaram na jornada de uma vida.\n\nEles não viajam sozinhos. No caminho, eles encontram o velho Muten-Roshi e aspirante a discípulo Kuririn, com quem Gokuu treina para se tornar um artista marcial mais forte para o próximo Torneio Mundial de Artes Marciais. No entanto, nem tudo é diversão e jogos; a capacidade de realizar qualquer desejo é poderosa, e há outras que fariam muito pior do que apenas desejar um namorado. Para impedir aqueles que tentam abusar do poder lendário, eles treinam para se tornarem lutadores mais fortes, usando sua força recém-descoberta para ajudar as pessoas ao seu redor ao longo do caminho.",
