              "sinopse": "Devido à sua personalidade alegre e capacidade de sorrir mesmo em um dia difícil de trabalho, Kanade Amamiya é repentinamente explorado na vida de ídolo pela lenda da indústria Haruto Mikami. Ele se junta à agência D-4 Production, onde conhece seus colegas do ensino médio Shin Oikawa, Junya Sasaki, Itsuki Katagiri e Chizuru Sawamura, que desejam se tornar ídolos. Inspirado por sua determinação, Kanade abraça esta nova vida.\n\nA chance perfeita para sua estreia aparece quando eles se reúnem para se apresentar no Dream Festival da companhia. Para chegar ao topo, eles devem coletar Dorika - cartões dados pelo público que os ídolos usam para formar suas roupas de palco - e ganhar a atenção do público. No entanto, o caminho para a fama é difícil, e os meninos devem formar um vínculo de amizade e confiança antes de alcançarem seus objetivos.",
