              "link": "https://myanimelist.net/anime/31339/Drifters",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Na Batalha de Sekigahara em 1600, Toyohisa Shimazu é a retaguarda de suas tropas em retirada e é gravemente ferido quando de repente se vê em um corredor branco moderno e reluzente. Diante de apenas um homem estoico chamado Murasaki e centenas de portas em ambos os lados, Toyohisa é puxado para a porta mais próxima e para um mundo completamente diferente do seu.\n\nA estranha terra é povoada por todos os tipos de criaturas fantásticas, bem como por guerreiros de diferentes épocas do mundo de Toyohisa que se pensava estarem mortos. Fazendo amizade com o infame senhor da guerra Nobunaga Oda e o antigo arqueiro Yoichi Suketaka Nasu, Toyohisa fica sabendo da agitação política que dilacera o continente. Além disso, eles foram convocados como \"Drifters\" para lutar contra os \"Fins\", pessoas que são responsáveis ​​pela criação do Império Orte e estão tentando aniquilar os Drifters. À medida que os fins se tornam mais poderosos, o mesmo acontece com a perseguição dos elfos e outros semi-humanos pelo Império. Cabe a Toyohisa e seu grupo de heróis não convencionais batalhar em uma nova guerra mundial para ajudar os súditos do Império, enquanto protegem a terra para reivindicar para si mesmos e desafiar os Fins.",
              "maturidade": null,
              "pontosBase": 0.0
