              "sinopse": "Apesar do ataque do Fim a Verlina ter sido repelido com sucesso, a guerra ainda não terminou. Com o reagrupamento dos exércitos de monstros, o Rei Negro aumenta seu domínio sobre o território já conquistado. Novos conflitos surgem por toda Orte, enquanto suas forças restantes lutam para manter o controle sobre as raças demi-humanas oprimidas há muito tempo.\n\nEnquanto Ends fica mais potente a cada dia, Toyohisa Shimazu permanece inconsciente após graves ferimentos sofridos durante a Batalha de Verlina. Enfrentando inimigos de todos os lados, o destino da humanidade ainda está no fio da navalha.",
