              "trailer": null,
              "episodios": 12,
              "sinopse": "Diz-se que, a cada poucos anos, ocorre o que é conhecido como \"Verão de Anu\". Durante aquele verão, graças à proteção divina do deus do céu Anu, todos os demônios na torre perdem seu poder. O país de Uruk começou uma invasão da torre para suprimir os demônios. Eles construíram posições dentro da torre, com o objetivo de chegar aos níveis superiores. O exército Uruk sabe que este é o terceiro verão de Anu - um momento perfeito para lançar uma missão para suprimir o monstro Druaga de uma vez por todas. Os soldados do exército não são os únicos na torre. Uma enitre cidade chamada Meskia formou-se dentro do primeiro andar da torre. Ele hospeda não apenas soldados, mas também aventureiros que ouviram rumores sobre um tesouro lendário chamado Haste de Cristal Azul, que se diz que repousa no topo da torre. Com todos esses grupos diferentes na mistura, cada um com sua própria agenda, só podemos imaginar como as coisas vão se desenrolar durante este verão incomum.",
              "maturidade": null,
