              "sinopse": "Com espíritos quebrados e perguntas enigmáticas que não têm respostas persistentes, Jil ainda está tentando descobrir tudo. Então, uma garota misteriosa chamada Kai aparece diante dele e diz: \"Leve-me ao topo da torre.\"\n\nO pedido de Kai envolto em ambigüidade, Jil terá outra chance de trabalhar para completar seu destino e ascender a Torre. Com suas esperanças e aspirações aparentemente escapando de suas mãos, Jil deve enfrentar o desafio mais uma vez nesta aventura sem fim.",
