              "trailer": null,
              "episodios": 12,
              "sinopse": "Durante uma caminhada regular depois da escola, a gulosa estudante Hibiki Sakura é confrontada por sua melhor amiga, Ayaka Uehara, sobre sua cintura cada vez maior. Com suas tentativas de exercícios solitários falhando miseravelmente, Hibiki decide ingressar no recém-inaugurado Silverman Gym. Em sua orientação, Hibiki corre para a presidente do conselho estudantil e ídolo da escola Akemi Souryuuin.\n\nNo entanto, logo descobrimos que Hibiki terá muito mais coisas do que esperava. Não só o Silverman Gym está cheio de fisiculturistas e atletas de renome mundial, mas para piorar as coisas, Akemi acaba por ser um fetichista muscular total! Enojado pela cena que se desenrola diante de seus olhos, Hibiki começa a sair, apenas para ser interrompido pelo treinador Naruzou Machio. Completamente encantada com seu recém-descoberto Príncipe Encantado, Hibiki se inscreve como membro da academia. Agora, como resultado de sua decisão repentina, Hibiki deve se adaptar a seu novo estilo de vida.",
