          "items": {
            "d0088_1": {
              "id": "d0088_1",
              "foto": "https://cdn1.wakanim.tv/press/animetasemaine/danmachi_kv.png",
              "link": "https://myanimelist.net/anime/28121/Dungeon_ni_Deai_wo_Motomeru_no_wa_Machigatteiru_Darou_ka",
              "trailer": null,
              "episodios": 13,
              "sinopse": "A vida na agitada cidade de Orário nunca é enfadonha, especialmente para Bell Cranel, um jovem ingênuo que espera se tornar o maior aventureiro do país. Depois de um encontro casual com a deusa solitária, Héstia, seus sonhos se tornam um pouco mais próximos da realidade. Com o apoio dela, Bell embarca em uma busca fantástica enquanto se aventura nas profundezas das catacumbas cheias de monstros da cidade, conhecidas apenas como \"Masmorras\". A morte espreita em cada esquina nas profundezas cavernosas deste labirinto aterrorizante, e um poder misterioso se move entre as sombras.\n\nMesmo na superfície, a sobrevivência é um privilégio conquistado com dificuldade. Na verdade, nada é certo em um mundo onde deuses e humanos vivem e trabalham juntos, especialmente quando muitas vezes lutam para se dar bem. Uma coisa é certa, porém: uma miríade de erros, triunfos e amizades aguarda o protagonista destemidamente otimista deste conto hercúleo.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0088_2": {
              "id": "d0088_2",
              "foto": "https://media.kg-portal.ru/anime/d/danmachiswordoratoria/production/danmachiswordoratoria_1o.jpg",
              "link": "https://myanimelist.net/anime/32887/Dungeon_ni_Deai_wo_Motomeru_no_wa_Machigatteiru_Darou_ka_Gaiden__Sword_Oratoria",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Depois de descer a este mundo, os deuses criaram guildas onde aventureiros podem testar sua coragem. Essas guildas, conhecidas como \"familia\", concedem aos aventureiros a chance de explorar, reunir, caçar ou simplesmente se divertir.\n\nCalabouço ni Deai wo Motomeru no wa Machigatteiru Darou ka Gaiden: Espada Oratóriacomeça em Orário, a animada cidade das aventuras. A Princesa da Espada, Ais Wallenstein, e a maga novata, Lefiya Viridis, são membros da Família Loki, que são especialistas em caça de monstros. Com o resto de seu grupo, eles viajam para a torre de Babel na esperança de explorar a masmorra abaixo. Lar de monstros poderosos, a masmorra vai cumprir o desejo de Ais de dominar suas habilidades com a espada, enquanto traz Lefiya mais perto de seu sonho de suceder Riveria Ljos Alf, vice-capitão da Família Loki, como o mago mais poderoso da terra.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0088_3": {
              "id": "d0088_3",
              "foto": "https://image.tmdb.org/t/p/original/pniVdlmhQ1oOwNtf1xlm91e47NL.jpg",
              "link": "https://myanimelist.net/anime/37347/Dungeon_ni_Deai_wo_Motomeru_no_wa_Machigatteiru_Darou_ka_II",
              "trailer": null,
              "episodios": 12,
              "sinopse": "É business as usual na enorme cidade de Orario, onde legiões de aventureiros se reúnem para explorar o \"Calabouço\" infestado de monstros. Entre eles está o facilmente atrapalhado, mas corajoso, Bell Cranel, o único membro da Família Héstia. Com a ajuda de sua partidária semi-humana Liliruca Arde e do ferreiro competente Welf Crozzo, Bell ganhou o título de Pequeno Novato ao se tornar o aventureiro de crescimento mais rápido de Orario, graças aos seus esforços nos níveis mais profundos do Calabouço.\n\nMasmorra ni Deai wo Motomeru no wa Machigatteiru Darou ka II continua as aventuras de Bell enquanto tenta trazer glória para sua deusa e proteger aqueles com quem ele se preocupa. No entanto, várias famílias e deuses em toda a cidade começam a notar suas conquistas e tentam adicioná-lo às suas fileiras.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0088_4": {
