            "d0088_7": {
              "id": "d0088_7",
              "foto": "https://i.loli.net/2019/08/07/q7Rx6mDwnXOg8Fp.jpg",
              "link": "https://myanimelist.net/anime/37348/Dungeon_ni_Deai_wo_Motomeru_no_wa_Machigatteiru_Darou_ka_Movie__Orion_no_Ya",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Na cidade de Orário, sob uma torre incrivelmente alta, fica a masmorra. Somente aventureiros que formam parcerias com os próprios deuses têm alguma esperança de derrotar os monstros que estão dentro. Mas a masmorra não é o único lugar onde existem monstros. Longe de Orário, nas ruínas de uma antiga cidade, surge uma nova ameaça. Para combater essa ameaça, a deusa Artemis veio a Orario em busca de um campeão - mas não é Ais Wallenstein (a lendária Princesa da Espada) nem Ottar (o guerreiro mais forte que já entrou na masmorra) que ela escolheu. Em vez disso, é Bell Cranel, um aventureiro novato em parceria com uma deusa de nível inferior.",
