        "d0089": {
          "id": "d0089",
          "parentes": [],
          "items": {
            "d0089_1": {
              "id": "d0089_1",
              "foto": "https://i.pinimg.com/originals/ff/2c/94/ff2c941f8c3370359d9c2a83a31f4f23.jpg",
              "link": "https://myanimelist.net/anime/6746/Durarara",
              "trailer": null,
              "episodios": 24,
              "sinopse": "No distrito de Ikebukuro, no centro de Tóquio, em meio a muitos rumores e avisos estranhos de gangues anônimas e ocupantes perigosos, uma lenda urbana se destaca das demais - a existência de um \"Cavaleiro Negro\" sem cabeça que se diz ser visto dirigindo uma motocicleta preta como azeviche. pelas ruas da cidade.\n\nMikado Ryuugamine sempre desejou a emoção da vida na cidade, e um convite de um amigo de infância o convence a se mudar para Tóquio. Ao testemunhar o Cavaleiro Negro em seu primeiro dia na cidade, seus desejos já parecem ter sido atendidos. Mas à medida que eventos sobrenaturais começam a ocorrer, cidadãos comuns como ele, junto com os habitantes mais pitorescos de Ikebukuro, se misturam na comoção que irrompe em sua cidade.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0089_2": {
              "id": "d0089_2",
              "foto": null,
              "link": "https://myanimelist.net/anime/8408/Durarara_Specials",
              "trailer": null,
              "episodios": 2,
              "sinopse": "Celty Sturluson tem a tarefa de entregar uma bolsa vermelha suspeita como parte de suas funções de mensageira - o problema é: ela está sendo procurada por várias organizações. Enquanto ela caminha por Ikebukuro em direção ao lugar para onde a bolsa deveria ser levada, ela é perseguida por homens misteriosos que falam uma língua estrangeira, e seu pacote acaba arrastando muitos dos residentes da cidade para o conflito.\n\nPosteriormente, o famoso ator Yuuhei Hanejima acaba de chegar a Ikebukuro como parte de um programa especial de TV, em busca do melhor casal que lhes dê a chance de aparecer em um de seus filmes. No entanto, Yuuhei Hanejima é na verdade um nome artístico de Kasuka Heiwajima, o irmão mais novo de Shizuo, e quando um usuário anônimo da internet ameaça matar o superstar, esse usuário descobre o peso do que significa esse relacionamento. Além disso, Shizuo descobre que o responsável pela tentativa de ataque é a praga intrometida que ele detesta com paixão.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "d0089_3": {
              "id": "d0089_3",
              "foto": "https://3.bp.blogspot.com/-NJQXurwR5JY/WAZ3NYIvs4I/AAAAAAAASCQ/BnV99KUHuxQswCLzOzc3QlyG9WKfQA7TQCLcB/s1600/onKERFIKpn0.jpg",
              "link": "https://myanimelist.net/anime/27833/Durararax2_Ketsu",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Enquanto Mikado Ryuugamine continua a purgar os Dólares de acordo com seu senso distorcido de justiça, Masaomi Kida espera trazer seu amigo de volta aos seus sentidos, juntando os Lenços Amarelos mais uma vez. Mal sabem eles que uma força muito mais dominante está prestes a entrar em sua luta pelo poder, uma força com a qual seu amigo Anri Sonohara está muito familiarizado.\n\nEnquanto isso, o grupo que se reuniu no apartamento de Shinra Kishitani percebe que está à beira de algo que mudará sua vida, um evento que lançará Ikebukuro em uma espiral de confusão. A ansiedade deles é percebida quando relatos sobre a cabeça de Celty sendo encontrada em público começam a aparecer em todas as notícias enquanto Kasane Kujiragi começa a se mover.\n\nJá se foram os breves períodos de tranquilidade enquanto a atual turbulência prepara o palco para uma apresentação final nesta emocionante conclusão da história dos melhores de Ikebukuro.",
              "maturidade": null,
              "pontosBase": 0.0
            },
