              "link": "https://myanimelist.net/anime/23199/Durararax2_Shou",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Embora a paz tenha finalmente retornado a Ikebukuro, muitas das ocorrências estranhas se tornaram vistas comuns pela cidade. Um desses casos é a constante perseguição policial a Celty Sturluson, o Cavaleiro Sem Cabeça. Além disso, alguém colocou uma grande recompensa por ela, acendendo a motivação de todos os membros da gangue para começar a procurar pela criatura sobrenatural. Enquanto isso, Mikado Ryuugamine é abordado por Aoba Kuronuma, um misterioso underclassman com intenções desconhecidas, que revela que conhece a verdadeira identidade de Mikado.\n\nMas o estado de tranquilidade de Ikebukuro dura pouco, pois uma nova ameaça aparece na forma de um assassino que atende pelo pseudônimo de \"Hollywood\", conhecido por usar uma máscara diferente cada vez que comete um crime. Como os vários eventos que estão ocorrendo provam estar conectados mais uma vez, Ikebukuro é lançado em outro conflito que ameaça engolfar a cidade inteira no caos.",
              "maturidade": null,
              "pontosBase": 0.0
            },
