              "link": "https://myanimelist.net/anime/30191/Durararax2_Shou__Watashi_no_Kokoro_wa_Nabe_Moyou",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Uma noite, Mikado Ryuugamine aceita um convite para ir ao apartamento de Shinra Kishitani, ansioso para falar com Celty já que algum tempo se passou desde a última conversa dos dois. Mas, para seu espanto, ele descobre que um grande grupo dos melhores de Ikebukuro se reuniu lá para uma festa quente.\n\nJá confuso com a situação atual, Mikado fica ainda mais surpreso ao ver que seu amigo e colega aluno da Academia Raira, Anri Sonohara, também está lá. Enquanto os dois decidem sentar-se juntos, alguns membros do grupo começam a relembrar eventos do passado: Mikado relembra uma aventura de sua infância com Masaomi Kida, Anri explica como ela se tornou amiga de Mika Harima e Shizuo Heiwajima conta sobre seu primeiro encontro com Tom Tanaka.",
              "maturidade": null,
