              "link": "https://myanimelist.net/anime/27831/Durararax2_Ten",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Em Ikebukuro, as vidas de seus cidadãos continuam se entrelaçando como se seus destinos estivessem predestinados. Mikado Ryuugamine está agora um passo mais perto de seu objetivo de viver uma vida emocionante e, por sua vez, aprofunda-se no lado mais sombrio de Ikebukuro. Depois de ganhar o controle absoluto sobre um ex-rival, ele usa seu poder recém-descoberto como deseja, purgando os dólares de dentro para moldá-lo na organização ideal. Isso prova ser tão desafiador quanto parece, já que Mikado agora deve lidar com interferência externa indesejada, principalmente um amigo ressurgindo e que sentia falta de você. Enquanto isso, Izaya Orihara ainda tem alguns planos na manga, embora um centro de troca de informações rival tenha se mostrado um grande obstáculo, espreitando no distrito central favorito de todos. Sem dúvida, mais cedo ou mais tarde, o caos irá atacar novamente.",
              "maturidade": null,
