              "episodios": 1,
              "sinopse": "Apesar do caos que está ocorrendo em Ikebukuro, Shinra Kishitani e Celty Sturluson decidiram fazer uma curta viagem. Empolgado por finalmente sair com quem ama, o médico clandestino prioriza dar a Celty toda a sua atenção, mesmo que isso signifique rejeitar ligações de sua boa amiga Izaya Orihara.\n\nNo entanto, apesar de suas esperanças de ter um feriado tranquilo, vários residentes de Ikebukuro continuam tentando entrar em contato com ele. Além disso, assim que Shinra começa a gostar de relembrar velhas memórias em um passeio de carruagem junto com sua amada, Celty começa a notar uma presença estranha ...",
