              "episodios": 12,
              "sinopse": "Em uma história que se passa anos atrás, Himura Yuu é um jovem estudioso e diligente com a intenção apenas de manter sua posição acadêmica de destaque na Otowa Academy. Um dia, ele conhece uma garota misteriosa chamada Amamiya Yuuko, que, para sua surpresa, o reconhece. Memórias de uma infância distante, memórias esquecidas ... encontrar Yuuko novamente forçará Yuu a enfrentar os arrependimentos e tristezas de seus passados ​​e presentes coletivos.\n\nNo presente, Kuze Shuuichi pode parecer um mulherengo, mas olhando mais de perto, é um homem que prefere ficar sozinho. Hayama Mizuki, no entanto, não é o tipo de garota que o deixaria em paz, especialmente depois de ouvir os belos sons de sua apresentação de violino. Enquanto Mizuki tenta se tornar mais perto dele, Kuze tenta afastá-la - a história de seu relacionamento inicial é obscurecida por tons de uma tragédia iminente.",
