              "trailer": null,
              "episodios": 12,
              "sinopse": "Na véspera de Natal, Hiro Hirono encontra Miyako Miyamura, uma garota frívola que \"pega emprestada\" sua bicicleta para perseguir um ladrão de bolsas. Depois que Hiro encontra sua bicicleta destruída e Miyako inconsciente, os dois inesperadamente passam a véspera de Natal juntos, e quando descobrem que vão para a mesma escola, seu relacionamento acidental se desenvolve ainda mais. Isso desperta o ciúme do amigo de infância de Hiro, Kei Shindou, cuja abordagem pura da vida chama a atenção de Kyosuke Tsutsumi, um fotógrafo mulherengo em busca da foto perfeita.\n\nEm outro lugar, Renji Asou, um garoto que sonha em ser o cavaleiro de uma garota em uma armadura brilhante, tem um encontro casual com a irmã gêmea de Kei - a excessivamente tímida Chihiro Shindou, que passa seu tempo lendo sozinha - em uma estação de trem abandonada. Os dois rapidamente se tornam amigos e decidem escrever um romance juntos. Porém, quando Renji descobrir o segredo de Chihiro, uma deficiência que faz com que ela tenha uma memória eternamente efêmera, seus ideais infantis serão colocados à prova.\n\nGuiados por dois adultos misteriosos, os relacionamentos desses jovens se entrelaçam em uma história de amor, rejeição, aceitação e memórias comoventes.",
