              "trailer": null,
              "episodios": 12,
              "sinopse": "Em um planeta distante da Terra, existe um reino cheio de rostos sorridentes. Princesa Yuuki tem 12 anos e está prestes a entrar em uma idade sensível na vida de uma pessoa. Todos os dias ela chora, ri e, às vezes, seu coração bate de tanta emoção. Todo o tempo, ela vive alegremente no palácio real.\n\nPreenchendo seus dias estão seus vassalos leais: seu tutor Reira, Izana que auxilia nos assuntos políticos, o líder da cavalaria Harold ... e então há seu amigo de infância e ajudante Joshua.\n\n\"Yuuki! Se você tem espírito e coragem, você pode fazer qualquer coisa!\"\n\n\"... Não, isso de novo não! Joshua, seja mais nobre!\"\n\nStella tem 17 anos e é um soldado competente e reservado. Porém, ela está sempre sorrindo ... pois sorrir é essencial para viver.\n\nEsta é a história de duas meninas nascidas em planetas distantes.",
