              "link": "https://myanimelist.net/anime/345/Eikoku_Koi_Monogatari_Emma",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Emma foi empregada doméstica a maior parte de sua vida. Trabalhando para uma governanta aposentada - a rígida, mas compassiva Kelly Stownar - Emma passou a amar seu trabalho e há muito tempo aceitou seu lugar na sociedade. Linda, trabalhadora e excepcionalmente gentil, Emma conquistou o coração de muitos trabalhadores de Londres - mas seus sentimentos sempre permanecem não correspondidos. Emma está esperando por amor e o encontra nos lugares mais improváveis.\n\nWilliam é o filho mais velho da rica família Jones - uma família que só recentemente foi aceita na pequena nobreza, garantindo sua posição na alta sociedade. Ele também é o ex-pupilo da Sra. Stownar, e em sua primeira visita em anos, ele se apaixona perdidamente por sua empregada. Suas tentativas sinceras de ganhar seu afeto, juntamente com sua boa natureza e personalidade calorosa, conquistaram o coração de Emma.\n\nMas a sociedade educada da Inglaterra do século 19 não aceita com bons olhos a rejeição da tradição. Como resultado, o relacionamento de Emma e William não poderia enfrentar mais oposição. Em um mundo onde as linhas de classe são tão fortemente defendidas quanto as fronteiras das nações, o amor deles tem força para sobreviver?",
              "maturidade": null,
              "pontosBase": 0.0
