              "link": "https://myanimelist.net/anime/2035/Eikoku_Koi_Monogatari_Emma__Molders-hen",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Na distante vila de Haworth, um novo capítulo na vida de Emma começou. Agora empregada pela rica família Molders, Emma decidiu deixar o passado para trás. Ela terá que se ajustar a uma nova casa, uma nova amante charmosa (mas excêntrica) e uma série de criados, alguns com seu próprio passado enterrado.\n\nEnquanto isso, de volta a Londres, William está fazendo o possível para manter os desejos de seu pai como herdeiro da família Jones, mas por mais que tente, ele não consegue esquecer Emma. No entanto, sempre que ele se sente pior, Eleanor está sempre lá para confortá-lo com um sorriso caloroso e tímido. A resposta ao seu coração partido poderia estar bem diante de seus olhos?",
