              "link": "https://myanimelist.net/anime/39792/Eizouken_ni_wa_Te_wo_Dasu_na",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Midori Asakusa vê o mundo de uma maneira um pouco diferente. Sempre com o nariz enfiado em um caderno de esboços, Asakusa desenha paisagens e fundos detalhados tanto do mundo ao seu redor quanto daquele dentro de sua imaginação sem limites. Até mesmo o simples ato de rabiscar em uma parede evolui para um reparo de emergência no casco externo de sua nave espacial. Ela só é trazida de volta à realidade por sua melhor amiga Sayaka Kanamori. Os dois são totalmente opostos, com a admiração infantil de Asakusa contrastada pela abordagem calculada de Kanamori da vida.\n\nDepois de um encontro casual onde os dois \"salvam\" a jovem modelo Tsubame Misuzaki de seu guarda-costas superprotetor, uma conexão instantaneamente surge entre Asakusa e Misuzaki, já que ambos compartilham uma intensa paixão pela arte e animação. Enquanto Asakusa se interessa por cenários e cenários, Misuzaki adora desenhar a forma humana. Percebendo uma oportunidade de ganhar dinheiro, Kanamori sugere que eles abram um clube de animação, que eles disfarçam de clube de cinema, já que a escola já tem um clube de anime. Assim começa a jornada do trio de produzir animações que irão maravilhar o mundo.\n\nDa mente brilhante de Masaaki Yuasa, Eizouken ni wa Te wo Dasu na! é uma carta de amor à animação, extremamente criativa em sua abordagem e um testemunho do potencial do meio.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
