              "sinopse": "Depois que Makoto Mizuhara concorda em testemunhar contra o barulhento presidente do conselho estudantil Katsuhiko Jinnai por subornar clubes escolares nas recentes eleições do conselho estudantil, Jinnai o persegue em uma tentativa de silenciar seu autoproclamado rival. De repente, durante a perseguição, o tempo para para todos - exceto Makoto. Perplexo, ele vagueia pelo campus até que percebe uma luz vindo do porão fechado da escola, onde uma relíquia antiga tinha acabado de ser descoberta.\n\nMakoto está caminhando em direção ao artefato cercado por fios de luz, quando dele sai uma mulher de outro mundo que afirma estar esperando por dez mil anos para vê-lo. Enfraquecida com o passar do tempo, ela usa seu poder restante para transportar um confuso Makoto para outro mundo, ao qual ela se refere como El-Hazard. No entanto, outros que ainda estão na escola também são apanhados no feitiço, a saber: Jinnai; Masamichi Fujisawa, o professor alcoólatra; e Nanami Jinnai, a obstinada irmã do presidente Jinnai.\n\nO mundo fantástico e magnífico de El-Hazard aguarda esses quatro indivíduos, onde eles se envolverão na história de seus habitantes e embarcarão em uma aventura cheia de risos, perigo e até romance.",
              "maturidade": null,
              "pontosBase": 0.0
            },
