              "link": "https://myanimelist.net/anime/116/El_Hazard__The_Wanderers",
              "trailer": null,
              "episodios": 26,
              "sinopse": "O gênio da ciência do ensino médio Makoto Mizuhara está trabalhando em seu mais novo projeto em preparação para o festival da escola, ao lado de seu melhor amigo Nanami Jinnai. O irmão de Nanami e rival de longa data de Makoto, o inescrupuloso presidente do conselho estudantil Katsuhiko Jinnai, está sendo investigado por maltratar o planejamento do festival escolar e está convencido de que Makoto está tramando para roubar sua posição. Uma noite, enquanto Makoto e Nanami estão fazendo uma pausa com seu professor Masamichi Fujisawa, Jinnai entra furtivamente no laboratório de ciências e sabota o dispositivo de Makoto, que de repente abre um portal que lança todos os quatro para outro mundo!\n\nAo chegar, Makoto é imediatamente atacado por uma horda de monstros insetos gigantes. Enquanto foge deles, ele se depara com Fujisawa e uma garota chamada Rune Venus. Depois de Fujisawa lutar contra os monstros, um grupo de dignitários chega, procurando por Rune, sua princesa. Eles informam Makoto e Fujisawa que estão em um mundo chamado El-Hazard e os levam de volta ao palácio de Roshtaria, seu reino. Embora seus conselheiros suspeitem dos recém-chegados, Rune decreta que eles devem ser tratados como convidados e rapidamente torna-se amigo de Makoto. Sem saber que Nanami e Jinnai também estão neste mundo, Makoto começa a trabalhar tentando descobrir um caminho de volta à Terra.",
              "maturidade": null,
