              "episodios": 12,
              "sinopse": "Em um mundo de aventureiros e magia está a Ilha Naral. A cada geração, um Lorde Demônio surge para atormentar a terra, e a cada geração, um Herói nasce para subjugá-lo. Por incontáveis ​​séculos, o ciclo se repetiu sem fim à vista. A mais recente Herói, Juulia \"Yusha\" Charldetto, quase completou sua valente campanha ao lado de membros de seu partido: o padre responsável Seiran \"Seira\" Élénoir, o enigmático mago Meiza \"Mei\" Endust e o guerreiro hiperenergético Fai Fai.\n\nNa batalha final contra o Lorde Demônio, o grupo de Yusha tenta um feitiço arriscado para lançar seu inimigo na deriva do tempo. Mas o encantamento dá errado, enviando Yusha e seus amigos de volta a um tempo antes do Lorde Demônio, antes de Yusha se tornar o Herói, e antes que o grupo se graduasse como aventureiros. Com suas memórias do futuro apagadas, as quatro garotas reiniciam suas ambições de se tornar o Grupo do Herói, aspirando derrotar o Lorde Demônio.\n\nNo entanto, em uma súbita reviravolta do destino, o Lorde Demônio também foi enviado de volta no tempo com suas memórias intactas. Reduzido à forma de uma menina, o Lorde Demônio leva o nome de Mao e se infiltra na escola de aventureiros como professor, planejando parar Yusha antes que ela se torne uma heroína. Assim começa a história de Yusha e seus amigos, em sua busca para derrotar o Lorde Demônio, sem saber que aquele que procuram está bem ao seu lado.",
