              "trailer": null,
              "episodios": 24,
              "sinopse": "Combustão Humana Espontânea: um fenômeno caótico que assola a humanidade há anos, transformando aleatoriamente pessoas comuns em criaturas flamejantes e violentas conhecidas como Infernais. Enquanto os infernais constituem os relatos da primeira geração da combustão humana, a segunda e a terceira gerações se tornaram conhecidas como pirocinéticos - pessoas dotadas com a habilidade de manipular e controlar suas chamas enquanto permanecem humanas. Para combater a ameaça Infernal e descobrir a causa, as Forças Armadas de Tóquio, a Fire Defense Agency e a Holy Church of Sol produziram sua resposta: a Special Fire Force.\n\nO jovem e ansioso Shinra Kusakabe pirocinético de terceira geração, apelidado de Pegadas do Diabo por sua capacidade explosiva de incendiar seus pés à vontade, torna-se membro da animada Special Fire Force Company 8. Sustentando o dever da brigada de extinguir os infernais em chamas e entregar suas almas descanse, Shinra está determinado a se tornar um herói que salvará as vidas daqueles ameaçados pelo terror das chamas.\n\nNo entanto, este não é o jogo do herói que Shinra imaginou. O Fire Force é uma bagunça fraturada de brigadas feudais, avistamentos infernais anormais estão aumentando por toda Tóquio, e um grupo sombrio está alegando ter respostas para o estranho incêndio que causou a morte da família de Shinra 12 anos atrás. Enfrentando muitos obstáculos dentro e fora da Força do Fogo, Shinra luta para descobrir a verdade por trás dos mistérios ardentes que o mantiveram no escuro.",
