              "episodios": 23,
              "sinopse": "Dentro da cúpula da cidade de Romdo está uma das últimas civilizações humanas na Terra. Milhares de anos atrás, uma catástrofe ecológica global condenou o planeta; agora, a vida fora dessas cúpulas é virtualmente impossível. Para acelerar a recuperação da humanidade, \"AutoReivs\", robôs semelhantes a humanóides, foram criados para ajudar as pessoas em seu dia-a-dia. No entanto, os AutoReivs começaram a contrair uma doença enigmática chamada \"Vírus Cogito\", que lhes dá autoconsciência. Re-l Mayer, neta do governante de Romdo, é designada para investigar esse fenômeno ao lado de seu parceiro do AutoReiv, Iggy. Mas o que começa como uma investigação de rotina rapidamente se transforma em uma conspiração enquanto Re-l é confrontado pelos pecados mais sombrios da humanidade.\n\nEm outro lugar em Romdo, um especialista em AutoReiv chamado Vincent Law também deve enfrentar seus demônios quando eventos surreais começam a ocorrer ao seu redor. Re-l, Iggy, Vincent e a criança AutoReiv chamada Pino formarão uma facção improvável enquanto lutam para descobrir os mistérios de Romdo e, finalmente, descobrir o verdadeiro propósito dos seres míticos chamados \"Proxies\".",
