              "sinopse": "Há um ano, Sagiri Izumi tornou-se meio-irmão de Masamune Izumi. Mas a morte repentina de seus pais dilacera sua nova família, fazendo com que Sagiri se torne um recluso que a isola de seu irmão e da sociedade.\n\nEnquanto cuida do que resta de sua família, Masamune ganha a vida como autor de novelas leves com um pequeno problema: ele nunca conheceu seu aclamado ilustrador, Eromanga-sensei, famoso por desenhar o erotismo mais obsceno. Por meio de uma série de acontecimentos embaraçosos, ele descobre que sua irmã mais nova foi sua parceira o tempo todo!\n\nConforme novos personagens e desafios aparecem, Masamune e Sagiri devem agora enfrentar a indústria de light novel juntos. Eromanga-Senseisegue o desenvolvimento de seu relacionamento e sua luta para ter sucesso; e à medida que Sagiri cresce lentamente fora de sua concha, por quanto tempo ela será capaz de esconder sua verdadeira personalidade do resto do mundo?",
