              "sinopse": "Este mundo passou por muitos entardeceres e está lentamente chegando ao fim. Dentro deste mundo, na parte ocidental da \"Terra do Crepúsculo\", havia uma nação que prosperou graças ao uso da alquimia.\n\nLá, para sobreviver à eventual chegada do \"Fim do Crepúsculo\", as pessoas devotaram seus esforços para redescobrir e recriar as tecnologias alquímicas perdidas. A tecnologia redescoberta da era passada foi reunida na cidade de pesquisa de alquimia conhecida como \"Central\", onde a pesquisa foi conduzida sobre como deter o avanço do crepúsculo.\n\nUm dos heróis é um jovem que pesquisou alquimia em Central, o outro uma garota que mora em uma pequena cidade na fronteira. O nome dessa garota é Escha. No processo de usar seu conhecimento da alquimia antiga para ajudar os outros, ela foi designada para o Departamento de Desenvolvimento. O nome do jovem é Logy. Tendo aprendido as mais novas técnicas alquímicas em Central, ele solicitou uma transferência para esta cidade com poucos funcionários para fazer uso de suas habilidades, e conhece Escha quando ele é designado para o Departamento de Desenvolvimento também. Os dois fazem a promessa de usar sua alquimia juntos e levar sucesso para o Departamento de Desenvolvimento.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
