              "link": "https://myanimelist.net/anime/28221/Etotama",
              "trailer": null,
              "episodios": 12,
              "sinopse": "A cada 60 anos, os céus realizam um ritual sagrado chamado ETM12. Esse costume envolve a seleção de um Eto-musume digno - seres celestiais que representam diferentes animais - para se tornar um dos membros do zodíaco chinês, ou Eto-shin. No entanto, desde o primeiro ETM12 há dois mil anos, o lote original de Eto-shin reina sem que ninguém seja capaz de substituí-los.\n\nNyaa-tan é um gato Eto-musume que aspira a se tornar um membro do zodíaco no atual ETM12. Para cumprir sua ambição, ela precisa garantir 12 selos, um para cada Eto-shin. Para isso, ela deve vencer vários tipos de batalhas usando Sol / Lull - energia divina criada pelas emoções positivas das pessoas. Esta tarefa não é fácil, entretanto, já que seus poderes como um Eto-musume estão muito abaixo das habilidades de um único Eto-shin. Como tal, ela precisa de uma fonte constante de energia.\n\nMas em um encontro casual, Nyaa-tan conhece Takeru Amato, um homem que acabou de ser transferido para o apartamento onde ela está secretamente hospedada. Para a alegria de Nyaa-tan, Takeru descobre que distribui Sol / Lull de alta qualidade - algo que o diferencia da maioria das pessoas. Com isso, a história de Takeru e Nyaa-tan começa. Enquanto Takeru apóia Nyaa-tan em seus sonhos, ele encontra o Eto-shin e começa a descobrir um passado misterioso.",
