              "trailer": null,
              "episodios": 6,
              "sinopse": "No futuro Japão, em uma época em que as donas de casa andróides se tornaram comuns, a sociedade obedece estritamente às Três Leis da Robótica, que todos os andróides devem seguir. Sob a influência do Comitê de Ética em Robótica, os andróides são tratados da mesma forma que uma tecnologia inferior, como eletrodomésticos. No entanto, existe uma minoria com adoração por andróides, categorizados como \"andróides holics\", e são rejeitados pelo público em geral.\n\nRikuo Sakisaka foi criado para aceitar os preceitos da sociedade sobre os andróides e está perfeitamente ciente de que eles não são humanos. Isto é, até o dia em que ele descobre uma mensagem estranha enterrada nos registros de atividades de seu andróide doméstico, Sammy. Isso o leva a Eve no Jikan, um café com apenas uma regra que seus clientes devem seguir: não deve haver distinção entre humanos e andróides. A curiosidade leva Rikuo a aprender mais sobre a loja, e ele tenta descobrir a razão por trás do comportamento peculiar de Sammy.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "e0023_": {
              "id": "e0023_",
              "foto": "https://i.pinimg.com/736x/d3/d1/df/d3d1df6725ea6e1d047249e75b0c4504.jpg",
              "link": "https://myanimelist.net/anime/7465/Eve_no_Jikan_Movie",
              "trailer": null,
              "episodios": 1,
              "sinopse": "A versão cinematográfica é a versão completa da história. Inclui todos os ONAs e cenas completamente novas, dando detalhes sobre a história de fundo de alguns personagens.\n\nEm algum momento no futuro Japão, os andróides estiveram envolvidos em todos os aspectos da vida das pessoas. Um dia, ao verificar o registro comportamental de seu andróide, Rikuo, um estudante, percebeu que os tempos de retorno de seu andróide têm sido estranhos recentemente. Com seu amigo Masaki, eles descobriram o lugar onde seu andróide, Sammy, tem visitado: um pequeno café chamado Eve no Jikan onde andróides e humanos não são vistos como diferentes. Ao conversar com as \"pessoas\" no café e descobrir mais sobre o comportamento de Sammy, Rikuo mudou sua visão sobre os andróides e os tratou como amigos ao invés de ferramentas. Ao mesmo tempo, em outras partes do Japão, o comitê de ética está tentando impor políticas para reduzir o envolvimento e o uso de andróides na sociedade.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
