              "episodios": 12,
              "sinopse": "\"Era uma vez, as fadas eram ferramentas de guerra.\"\n\nA história se passa em um mundo onde as fadas possuem e habitam animais, dando-lhes habilidades misteriosas. Ao remover os órgãos de um animal possuído e transplantá-los em humanos, as fadas podem ser convocadas como um alter ego e usadas como uma arma. Esses indivíduos que usavam fadas como ferramentas de guerra eram chamados de \"Soldados Fadas\". Depois que a guerra acabou e eles completaram seus papéis, os soldados perderam seu propósito. Alguns começaram a trabalhar para o governo, alguns se juntaram à máfia e alguns até se tornaram terroristas, pois cada um escolheu seu próprio modo de vida.\n\nNove anos se passaram desde a guerra. A protagonista Mariya é uma nova recruta de \"Dorothea\", uma organização que investiga e suprime crimes relacionados a fadas. Em meio à situação política instável, criminosos com feridas persistentes da guerra e conflitos passados ​​emergem e se envolvem no terrorismo como um ato de vingança. Esta é a história de Soldados Fadas, lutando por sua própria justiça em um mundo caótico do pós-guerra.",
