        "f0002": {
          "id": "f0002",
          "parentes": [],
          "items": {
            "f0002_1": {
              "id": "f0002_1",
              "foto": "https://anipoisk.org/uploads/posters/2017-10/poster_1508864881125.jpg",
              "link": "https://myanimelist.net/anime/6702/Fairy_Tail",
              "trailer": null,
              "episodios": 175,
              "sinopse": "Na terra mística de Fiore, a magia existe como uma parte essencial da vida cotidiana. Incontáveis ​​guildas de magia estão no centro de todas as atividades mágicas e servem como locais para magos de mentes semelhantes se unirem e aceitarem solicitações de trabalho. Entre eles, Fairy Tail se destaca dos demais como um lugar de força, espírito e família.\n\nLucy Heartfilia é uma jovem maga em busca das chaves do portal celestial, e seu sonho é se tornar uma feiticeira completa, ingressando nesta famosa guilda. Em sua busca, ela encontra Natsu Dragneel e seu parceiro Happy, que estão em uma missão para encontrar o pai adotivo de Natsu, o dragão Igneel.\n\nAo ser enganada por um homem, Lucy cai em uma tentativa de sequestro, apenas para ser salva por Natsu. Para seu choque, ele revela que é um membro da Fairy Tail e a convida para se juntar a eles. Lá, Lucy conhece os estranhos membros da guilda, como o mago do gelo Gray Fullbuster e a espadachim mágica Erza Scarlet. Juntos como uma família, eles lutam contra as forças do mal, ajudam os necessitados e ganham novos amigos, enquanto desfrutam da aventura sem fim que é Fairy Tail.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0002_2": {
              "id": "f0002_2",
              "foto": "https://pm1.narvii.com/6134/24e56c122f361319f44c12d8b7893a582ede11a1_hq.jpg",
              "link": "https://myanimelist.net/anime/22043/Fairy_Tail_2014",
              "trailer": null,
              "episodios": 102,
              "sinopse": "Os Grand Magic Games atingem seu clímax após a vitória impressionante de Natsu Dragneel e Gajeel Redfox sobre Sting Eucliffe e Rogue Cheney da guilda Sabertooth. Este sucesso empurra a guilda Fairy Tail para mais perto de ser coroada a campeã geral, mas obter a vitória não é o único desafio que enfrentam. Um mistério ainda envolve um estranho encapuzado e o sinistro Portal do Eclipse, deixando mais perguntas do que respostas.\n\nMais aventuras malucas estão no horizonte para Fairy Tail enquanto suas travessuras destrutivas e alegres turbulências continuam inabaláveis. Seu maior desafio está se aproximando rapidamente, mas unidos como uma família, a guilda estará sempre pronta para enfrentar qualquer ameaça que surgir em seu caminho.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0002_3": {
              "id": "f0002_3",
              "foto": "https://www.ilcineocchio.it/cine/wp-content/uploads/2020/05/FairyTailLASACERDOTESSADELLAFENICE.jpg",
              "link": "https://myanimelist.net/anime/12049/Fairy_Tail_Movie_1__Houou_no_Miko",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Nas montanhas do norte de Fiore fica a Vila do Fogo, onde uma relíquia azul exuberante conhecida como Pedra da Fênix é preservada. Confiado a uma mulher misteriosa chamada Éclair, diz-se que contém o poder de uma antiga fênix. Ela vagueia pela terra sozinha e protege a pedra do perigo, apesar de não ter nenhuma lembrança de por que foi deixada sob seus cuidados e apenas a mais leve lembrança de para onde ela deve levá-la.\n\nDepois de encontrar a Fairy Tail da guilda de bruxos, Éclair recebe uma oferta de Natsu Dragneel e seus amigos para ajudá-la a descobrir os mistérios que cercam a pedra. No entanto, no meio da jornada do grupo, Éclair é repentinamente atacada e a pedra é tirada dela. Com isso, intenções nefastas de reviver a fênix em chamas por seu poder incomparável vêm à tona, e os magos da Fairy Tail se encontram em uma situação que pode significar uma calamidade. Eles agora devem trabalhar juntos para evitar o renascimento da fênix e salvar o mundo da ruína.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0002_4": {
