              "foto": "https://wallpaperset.com/w/full/f/9/9/530478.jpg",
              "link": "https://myanimelist.net/anime/17535/Fairy_Tail_Movie_1__Houou_no_Miko_-_Hajimari_no_Asa",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Este especial mostra um dia da vida de Eclair como prólogo do filme Houou no Miko.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0002_5": {
              "id": "f0002_5",
              "foto": "https://pbs.twimg.com/media/C9s9Zt9UAAAfNws.jpg:large",
              "link": "https://myanimelist.net/anime/30778/Fairy_Tail_Movie_2__Dragon_Cry",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Dragon Cry é um artefato mágico de poder mortal, transformado em um bastão pela fúria e desespero de dragões há muito desaparecidos. Agora, esse poder foi roubado das mãos do reino Fiore pelo nefasto traidor Zash Caine, que foge com ele para a pequena nação insular de Stella. Com medo de que o poder tenha caído em mãos erradas, o Rei dos Fiore rapidamente envia Fairy Tail para recuperar o cajado. Mas essa tarefa se mostra assustadora, pois um segredo sombrio está no coração do reino de Stella. Dragon Cry segue sua história enquanto eles reúnem todas as suas forças para recuperar o cajado roubado e salvar os dois reinos.",
