              "foto": "https://www.v2anime.com/media/cache/7f/18/7f18cfa82090762c38dd0b0b3977ffcd.jpg",
              "link": "https://myanimelist.net/anime/18393/Fairy_Tail_x_Rave",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Enquanto em uma missão para encontrar e derrotar um mago problemático, vários membros da guilda Fairy Tail são divididos em uma cidade desconhecida. Ao mesmo tempo, Haru, Elie e o resto do grupo também são separados. Em uma feliz reviravolta nos acontecimentos, Elie encontra Lucy e Happy, que estão procurando por Natsu. Enquanto isso, Haru se depara com Natsu, que está lutando contra o enjôo. Embora ela pareça amigável, Elie corresponde à descrição do encrenqueiro que os membros da Fairy Tail foram designados para localizar. Para piorar a situação, Natsu descobre a relação de Haru com ela e suspeita que eles sejam cúmplices.\n\nNeste cruzamento entre duas séries populares, Fairy Tail x Ravesegue os dois grupos conforme eles descobrem suas semelhanças entre si. À medida que as falhas de comunicação aumentam, eles são colocados um contra o outro em um confronto acalorado de poderes, mas terão que trabalhar juntos contra um inimigo comum.",
              "maturidade": null,
