              "link": "https://myanimelist.net/anime/35972/Fairy_Tail__Final_Series",
              "trailer": null,
              "episodios": 51,
              "sinopse": "Embora Fairy Tail tenha sido dissolvida e seus membros agora estejam espalhados por Fiore, Natsu Dragneel não desistiu de reunir a guilda que ele e outros chamavam de lar. Junto com seus companheiros Happy e Lucy Heartfilia, ele não vai parar por nada para manter Fairy Tail e seu espírito ígneo vivos, mesmo enquanto enfrentam sua prova mais difícil: a invasão de Fiore pelo imenso exército do Império Alvarez e seu familiar régua.",
