              "foto": "https://media.kg-portal.ru/anime/f/fruitsbasket/production/fruitsbasket_1.jpg",
              "link": "https://myanimelist.net/anime/120/Fruits_Basket",
              "trailer": null,
              "episodios": 26,
              "sinopse": "Após o acidente em que perdeu sua mãe, Tooru, de 16 anos, vai morar com seu avô, mas devido à reforma de sua casa, não pode continuar morando com ele. Alegando que encontrará alguém para ficar, mas também temendo as críticas de sua família e não querendo sobrecarregar nenhum de seus amigos, Tooru recorre a morar secretamente sozinha em uma tenda na floresta.\n\nUma noite, voltando do trabalho, ela encontra sua tenda enterrada sob um deslizamento de terra. Yuki Souma, o \"príncipe\" de sua escola, e seu primo Shigure Souma, um escritor famoso, tropeçam na situação de Tooru e a convidam para ficar com eles até que as reformas da casa de seu avô estejam completas.\n\nAo chegar na casa de Souma, Tooru descobre seu segredo: se um Souma for abraçado por alguém do sexo oposto, ele se transforma temporariamente em um dos animais do zodíaco! No entanto, esse estranho fenômeno não é motivo de riso; em vez disso, é uma terrível maldição que guarda uma história sombria. Enquanto ela continua sua jornada, encontrando mais membros da família do zodíaco, a natureza bondosa, porém resiliente de Tooru será o suficiente para prepará-la para o que está por trás das portas da casa Souma?",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0018_2": {
              "id": "f0018_2",
              "foto": "https://pbs.twimg.com/media/EMh217HXUAA50-m.jpg:large",
              "link": "https://myanimelist.net/anime/38680/Fruits_Basket_1st_Season",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Tooru Honda sempre foi fascinada pela história do Zodíaco Chinês que sua amada mãe lhe contou quando criança. No entanto, uma súbita tragédia familiar muda sua vida, e as circunstâncias subsequentes a deixam sozinha. Tooru agora é forçada a morar em uma barraca, mas mal sabe ela que sua casa temporária reside na propriedade privada da estimada família Souma. Tropeçando em sua casa um dia, ela encontra Shigure, um primo Souma mais velho, e Yuki, o \"príncipe\" de sua escola. Tooru explica que ela mora perto, mas os Soumas eventualmente descobrem seu segredo bem guardado de ser uma sem-teto quando a veem caminhando de volta para sua tenda uma noite.\n\nAs coisas começam a melhorar para Tooru quando eles gentilmente se oferecem para recebê-la depois de ouvir sobre sua situação. Mas logo depois, ela se envolve em uma briga entre Yuki e seu primo de temperamento explosivo, Kyou. Ao tentar impedi-los, ela descobre que a família Souma tem um segredo bem guardado: sempre que são abraçados por um membro do sexo oposto, eles se transformam nos animais do Zodíaco Chinês.\n\nCom esta nova revelação, Tooru descobrirá que viver com os Soumas é uma aventura inesperada cheia de risos e romance.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0018_3": {
              "id": "f0018_3",
              "foto": "https://pbs.twimg.com/media/EUriTw2UEAMiu6d.jpg",
              "link": "https://myanimelist.net/anime/40417/Fruits_Basket_2nd_Season",
              "trailer": null,
              "episodios": 25,
              "sinopse": "Um ano se passou desde que Tooru Honda começou a morar na residência de Souma, e desde então ela criou relacionamentos mais fortes com seus habitantes Shigure, Kyou e Yuki. Ela também se aproximou do resto da família Souma e se familiarizou com seu segredo ancestral, tendo-os ajudado em muitos de seus problemas pessoais. Quanto mais perto Tooru fica, no entanto, mais ela começa a perceber que seu segredo contém uma verdade mais sombria do que ela inicialmente presumiu.\n\nO verão se aproxima e Tooru é convidada a passar os dias com os Soumas, principalmente Kyou e Yuki. Tooru deseja férias tranquilas, mas seu relacionamento próximo com os dois meninos e o resto dos Soumas pode causar problemas. À medida que se tornam mais íntimos, seu tempo despreocupado juntos é prejudicado por antigas dificuldades e sentimentos do passado que começam a ressurgir. O Banquete Eterno também atinge os membros do zodíaco, e eles devem cuidar de seus deveres ao lado do enervante chefe da família, Akito Souma.\n\nCom o banquete se aproximando e uma infinidade de sentimentos a serem resolvidos, a vida de Tooru com os Soumas permanecerá pacífica, ou ela se encontrará em uma situação da qual não pode escapar?",
              "maturidade": null,
              "pontosBase": 0.0
            },
