              "trailer": null,
              "episodios": 12,
              "sinopse": "Ryou Sakaguchi é um estudante totalmente normal do ensino médio, além de seu único hobby incomum. Sakaguchi é um fudanshi - um homem que adora ler mangás de \"amor de meninos\" e fantasiar sobre o potencial gay que vê em todos os lugares. Ele tem apenas um desejo antes de morrer: encontrar alguns amigos que entendam sua paixão secreta.\n\nSeu desejo se torna realidade, conforme Sakaguchi começa a descobrir uma série de partes interessadas. Há Rumi Nishihara, um fujoshi enrustido que está mais do que ansioso para discutir as alegrias do amor dos meninos com Sakaguchi; o extravagante líder gay do clube de culinária da escola, Yuujirou Shiratori, que não faz nenhum esforço para esconder sua sexualidade; Akira Ueda, o admirador diligente de Shiratori, que fará qualquer coisa pelo amor de sua vida; e até mesmo o travesso Daigo, um companheiro fudanshi e popular autor de doujinshi do amor dos meninos. Parado ao lado deles durante todo o caos otaku está o melhor amigo de Sakaguchi, Toshiaki Nakamura, que deseja que seus colegas de classe comecem a agir mais como pessoas normais.",
