              "link": "https://myanimelist.net/anime/32696/Fukigen_na_Mononokean",
              "trailer": null,
              "episodios": 13,
              "sinopse": "O início da carreira de Hanae Ashiya no ensino médio não foi fácil - ele passou toda a primeira semana na enfermaria, e sua inexplicável condição só está piorando. A causa de seu tormento é a misteriosa criatura peluda que se apegou a ele desde que a encontrou na véspera do início das aulas.\n\nEnquanto sua saúde continua a piorar e a criatura cresce de tamanho, Hanae encontra um panfleto anunciando um exorcista que expulsa youkai. Desesperado e sem nada a perder, ele liga para o número e é levado ao Mononokean, uma sala de chá que de repente aparece ao lado da enfermaria. Um homem taciturno, Haruitsuki Abeno, relutantemente ajuda Hanae, mas exige o pagamento depois. Para desespero de Hanae, ele não pode pagar os honorários e deve se tornar um funcionário da Mononokean para saldar sua dívida. E para piorar as coisas, seu novo chefe é na verdade um de seus colegas de classe. Se Hanae espera saldar sua dívida, ele deve trabalhar junto com Abeno para guiar uma variedade de youkais perigosos, estranhos e interessantes de volta ao Mundo Inferior.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0021_2": {
              "id": "f0021_2",
              "foto": "https://scdn.line-apps.com/stf/linenews-issue-1467/rssitem-5064238/91b92188ed1563d3258a705a196150a2a6fa46eb.jpg",
              "link": "https://myanimelist.net/anime/37958/Fukigen_na_Mononokean_Tsuzuki",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Apesar de estar sobrecarregado de dívidas com o taciturno Haruitsuki Abeno, Hanae Ashiya passou a gostar de seu trabalho como exorcista. Sua habilidade de se comunicar com youkai deu a ele um senso de responsabilidade em relação às criaturas mágicas, e ele continua a trabalhar duro para enviá-las ao seu verdadeiro lar no Submundo.\n\nQuando a vida de Ashiya finalmente se estabiliza, o youkai ameaça perturbá-la mais uma vez. O conhecimento de sua existência começou a se espalhar, e nem todos estão felizes por ter um humano trabalhando para o Mononokean, o salão de chá interdimensional. Mas um dia, uma simples visita ao Mundo Inferior chama a atenção daqueles que estão no poder, e Ashiya logo descobre que nem todo youkai está disposto a seguir os planos de Abeno.",
