              "sinopse": "Todos os dias, uma jovem de máscara fica na praia e canta uma melodia nostálgica. Depois de passar por duas despedidas de cortar o coração quando era apenas uma criança, Nino Arisugawa tem cantado suas canções para o oceano, vinculada por uma promessa feita a seus dois amigos de infância - seu primeiro amor, Momo Sakaki, e um menino que compôs música , Kanade \"Yuzu\" Yuzuriha. Como nunca se conheceram, os meninos prometeram individualmente que, se Nino se separasse deles, a voz dela seria o farol para reuni-los novamente.\n\nDepois de seis longos anos, o destino finalmente colocou Nino, Momo e Yuzu na mesma escola. No entanto, a passagem do tempo mudou muitas coisas em suas vidas - enquanto Nino tenta implacavelmente cumprir sua promessa de infância com os meninos, os sentimentos de Yuzu por ela ressurgem, e Momo faz de tudo para evitar um reencontro com Nino. Por meio da música, eles serão capazes de consertar sua amizade e superar todos os sentimentos envolvidos neste complicado triângulo amoroso?",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
