              "trailer": null,
              "episodios": 24,
              "sinopse": "Equipada com armamento de ponta e tropas especializadas, uma organização militar privada chamada Mithril se esforça para extinguir o terrorismo mundial e todas as ameaças à paz na Terra. A organização é alimentada pelos \"sussurrados\", indivíduos que possuem conhecimento intuitivo e a notável capacidade de criar dispositivos e máquinas poderosas.\n\nSousuke Sagara, de 17 anos, sargento que trabalhava para Mithril, foi designado para proteger Kaname Chidori, um candidato sussurrado. Ele recebe a ordem de ingressar na turma do ensino médio e ficar o mais próximo possível dela para evitar que ela caia nas mãos do inimigo - isto é, se ele puder se misturar com segurança com seus colegas de classe sem revelar sua verdadeira identidade.\n\nSousuke, que foi criado em um campo de batalha e tem muito pouco conhecimento sobre o estilo de vida de um estudante médio do ensino médio, deve se adaptar a uma vida escolar normal para proteger Kaname. No entanto, as forças inimigas já começaram a fazer seu movimento e Sousuke está prestes a descobrir que o adversário que vem atrás da garota sussurrada pode ser muito mais familiar do que ele esperava.",
              "maturidade": null,
