              "sinopse": "O turbulento estudante Kaname Chidori e o soldado Sousuke Sagara estão desfrutando de uma vida de colégio feliz. No entanto, seus dias pacíficos são interrompidos pela ameaçadora organização terrorista Amalgam. Leonard Testarossa, um membro da organização que possui \"Whispered\", busca adquirir Kaname e seu conhecimento.\n\nA batalha de Kaname e Sousuke contra Amalgam começa bem em sua própria vizinhança, que eventualmente os leva a uma caçada ao redor do mundo. Das exóticas terras do Laos à árida costa mexicana, Sousuke deve reunir inteligência para derrubar Amalgam. Enquanto isso, as habilidades de Kaname aumentam, mas também aumenta sua frustração conforme sua determinação murcha. Presa em um intenso jogo de esconde-esconde, bem como em tramas estratégicas, a dupla tenta se conectar e ir além de seus próprios limites.",
