              "trailer": null,
              "episodios": 13,
              "sinopse": "Depois de superar vários eventos tumultuados, o sargento mercenário Sousuke Sagara de Mithril e a estudante Kaname Chidori \"Sussurrada\" retornam às suas vidas normais de colégio. Sousuke continua seus esforços para assimilar a população civil e administrar sua missão ao mesmo tempo, enquanto Kaname tenta apoiar seus esforços (mesmo que suas travessuras muitas vezes a deixem maluca).\n\nPorém, à medida que suas vidas se acalmam, novos problemas começam a aparecer. O surgimento de uma organização terrorista independente conhecida como Amalgam e conflitos internos dentro de Mithril ameaçam transformar a unidade em uma série de fracassos e traições. E os novos e poderosos modelos Arm Slave só pioram a situação quando a paz mundial está em jogo.\n\nEnquanto Kaname e Sousuke enfrentam suas próprias batalhas internas em meio a lutas com risco de vida, eles serão capazes de fazer as escolhas certas e mudar seu futuro?",
