        "f0024": {
          "id": "f0024",
          "parentes": [],
          "items": {
            "f0024_1": {
              "id": "f0024_1",
              "foto": "https://i.pinimg.com/originals/b5/72/c9/b572c991b9f3233f526dd877642076ce.jpg",
              "link": "https://myanimelist.net/anime/121/Fullmetal_Alchemist",
              "trailer": null,
              "episodios": 51,
              "sinopse": "Edward Elric, um jovem alquimista brilhante, perdeu muito em sua vida de 12 anos: quando ele e seu irmão Alphonse tentam ressuscitar sua mãe morta por meio do ato proibido de transmutação humana, Edward perde seu irmão, bem como dois de seus membros . Com suas habilidades supremas de alquimia, Edward liga a alma de Alphonse a uma grande armadura.\n\nUm ano depois, Edward, agora promovido a alquimista de metal completo do estado, embarca em uma jornada com seu irmão mais novo para obter a Pedra Filosofal. Há rumores de que o objeto mítico lendário é capaz de amplificar as habilidades de um alquimista aos trancos e barrancos, permitindo-lhes assim ultrapassar a lei fundamental da alquimia: para ganhar algo, um alquimista deve sacrificar algo de igual valor. Edward espera recorrer aos recursos militares para encontrar a lendária pedra e restaurar o corpo dele e de Alphonse ao normal. No entanto, os irmãos Elric logo descobrem que há mais na lendária pedra do que os olhos podem ver, enquanto são conduzidos ao epicentro de uma batalha muito mais sombria do que eles poderiam ter imaginado.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0024_2": {
              "id": "f0024_2",
              "foto": "https://pbs.twimg.com/media/EOlkBr5U0AUsoJd.jpg",
              "link": "https://myanimelist.net/anime/5114/Fullmetal_Alchemist__Brotherhood",
              "trailer": null,
              "episodios": 64,
              "sinopse": "\"Para que algo seja obtido, algo de igual valor deve ser perdido.\"\n\nA alquimia é limitada por esta Lei da Troca Equivalente - algo que os jovens irmãos Edward e Alphonse Elric só percebem depois de tentarem a transmutação humana: o único ato proibido de alquimia. Eles pagam um preço terrível por sua transgressão - Edward perde sua perna esquerda, Alphonse seu corpo físico. É apenas com o sacrifício desesperado do braço direito de Edward que ele é capaz de prender a alma de Alphonse em uma armadura. Devastado e sozinho, é a esperança de que os dois eventualmente retornem aos seus corpos originais que dá a Edward a inspiração para obter membros de metal chamados \"automail\" e se tornar um alquimista estatal, o Fullmetal Alchemist.\n\nTrês anos de busca depois, os irmãos procuram a Pedra Filosofal, uma relíquia mítica que permite ao alquimista superar a Lei da Troca Equivalente. Mesmo com os aliados militares Coronel Roy Mustang, Tenente Riza Hawkeye e Tenente Coronel Maes Hughes do seu lado, os irmãos se encontram em uma conspiração nacional que os leva não apenas à verdadeira natureza da elusiva Pedra Filosofal, mas também à obscura de seu país história também. Entre encontrar um serial killer e correr contra o tempo, Edward e Alphonse devem se perguntar se o que estão fazendo os tornará humanos novamente ... ou tirará sua humanidade.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0024_3": {
              "id": "f0024_3",
              "foto": "https://f002.backblazeb2.com/file/animepill/i/4480.webp",
              "link": "https://myanimelist.net/anime/7902/Fullmetal_Alchemist__Brotherhood_-_4-Koma_Theater",
              "trailer": null,
              "episodios": 16,
              "sinopse": "Pequenos especiais dos DVDs / BDs.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0024_4": {
              "id": "f0024_4",
              "foto": "https://www.animeclick.it/immagini/anime/Fullmetal_Alchemist_2009_OAV_1/cover/Fullmetal_Alchemist_2009_OAV_1-cover.jpg",
              "link": "https://myanimelist.net/anime/6421/Fullmetal_Alchemist__Brotherhood_Specials",
              "trailer": null,
              "episodios": 4,
              "sinopse": "Segredos surpreendentes e fatos surpreendentes são expostos pela primeira vez em Fullmetal Alchemist: Brotherhood OVA Collection, uma nova coleção de histórias ambientadas em cantos nunca antes vistos do universo FMA. Junte-se a Ed e Al enquanto eles perseguem rumores de uma transmutação humana bem-sucedida em uma teia de chocantes dramas familiares e mentiras. Dê uma espiada nos lados ocultos das personalidades de Winry e Hawkeye. Sobreviva ao norte gelado com a jovem Izumi Curtis enquanto ela luta para obter uma compreensão mais profunda da alquimia. Explore a lendária amizade compartilhada por Mustang e Hughes e observe-os crescer de rivais da escola militar em irmãos endurecidos transformados pelos horrores da Guerra Ishvalan. Você pensou que sabia de toda a história. Você pensou que todas as histórias foram contadas. A coleção Fullmetal Alchemist: Brotherhood OVA oferece a prova: você estava errado.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0024_5": {
              "id": "f0024_5",
              "foto": "https://media.kitsu.io/anime/poster_images/808/original.jpg?1491622696",
              "link": "https://myanimelist.net/anime/908/Fullmetal_Alchemist__Premium_Collection",
              "trailer": null,
              "episodios": 3,
              "sinopse": "1. Alquimistas do Estado vs Sete Homúnculos\nUm filme de 10 minutos apresentando: Ed, Al, Mustang e muitos outros membros do Estado lutando com os mortais Homonculi em uma realidade alternativa Amestris.\n\n2. Chibi Party (Enkai-hen)\nCurta peça de 6 minutos desenhada no estilo Super Deformado, onde todos os personagens da série (incluindo os bandidos) estão celebrando uma \"After Party\" do filme Conquistador de Shambala.\n\n3. Crianças (Kodomo-hen)\nHistória curta de 3 minutos que mostra Edward e seus netos nos dias atuais de 2005.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0024_6": {
              "id": "f0024_6",
              "foto": "https://images-na.ssl-images-amazon.com/images/I/51JsH417XFL._SY450_.jpg",
              "link": "https://myanimelist.net/anime/664/Fullmetal_Alchemist__Reflections",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Uma reflexão sobre o que aconteceu durante a série FMA.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0024_7": {
              "id": "f0024_7",
              "foto": "https://www.infoanime.com.br/poster/2005/fullmetalalchemistm.jpg",
              "link": "https://myanimelist.net/anime/430/Fullmetal_Alchemist__The_Conqueror_of_Shamballa",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Em desespero, Edward Elric sacrificou seu corpo e alma para resgatar seu irmão Alphonse, e agora está deslocado no coração de Munique, Alemanha. Ele luta para se adaptar a um mundo completamente estranho para ele após a crise econômica que se seguiu ao fim da Primeira Guerra Mundial. Isolado e incapaz de voltar para casa com suas habilidades de alquimia, Edward continua a pesquisar outros métodos de escapar da prisão ao lado de colegas que têm semelhanças impressionantes com muitas das pessoas que ele deixou para trás. Enquanto a dissidência cresce entre os cidadãos alemães, seus vizinhos também sentem a inquietação da nação humilhada.\n\nEnquanto isso, Alphonse continua investigando o desaparecimento de Edward, mergulhando na ciência da alquimia na esperança de finalmente se reunir com seu irmão mais velho.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0024_8": {
              "id": "f0024_8",
              "foto": "https://i.pinimg.com/originals/06/1b/93/061b93bea1b5a23f843f36fab2121a58.jpg",
              "link": "https://myanimelist.net/anime/9135/Fullmetal_Alchemist__The_Sacred_Star_of_Milos",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Perseguindo um alquimista fugitivo com poderes estranhos, os irmãos Edward e Alphonse Elric tropeçam no vale esquálido de Milos. Os milosianos são um grupo oprimido que busca recuperar sua terra sagrada de Creta: um país militarista que anexou à força sua nação. No olho da tempestade política está uma garota chamada Julia Crichton, que deseja enfaticamente que os Milos recuperem suas forças e voltem a ser uma nação de paz.\n\nFazendo amizade com a garota, Edward e Alphonse se encontram no meio de uma resistência crescente que envolve o uso do mesmo objeto que eles procuraram o tempo todo - a Pedra Filosofal. No entanto, suas experiências anteriores com a pedra causam-lhes reserva, e os irmãos não estão dispostos a ajudar.\n\nMas ao descobrirem os segredos por trás das intenções e da história questionável de Creta, os irmãos são atraídos para a batalha entre os rebeldes Milos, que desejam sua liberdade, e os militares cretenses, que buscam o poder absoluto.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0024_9": {
              "id": "f0024_9",
              "foto": "https://i.ytimg.com/vi/6_bRx-vecl4/maxresdefault.jpg",
              "link": "https://myanimelist.net/anime/10842/Fullmetal_Alchemist__The_Sacred_Star_of_Milos_Specials",
              "trailer": null,
              "episodios": 4,
              "sinopse": "Para marcar a abertura do filme Fullmetal Alchemist: The Sacred Star of Milos, em 2 de julho, o site Pia Eiga Seikatsu postou um vídeo exclusivo \"entrevista\" com as estrelas do filme, Edward e Alphonse Elric (dublado por Romi Park e Rie Kugimiya , respectivamente). Mantendo o espírito do mangá original de Hiromu Arakawa e dos dois animes para televisão, o entrevistador tem dificuldade em descobrir quem é o \"Fullmetal Alchemist\". (A entrevista tem participações especiais de outras estrelas do anime.) Também inclui 3 sessões de \"Estudo\" com o \"Professor\" Mustang, ensinando Winry e Hawkeye sobre Creta e Milos.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "f0025": {
          "id": "f0025",
          "parentes": [],
          "items": {
            "f0025_1": {
              "id": "f0025_1",
              "foto": "https://www.omegascopio.com.br/wp-content/uploads/2020/01/kk.jpg",
              "link": "https://myanimelist.net/anime/41025/Fumetsu_no_Anata_e",
              "trailer": null,
              "episodios": 20,
              "sinopse": "Ele, um misterioso ser imortal, é enviado à Terra sem emoções nem identidade. No entanto, é capaz de assumir a forma de quem está ao redor com um forte impulso.\n\nNo início, é uma esfera. Então, ele imita a forma de uma rocha. Conforme a temperatura cai e a neve cai sobre o musgo, ela herda o musgo. Quando um lobo ferido e solitário chega mancando e se deita para morrer, ele assume a forma de um animal. Finalmente, ganha consciência e começa a percorrer a tundra vazia até encontrar um menino.\n\nO menino mora sozinho em uma cidade fantasma, que os adultos abandonaram há muito tempo em busca do paraíso que dizem existir muito além do mar infinito de tundra branca. No entanto, seus esforços foram em vão e agora o menino está em um estado crítico.\n\nAdquirindo a forma de menino, parte em uma jornada sem fim, em busca de novas experiências, lugares e pessoas.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
        },
        "f0026": {
