              "link": "https://myanimelist.net/anime/37188/Fumikiri_Jikan",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Todos os dias, todos os tipos de pessoas param em cruzamentos de ferrovias a caminho do trabalho ou da escola, resultando em todos os tipos de conversas diferentes. Amigos, inimigos, conhecidos e completos estranhos - há sempre um novo encontro a ser feito.\n\nFumikiri Jikan documenta as discussões que acontecem nesses locais. Quer sejam engraçados ou deprimentes, esperados ou completamente inesperados, eles certamente têm o potencial de ser bastante interessantes.",
              "maturidade": null,
