              "sinopse": "Kouhei Araki, editor veterano da divisão editorial de dicionários da Genbu Publishing, planeja se aposentar para cuidar melhor de sua esposa doente. No entanto, antes de se aposentar, ele deve encontrar um substituto para completar seu último projeto: um novo dicionário chamado \"A Grande Passagem\". Mas não importa para onde olhe, ele não consegue encontrar ninguém adequado, pois fazer um dicionário requer muita paciência, tempo e dedicação.\n\nMitsuya Majime trabalha na divisão de vendas da Genbu Publishing, mas tem poucas habilidades sociais e uma incapacidade de ler o humor na maioria das situações. Apesar disso, destaca-se pelo entusiasmo pela palavra, graças ao seu amor pela leitura e à sua personalidade cuidada. São essas habilidades que atraem Araki e o levam a oferecer a Majime uma posição no departamento editorial do dicionário. Conforme Majime aceita sua nova posição, ele se descobre inseguro sobre suas habilidades e questiona se ele se encaixará com seus novos colegas de trabalho. No entanto, em meio ao vasto mar de palavras, a Grande Passagem os reunirá.",
