              "foto": "https://images-na.ssl-images-amazon.com/images/I/715Ufw-3yPL._CR129,7,744,1392_.jpg",
              "link": "https://myanimelist.net/anime/33047/Fate_Extra__Last_Encore",
              "trailer": null,
              "episodios": 10,
              "sinopse": "Um inferno tecnológico disfarçado de paraíso, a Tsukimihara Academy é uma escola secundária artificial que serve de cenário para a próxima Guerra do Santo Graal. Criada pelo computador Moon Cell, a escola é habitada por almas projetadas na Terra que têm a menor aptidão para ser um \"Mestre\". Destas 256 almas, 128 serão escolhidas para o torneio principal e receberão um Servo. Com todos os Mestres selecionados, a Academia ativa um expurgo, visando as formas de vida restantes para eliminação.\n\nDespertando em uma poça de seu próprio sangue, Hakuno Kishinami se recusa a morrer. Alimentado por sentimentos desconhecidos de ódio, ele jura lutar pela sobrevivência. Enquanto ele luta para escapar de um perseguidor implacável, ele encontra uma lâmina carmesim mergulhada no solo; e puxando-o para fora, Hakuno convoca seu próprio Servo, Saber, que instantaneamente destrói seu perseguidor em uma enxurrada de pétalas de rosa. Com seu novo poder, Hakuno deve agora começar sua jornada ao núcleo da Moon Cell, a Angelica Cage. Lá, ele vai desvendar a razão deste mundo artificial e os segredos de seu próprio passado encharcado de sangue.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0033_2": {
              "id": "f0033_2",
              "foto": "https://i1.wp.com/i.imgur.com/0VnlUBH.jpg?resize=225%2C350&ssl=1",
              "link": "https://myanimelist.net/anime/37651/Fate_Extra__Last_Encore_-_Illustrias_Tendousetsu",
              "trailer": null,
              "episodios": 3,
              "sinopse": "Depois de derrotar os vários Floor Masters dos seis níveis anteriores, Hakuno Kishinami e Saber chegam ao último andar da Moon Cell. Seu oponente será Leonardo B. Harwey - o Mestre mais forte da história da Guerra do Santo Graal e o atual favorito dos fãs, após sua vitória anterior.\n\nQuando eles alcançam um campo de flores entre as ilhas flutuantes, Hakuno, Saber e Rin Toosaka encontram um homem encapuzado cuidando das flores. Saber imediatamente saca sua lâmina diante da figura encoberta, que se revela como o Príncipe Gawain: o Sabre de Platina e Cavaleiro da Távola Redonda. No entanto, quando Gawain insiste que não tem interesse em lutar, os quatro discutem as possibilidades infinitas para o Santo Graal, com Hakuno determinado a retornar a Célula Lunar à sua forma original.\n\nA discussão termina com um clangor ao longe, ecoando pelos céus. O gasto Gawain, sabendo de seu significado, informa aos três que não resta muito tempo para suas vidas. Ele acena para o campo de batalha final, onde os dois Sabres devem duelar mais uma vez para determinar o futuro da humanidade.",
              "maturidade": null,
              "pontosBase": 0.0
            },
