              "episodios": 1,
              "sinopse": "Uma colaboração entre o jogo móvel Ken to Mahou no Logless Inishie no Megami e o videogame Fate / Extella (que se passa no mundo Fate / Extra e Fate / Extra CCC). Anunciar que Nero Claudius (e outros) do último agora são personagens jogáveis ​​no primeiro. Junto com equipamentos de edição limitada e prêmios, o evento funcionou de 07 a 21 de dezembro de 2016. O comercial apresenta algumas imagens de ação ao vivo do aplicativo de telefone, mas é predominantemente imagens animadas exclusivas.",
              "maturidade": null,
