              "sinopse": "2016 DC, as fundações da humanidade foram incineradas pelo Rei Mago Salomão. A Caldéia, uma organização secreta de magos com a missão de preservar o futuro da humanidade, previu a extinção da humanidade em 2015. Assim, começou a operação para reparar as singularidades na história causadas pelo Santo Graal disperso no tempo e no espaço - Operação Grande Ordem.\n\nUsando a tecnologia de viagem no tempo Rayshift, o último mestre de Chaldea, Ritsuka Fujimaru, e seu semi-servo Mash Kyrielight viajaram e resolveram seis Singularidades. Agora, eles partem para seu destino mais perigoso: uma civilização na Era dos Deuses, 2655 AC, Mesopotâmia. Ritsuka e Mash logo descobrem que as Feras Demoníacas vagam pela terra, atacando pessoas e cidades. Em meio ao caos e ao terror, encontra-se a última defesa da humanidade - Uruk, uma cidade-fortaleza que atua como a linha de frente da batalha contra as feras. A frente de batalha é comandada por ninguém menos que o Rei Gilgamesh, o Rei dos Heróis, que buscou a ajuda de Espíritos Heróicos e assumiu o papel de um mago para proteger sua cidade.\n\nJunto com Gilgamesh e os servos convocados, Ritsuka e Mash devem proteger Uruk contra o ataque das feras mágicas e derrotar a Aliança das Três Deusas, que visa erradicar a humanidade; o tempo todo, uma ameaça maior paira sobre Uruk, preparando-se para seu despertar.",
              "maturidade": null,
              "pontosBase": 0.0
            },
