              "sinopse": "Ao acordar para se encontrar em uma versão paralela da cidade de Fuyuki, Illyasviel \"Illya\" von Einzbern está perdida e sozinha. Ela descobre sua casa em ruínas, com uma enorme cratera no centro de sua cidade natal. Com a neve caindo no meio do verão, a confusão consome a jovem estudante primária, que não tem conhecimento de onde seus amigos ou sua varinha Ruby podem estar.\n\nChegando aos restos de sua casa, ela é repentinamente atacada por uma garota amnésica. Vestindo um uniforme de ginástica enquanto a temperatura gélida aumenta, a misteriosa garota não tem ideia de onde está ou por que apareceu. No entanto, esse estranho, conhecido como Tanaka, aparentemente tem informações sobre a localização de Rin Toosaka, Miyu Edelfelt e o resto dos amigos desaparecidos de Illya.\n\nFugindo de agentes da família Ainsworth⁠ - aqueles que controlam esse reino paralelo - para onde esses dois irão parar e como Illya irá restaurar o presente de volta ao mundo que ela conheceu?",
