              "trailer": null,
              "episodios": 1,
              "sinopse": "A Guerra do Santo Graal: uma violenta batalha entre magos na qual sete mestres e seus servos convocados lutam pelo Santo Graal, um artefato mágico que pode conceder ao vencedor qualquer desejo. Quase 10 anos atrás, a batalha final da Quarta Guerra do Santo Graal causou estragos na cidade de Fuyuki e tirou mais de 500 vidas, deixando a cidade devastada.\n\nShirou Emiya, um sobrevivente desta tragédia, aspira a se tornar um herói da justiça como seu salvador e pai adotivo, Kiritsugu Emiya. Apesar de ser apenas um estudante, Shirou é lançado na Quinta Guerra do Santo Graal quando acidentalmente vê uma batalha entre os servos da escola e convoca seu próprio servo, Saber.\n\nQuando uma sombra misteriosa começa uma farra assassina na cidade de Fuyuki, Shirou se alinha com Rin Toosaka, um colega participante da Guerra do Santo Graal, a fim de impedir a morte de inúmeras pessoas. No entanto, os sentimentos de Shirou por sua amiga Sakura Matou o levam mais fundo nos segredos obscuros que cercam a guerra e as famílias rivais envolvidas.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "f0036_3": {
              "id": "f0036_3",
              "foto": "https://pbs.twimg.com/media/DwUTXZ2UwAIP5YI.jpg:large",
              "link": "https://myanimelist.net/anime/33049/Fate_stay_night_Movie__Heavens_Feel_-_II_Lost_Butterfly",
              "trailer": null,
              "episodios": 1,
              "sinopse": "A Quinta Guerra do Santo Graal continua, e o caos que se segue resulta em apostas mais altas para todos os participantes. Shirou Emiya continua a participar da guerra, aspirando a ser um herói da justiça que salva a todos. Ele sai em busca da verdade por trás de uma misteriosa sombra escura e sua onda de assassinatos, determinado a derrotá-la.\n\nEnquanto isso, Shinji Matou coloca seus próprios planos em movimento, ameaçando Shirou por meio de sua irmã Sakura Matou. Shirou e Rin Toosaka lutam contra Shinji, na esperança de livrar Sakura dos abusos de seu irmão. Mas a horrível verdade dos irmãos Matou começa a vir à tona, e muitos segredos sombrios são expostos.\n\nFate / stay night Movie: Heaven's Feel - II. Borboleta perdidacontinua a se concentrar nos Mestres e Servos restantes enquanto lutam entre si na esperança de obter o Santo Graal. No entanto, conforme a escuridão surge na cidade de Fuyuki, até mesmo o estado de sua guerra sagrada pode estar em perigo.",
