              "link": "https://myanimelist.net/anime/22297/Fate_stay_night__Unlimited_Blade_Works",
              "trailer": null,
              "episodios": 12,
              "sinopse": "A Guerra do Santo Graal é uma batalha real entre sete magos que servem como Mestres. Mestres, através do uso dos selos de comando que recebem quando entram na guerra, comandam os Espíritos Heróicos conhecidos como Servos para lutar por eles na batalha. Na Quinta Guerra do Santo Graal, Rin Toosaka está entre os magos que entram na competição. Com seu Servo, Archer, ela espera obter o prêmio final - o Santo Graal, um artefato mágico capaz de conceder a seu portador qualquer desejo.\n\nUma das colegas de classe de Rin, Emiya Shirou, acidentalmente entra na competição e acaba comandando um Servo conhecido como Saber. Ao se depararem com inimigos mútuos, Rin e Shirou decidem formar uma aliança temporária enquanto desafiam seus oponentes na Guerra do Santo Graal.",
