              "trailer": null,
              "episodios": 13,
              "sinopse": "No meio da Quinta Guerra do Santo Graal, Caster coloca seus planos em movimento, começando com a captura de Sabre Servo de Shirou. Com a bruxa cada vez mais poderosa, Rin e Archer determinam que ela é uma ameaça que deve ser enfrentada imediatamente. Mas à medida que o equilíbrio de poder na guerra começa a mudar, o Mestre e o Servo encontram-se em caminhos diferentes.\n\nEnquanto isso, apesar de perder seu Servo e tropeçar nos ferimentos, Shirou ignora o aviso de Rin para abandonar a batalha real, forçando seu caminho para a luta contra Caster. Determinado a mostrar sua determinação em lutar, o potencial de Shirou para se tornar um protetor do povo é colocado à prova.\n\nEm meio ao derramamento de sangue e ao caos, as motivações de cada Mestre e Servo são lentamente reveladas à medida que eles sacrificam tudo para se erguer como o vencedor e reivindicar o Santo Graal.",
