              "episodios": 1,
              "sinopse": "Depois que a missão de Cure Muse de restaurar o bom coração de seu pai foi cumprida, Ako e Mephisto decidiram retornar para Major Land juntos. De repente, um barulho uivante ecoou pela cidade e, quando parou, toda a música havia sumido. Ako e Mephisto tentaram estabelecer contato com o Major Land, mas não obtiveram resposta.\nCheios de preocupação, Hibiki e os outros foram para Major Land, onde não havia sinal da antiga terra de música transbordante. O mundo estava desolado, sem som, seu povo desprovido de emoção como pedra, continuando a tocar seus instrumentos silenciosos. A única que sobrou foi Suzu, amiga de Ako, que explicou como Afrodite mudou repentinamente e tirou todas as músicas da terra. Ako e Mephisto, incrédulos e determinados a descobrir a verdade, se dirigiram ao palácio onde Afrodite estava. Hibiki, Kanade e Ellen decidiram correr atrás de Suzu, que fugiu depois que Ako se recusou a acreditar em sua história.\n\nEnquanto perseguiam Suzu, as garotas se encontraram com 3 homens ansiosos para roubar o Baú de Cura. E quando a verdade lentamente veio à tona, a Pretty Cure teve que enfrentar o verdadeiro inimigo.",
