              "episodios": 49,
              "sinopse": "É seu primeiro dia em uma nova escola, e a alegre Hana Nono está pronta para começar de novo, sonhando em se tornar madura e confiável - muito longe de seu jeito infantil de sempre. Embora ela cause uma primeira impressão desastrosa, Hana logo faz amizade com dois de seus colegas: a gentil e estudiosa representante da classe Saaya Yakushiji, e uma garota legal e misteriosa Homare Kagayaki.\n\nNaquela noite, um bebê mágico cai do céu bem na varanda de Hana. Ela fica imediatamente apaixonada por ela e a chama de Hug-tan. Ao lado de Hug-tan está um hamster sarcástico, Hariham Harry, que murmura que Hana \"não é a única\" antes de desaparecer com o bebê.\n\nNo dia seguinte, Hana acredita que o encontro é um sonho, até que as pessoas em toda a cidade começam a desabar e um monstro gigante aparece, alimentando-se de sua energia. Quando Hana foge, ela vê Hug-tan e Harry sob ataque. Fazendo uma posição para protegê-los, ela e Hug-tan de repente brilham com energia e uma gema em forma de coração se forma.\n\nCom o poder do cristal, Hana se transforma em uma heroína chamada \"Cure Yell\" e derrota o monstro. Surpreso com o poder de Hana, Harry explica que ele e Hug-tan vieram de um futuro congelado no tempo pela Criasu Corporation, a mesma organização que criou o monstro. Apenas os Cristais do Futuro, as manifestações das esperanças e sonhos de alguém e o Precuro que eles criam têm uma chance de derrotar Criasu e salvar o futuro!",
