              "trailer": null,
              "episodios": -1,
              "sinopse": "Nodoka Hanadera, estudante do ensino médio doentia, mas otimista, acaba de se mudar para a cidade de Sukoyaka, um lugar famoso por sua atmosfera saudável. Ela imediatamente faz amizade com dois de seus colegas de classe: o gentil, mas atlético, Chiyu Sawaizumi, cuja família administra uma pousada de fontes termais, e a alegre e elegante filha de um veterinário, Hinata Hiramitsu.\n\nLogo após chegar, Nodoka encontra um cachorrinho doente em uma floresta, cercado por três animais mágicos falantes: Rabbirin, Penguitan e Nyatoran. Eles dizem a ela que o cachorro, Princesa Latte, só pode ser curado derrotando um monstro próximo conhecido como \"Mega Byogen\" e purificando a terra que ele corrompeu. Apesar de ser impotente, Nodoka se recusa a desistir e deixar o Latte sofrer.\n\nMovido por sua determinação, Rabbirin faz um pacto com Nodoka, permitindo que ela se transforme em uma heroína conhecida como Precura. Assumindo a persona de \"Cure Grace\", o Nodoka energizado luta contra o Byogen e cura a terra, curando Latte.\n\nEnquanto o Byogen e seus líderes continuam seus ataques, Penguitan e Nyatoran também encontram seus parceiros em Chiyu e Hinata, dando a eles os poderes de \"Cure Fontaine\" e \"Cure Sparkle\", respectivamente. Agora, cabe aos três Precure e seus amigos animais parar o Byogen e proteger a Terra de suas infecções!",
