              "episodios": 49,
              "sinopse": "Hikaru Hoshina é um estudante enérgico do ensino médio que ama o espaço e o ocultismo. Enquanto ela desenha constelações em seu caderno, uma criatura pequena e fofa aparece de repente dele! A criatura, que ela chama de Fuwa, acaba por ser um alienígena com a habilidade de criar buracos de dobra.\n\nQuando os companheiros de Fuwa, os alienígenas Lala Hagoromo e Prunce, chegam à Terra, eles declaram que estão procurando pelo Precure, guerreiros lendários que irão salvar o universo. Mas uma organização conhecida como Notraiders logo segue e ataca, com a intenção de capturar Fuwa e seu poder. Superada pelo desejo de proteger Fuwa, Hikaru se transforma na \"Estrela da Cura\", uma das Precuras que Lala e os outros estão procurando!\n\nAgora cabe a Hikaru e o resto se defender do ataque dos Notraiders, descobrir o resto do Precure e encontrar as Star Color Pens, artefatos que irão despertar a Princesa das 12 Estrelas que mantém o universo em equilíbrio.",
