              "link": "https://myanimelist.net/anime/11569/Precure_All_Stars_DX_the_Dance_Live%E2%99%A5__Miracle_Dance_Stage_e_Youkoso",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Precure All-Stars DX the Dance Live: Miracle Dance Stage e Youkoso é uma produção de dança all-in-3D apresentando Pretty Cures das temporadas Futari wa Pretty Cure Max Heart até Suite Pretty Cure ♪ (sem Cure Muse).\n\nA produção dura 10 minutos e é feita inteiramente em 3D estereoscópico, apresentando um medley de músicas dos diferentes filmes DX, além de algumas músicas inéditas. A produção de dança em si foi lançada nos cinemas em 5 de agosto de 2011, acompanhada pelo lançamento de um novo single, Pretty Cure All Stars 3D Theatre Theme Song. O filme começa quando uma estrela cadente rosa cai do céu noturno e sai de uma loja de brinquedos, atingindo uma das Cure Dolls of Melody em exibição. A Melody Doll ganha vida, libertando-se de sua caixa. Pulando no chão, ela explora a loja de brinquedos quando ouve o barulho de uma multidão vindo de fora. Correndo para fora da loja, ela descobre uma enorme tela de TV que reflete uma imagem \"real\" de si mesma. Brincando com ele, ela logo se junta a uma Cure Doll of Rhythm. Os dois localizam Hummy, esperando vários andares abaixo na pista de dança, que acenou para eles e mandou dois teclados de arco-íris para o Cure Dolls. Acenando um para o outro, os dois deslizam o teclado para a pista de dança e o show começa. O show termina com uma cena da enorme tela da TV exibida durante a introdução. As 3 Suítes ♪ Curas são vistas sorrindo e acenando para o público, e conforme a cena se afasta, as 3 Cure Dolls são mostradas na parte inferior da tela.",
