              "trailer": null,
              "episodios": 12,
              "sinopse": "Manabi Straight! segue a vida de um grupo de meninas do ensino médio que viveu no ano de 2035 enquanto frequentavam a Seioh Private High School, exclusivamente para meninas. Como a taxa de natalidade caiu drasticamente, as escolas estão fechando devido à falta de alunos disponíveis para ensinar. O moral nas escolas caiu drasticamente e Seioh não é exceção.\n\nA história começa quando o personagem principal, Manami Amamiya, é transferido para Seioh. Depois de alguns hijinks iniciais envolvendo uma scooter futurística e um encontro de natação, seguido por uma apresentação musical inspiradora da escola, ela é empossada como presidente do conselho estudantil. A história que se segue refere-se a Manami trabalhando com Mika Inamori, o único outro membro do conselho estudantil, e três outros colegas de classe chamados Mutsuki Uehara, Mei Etoh e Momoha Odori, em assuntos do conselho estudantil. Depois de algumas reformas na sala do conselho estudantil, Manami e suas amigas começaram a planejar o próximo festival estudantil.",
