              "trailer": null,
              "episodios": 12,
              "sinopse": "No século anterior, um desastre sem precedentes conhecido como Invertia reformou drasticamente o mundo. Os poderes das nações existentes diminuíram significativamente, abrindo caminho para que um conglomerado chamado Fundação Império Integrado assumisse o controle. Mas, o mais importante, o Invertia levou ao surgimento de uma nova espécie de humanos que nascem com capacidades físicas fenomenais - a Genestella. Sua elite é escolhida a dedo em todo o mundo para frequentar as seis melhores escolas e duelam entre si em batalhas de entretenimento chamadas Festas.\n\nAyato Amagiri é um estudante transferido com bolsa de estudos na prestigiosa Seidoukan Academy, que recentemente tem sofrido com o declínio no desempenho. Por meio de uma série de eventos, ele acidentalmente vê a popular Bruxa das Chamas Resplandecentes, Julis-Alexia von Riessfeld, meio vestida! Enfurecido, Julis o desafia para um duelo por se intrometer em sua privacidade. Após o dito duelo ser anulado pelo presidente do conselho estudantil, Ayato revela que não tem interesse nas Festas. Em vez disso, ele se matriculou na academia para investigar o paradeiro de sua irmã mais velha desaparecida. Mas quando uma trama mais tortuosa se desenrola, Ayato se prepara para alcançar a vitória, enquanto é cercado por algumas das mais talentosas Genestella do planeta.",
              "maturidade": null,
              "pontosBase": 0.0
