              "sinopse": "Três irmãs, Hozuki, Kazuki e Hazuki, são descendentes de Galileu e têm personalidades e gostos completamente diferentes; eles nunca se encontram cara a cara. Um dia, as meninas são repentinamente atacadas por uma organização misteriosa. A organização estava atrás do \"Galileo Tesoro\" que Galileo Galilei teria descoberto. Ainda sem saber o que estava acontecendo, as irmãs escapam na aeronave que construíram após o ataque repentino. Mas não será tão fácil para essas três irmãs ajudarem-se mutuamente quando estiverem constantemente em conflito uma com a outra. O que é o Tesoro e o que é a organização depois? E a relação entre as irmãs? É um trio de garotas lindas, ação e mistério!",
