              "sinopse": "Keita Amano é um típico jogador de colégio que vive a vida de um estudante comum. Um dia, porém, ele tem um encontro inesperado com a garota mais fofa da escola que o faz querer desaparecer sem deixar vestígios!\n\nEssa garota, Karen Tendou, é uma aluna exemplar que é proclamada o ídolo da escola. Ela descobre que Amano é um jogador, e esse novo conhecimento incita um desejo apaixonado de recrutá-lo para o clube de jogo. Ao visitar o clube, Amano é fortemente alertado sobre um lado do jogo totalmente diferente daquele que ele tanto ama.\n\nO interesse de Tendou em Amano começa a sacudir o que antes era uma vida monótona, enchendo-a de espontaneidade, estranheza e um pouco de caos. Como resultado, cada dia se torna uma batalha cômica pela sanidade de Amano enquanto ele tenta se adaptar a essas mudanças inesperadas e selvagens.",
