              "episodios": 12,
              "sinopse": "Nicholas Brown e Worick Arcangelo, conhecidos na cidade de Ergastalum como os \"Faz-tudo\", são mercenários de aluguel que assumem tarefas que ninguém mais pode cuidar. Contratados por poderosos sindicatos da máfia e policiais, os faz-tudo tem que estar prontos e dispostos a tudo. Depois de completar a ordem de matar um cafetão local, os faz-tudo adicionam Alex Benedetto - uma prostituta também designada para eliminação - em suas fileiras para protegê-la das forças que querem que ela saia do decrépito inferno de uma cidade que ela passou a chamar de lar. No entanto, o paraíso desse criminoso está passando por um período de profundas mudanças que ameaça corroer o delicado equilíbrio de poder.\n\nErgastalum já foi um refúgio seguro para \"Twilights\", super-seres humanos nascidos como resultado de uma droga especial, mas agora estão sendo caçados por uma feroz organização clandestina. Esta nova ameaça está surgindo para desafiar tudo que a cidade representa, e os trabalhadores manuais não serão capazes de evitar a guerra que se aproxima.",
