              "trailer": null,
              "episodios": 13,
              "sinopse": "Achou que sua vida era ruim? Às vezes, a morte é pior. Não há salvação, paz, nem deus esperando para recebê-lo aos seus cuidados. Mas espere, um deus? Talvez você esteja falando sobre aquela grande bola preta presa na sala com você. Agora você é lançado em um jogo, lutando contra alienígenas verdes e monstros robôs pela chance de sobreviver.\n\nQuando Kei Kurono é morto, ele se vê preso em tal jogo - um teste de suas habilidades, moral e vontade de sobreviver. Sua vida não é dele; sua morte é cuspida e pisoteada inúmeras vezes. O que acontece se ele não ouvir? Deus sabe.\n\nUma palavra de advertência: Gantz não é para os medrosos, mas também não é tão simples quanto parece. Sangue, estupro e violência são crescentes, assim como retratos de ganância, violência e toda a feiura que se vê na sociedade hoje.",
