              "link": "https://myanimelist.net/anime/395/Gantz_2nd_Stage",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Kurono Kei e seu ex-colega de escola primária, Kato Masaru, sobreviveram às duas primeiras provações que a desconhecida esfera negra de Gantz os enviou. Explodir partes do corpo, lutar para permanecer vivo até os últimos segundos e ver seus companheiros cair em uma pilha de sangue e sangue são normais para eles agora. Eles estão cientes agora que Gantz pode chamá-los junto com quaisquer novos feitos, a qualquer momento para outro confronto com alienígenas.\n\nAs experiências de Kato no mundo de Gantz darão a ele a mesma coragem no mundo real? Com o colega veterano Gantzer Kei Kishimoto atualmente hospedado na casa de Kurono como seu \"animal de estimação adotado\", Kurono pode afastar seu desejo crescente por suas mamas?",
              "maturidade": null,
              "pontosBase": 0.0
