            "g0015_3": {
              "id": "g0015_3",
              "foto": "https://stat.ameba.jp/user_images/20160904/23/waruikuse/86/f3/p/o0699096013740517400.png?caw=800",
              "link": "https://myanimelist.net/anime/32071/Gantz_O",
              "trailer": null,
              "episodios": 1,
              "sinopse": "A morte não precisa ser o fim; pode-se viver de novo, mas apenas vencendo o jogo colocado pela bola preta chamada Gantz.\n\nNo caminho para casa para comemorar o aniversário de seu irmão mais novo, um estudante corajoso e bondoso chamado Masaru Katou é morto a facadas. Ele acorda em uma pequena sala com vista da cidade no coração de Tóquio - e ele não está sozinho. Para sua surpresa, não é a vida após a morte, mas a sala de espera para um jogo de apostas altas com suas vidas em jogo. Antes de ter a chance de processar a situação, Masaru recebe uma arma e é teletransportado para o centro de Osaka para realizar uma tarefa simples: eliminar qualquer alienígena à vista.\n\nAcompanhado pelo idoso Yoshikazu Suzuki, o deslumbrante ídolo Reika Shimohira e o frio mas experiente Jouichirou Nishi, Masaru deve superar seus medos para sobreviver ao jogo e voltar para casa para seu irmão que o espera.",
