              "sinopse": "Monstros conhecidos como \"Horrores\" invadiram o mundo, entrando pelos portões do Reino das Trevas do Makai. Essas criaturas demoníacas e corruptas têm a capacidade de se apoderar de corpos humanos e se alimentar de suas almas. Cidadãos que estão fora após o pôr do sol provavelmente nunca verão o sol nascer novamente, mas aqueles que vivem na capital não precisam se preocupar - eles são protegidos por um campo de força espiritual criado pelo grupo de feiticeiros Onmyouji.\n\nDe posse de uma armadura lendária, o Cavaleiro Dourado Raikou proclama que protegerá a todos dos Horrores. Acompanhado por seu assistente Kintoki e o misterioso Alquimista Makai Seimei, ele se esforça para se tornar um formidável Cavaleiro Makai, mas Raikou está mal preparado para lidar com os efeitos colaterais da armadura. Decepcionado com suas próprias deficiências, ele parte em uma jornada de autodescoberta para dominar suas fraquezas e provar seu valor.",
