              "trailer": null,
              "episodios": 24,
              "sinopse": "Em nome do rei, o Reino Valiante lançou caçadas para exterminar os usuários de bruxaria. Dezessete anos depois, sua perseguição ainda está crescendo em tamanho e brutalidade. Sem o conhecimento dos cidadãos, os alvos dessa caça às bruxas são os protetores secretos da humanidade. Conhecidos como os Cavaleiros e Alquimistas do Makai, eles têm uma forte vontade de proteger as pessoas dos Horrores, demônios que possuem almas atormentadas pela tristeza e pela dor.\n\nUm desses Cavaleiros do Makai é Leon Luis, de 17 anos, que herda de sua mãe a lendária armadura do Cavaleiro Dourado Garo. Embora possua grande poder, ele luta para superar o ódio que sente pela morte de sua mãe nas mãos do reino. Seu pai, alemão, conhecido como Zoro, o Cavaleiro Cortador das Sombras, ainda está treinando Leon quando ele é chamado para investigar o surgimento de Horrors na capital do reino. Embora German saiba que a vontade de Leon está vacilando, ele decide trazer Leon para continuar seu treinamento.\n\nEnquanto Alemão e Leão vão para a capital, o amável filho do rei, Alfonso San Valiante, luta para encontrar uma solução para a crescente ameaça do Terror. Mas antes que ele pudesse fazer isso, ele foi traído e banido de seu próprio reino. Para voltar para casa, Alfonso parte em busca da ajuda e da força de que precisa para recuperar o trono. Durante sua busca, ele encontra Leon, cujas interações com o príncipe mudarão para sempre o destino de ambos",
