              "sinopse": "A corrupção paira sobre a próspera cidade de Russell, onde manifestações de emoções negativas chamadas de horrores causam caos e confusão. A Ordem Makai é o último bastião de esperança contra essas criaturas profanas. Usando várias pequenas empresas como frentes, eles empregam poderosos Cavaleiros do Makai e mágicos Alquimistas do Makai para combater a ameaça do Terror.\n\nDentro desta ordem secreta, o mais alto posto de Cavaleiro de Ouro foi concedido a um homem grande e poderoso chamado Espada, concedendo-lhe o uso da armadura e lâmina Garo. Só ele conhece uma trama que ameaça toda a Ordem Makai, com sua única dica sendo a frase \"El Dorado\". Enquanto lutava contra um Horror, ele encontra Sophia \"Sophie\" Hennis, uma adolescente cujo desaparecimento do irmão anos atrás também está ligado a a mesma frase. Os dois concordam em trabalhar juntos para descobrir a verdade por trás de \"El Dorado\" e o desaparecimento do irmão de Sophie.",
              "maturidade": null,
