          "items": {
            "g0018_1": {
              "id": "g0018_1",
              "foto": "https://i.abyss.moe/images/EtNy.jpg",
              "link": "https://myanimelist.net/anime/28907/Gate__Jieitai_Kanochi_nite_Kaku_Tatakaeri",
              "trailer": null,
              "episodios": 12,
              "sinopse": "O oficial das Forças de Autodefesa do Japão (JSDF) fora de serviço e otaku, Youji Itami, está a caminho de participar de uma convenção de doujin em Ginza, Tóquio, quando um portal misterioso na forma de um grande portão aparece de repente. Deste portão, criaturas sobrenaturais e guerreiros vestidos com armaduras medievais emergem, atacando pela cidade, matando e destruindo tudo em seu caminho. Com ações rápidas, Youji salva tantas vidas quanto pode, enquanto o resto do JSDF direciona seus esforços para impedir a invasão.\n\nTrês meses após o ataque, Youji foi encarregado de liderar uma equipe especial de reconhecimento, como parte de uma força-tarefa JSDF, que será enviada para o mundo além do portão - agora sendo chamada de \"Região Especial\". Eles devem viajar a este mundo desconhecido para aprender mais sobre com o que estão lidando e tentar fazer amizade com os habitantes locais na esperança de criar laços pacíficos com o império governante. Mas se falharem, enfrentam a consequência de participar de uma guerra devastadora que envolverá os dois lados do portão.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0018_2": {
              "id": "g0018_2",
              "foto": "https://4.bp.blogspot.com/-_Ufib_XGNA0/V_f8WJHRSgI/AAAAAAAAFAw/_4z0PRMCwbEBtfLJgFmS59cHueciniPGgCLcB/s1600/GATE%2BJieitai%2BKanochi%2Bnite%252C%2BKaku%2BTatakaeri%2B-%2BEnryuu-hen.jpg",
              "link": "https://myanimelist.net/anime/31637/Gate__Jieitai_Kanochi_nite_Kaku_Tatakaeri_2nd_Season",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Vários meses se passaram desde o infame Incidente de Ginza, com as tensões entre o Império e as JSDF aumentando na vasta e misteriosa \"Região Especial\" por causa das negociações de paz. A ganância e curiosidade das potências globais também começaram a crescer, conforme relatos sobre as limitações tecnológicas das civilizações arcaicas do reino mágico vêm à luz.\n\nEnquanto isso, o tenente Youji Itami e seu alegre bando de admiradoras lutam para navegar na complexa intriga política que assola a corte do Império. Apesar de seus melhores esforços, a princesa Piña Co Lada enfrenta dificuldades ao tentar convencer seu pai de que as JSDF não têm a intenção de conquistar seu reino. Pressionado de ambos os lados do Portão, Itami deve considerar medidas ainda mais drásticas para cumprir sua missão.",
              "maturidade": null,
