              "episodios": 20,
              "sinopse": "Com a crescente demanda por transplantes de órgãos de alta qualidade no Japão, muitas organizações clandestinas realizaram operações de sequestro e assassinato para obter órgãos para venda; médicos cirurgiões também começaram a praticar. Até começou a intervir em países externos como a China.\n\nNossa protagonista, Tamaki Suzuhara, uma linda mas misteriosa garota do ensino médio, tenta encontrar alguém muito importante para ela que está desaparecido. Ela ingressou em uma rede de tráfico ilegal de órgãos, que sequestrou aqueles que foram julgados \"moralmente curados\" para remoção morfológica e cirúrgica de órgãos.\n\nVamos ver aonde essa jornada sangrenta e o dilema moral de Tamaki Suzuhara vão nos levar. Ela pode encontrar o que ela quer?",
