            "g0035_1": {
              "id": "g0035_1",
              "foto": "https://i1.wp.com/pic4.zhimg.com/v2-fb201bfe4f8b0d87242ebd3b25c3935c_r.jpg",
              "link": "https://myanimelist.net/anime/32936/Gin_no_Guardian",
              "trailer": null,
              "episodios": 12,
              "sinopse": "A estudante e gamer Suigin Riku estuda na prestigiosa Shinryou Private Academy, uma escola para a elite e para os filhos dos ricos. Mas rico ou rico não são palavras que descrevem Suigin; na verdade, ele é muito pobre e deve trabalhar em muitos empregos de meio período para pagar suas mensalidades. Durante um desses trabalhos, ele mergulha em uma piscina para salvar seu gato de estimação, sabendo que não pode nadar. Felizmente, ele é salvo por Rei Riku, a linda e popular filha de um desenvolvedor de jogos, e ele se apaixona por ela.\n\nEle também se sente atraído por outra garota: uma nova amiga que conhece em Dungeon Century, seu RPG online favorito. Mas quando o jogo está programado para encerrar, ele sabe que suas aventuras com ela logo terminarão. No entanto, um dia após o jogo ser encerrado, ele descobre que Rei e a garota online são a mesma coisa. Logo depois, Rei dá a Suigin um novo jogo destinado a substituir o Dungeon Century - um jogo de invasão de tumbas chamado Grave Buster. Mas quando Rei é repentinamente sequestrada, Suigin é puxado para dentro do Grave Buster para salvá-la.\n\nGin no Guardian segue Suigin enquanto ele joga Grave Buster para salvar Rei, enquanto descobre os segredos escondidos dentro do jogo.",
              "maturidade": null,
              "pontosBase": 0.0
