              "link": "https://myanimelist.net/anime/35757/Gin_no_Guardian_II",
              "trailer": null,
              "episodios": 6,
              "sinopse": "Na Shinryou Private Academy - uma escola cara para alunos ricos - ninguém esperaria encontrar o pobre Suigin Riku. Quando ele não está trabalhando em um de seus muitos empregos de meio período para pagar suas mensalidades, ele freqüentemente pode ser encontrado jogando RPG Dungeon Century, onde cultivou um relacionamento com um amigo online. No entanto, quando Dungeon Century é encerrado, ele descobre que sua paixão, o bondoso Rei Riku, e seu amigo online são a mesma pessoa.\n\nMas no rescaldo dessa revelação, Rei é sequestrado e levado para Grave Buster, que é um novo jogo online dos criadores de Dungeon Century, forçando Suigin a entrar no duro novo mundo de um jogo pay-to-win para salvar dela. Gin no Guardian 2ª Temporadacontinua a busca de Suigin para resgatar Rei, enquanto tenta resolver os mistérios deste estranho jogo.",
