              "trailer": null,
              "episodios": 11,
              "sinopse": "Yuugo Hachiken é estudioso, trabalhador e cansado de tentar corresponder às expectativas que não consegue atender. Com o início de um novo ano letivo, ele decide se matricular no Ooezo Agricultural High School, um internato localizado no interior de Hokkaido, como uma forma de escapar do estresse causado por seus pais.\n\nInicialmente convencido de que se sairia bem nesta instituição, Hachiken é rapidamente provado que estava errado por seus talentosos colegas de classe, indivíduos que viveram em fazendas durante toda a vida e sabem quase tudo quando se trata de comida, vegetais e até mesmo a fisiologia do gado ! Quer seja acordar às cinco da manhã para um trabalho árduo ou para cuidar de animais de fazenda, Hachiken é um completo amador quando se trata da dura vida agrícola.\n\nGin no Sajisegue a história cômica de um jovem estudante enquanto ele tenta se encaixar em um ambiente completamente novo, conhecendo muitas pessoas únicas ao longo do caminho. Enquanto ele luta para apreciar o ambiente, Hachiken espera descobrir seus sonhos, para que ele possa levar uma vida plena em seus próprios termos.",
