              "trailer": null,
              "episodios": 12,
              "sinopse": "A patinadora artística Tazusa Sakurano está no caminho certo para as Olimpíadas. Como uma das principais concorrentes, suas chances estão em uma única competição no Canadá. No entanto, durante seu programa, ela cai e bate com a cabeça no gelo, deixando-a inconsciente. Ao mesmo tempo, o piloto de acrobacias canadense Pete Pumps cai em um incêndio de fogo.\n\nApós seu fracasso devastador, Tazusa retorna para casa no Japão, mas ela começa a ouvir uma voz em sua cabeça. Na realidade, quando Pete chegou às portas do céu, ele teve o acesso negado por seus pecados. Em vez disso, ele disse para esperar 100 dias e agora está preso no corpo de Tazusa! Não querendo deixar isso interromper sua vida - mesmo que seu corpo esteja um pouco lotado - Tazusa segue em frente com a patinação, enquanto uma voz incômoda pode apenas ser capaz de ajudá-la a realizar seu sonho.",
