        "g0039": {
          "id": "g0039",
          "parentes": null,
          "items": {
            "g0039_1": {
              "id": "g0039_1",
              "foto": "https://1.bp.blogspot.com/-gfGqGy3Pg80/X6AIdsh6OmI/AAAAAAAAEno/JHHK-htP7gsgAWpWPe1IfSUr6ayJkfs0wCLcBGAsYHQ/s630/Ginga%2BEiyuu%2BDensetsu.jpg",
              "link": "https://myanimelist.net/anime/820/Ginga_Eiyuu_Densetsu",
              "trailer": null,
              "episodios": 110,
              "sinopse": "O impasse de 150 anos entre as duas superpotências interestelares, o Império Galáctico e a Aliança dos Planetas Livres, chega ao fim quando surge uma nova geração de líderes: o gênio militar idealista Reinhard von Lohengramm e o historiador reservado da FPA, Yang Wenli .\n\nEnquanto Reinhard sobe na hierarquia do Império com a ajuda de seu amigo de infância, Siegfried Kircheis, ele deve lutar não apenas na guerra, mas também nos remanescentes da dinastia Goldenbaum, a fim de libertar sua irmã do Kaiser e unificar a humanidade sob um governante genuíno. Enquanto isso, do outro lado da galáxia, Yang - um forte defensor dos ideais democráticos - tem que se manter firme em suas crenças, apesar das lutas da FPA, e mostrar a seu aluno, Julian Mintz, que a autocracia não é a solução.\n\nEnquanto as ideologias se chocam em meio às muitas baixas da guerra, os dois gênios da estratégia devem se perguntar qual é a verdadeira razão por trás de sua batalha.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0039_2": {
              "id": "g0039_2",
              "foto": "https://pbs.twimg.com/media/C1UihLkXEAAodI5.jpg",
              "link": "https://myanimelist.net/anime/3016/Ginga_Eiyuu_Densetsu__Arata_Naru_Tatakai_no_Overture",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Liderado por Reinhard von Müsel, o Império Galáctico esmaga a Aliança dos Planetas Livres na Quarta Batalha de Tiamat. Chegando à capital imperial de Odin para uma recepção de herói, a vitória de Reinhard valeu-lhe uma promoção a Alto Almirante e o distinto título de Conde von Lohengramm. Por outro lado, Yang Wen-li retorna com segurança à capital da Aliança, Heinessen, sem alarde e se reúne com seus queridos amigos.\n\nReinhard e Yang estão ansiosos por uma suspensão tão esperada. No entanto, a pedido do intrigante duque Otho von Braunschweig, o Alto Comando Imperial ordena ao novo Alto Almirante que invada a Aliança com uma frota de vinte mil navios. Depois que o duque vaza o plano para o governo da Aliança, três frotas totalizando 40 mil navios são enviadas para conter o ataque e recriar a famosa Batalha de Dagon. Mas, embora Reinhard esteja em desvantagem numérica de dois para um, ele tem um plano engenhoso - e Yang o vê bem. Os superiores de Yang atenderão ao seu aviso antes que seja tarde demais?",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0039_3": {
              "id": "g0039_3",
              "foto": "https://ru.myanimeshelf.com/upload/dynamic/2012-05/10/HBL_DVD1.jpeg",
              "link": "https://myanimelist.net/anime/3371/Ginga_Eiyuu_Densetsu_Gaiden",
              "trailer": null,
              "episodios": 24,
              "sinopse": "Ginga Eiyuu Densetsu Gaiden é a primeira de duas adaptações OVA de histórias paralelas da série de romances Ginga Eiyuu Densetsu . Esta primeira adaptação segue as realizações de Reinhard von Müsel e Siegfried Kircheis do Império Galáctico antes da fatídica Batalha de Astarte.\n\nOs Silver-White Valley\nReinhard e Kircheis se graduam em sua academia militar e são imediatamente enviados para o planeta fronteiriço congelado Kapche-Lanka. Sem o conhecimento deles, seus novos esquemas superiores para matar Reinhard em nome de um rival da irmã de Reinhard, Annerose von Grünewald.\n\nSonhos da manhã, canções da noite\nReinhard e Kircheis são designados para a Polícia Militar Imperial, onde descobrem as práticas corruptas e opressivas da aplicação da lei do Império. Eles logo recebem ordens para investigar o assassinato de um estudante em sua alma mater.\n\nDesonra\nEnquanto Reinhard aguarda a concessão de seu novo título de Conde von Lohengramm, ele envia Kircheis para passar férias no resort artificial satélite Kreuznach III. Inquieto com a falta de trabalho, Kircheis auxilia a polícia local em um caso de tráfico de drogas relacionado a um ataque a um ex-vice-almirante em desgraça.\n\nCem bilhões de estrelas, cem bilhões de luzes\nEmbora Reinhard ainda seja um comodoro encarregado de apenas um único esquadrão, ele lamenta a incompetência de seus superiores durante uma batalha contra a Aliança dos Planetas Livres. Conquistando sucessos militares sob o comando direto do vice-almirante Richard von Grimmelshausen, Reinhard se choca repetidamente com Hermann von Lüneburg, um comodoro e ex-comandante regimental do infame Rosen Ritter da Aliança.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0039_4": {
              "id": "g0039_4",
              "foto": "https://image.laftel.net/items/thumbs/large/a1366317-22fc-4eb6-9de4-d1b7f9d1f96a.jpg",
              "link": "https://myanimelist.net/anime/3665/Ginga_Eiyuu_Densetsu_Gaiden_1999",
              "trailer": null,
              "episodios": 28,
              "sinopse": "Ginga Eiyuu Densetsu Gaiden (1999) é a segunda de duas adaptações OVA de histórias paralelas da série de romances Ginga Eiyuu Densetsu . Esta segunda adaptação segue as conquistas de Yang Wen-li da Aliança dos Planetas Livres antes da batalha fatídica de Astarte, e continua os contos de Reinhard von Müsel e Siegfried Kircheis do Império Galáctico.\n\nLabirinto Espiral\nYang é levado ao centro das atenções após sua famosa evacuação de civis de El Facil. Após uma promoção dupla não oficial e uma enxurrada de atenção da mídia, ele narra sua pesquisa da Máfia do ano 730 - um grupo unido de oficiais militares da Aliança centrado em torno do famoso estrategista Bruce Ashbey. Ele investiga uma afirmação surpreendente da falecida viúva de Ashbey que pode ter enormes ramificações políticas: que o grande herói de guerra não foi morto em ação, mas assassinado.\n\nO Mutineer\nReinhard e Kircheis estão postados no destróier Hameln II, ancorado na Fortaleza de Iserlohn. Depois de ganhar o respeito da tripulação, a liderança de Reinhard é testada quando o capitão é gravemente ferido e passa a autoridade de comando para Reinhard, o segundo oficial de patente mais alta no convés.\n\nO duelista\nEnquanto Reinhard e Kircheis estão trabalhando na capital imperial Odin, Reinhard fica sabendo de uma disputa de direitos de mineração envolvendo Dorothea von Schaffhausen, amiga de sua irmã Annerose von Grünewald. Ao ouvir que o conde Herxheimer pretende resolver a questão com um duelo, Reinhard se oferece para representar a família Schaffhausen.\n\nO Retriever\nDepois de cair em desgraça com a nobreza, o Conde Herxheimer está tentando escapar para a Aliança de Planetas Livres com um protótipo de gerador de partículas de Seffle roubado. Reinhard tem a tarefa de recuperar o protótipo e o desertor, mas só é designado ao cruzador Hässliche Entlein devido à natureza confidencial da missão.\n\nA Terceira Batalha de Tiamat\nPara comemorar o 30º ano do reinado do Kaiser Friedrich IV, o Império anuncia uma campanha militar em larga escala contra a Aliança dos Planetas Livres. No confronto que se seguiu entre a força expedicionária imperial e três frotas da Aliança, a intervenção oportuna de Reinhard molda as marés da guerra.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0039_5": {
              "id": "g0039_5",
              "foto": "https://i.pinimg.com/736x/ad/59/98/ad59989bca5ff0b7c1598b8af5422006--galactic-heroes-wings.jpg",
              "link": "https://myanimelist.net/anime/3015/Ginga_Eiyuu_Densetsu_Gaiden__Ougon_no_Tsubasa",
              "trailer": null,
              "episodios": 1,
              "sinopse": "O Império Galáctico e a Aliança dos Planetas Livres estão travados em uma guerra aparentemente sem fim há mais de um século e meio. No Império, um jovem Siegfried Kircheis conhece Reinhard von Müsel e sua irmã mais velha, Annerose. Kircheis tem uma amizade feliz com os dois lindos irmãos de cabelos louros até o dia em que seu pai alcoólatra, um nobre inferior e de baixa reputação, aceita um pedido para que Annerose seja vendida como concubina ao Kaiser. Embora enfurecido, Reinhard é impotente para parar os caprichos da Corte Imperial. Ele e seu pai logo se mudam, deixando Kircheis para trás.\n\nAlguns anos depois, Reinhard retorna em um uniforme militar e declara sua intenção de subir na hierarquia e libertar sua irmã da servidão sexual. Kircheis se junta a Reinhard nesta jornada ousada para salvar Annerose, ansiando por ficar para sempre ao lado de seus amigos.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0039_6": {
              "id": "g0039_6",
              "foto": "https://pbs.twimg.com/media/Eh6pSbQXgAIOwL9.jpg",
              "link": "https://myanimelist.net/anime/42886/Ginga_Eiyuu_Densetsu__Die_Neue_These_Zoku-hen",
              "trailer": null,
              "episodios": 24,
              "sinopse": "Continuação do Ginga Eiyuu Densetsu: Die Neue Estas séries.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0039_7": {
              "id": "g0039_7",
              "foto": "https://pbs.twimg.com/media/EAANO6RWsAIugBx.jpg",
              "link": "https://myanimelist.net/anime/31433/Ginga_Eiyuu_Densetsu__Die_Neue_These_-_Kaikou",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Por mais de um século e meio, dois estados interestelares lutaram pelo controle da Via Láctea. O Império Galáctico, uma monarquia absoluta governada pelo Kaiser Friedrich IV e uma nobreza entrincheirada, visa suprimir os rebeldes que ousam se opor à coroa inviolável. A Aliança de Planetas Livres, uma democracia representativa liderada por um Alto Conselho corrupto, degenera à medida que seus líderes eleitos⁠ usam a guerra e o conflito como forma de ganhar o apoio popular.\n\nMas este impasse de longa data entre o Império e a Aliança termina com a ascensão de dois gênios militares opostos. Reinhard von Lohengramm, um nobre menor e Alto Almirante do Império por meio de seu brilhantismo estratégico e da posição de sua irmã como a concubina favorita do Kaiser, sonha em conquistar a galáxia e unir a humanidade sob seu punho de ferro. Enquanto isso, Yang Wen-li da Aliança, um historiador ávido e relutante comodoro aclamado como o Herói de El Facil, usa sua habilidade tática para contornar a incompetência de seus líderes - e abrir o caminho para uma paz duradoura. À medida que a guerra avança, Reinhard e Yang lutam por seus ideais e por garantir seu lugar entre as estrelas como líderes de uma nova era de heróis galácticos.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0039_8": {
              "id": "g0039_8",
              "foto": "https://pbs.twimg.com/media/ECVH4TbU8AEtuzt.jpg",
              "link": "https://myanimelist.net/anime/36369/Ginga_Eiyuu_Densetsu__Die_Neue_These_-_Seiran_1",
              "trailer": null,
              "episodios": 4,
              "sinopse": "A invasão do Império Galáctico pela Aliança dos Planetas Livres falhou depois que a má gestão do abastecimento levou a grandes perdas. Não querendo abortar a expedição apesar de estar em grande desvantagem numérica, o almirante da frota Lazar Lobos ordena que as frotas restantes da Aliança se reúnam na zona estelar de Amritsar para uma resistência final contra o contra-ataque que se aproxima.\n\nO gênio estratégico Almirante da Frota Reinhard von Lohengramm lidera as forças imperiais nesta batalha decisiva com uma vantagem esmagadora. No entanto, seu rival, o mágico tático vice-almirante Yang Wen-li da Aliança, mais uma vez compensa a incompetência de seus superiores e encena uma fuga por pouco para ele e seus colegas soldados. Embora Reinhard e Yang estejam descontentes com o resultado - o primeiro por sua vitória imperfeita e o segundo pelas tremendas baixas - sua atenção deve se voltar para a agitação política borbulhante em ambos os lados da galáxia.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0039_9": {
              "id": "g0039_9",
              "foto": "https://www.nautiljon.com/images/more/02/91/162919.jpg",
              "link": "https://myanimelist.net/anime/36370/Ginga_Eiyuu_Densetsu__Die_Neue_These_-_Seiran_2",
              "trailer": null,
              "episodios": 4,
              "sinopse": "A trama do Marquês Reinhard von Lohengramm para desestabilizar a Aliança dos Planetas Livres é bem-sucedida quando o traiçoeiro ex-contra-almirante Arthur Lynch instiga um golpe em Heinessen. Equipado com um plano elaborado pelo próprio Reinhard, Lynch incentiva seu amigo de longa data, almirante Dwight Greenhill, a supervisionar a derrubada do governo civil pelo Conselho Militar de Salvação Nacional. Buscando defender a democracia e restaurar a constituição da Aliança, o almirante Yang Wen-li enfrenta seus concidadãos - e, lamentavelmente, o pai de sua devotada ajudante tenente Frederica Greenhill.\n\nAgora, com a Aliança dos Planetas Livres completamente ocupada com seus próprios assuntos internos, as forças do Império Galáctico podem suprimir com segurança a recém-formada Liga Lippstadt liderada pelo Duque Otto von Braunschweig. No entanto, com seu amigo e leal subordinado Alto Almirante Siegfried Kircheis lutando longe nas regiões de fronteira controladas pelos nobres, Reinhard cada vez mais depende do conselho do implacável vice-almirante Paul von Oberstein, cuja influência dentro do estimado almirante Lohengramm cresce constantemente.\n\nEmbora o derramamento de sangue seja inevitável em ambos os lados da galáxia, Yang Wen-li da Aliança e Reinhard von Lohengramm do Império fazem a si mesmos as mesmas perguntas: como a história olhará para trás em suas ações? Os fins justificarão os meios?",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0039_10": {
              "id": "g0039_10",
              "foto": "https://pbs.twimg.com/media/EQ955FHUwAA6W3Z.jpg",
              "link": "https://myanimelist.net/anime/36371/Ginga_Eiyuu_Densetsu__Die_Neue_These_-_Seiran_3",
              "trailer": null,
              "episodios": 4,
              "sinopse": "A pedido do almirante Yang Wen-li, o oficial de inteligência desertado, comandante Baghdash, faz uma transmissão de emergência anunciando que o Conselho Militar de Salvação Nacional deu um golpe sob a direção do Império Galáctico. Apesar da falta de evidências físicas, esta declaração debilitante inspira o ex-contra-almirante Andrew Lynch a revelar seu próprio papel em semear a discórdia dentro da Aliança dos Planetas Livres. Um tiroteio fatal entre Lynch e o almirante Dwight Greenhill atua como a sentença de morte final para o curto período de governo marcial.\n\nDentro do Império Galáctico, imagens do bombardeio nuclear do Duque Otto von Braunschweig em Westerland resultam na dissolução da Liga Lippstadt. A decisão do Marquês Reinhard von Lohengramm de permitir o massacre para ganho pessoal cria uma cisão entre ele e o Alto Almirante Siegfried Kircheis, azedando o gosto de sua vitória inevitável. Agora à beira de alcançar o poder absoluto, Reinhard é atacado por suas aparentes falhas pessoais e as pesadas responsabilidades da liderança.\n\nEmbora as guerras civis na Aliança e no Império estejam chegando ao fim, nenhum dos lados pode recuperar o que foi perdido. Yang Wen-li e Reinhard von Lohengramm se consolam amargamente com o conhecimento de que, do outro lado da galáxia, está um oponente digno - e um verdadeiro igual.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0039_11": {
              "id": "g0039_11",
              "foto": "https://www.graphicstory.com/upload/image_528_1546818639.jpg",
              "link": "https://myanimelist.net/anime/3014/Ginga_Eiyuu_Densetsu__Waga_Yuku_wa_Hoshi_no_Taikai",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Quatro meses antes do Conde von Lohengramm do Império Galáctico enfrentar Yang Wen-li da Aliança dos Planetas Livres na Batalha de Astarte, ele ainda era apenas Reinhard von Müsel. O almirante mais jovem da história do Império, Reinhard foi desprezado e rejeitado por seus pares como irmão da concubina do Kaiser.\n\nAo chegar à Fortaleza de Iserlohn com sua frota expedicionária, Reinhard imediatamente recebe uma ordem do ambicioso e astuto Almirante da Frota Gregor von Mückenberger: interceptar uma frota da Aliança em uma zona estelar vizinha. Apesar de reconhecer isso como uma tentativa velada de matá-lo em combate, Reinhard, no entanto, ordena a seus homens cansados ​​e cansados ​​que enfrentem o inimigo na atmosfera do gigante gasoso Legnica. Mas, sem o seu conhecimento, isso marcará o primeiro de seus muitos encontros históricos com o Herói de El Facil.",
              "maturidade": null,
              "pontosBase": 0.0
            }
          }
