          ],
          "items": {
            "g0042_1": {
              "id": "g0042_1",
              "foto": "https://st-listas.20minutos.es/images/2017-10/424905/5232297_640px.jpg?1507067778",
              "link": "https://myanimelist.net/anime/918/Gintama",
              "trailer": null,
              "episodios": 201,
              "sinopse": "Os Amanto, alienígenas do espaço sideral, invadiram a Terra e conquistaram o Japão feudal. Como resultado, uma proibição de espadas foi estabelecida, e os samurais do Japão são tratados com indiferença como consequência.\n\nNo entanto, um homem, Gintoki Sakata, ainda possui o coração de samurai, embora por seu amor por doces e trabalho como yorozuya, não se pudesse esperar isso. Acompanhando-o em sua linha de trabalho faz-tudo, estão Shinpachi Shimura, um menino de óculos e um coração forte, Kagura com seu guarda-chuva e estômago aparentemente sem fundo, assim como Sadaharu, seu cão de estimação enorme. É claro que esses biscates nem sempre são simples, já que freqüentemente têm desentendimentos com a polícia, rebeldes maltrapilhos e assassinos, muitas vezes levando a consequências engraçadas, mas infelizes.\n\nQuem disse que a vida como um menino de recados era fácil?",
              "maturidade": null,
