              "foto": "https://www.gaobei.com/upload/10001/article/2018_05/05150035_7rhhfm.jpg",
              "link": "https://myanimelist.net/anime/37864/Yinhun_x_KFC",
              "trailer": null,
              "episodios": 1,
              "sinopse": "A plataforma de streaming chinesa Weibo está hospedando filmagens exclusivas de Gintama . O anúncio está em japonês com legendas em chinês, mostrando os personagens que gostam da marca chinesa da KFC.\n\nGintama é intitulado e comercializado como Yinhun na China.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0042_3": {
              "id": "g0042_3",
              "foto": "https://animerobo.com/wp-content/uploads/2018/11/gintama-benizakura-arc-a-new-retelling.png",
              "link": "https://myanimelist.net/anime/7472/Gintama_Movie_1__Shinyaku_Benizakura-hen",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Gintoki e seus amigos Yorozuya (ou melhor, funcionários sofrendo com violações trabalhistas), Shinpachi e Kagura, continuam a sobreviver na futurística cidade infestada de alienígenas de Edo. Eles assumem qualquer trabalho que possam encontrar enquanto tentam não se envolver em nada muito perigoso. Mas quando Katsura, o líder dos rebeldes Joui e conhecido de longa data de Gintoki, desaparece após ser brutalmente atacado por um assassino desconhecido, Shinpachi e Kagura começam uma investigação sobre seu paradeiro e a identidade do agressor. Enquanto isso, Gintoki assume um trabalho aparentemente não relacionado: o ferreiro Tetsuya pede que Gin recupere uma estranha e poderosa espada chamada Benizakura, que foi recentemente roubada.\n\nConforme as duas investigações se cruzam gradualmente, a tripulação de Yorozuya se vê no meio de uma grande conspiração que depende da natureza sinistra da espada Benizakura. Gintoki resolve levar a luta diretamente para o quartel-general inimigo e, junto com alguns aliados inesperados, inicia uma de suas tarefas mais perigosas.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0042_4": {
              "id": "g0042_4",
              "foto": "https://st.kp.yandex.net/images/flyer/2765_face_1200.jpg",
              "link": "https://myanimelist.net/anime/15335/Gintama_Movie_2__Kanketsu-hen_-_Yorozuya_yo_Eien_Nare",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Quando Gintoki apreende um pirata de cinema em uma estreia, ele verifica a filmagem da câmera e se vê transportado para uma versão pós-apocalíptica de Edo, onde uma epidemia misteriosa chamada \"Peste Branca\" devastou a população mundial. Acontece que o pirata do filme não era um pirata, afinal - era uma máquina do tempo andróide, e Gintoki foi lançado cinco anos no futuro! Shinpachi e Kagura, seus companheiros Yorozuya, tiveram uma briga e agora são vigilantes solitários endurecidos pela batalha e ele próprio está desaparecido há anos, desaparecendo sem deixar vestígios depois de rabiscar uma mensagem estranha em seu diário.\n\nPartindo no disfarce dado a ele pela máquina do tempo andróide, Gintoki aleatoriamente reúne a equipe de Yorozuya para investigar a Peste Branca, e logo descobre que a chave para salvar o futuro está na escuridão de seu próprio passado. Determinado a enfrentar um inimigo poderoso, ele faz uma descoberta importante - com um bando desordenado de amigos e aliados ao seu lado, ele não precisa lutar sozinho.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0042_5": {
              "id": "g0042_5",
              "foto": "https://i.ytimg.com/vi/CedLOVAUdaY/sddefault.jpg#404_is_fine",
              "link": "https://myanimelist.net/anime/19261/Gintama_x_Mameshiba",
              "trailer": null,
              "episodios": 6,
              "sinopse": "Exibido como um comercial para promover o Gintama: Kanketsu-hen - Yorozuya yo Eien Nare Filme, Gintoki, Kagura e Shipachi se transformaram em \"criaturas vivas estranhas\".\n\nEsta é uma paródia de Gintama no Kids Short Animation \"Mameshiba\" com os personagens, as criaturas híbridas do feijão-espada-cão.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0042_6": {
              "id": "g0042_6",
              "foto": "https://alioss.yystv.cn/doc/3815/9b0384083c7fe39f54699cb3d0dcc772.jpeg_mw680water",
              "link": "https://myanimelist.net/anime/9969/Gintama",
              "trailer": null,
              "episodios": 51,
              "sinopse": "Após um hiato de um ano, Shinpachi Shimura retorna a Edo, apenas para tropeçar em uma surpresa chocante: Gintoki e Kagura, seus companheiros membros do Yorozuya, se tornaram personagens completamente diferentes! Fugindo da sede de Yorozuya em confusão, Shinpachi descobre que todos os habitantes de Edo passaram por mudanças impossivelmente extremas, tanto na aparência quanto na personalidade. O mais inacreditável é que sua irmã Otae se casou com o chefe Shinsengumi e perseguidor desavergonhado Isao Kondou e está grávida de seu primeiro filho.\n\nConfuso, Shinpachi concorda em se juntar ao Shinsengumi a pedido de Otae e Kondou e encontra transformações ainda mais surpreendentes em andamento tanto dentro quanto fora das fileiras da organização. No entanto, descobrindo que o vice-chefe Toushirou Hijikata permaneceu inalterado, Shinpachi e seu improvável aliado Shinsengumi decidiram devolver a cidade de Edo à forma como eles se lembram dela.\n\nCom ainda mais piadas sujas, paródias irônicas e referências sem vergonha, Gintama ' segue a equipe de Yorozuya em mais de suas desventuras no mundo vibrante e cheio de alienígenas de Edo.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0042_7": {
              "id": "g0042_7",
              "foto": "https://cdn.img.tsutaya-tv.net/img/10001/100019052/100019052_1_c_sp_l.jpg",
              "link": "https://myanimelist.net/anime/15417/Gintama__Enchousen",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Enquanto Gintoki Sakata estava fora, os Yorozuya encontraram um novo líder: Kintoki, o doppelganger de cabelos dourados de Gintoki. Para recuperar sua posição anterior, Gintoki precisará da ajuda daqueles ao seu redor, um feito preocupante quando ninguém consegue se lembrar dele! Entre Kintoki e Gintoki, quem reivindicará o trono como personagem principal?\n\nAlém disso, Yorozuya faz uma viagem de volta ao distrito da luz vermelha de Yoshiwara para ajudar uma cortesã idosa em sua busca por seu amante há muito perdido. Embora o distrito não esteja mais acorrentado sob a superfície da terra, o trio logo descobre as trágicas histórias dos habitantes de Yoshiwara que ainda os perseguem. Com flashback após flashback, esta missão tem Yorozuya testemunhando o amor eterno e protegendo-o da melhor forma que podem com seus corações e almas.\n\nGintama ':inclui momentos de intensidade repleta de ação, juntamente com seu humor alegre e pastelão usual para Gintoki e seus amigos.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0042_8": {
