              "trailer": null,
              "episodios": 1,
              "sinopse": "Acompanha edição limitada do 58º volume do mangá Gintama.\n\nO slogan para o anime empacotado é: \"É hora de todos os membros do Yorozuya ... acordarem apenas mais uma vez.\"",
              "maturidade": null,
              "pontosBase": 0.0
