            "g0042_9": {
              "id": "g0042_9",
              "foto": "https://konata.cz/wp-content/uploads/2017/07/AnimDTH_Gintama_2017.jpg",
              "link": "https://myanimelist.net/anime/34096/Gintama",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Depois de se juntar à resistência contra o bakufu, Gintoki e sua gangue estão escondidos, junto com Katsura e seus rebeldes Joui. O Yorozuya é logo abordado por Nobume Imai e dois membros do Kiheitai, que explicam que os piratas Harusame se voltaram contra o Capitão Kamui da 7ª Divisão e seu ex-aliado Takasugi. Os Kiheitai oferecem uma tarefa a Gintoki: encontrar Takasugi, que está desaparecido desde que seu navio foi emboscado em um ataque a Harusame. Nobume também faz uma revelação impressionante sobre o Tendoushuu, uma organização secreta que puxa as cordas de várias facções, e seu líder Utsuro, a figura sombria com uma semelhança misteriosa com o antigo professor de Gintoki.\n\nPegando uma carona na nave espacial de Sakamoto, o Yorozuya e Katsura partiram para Rakuyou, o planeta natal de Kagura, onde as várias facções se reuniram e as tensões estão se formando. Rancores de longa data, lutas políticas e o plano sinistro e abrangente do Tendoushuu finalmente culminam em uma batalha massiva e decisiva em Rakuyou.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0042_10": {
              "id": "g0042_10",
              "foto": "https://www.an-ime.com/wp-content/uploads/2017/10/gintama-2017-1.jpg",
              "link": "https://myanimelist.net/anime/35843/Gintama__Porori-hen",
              "trailer": null,
              "episodios": 13,
              "sinopse": "Após os eventos sombrios de Iga, Ilha Kokujou, Rakuyou e vários confrontos infrutíferos com os Tenshouin Naraku e Tendoshuu, Gintama .: Porori-hen leva seus espectadores em uma viagem pelo caminho da memória até quando Yorozuya estava fazendo o que fazia de melhor - estranho empregos. O grande caçador espacial Umibouzu voltou a Edo e fica furioso ao saber que sua filha Kagura tem namorado. Ele culpa Gintoki por ser um guardião incompetente, mas finalmente chegou a hora de ele deixar sua filha ir?\n\nDe volta com paródias sem vergonha, humor picante e camaradagem animada, Gintoki, Kagura e Shinpachi se deparam com situações imprevistas que conseguem ser hilárias e emocionantes.",
              "maturidade": null,
              "pontosBase": 0.0
