              "sinopse": "A plataforma de streaming chinesa Weibo está hospedando filmagens exclusivas de Gintama . O anúncio está em japonês com legendas em chinês e mostra os personagens curtindo a marca chinesa da Cup Noodles, Hé Wèi Dào.\n\nGintama é intitulado e comercializado como Yinhun na China.",
