              "foto": "https://ninjinanimehome.files.wordpress.com/2019/07/59647-mig.jpg",
              "link": "https://myanimelist.net/anime/36838/Gintama__Shirogane_no_Tamashii-hen",
              "trailer": null,
              "episodios": 12,
              "sinopse": "Após a batalha feroz em Rakuyou, o passado incontável e o verdadeiro objetivo do líder imortal Naraku, Utsuro, são finalmente revelados. Ao corromper as reservas de Altana de vários planetas, Utsuro desencadeou com sucesso a intervenção do maior inimigo de Tendoshuu: o Exército de Libertação de Altana. Com a Terra como o principal campo de batalha nesta guerra interplanetária, o plano mestre de Utsuro para destruir o planeta - e a si mesmo - está quase completo.\n\nUm ataque ao Terminal Central O-Edo marca o início da batalha final para retomar a terra do samurai. Com o Yorozuya em nenhum lugar à vista, o bakufu quase desabou e o Shogun desaparecido, as pessoas ficam completamente desamparadas enquanto o Exército de Libertação começa a pilhar Edo em nome de libertá-los do governo de Tendoshuu.\n\nPegos no fogo cruzado entre duas forças igualmente imponentes, Gintoki, Kagura, Shinpachi e os ex-alunos de Shouyou Yoshida podem colocar de lado suas diferenças e unir seus aliados para proteger o que eles amam?",
