              "episodios": 1,
              "sinopse": "Segundo o Tsutaya Online, o DVD de Gintama: Shinyaku Benizakura-hen será lançado no dia 15 de dezembro. Um novo especial será fornecido com a edição limitada.\n\n\nÉ a piada corrente do episódio de Ben Johnson, em que a equipe de animação reutiliza as filmagens de Ano Novo; Yorozuya se sentava ao redor do kotatsu comendo uma tigela de tangerinas. Eles discutem assuntos elaborados, Shinpachi reclama sobre a reutilização de imagens de animação e, em seguida, Gin-chan sempre termina a piada com um anúncio inútil.",
