              "link": "https://myanimelist.net/anime/21899/Gintama__Yorinuki_Gintama-san_on_Theater_2D",
              "trailer": null,
              "episodios": 2,
              "sinopse": "O Demoníaco Vice-Comandante do Shinsengumi, Toushirou Hijikata, adquire uma espada amaldiçoada - uma que reescreve completamente sua personalidade, transformando-o de um policial duro e prático em um otaku desesperado. Enquanto ele luta para quebrar a maldição, um ambicioso novo membro da força policial, Itou Kamotarou, aproveita a oportunidade para depor Hijikata em sua tentativa de conquistar o poder dentro da organização. No entanto, o esquema de Itou é revelado como mais tortuoso do que qualquer um imaginava, e a própria existência do Shinsengumi é lançada em perigo.\n\nEm outra época e lugar, o time Yorozuya é repentinamente saudado por um novo recruta em potencial. Diante deles está uma jovem misteriosa chamada Pirako Doromizu, que esconde uma tendência para a violência extrema por trás de seu exterior sorridente e entusiasmado. No entanto, sem o conhecimento de Gintoki e dos outros, Pirako tem fortes laços com uma das figuras governantes do distrito Kabuki de Edo, e sua chegada desencadeia uma reação em cadeia que lança os habitantes do distrito em uma guerra civil.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0042_22": {
