              "foto": "https://pbs.twimg.com/media/DSkoPPRX0AEWwmz.jpg",
              "link": "https://myanimelist.net/anime/28977/Gintama%C2%B0",
              "trailer": null,
              "episodios": 51,
              "sinopse": "Gintoki, Shinpachi e Kagura voltam como os divertidos, mas falidos membros do time Yorozuya! Vivendo em uma realidade alternativa Edo, onde espadas são proibidas e senhores alienígenas conquistaram o Japão, eles tentam prosperar fazendo qualquer trabalho que possam colocar as mãos. No entanto, Shinpachi e Kagura ainda não foram pagos ... Gin-chan realmente gasta todo esse dinheiro jogando pachinko?\n\nEnquanto isso, quando Gintoki cambaleia bêbado para casa uma noite, uma nave alienígena cai nas proximidades. Um membro da tripulação mortalmente ferido emerge do navio e dá a Gintoki um estranho dispositivo em forma de relógio, avisando-o de que é incrivelmente poderoso e deve ser protegido. Confundindo-o com seu despertador, Gintoki quebra o dispositivo na manhã seguinte e de repente descobre que o mundo fora de seu apartamento parou. Com Kagura e Shinpachi ao seu lado, ele sai para consertar o dispositivo; embora, como sempre, nada seja tão simples para a equipe de Yorozuya.\n\nCheio de humor irônico e momentos de emoção sincera, a quarta temporada de Gintama encontra Gintoki e seus amigos enfrentando suas desventuras mais hilariantes e crises mais perigosas.",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "g0042_23": {
