              "foto": "https://u.livechart.me/anime/1968/poster_image/bfbf7a3931ef61da3a434b2e81666369.jpg?style=large&format=jpg",
              "link": "https://myanimelist.net/anime/32366/Gintama%C2%B0__Aizome_Kaori-hen",
              "trailer": null,
              "episodios": 2,
              "sinopse": "O distrito da luz vermelha, Yoshiwara, é subitamente tomado por \"Aizen Kou\", um incenso que tem a capacidade de fazer qualquer pessoa se apaixonar pela primeira pessoa que vê. Tendo sido declarada ilegal por sua forte potência, a droga do amor teria desaparecido para sempre do distrito da luz vermelha; no entanto, parece ter encontrado seu caminho de volta para dentro das paredes de Yoshiwara e agora tem todo o distrito sob sua influência.\n\nDos afetados está o frio capitão Hyakka, Tsukuyo, e a primeira pessoa que ela vê após inalar a fumaça é ninguém menos que o descarado líder Yorozuya, Gintoki Sakata. Sem o conhecimento de todos, ela já estava atraída por Gintoki. Com esses sentimentos ocultos agora intensificados, Tsukuyo deve superar suas aflições e trabalhar com o Yorozuya para fazer com que todos voltem ao normal.",
              "maturidade": null,
              "pontosBase": 0.0
