              "sinopse": "\"Senshadou\" é um esporte tradicional que usa tanques da era da Segunda Guerra Mundial em partidas baseadas em eliminação. Amplamente praticado por mulheres e meninas, é anunciado como uma forma de arte voltada para tornar as mulheres mais proeminentes na cultura e atraente para os homens. Tornando-se um fenômeno mundial ao longo do tempo, a influência da senshadou leva à criação de um campeonato mundial que em breve será realizado no Japão.\n\nMiho Nishizumi, que vem de uma linhagem de especialistas em senshadou bem respeitados, está em desacordo com o esporte depois que um evento traumático a levou a se aposentar e, eventualmente, a se formar um racha entre ela e sua família. Para evitar a prática o máximo possível, ela se transfere para a Ooarai Girls High School, onde o programa senshadou foi abolido. No entanto, com as notícias dos próximos campeonatos, a escola revive seu programa de tanques e Miho é forçado a entrar.\n\nAgora, com a ajuda de alguns novos amigos, ela deve superar seu passado e mais uma vez assumir o comando de um esquadrão de tanques em um esforço para salvar sua escola do fechamento, ao mesmo tempo provando para sua família que o estilo Nishizumi de senshadou não é apenas sobre a vitória.",
