              "sinopse": "Shuuichi Kagaya é o que alguém consideraria um estudante médio do ensino médio, mas às vezes, ele se transforma em um monstro. Ele não sabe como ou por que obteve suas habilidades, apenas que preferia que ninguém soubesse sobre elas. Uma noite, ele encontra um prédio em chamas com uma garota presa dentro. Decidindo salvá-la, ele a transforma e a carrega para um local seguro, mas acidentalmente deixa cair seu telefone.\n\nNo dia seguinte, a garota que ele salvou - Claire Aoki - o encontra e o confronta sobre sua identidade de monstro. Ela ainda vai tão longe a ponto de empurrá-lo do telhado da escola para provar sua teoria depois que Shuichi nega suas alegações. Desesperado para se salvar, ele se transforma, e Claire tira uma foto para chantageá-lo a dizer a ela tudo o que sabe sobre monstros, o que, ironicamente, não é muito.\n\nAcontece que Claire tem um segredo: ela está procurando por sua irmã, que também se tornou um monstro. Ela pede a ajuda de Shuichi para rastreá-la, mas eles não são os únicos em busca de respostas.",
