              "trailer": null,
              "episodios": 43,
              "sinopse": "Eikichi Onizuka, de 22 anos — ex-líder de gangue de motoqueiros, conquistador de Shonan e virgem — tem um sonho: se tornar o maior professor do ensino médio de todo o Japão. Isso não é por causa da paixão por ensinar, mas porque ele quer uma esposa adolescente amorosa quando ele é velho e cinza. Ainda assim, para um, ganancioso e preguiçoso delinquente, há mais em Onizuka do que parece. Assim, quando ele consegue um emprego como professor de sala de aula da Classe 3-4 na prestigiada Academia da Floresta Sagrada — apesar de suplexar o vice-diretor - todos os seus talentos são postos à prova, já que esta classe é particularmente infame.\n\nDevido ao seu desprezo absoluto por todos os professores, os alunos da classe usam a guerra psicológica para quebrar mentalmente qualquer novo professor de sala de aula que recebem, forçando-os a sair da escola. No entanto, Onizuka não é um professor comum, e ele está pronto para qualquer desafio em seu caminho.\n\nBullying, suicídio e assédio sexual são apenas alguns dos problemas que seus alunos enfrentam diariamente. Ao lidar com as raízes de seus problemas, Onizuka os apoia com seus métodos imprevisíveis e não convencionais — mesmo que isso signifique pular de um prédio para salvar uma criança suicida. Graças ao seu charme excêntrico e natureza divertida, a classe 3-4 lentamente aprende o quão agradável a escola pode ser quando você é o aluno do Grande Professor Onizuka.\n",
