              "sinopse": "Makunouchi Ippo foi vítima de bullying a vida inteira. Constantemente fazendo recados e sendo espancado pelos colegas, Ippo sempre sonhou em mudar, mas nunca teve a paixão de agir de acordo. Um dia, em meio a mais um bullying, Ippo é salvo por Takamura Mamoru, que por acaso é boxeador. Ippo desmaia com os ferimentos e é levado ao ginásio de boxe Kamogawa para se recuperar. À medida que ele recupera a consciência, ele fica maravilhado e surpreso com seu novo ambiente no ginásio, embora não tenha confiança para tentar qualquer coisa. Takamura coloca uma foto do colega de classe de Ippo em um saco de pancadas e o força a dar um soco. Só então Ippo sente algo se mexer dentro dele e acaba pedindo a Takamura para treiná-lo no boxe. Pensando que Ippo não tem o que é preciso, Takamura dá-lhe uma tarefa considerada impossível e dá-lhe o prazo de uma semana. Com um desejo repentino de ficar mais forte, para si e para sua mãe trabalhadora, Ippo treina incansavelmente para cumprir a tarefa dentro do prazo. Assim começa a jornada do Ippo ao topo do mundo do boxe.",
              "maturidade": null,
              "pontosBase": 0.0
