              "trailer": null,
              "episodios": 1,
              "sinopse": "O desafiante se tornou o campeão, pois Ippo Makunouchi agora usa o cinturão campeão dos pesos penas do Japão.\nJá se passou algum tempo desde a vitória de Ippo, e ele encontrou seus amigos e o treinador tão solidários como sempre; sua paixão, Kumi Mashiba, parece gostar de passar o tempo com ele também. As coisas estão parecendo boas para o novo campeão, mas assim como uma vez ele planejou se tornar o melhor, seu primeiro desafiante representa uma ameaça intimidante.\n\nKazuki Sanada trabalha como médico no mesmo hospital que Kumi e luta estrategicamente. Conhecido por integrar seu conhecimento do corpo humano em suas lutas, Sanada é um adversário temível - no entanto, mais enervante do que sua capacidade física, ele conquistou o apoio das enfermeiras. Apesar de ser campeão, Ippo sente a pressão para enfrentar o grande desafio, manter o cinturão e conquistar a garota que ama.",
              "maturidade": null,
