              "link": "https://myanimelist.net/anime/265/Hajime_no_Ippo__Mashiba_vs_Kimura",
              "trailer": null,
              "episodios": 1,
              "sinopse": "Tatsuya Kimura está começando a se sentir deixada para trás. Com seus amigos Ippo Makunouchi e Mamoru Takamura detendo o cinturão do campeonato em suas respectivas categorias de peso, a incapacidade de Kimura de se tornar o campeão júnior de boxe leve do Japão o consome. Programado para lutar com o atual campeão Ryo Mashiba, Kimura começa a treinar com o rival de Ippo Ichirou Miyata, que anteriormente sofreu uma derrota esmagadora do estilo de boxe \"Hitman\" de Mashiba.\n\nMas Mashiba tem seu próprio desejo de segurar o cinturão, esperando em breve almejar o título mundial e garantir estabilidade financeira para sua irmã Kumi. Será que o impulso irresistível de Kimura para provar sua força como boxeador superará o desejo desesperado de Mashiba de proporcionar uma vida melhor para Kumi?",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "h0014_5": {
              "id": "h0014_5",
