              "link": "https://myanimelist.net/anime/5258/Hajime_no_Ippo__New_Challenger",
              "trailer": null,
              "episodios": 26,
              "sinopse": "O campeão japonês peso pena, Ippo Makunouchi, defendeu e manteve o título com sucesso. Enquanto isso, seu rival, Ichirou Miyata, ressurgiu no Japão, visando seu próprio cinturão de penas na Federação de Boxe do Pacífico Oriental. Quando o resto do mundo bater, no entanto, os melhores lutadores do Japão enfrentarão o desafio e alcançarão a glória no topo? Ou a pequena nação insular será esmagada pelo peso de entidades maiores? Desta vez, os campeões se tornarão desafiadores, chamando o resto do mundo e prontos para mostrar seu espírito de luta!",
              "maturidade": null,
              "pontosBase": 0.0
            },
            "h0014_6": {
              "id": "h0014_6",
