              "link": "https://myanimelist.net/anime/19647/Hajime_no_Ippo__Rising",
              "trailer": null,
              "episodios": 25,
              "sinopse": "O campeão japonês peso pena Makunouchi Ippo defendeu o cinturão do título mais uma vez com a ajuda de seu movimento devastador: o Dempsey Roll. No entanto, novos desafiadores estão surgindo à esquerda e à direita, alegando ter uma resposta para o movimento responsável por esmagar seus oponentes. Será que Ippo será capaz de enfrentar o desafio ou o peso de seu orgulho o destruirá antes que ele descubra o que significa ser forte? Enquanto isso, seu colega Kamogawa Gym, Aoki Masaru, está a apenas um pulo, salto e um soco de sapo de reivindicar seu próprio cinturão, pronto para enfrentar o campeão japonês dos leves!\n\nHajime no Ippo: Aumentocontinua a busca de Ippo para se tornar mais forte, apresentando o mesmo elenco de amáveis ​​idiotas do Kamogawa Gym, enquanto colocam seus corpos e corações em risco para abrir caminho no mundo cruel do boxe profissional. Com vontade de ferro, Ippo entra no ringue mais uma vez.",
