              "trailer": null,
              "episodios": 12,
              "sinopse": "Embora a cidade de Fukuoka possa parecer relativamente pacífica à primeira vista, na verdade ela abriga uma mistura próspera de indivíduos perigosos, como assassinos, detetives e caçadores de vingança profissionais logo abaixo de sua superfície. Entre eles está Zenji Banba, um detetive despreocupado e observador que está investigando o trabalho de outras empresas de assassinos na área. No entanto, Banba pode não ser o único a ter problemas com essas organizações, já que Xianming Lin, um assassino crossdressing que trabalhava para uma dessas empresas, começa a se cansar de sua falta de empregos e de pagamento.\n\nUm dia, depois que o alvo atual de Lin comete suicídio antes que o assassino possa alcançá-lo, sua empresa se recusa a pagar a ele mesmo a metade do valor que originalmente deveriam pagar pelo assassinato. Frustrado, Lin pede outra missão e recebe a oferta de tirar Banba, que sua organização acredita estar interferindo em seus negócios. No entanto, quando Banba chega em sua casa e encontra o assassino dentro, Lin surpreendentemente nem tenta matá-lo. Em vez disso, ele oferece ao detetive outra opção: juntar-se a ele e formar uma equipe. Com a oferta na mesa, exatamente como Banba responderá, e quais planos Lin tem guardado para o mundo subterrâneo de Fukuoka?",
