              "trailer": null,
              "episodios": 12,
              "sinopse": "Em 1864, no Japão, uma jovem chamada Chizuru Yukimura está procurando por seu pai desaparecido, Koudou, um médico de profissão cujo trabalho frequentemente o leva para longe de casa. Mas sem nenhuma palavra dele em meses, Chizuru se disfarça de homem e segue para Kyoto em busca dele. Atraindo a atenção de ronin, ela tenta se esconder e acaba testemunhando uma visão horripilante: o ronin sendo brutalmente assassinado por homens de cabelos brancos enlouquecidos. Em uma reviravolta surpreendente nos acontecimentos, os membros do Shinsengumi chegam para despachar as criaturas. Mas a segurança de Chizuru não dura muito, pois este grupo de homens a amarra e a leva de volta para seu quartel general, sem saber se a deixam viver ou se a silenciam permanentemente.\n\nNo entanto, assim que ela revela o nome de seu pai, os Shinsengumi decidem mantê-la segura, pois eles também estão procurando por ele. Mas Koudou está mais conectado aos Shinsengumi do que eles parecem, e logo Chizuru se vê envolvida em um conflito entre os Shinsengumi e seus inimigos, bem como na tensão política em Kyoto.",
              "maturidade": null,
