              "link": "https://myanimelist.net/anime/9065/Hakuouki_Hekketsuroku",
              "trailer": null,
              "episodios": 10,
              "sinopse": "Após a conclusão do Hakuouki , Chizuru Yukimura e os Shinsengumi são forçados a fugir de Kyoto e embarcar para Edo. Na ausência de seu comandante Isami Kondou, o vice-comandante Toshizou Hijikata intervém como comandante interino. No entanto, Hijikata não está apenas lutando com os deveres extras de liderança - o que preocupa todos ao seu redor - mas também com uma nova sede de sangue incontrolável. Para piorar as coisas, o desejo não o afeta sozinho e está até começando a enlouquecer alguns de seus subordinados.\n\nFinalmente, Kondou retorna com ordens do imperador para defender o castelo e um novo nome para seu esquadrão: Kouyou Chinbutai. Mas na guerra, o equilíbrio de poder pode mudar repentinamente e as alianças podem vacilar. Em Hakuouki Hekketsuroku, Chizuru segue a Shinsengumi até o centro da guerra e continua a busca por seu pai desaparecido, enquanto o vínculo entre ela e Hijikata fica cada vez mais forte.",
