              "trailer": null,
              "episodios": 12,
              "sinopse": "O ano é 1863 e enquanto as feridas purulentas da discórdia política do Japão explodem em ondas violentas de confrontos de rua e assassinatos, o Shogunato Tokugawa envia uma nova força de samurais sem mestre chamados Roshigumi para ajudar as forças Aizu em Kyoto. No entanto, a nova \"polícia\" é tudo menos uma força coesa e o assassinato já os dividiu em duas facções opostas. O mais forte é liderado pelo brutal Serizawa Kamo e o menor pelo mais honrado, mas menos assertivo, Isami Kondo. É para essa matilha de lobos que Ryunosuke Ibuki é arrastado pelo raivoso Serizawa. Forçado a ser um escravo virtual por dívida de sangue, ele odeia o samurai e tudo o que eles representam. Mas ao ver como a outra metade do samurai vive, ele começa a acreditar que ainda pode haver uma chance, tanto para ele quanto para o Japão.",
