              "sinopse": "Halo Legends apresenta sete histórias diferentes ambientadas no universo de Halo, cada uma feita por um estúdio diferente.\n\nA Babá segue os Helljumpers, Orbital Drop Shock Troopers que são enviados para trás das linhas inimigas para realizar um assassinato.\n\nO duelo apresenta a história de um antigo Árbitro que se recusou a se curvar à religião do Covenant. Marcado como herege, ele agora deve enfrentar as consequências de suas ações.\n\nO pacote retrata um grupo de espartanos, incluindo o Master Chief, que são enviados para se infiltrar em uma nau capitânia Covenant e recuperar um “pacote” em uma operação secreta.\n\nOrigensmostra Master Chief e Cortana presos após os eventos de Halo 3, com Cortana resumindo a queda dos precursores, a derrota do Dilúvio e a ascensão da humanidade, bem como os eventos da Guerra Humano-Aliança.\n\nHomecoming centra-se na Spartan Daisy, que relembra seu passado, e o projeto SPARTAN-II enquanto evacuava os soldados do UNSC presos pelas forças Covenant.\n\nO protótipo é visto da perspectiva do Sargento da Marinha Fantasma, que está determinado a lutar por tudo o que vale para compensar as queixas do passado.\n\nOdd One Out é uma paródia não canônica de Halo apresentando Spartan 1337, que sofre de extrema má sorte.",
