              "sinopse": "Kajika Louisa Kugami Burnsworth é a única filha de Harry Burnsworth, um influente e respeitado industrial que tem o poder de mover o mundo. Havia uma ameaça à vida de Kajika quando ela tinha apenas dois anos, e sua mãe morreu protegendo-a. Após este trágico incidente, Harry enviou seu único filho para uma ilha isolada, Giviolle, onde ela foi criada pela nativa da ilha, Maria. Os companheiros de Kajika durante seu tempo lá incluem um leopardo branco chamado Mustafa e um menino chamado Li Ren Fang, que a visitava duas ou três vezes por ano.\n\nKajika, agora com 14 anos, retorna ao lado de seu pai, apenas para ser dito para começar um jogo para encontrar seu futuro marido. Harry garante que Kajika participe voluntariamente deste jogo dizendo-lhe que ela precisa enfrentar a dureza de seu destino junto com o homem que ela escolhe para ser seu marido. Ela precisa decidir entre os três candidatos que Harry escolheu pessoalmente, mas não será fácil. Kajika deve descobrir quem são e onde eles estão sem qualquer informação para continuar, exceto que todos eles possuem um brilho irresistível e charme. O tempo todo, os homens nem sabem que são os escolhidos. Kajika também deve escolher sabiamente, já que seu parceiro tem que aceitá-la voluntariamente para ser sua noiva.\n\nHansakeru Seishounen gira em torno de amor cativante, paixão intensa, amizade nobre, lealdade eterna, relações familiares e intriga política. O peso do destino de Kajika é real, a ameaça à vida de Kajika é inevitável, e o jogo do marido é mais do que apenas um mero jogo. Harry precisa encontrar um parceiro adequado para proteger sua filha antes que alguém descubra o segredo profundo de Kajika — um segredo que até ela desconhece.",
