              "sinopse": "Após seu sucesso na fase classificatória para a competição regional de Kansai, os membros da banda de concertos kitauji high school estão de olho na próxima apresentação. Utilizando suas férias de verão ao máximo, a banda participa de um acampamento onde eles são instruídos por seu conselheiro de banda Noboru Taki e seus amigos que ganham a vida como músicos profissionais.\n\nKumiko Oumae e seus amigos continuam determinados a alcançar o ouro na competição kansai, mas problemas surgem quando um estudante que uma vez deixou a banda mostra interesse em se juntar e desperta memórias desagradáveis para os membros do segundo ano. Kumiko também aprende sobre o passado surpreendente de seu professor e a motivação por trás de seu desejo de levar a banda à vitória. Alcançar os nacionais exigirá trabalho duro, e a convicção inflexível no compromisso de cada aluno com a banda será posta à prova.\n",
