              "episodios": 1,
              "sinopse": "Os dias de solidão de Liz chegam ao fim quando ela conhece um pássaro azul na forma de uma jovem. Embora seu relacionamento floresça, Liz deve tomar uma decisão dolorosa, a fim de realmente realizar seu amor por Blue Bird.\n\nVeteranos do ensino médio e amigos próximos Mizore Yoroizuka e Nozomi Kasaki são encarregados de tocar os principais instrumentos no terceiro movimento de Liz and the Blue Bird, uma peça de banda de concertos inspirada neste conto de fadas. A introvertida e reservada Mizore toca o oboé, representando a gentil e gentil Liz. Enquanto isso, o radiante e popular Nozomi toca flauta, retratando o alegre e enérgico Pássaro Azul.\n\nNo entanto, enquanto ensaiam, a distância entre Mizore e Nozomi parece crescer. Seu dueto desarticulado decepciona a banda, e com a formatura no horizonte, a incerteza sobre o futuro estimula emoções complicadas. Com pouco tempo para melhorar à medida que seu desempenho se aproxima, eles tentam desesperadamente se conectar com seus respectivos personagens. Mas quando Mizore e Nozomi considerarem a história de uma nova perspectiva, as meninas encontrarão forças para enfrentar duras realidades?\n\nUma adaptação cinematográfica spin-off do Hibike Euphonium! série, Liz a Aoi Tori dança entre os paralelos de um conto de fadas encantador, uma peça musical comovente, e uma delicada amizade no ensino médio.\n",
