              "sinopse": "Kazuma Hoshino está se preparando para uma nova fase de sua vida na adolescência. Por causa da saúde mais fraca que a média de seu irmão Ayumu, seus pais acharam melhor para a família se mudar da cidade para um ambiente mais rural. Agora os dois irmãos estão fora para a Pousada Yorozuyo onde eles vão ficar até que seus pais possam resolver os negócios de volta na cidade e montar sua nova casa.\n\nSua chegada à pousada não sai como planejado quando pegam o ônibus errado, acabam no meio do nada, Ayumu tem seu chapéu roubado por um macaco selvagem, e Kazuma se perde na floresta tentando rastrear o animal. Tudo leva a um encontro casual com uma jovem espirituosa chamada Ui, que Kazuma acaba acidentalmente caindo e se beijando enquanto ela tenta leva-lo de volta ao ponto de ônibus. Isso dificilmente fica bem com o amigo de Ui, Ibuki, que rapidamente chuta Kazuma e o manda em seu caminho. Para o horror contínuo de Kazuma, sua má sorte é perpetuada na pousada graças à sua senhoria Senka e seu senso de humor ligeiramente, e então descobrir que dois de seus colegas são as meninas que ele envergonhou-se na frente das costas na floresta!\n\nHoshizora e Kakaru Hashi encontra Kazuma se adaptando à sua nova escola, lidando com as múltiplas mulheres que entraram em sua vida, fornecendo apoio emocional para seu irmão mais novo, e lidando com a vida com sua nova proprietária. No entanto, por alguma razão, algo sobre este lugar está trazendo sussurros do passado para a mente de Kazuma. Small pisca de volta para um tempo mais inocente e uma amizade há muito esquecida. O que esse déjà vu pode significar?",
