              "sinopse": "O céu é o limite em Houkago no Pleiades. Com o telescópio na mão, Subaru está pronto para ir à sala de observação de sua escola, a fim de ter uma visão da chuva de meteoros daquela noite. O que ela menos espera é que atrás da porta do observatório não havia o céu estrelado, mas um jardim luxuoso, completo com uma fonte resplandecente e um menino misterioso com longos cabelos ruivos.\n\nMas o jardim logo desapareceu, como se Subaru estivesse apenas imaginando coisas. Tudo o que resta dessa visão brilhante é uma estranha criatura de bolhas que a leva a outra porta mágica, ocupada por outras garotas em trajes mágicos como bruxas. Revelações começam a bater subaru um após o outro: uma das meninas na sala é sua amiga de infância Aoi, a pequena bolha é na verdade um alienígena de uma espécie chamada Pleiadians tentando voltar para casa, e Subaru foi selecionado por ele para se tornar o mais novo membro de seu grupo!\n\nAgora, os sonhos de Subaru das estrelas se tornaram realidade da maneira mais selvagem, enquanto ela e seus amigos tentam reunir pedaços do motor da espaçonave pleiadiana para devolver o ser à sua casa. Mas eles não são os únicos depois das peças do motor, e eles não têm ideia do porquê!",
